                new Joke() { Id = 104, Active = true, Title = "Janezek na testu, ker je pameten", Description = "Janezek vpraša svojo učiteljico, če lahko govori z njo po šolski uri. Ona se strinja.      Učiteljica: In, Janezek, kaj mi želiš povedati?    Janezek: Mislim, da sem preveč pameten, da bi ostal v tem razredu, ker se dolgočasim.  Želim, da me daste direktno v gimnazijo.    Učiteljica obvesti o tem ravnatelja, ki vpraša Janezka, če lahko naredi test.    Janezek se strinja brez oklevanja in ravnatelj začne s vprašanji:    Ravnatelj: No, Janezek, da vidimo... 13x4?  Janezek: 52!    Ravnatelj: In kvadratni koren iz 9 ?  Janezek: 3, gospod ravnatelj.    Ravnatelj: Glavno mesto JaponskeJanezek: Tokio.    Test traja še pol ure, Janezek pa ne naredi nobene napake. Na koncu je ravnatelj  zadovoljen z rezultatom, učiteljica pa vpraša, ali mu lahko zdaj ona postavi nekaj vprašanj.  Oba se strinjata in učiteljica začne spraševati:    Učiteljica: Dobro, Janezek. Krava ima 4, jaz pa 2. Kaj je to?  Janezek: Noge, gospa učiteljica.      Učiteljica: Točno. Kaj lahko najdemo v tvojih hlačah, v mojih pa ne?    Ravnatelj je presenečen nad vprašanjem...    Janezek: Žepe!    Učiteljica: Dobro, Janezek. Kje so ženske najbolj kodraste ?      Ravnatelj se pripravlja, da poseže z besedo med njiju,    a Janezek odgovori:V Afriki    Učiteljica: Kaj je mehko a na rokah ženske postane trdo?    Ravnatelj zavije z očmi, a Janezek spet odgovarja.    Janezek: Lak za nohte.    Učiteljica: Kaj imajo moški in ženske na sredini nog?    Janezek: Kolena!    Učiteljica: V redu. Kaj ima poročena ženska širše kot neporočena?    Ravnatelj ne more verjeti svojim ušesom.    Janezek: Posteljo, gospa učiteljica.    Učiteljica: Kateri del mojega telesa je največkrat vlažen?    Janezek: Vaš jezik!    Učiteljica: Katera beseda se začne s črko ''p'' in označuje nekaj, kar se pod moško roko orosi, moški pa hoče še.    Janezek: Pivo    Ravnatelj je brez sape, ves moker od znoja, odloči se, da bo prekinil test