                new Joke() { Id = 114, Active = true, Title = "Ženske v postelji", Description = "Kaj pravijo različne ženske v postelji:    Astmatičarka: \"Uhh... uhhh...uhhh...\"  Matematičarka: \"Ponovi... ponovi...\"  Veterinarka: \"Daj me, bikec moj, daj me...\"  Učiteljica: \"Da...tako...zelo dobro...pravilno...odlicno!\"  Morilka: \"Če zdaj nehaš, te ubijem!\"  Navijacica: \"Vzdrzi...dajmo...se...\"  Neobveščena: \"Kaj je to?...zakaj?...kaj počnes?\"  Optimistka: \"Da...da...da...\"  Pesimistka: \"Ne...ne...ne...\"  Prometni tehnik: \"Bolj na desno...ne, ne...malo navzgor...naprej...\"  Versko blazna : \"O moj bog...o moj bog...\"  Samomorilska: \"Joj, umiram...joj, umiram...\"  Skrbnica racunalnikov: \"OK...OK...OK...\"  Uciteljica angleščine: \"Ohhh, yes...ohhh, God...\"  Vedeževalka: \"čutim da prihaja...blizu je...tu je...umpfgrrr!!!\"  Merkatorjevka: \"Ti si moj najboljsi sosed!\"", CategoryId = 40 },
                new Joke() { Id = 115, Active = true, Title = "Viagra", Description = "Mož in žena se zjutraj pogovarjata:  \"Dragi, a nama naredim jajčka s šunko? Pa kavico?\"  Mož: \"Ma ne ... to je zarad viagre ... sploh nimam apetita...\"  Potem pride čas kosila:  Žena: \"Dragi, a naredim eno fovš župco, pa un meso lahko spečem, bo hitr narjen\"  mož: \"Ne ... to je zarad viagre ... sploh nimam apetita ...\"  Zvečer, čas večerje:  Žena: \"Dragi, a nama pripravim sendvičke, pa čaj? Bo čist kuj narjen?\"  Mož: \"Ne ... to je zarad viagre ... sploh nimam apetita\"    Žena:\"PA DOBR ČLOVK, ZLEZ ŽE ENKRAT DOL Z MENE, JST UMIRAM OD LAKOTE!!!!!!!\"", CategoryId = 11 },
                new Joke() { Id = 116, Active = true, Title = "V hribovski vasici", Description = "V hribovski vasici, bogu za hrbtom, je živela mlada punca Francka.  Nekega jutra se zbudi in med nogami začuti močno ščemenje, ki ni in ni  nehalo.  Po parih dnevih se odpravi vprašat župnika za nasvet, kako naj se reši  tega ščemenja.  \"Veš, to ti je muha noter zlezla in zdaj ne more ven, zato te tako srbi.  Vem kakšna je rešitev, a ti žal ne smem pomagat, ker sem župnik?\"  Francka žalostna zapusti cerkev.  Na polju vidi soseda Poldeta, kako v potu svojega znoja, okopava krompir.  Pove mu vse glede muhe in ga zaprosi za pomoč,  Polde pa: \"Jaz bi ti že rade volje pomagal, a sem žal prestar za kaj  takega..\"  Nato pride do pašnika, kjer je pasel krave mlad postaven pastir.  Ko mu zaupa svoj problem in ga zaprosi za pomoč, se pastir veselo nasmehne  in ji reče, naj sleče obleko.  Francka jo sleče.  Modrček je kar pokal od napetih prsi, gate pa so bolj odkrivale kot  skrivale, njeno mednožje.  Potem ji pastir reče naj sleče še to dvoje, se uleže predenj in da noge  narazen.  Francka ga brez obotavljanja uboga.  Nato tudi pastir sleče svoje hlače pa gate, počepne pred Francko in se  poserje:  \"Če to ne bo zvabilo muhe ven, potem pa res ne vem kako še pomagat?.", CategoryId = 40 },
                new Joke() { Id = 117, Active = true, Title = "faran pri spovedi", Description = "Faran: “Oče, imel sem bližnje srečanje z neko žensko ... skoraj ...”  Župnik: “Kako to misliš ... skoraj ... sin moj?”  Faran: “No, slekla sva se, legla v posteljo, drgnila najine intimne dele ... pa sem se pravočasno ustavil, še preden bi se lahko kaj resnega zgodilo ...”  Župnik: “Sin moj, drgnenje intimnih delov je isto kot da bi ga dal noter. Pusti to žensko, za pokoro pa zmoli petdeset očenašev in vrzi 50 € v pušico za reveže ...”  Naslednjo nedeljo:  Župnik: “Sin moj, si zmolil pokoro, ki sem ti jo naložil prejšnjo nedeljo? Si izpolnil vse, kar sem ti naročil?”  Faran: “Sem, seveda sem, oče.”  Župnik: “Nisem opazil, da bi vrgel 50 € v pušico za reveže.”  Faran: “No, z bankovcem za 50 € sem podrgnil po pušici, noter ga pa nisem dal. Pa saj ste sami rekli, da je drgnenje isto, kot da bi ga dal noter.”", CategoryId = 5 },
