                new Joke() { Id = 123, Active = true, Title = "Mastrubiranje na kavču", Description = "Prijateljici se pogovarjata po telefonu:  \"Si lahko predstavljaš kaj takega, ko sem prišla domov, je moj dragi sedel na kavču v dnevni sobi in masturbiral!\"    \"Vau, neverjetno! In kaj si storila?\"    \"Ja kaj, vzela sem mu ga v usta in opravila do konca!\"    Prijateljica začudeno: \"Vau, in zakaj to...?\"    \"Lažje izperem usta in očistim zobe, kot celo sedežno, tepih in zavese.\"", CategoryId = 27 },
                new Joke() { Id = 124, Active = true, Title = "Moški pri zdravniku", Description = "Zdravnik je pregledal pacienta in mu zadovoljno rekel:  \"Zdravi ste in v odlični kondiciji. Kako pa vaše sek-sualno življenje?\"  \"No ja, gre. Trikrat na teden že gre\"!  \"Kaj, a samo trikrat na teden? Pri vaši konstituciji in zdravju bi morali radost življenja okušati vsak dan trikrat, ne pa trikrat na teden\".  \"Saj bi, ampak ne gre zaradi službe\".  \"Saj sem vedel. Preveč ste obremenjeni. Kaj pa ste po poklicu?\", ga vpraša zdravnik.  \"Duhovnik sem ...\"!", CategoryId = 39 },
