                new Joke() { Id = 126, Active = true, Title = "Upokojenec v parku", Description = "Klepetata na klopci v parku dva starejša upokojenca, pa gospa vpraša gospoda:  \"Koliko let pa imate?\"  On: \"95 \"  Ona: \"Ne bi vam dala\"  On: \"Sej tut ne bi mogu.\"", CategoryId = 43 },
