                new Joke() { Id = 156, Active = true, Title = "Skok čez plot in bežanje", Description = "Micka si je privoščila skok čez plot z Janezom. Ko sta tako nekega dne seksala, slišita avto, ki se ustavi na dvorišču.  Micka plane iz postelje, pogleda na dvorišče in vzlikne:  \"Moj Bog, moj mož se je prej vrnil s potovanja. Janez, takoj skoči skozi okno na cesto in izgini!\"    Janez pogleda skozi okno in odvrne:  \"Ne morem, Micka. Saj vidiš, da dežuje!\"    Micka se obupano zgrabi za glavo in krikne:  \"Janez, če naju moj mož zasači, naju bo oba ubil.\"    Janez torej plane iz postelje, pograbi svojo obleko, skoči skozi okno na cesto in se znajde v skupini maratoncev, ki prav tisti hip tečejo mimo Mickine hiše. Da bi zabrisal sled za seboj, se jim Janez pridruži.    Čez nekaj časa se Janezu med tekom približa prvi maratonec in vpraša:  \"Kolega, ali teceš maraton vedno nag?\"  Janez: \"Vedno. Tako prijetno je čutiti pihljanje vetra, ko sem nag, in tako bolje čutim povezanost z naravo.\"    Čez nekaj časa se Janezu med tekom približa drugi maratonec in vpraša:  \"Kolega, ali tečeš maraton vedno z obleko pod pazduho?\"  Janez: \"Vedno. Tako praktično je imeti obleko pri sebi. Ko pritečem na cilj, se lahko takoj oblečem, usedem v avto in odpeljem domov.\"    Čez nekaj časa se Janezu med tekom približa tretji maratonec in vpraša:  \"Kolega, ali teceš maraton vedno s kondomom na tiču?\"  Janez: \"Ne vedno. Samo če dežuje.\"", CategoryId = 27 },
                new Joke() { Id = 157, Active = true, Title = "Dokaži, da si moški", Description = "Mož zaloti ženo v postelji z ljubimcem.  Ta skoči iz postelje in hoče zbežati.    Žena zavpije ljubimcu:  \"Dokaži, da si moški!\"    Ljubimec:  \"A zdaj pa še njemu?\"", CategoryId = 27 },
                new Joke() { Id = 158, Active = true, Title = "Prodajalka in tečna stranka", Description = "Možakar vstopi v trgovino in pri mladi prodajalki naroči 10 dag pariškeklobase.    Prodajalka nareže klobaso, jo položi na tehtnico in vpraša: \"12dag je,jo lahko zavijem?\"  Možakar zavije z očmi:  \"Rekel sem 10 dag, prosim, da to upoštevate!\"    Prodajalki ne preostane drugega kakor, da odstrani dve rezini klobase in vpraša:  \"Devet dag je, bo v redu?\"    Možak nejevolno zmaja z glavo:  \"Devet ni 10. Rekel sem 10 dag.\"    Prodajalka doda eno rezino nazaj:  \"Ali je lahko 10 dag in pol?\"    Možakar pa vzroji:  \"Ali res moram stokrat ponavljati?! Hočem 10 dag in pika!\"    Prodajalka se nagne k njemu in ga po tiho vpraša:  \"Me lahko prosim primete za prsi?\"    Možakar je šokiran in zmedeno vpraša:  \"Zakaaaj pa zdaj to?\"    Prodajalka pa mirno odvrne:  \"Kadar me kdo jebe, mi je všeč, če me zraven drži za joške!\"", CategoryId = 43 },
                new Joke() { Id = 159, Active = true, Title = "Kmet na banki dviguje denar", Description = "Pride kmet na banko in želi dvigniti denar z računa. Pobrska po žepih in na dan privleče potrdilo o depozitu. Gospa za okencem si ga oglede in reče:  \"Žal mi je, ampak tega denarja ne morete dvigniti. Je namreč vezan za eno leto.\"  Kmet se začudi: \"Kako ne morem, če ga pa potrebujem?\"  \"Ja vezan je, gospod, šele čez eno leto ga boste lahko dvignili,\" mu pojasni uslužbenka.  Kmet se malo zamisli, potem pa se spomni, da ima še en depozit na drugem računu. Na dan privleče še drugo potrdilo, a tudi tukaj se zatakne.  \"Zelo mi je žal, veste, ampak tudi ta denar je vezan. Šele čez dve leti ga boste lahko dvignili.\"  \"Kako to mislite vezan?\"  \"Ja vezan je, gospod, in to pomeni, da ga v tem trenutku ne morete dvigniti.\"  Kmet že precej nejevoljno reče: \"Ampak jaz moram odplačati dolgove in nujno potrebujem ta denar sedaj.\"  Uslužbnenka za okencem spredvidi, da bo preprostemu možaku težko razložiti vse skupaj, zato predlaga drugačno rešitev:  \"Gospod, vi ste kmet, kajneda? Kaj pa če bi poskusili upniku plačati kako drugače? Recmo… ali imate jajca? Morda bi šlo pa na ta način?\"  Kmet jo za daljši trenutek pogleda, potem pa reče:  \"Da, imam jajca. Ampak veste, so vezana na tiča!\"", CategoryId = 43 },
                new Joke() { Id = 160, Active = true, Title = "Sreča v nesreči", Description = "Kaj je sreča v nesreči?    Ko ti žena reče, da imaš največjega tiča v domači ulici .....", CategoryId = 11 },
                new Joke() { Id = 161, Active = true, Title = "Po petnajstih letih zapora", Description = "Arestant po 15 letih zbeži iz zapora.    Vdre v hišo, da bi našel hrano in orožje, in naleti na par v postelji.  Ukaže moškemu, naj zleze iz nje, in ga priveže na stol, žensko pa priveže na posteljo, jo poljubi na vrat, vstane in odide v kopalnico.  Medtem mož reče ženi: \"Poslušaj, ta tip je pobegli zapornik. Verjetno je bil dolgo v zaporu in že leta ni videl ženske.  Videl sem, kako je poljubil tvoj vrat.  Če bo želel seksati s tabo, se mu ne upiraj in se ne pritožuj, samo naredi, kar hoče.  Bodi močna, draga. Ljubim te.\"    Žena mu odgovori:  \"Ni poljubil mojega vratu, na uho mi je zašepetal, da je gej in da se mu zdiš seksi, in me vprašal, ali imava kaj vazelina.  Rekla sem mu, da je v kopalnici.  Bodi močen, dragi. Tudi jaz te ljubim.\"", CategoryId = 27 },
                new Joke() { Id = 162, Active = true, Title = "Dekle pred operacijo", Description = "Ljubko dekle s čudovitim telesom je tik pred tem, da jo operirajo. Leži na gibljivi postelji, povsem gola, na njej je le rjuha.  Medicinska sestra jo pripelje do vrat operacijske sobe in vstopi, da bi preverila, ali je že vse pripravljeno.    Po hodniku k punci pristopi mož v belem, privzdigne rjuho, si ogleduje njeno telo in nato stopi se po enega tipa v belem.  Tudi ta privzdigne rjuhico, pozorno analizira. Pride še tretji, ki je že bolj drobnogleden kot prejšnja dva.    Dekle naposled izgubi potrpljenje:    \"Super, da me tako natančno pregledujete, toda zanima me, kdaj me boste že enkrat operirali??\"    Eden izmed trojice skomigne:\"Ne vem, mi samo hodnik malamo.\"", CategoryId = 39 },
                new Joke() { Id = 163, Active = true, Title = "Razlaga, kako je prišel na svet", Description = "Sin: \"Ati, ati, kako sem jaz prišel na svet?\"    Oče: \"Jaaa ... veš, štorklja te je prinesla.\"    Sin: \"Uuuu, ati, ti si taki car! Kaj vse si ti nategno!?\"", CategoryId = 11 },
                new Joke() { Id = 164, Active = true, Title = "Presenečenje za moške", Description = "So se dogovorile tri prijateljice, da bodo svojim dragim pripravile presenečenje.    Oblekle so se v sado-mazo črne oprijete usnjene jakne, črne tange, štikle, črne preveze čez oči in vse kar pač zraven paše. Pa da vidijo kaj bo.    Prva je imela ljubimca, druga zaročenca, tretja pa je bila že kar nekaj let poročena. Čez nekaj dni se srečajo.    Tista z ljubimcem: \"Ej stara, ko mej zagledu je čist znoru, je reku da sem ženska njegovega življenja in pol stara, sva sekala ceeellooo noč pa še dopoldne\"    Zaročenka: \"Ja itak, ko me je zagledu me je pograbu pa sva seksala kot mlada zajčka.\"    In tista poročena: \"Ma ja, ko je prišel s šihta, me je najprej vprašujoče pogledal ,potem pa dejal:  \"Hej, Zorro kaj je pa za večerjo??\"", CategoryId = 11 },
                new Joke() { Id = 165, Active = true, Title = "Obupana zaradi pomanjkanja seksa", Description = "Starejša gospa gre h župniku, da se izpove in mu reče:  \"Joj gospod župnik kako pogrešam seks!\"    Župnik ji odgovori:  \"Na onem svetu boš imela toliko seks, kolikor boš hotela.\"    Ženska gre malo razočarana iz cerkve, pride do mosta, ko se ji porodi ideja, da bi se vrgla z mosta na avtocesto in tako prišla do sexa. Spleza preko ograje in skoči. Ravno v tistem trenutku se pripelje tovarnjak z bananami in ženska zleti na banane.    Ko pride k sebi je vse temno okrog nje, začne otipavati okoli sebe in vzhičeno reče:  \"Počasi fantje počasi..., vsi pridete na vrsto!\"", CategoryId = 27 },
                new Joke() { Id = 166, Active = true, Title = "Trideseta obletnica poroke", Description = "Mož in žena praznujeta 30. obletnico poroke. Odločita se, da bosta ponovila poročno potovanje.    In res se odpravita na pot. Ko se peljeta po neki cesti na podeželju, ob kateri je ograja za krave, žena reče: \"Kaj če bi zdaj naredila tisto, kar sva pred 30 leti?\"    Mož ustavi avto in naslonita se na ograjo ter začneta seksat.    Ko končata, mož reče ženi: \"Pred 30 leti pa nisi tolk migala.\"    Žena mu odgovori: \"Pred 30 leti ograja še ni bla električna.\"", CategoryId = 27 },
                new Joke() { Id = 167, Active = true, Title = "Nočni let", Description = "So bili trije pedri na nočnem prekooceanskem letu.  Pa reče prvi: \"Kaj, ko bi me vidva nabrisala?\"    \"Si nor, bo kdo videl!\"   \"Ma nobeden, saj vsi spijo.\"  \"Bo pa kdo slišal in se zbudil, verjetno je pa vsaj stevardesa budna!!\"    \"Nobeden, bosta videla!\" In začne klicati: \"Bi lahko dobil kozarec vode!\"   In nič se ni zgodilo. \"BI LAHKO DOBIL KOZAREC VODE, KER MI JE SLABO!!\"    In spet se ni nič zgodilo.    \"No vidiš, nobeden se ne zbudi, sedaj me pa kar po vrsti naguzita.\"    Zgodaj zjutraj gre stevardesa po avionu in opazi starčka, ki se trese od mraza.  \"Gospod, vam je hladno?\"  \"Ma, zebe me kot psa!\"  \"Zakaj pa niste poklicali in prosili za odejo?\"  \"Ni šans! Je eden klical in prosil za vodo, pa so ga potem celo noč jebali!!\"", CategoryId = 27 },
                new Joke() { Id = 168, Active = true, Title = "80 letnik in 20 letnica", Description = "Se poročita 80-letnik in 20-letnica.  Po nekaj mesecih se jima rodi otrok in sestra v porodnišnici vpraša očeta: To je nemogoče. Kako vam je to uspelo pri teh letih?    Pa ji odgovori: \"Star motor je treba negovati.\"    Zgodba se po kakem letu ponovi. Še drugo rojstvo.    Sestra ponovno: \"Ne morem verjeti. Kako vam je lahko spet uspelo?\"    Pa 80-letnik spet ponosno: \"Star motor je treba negovati.\"    Naslednje leto pa že tretje rojstvo. Sestra: \"Ste pa res možakar!\"    Srečni oča: \"Star motor je treba negovati\", ji odgovori.    Sestra pa pripomni: \"Samo sedaj je pa že čas, da zamenjate olje, ker je vaš tretji otrok črn!\"", CategoryId = 27 },
                new Joke() { Id = 169, Active = true, Title = "Razlika med ženskami", Description = "Pri 8 -- Neseš jo v posteljico in ji poveš zgodbico.    Pri 18 -- Poveš ji zgodbico, da jo spraviš v posteljo    Pri 28 -- Ne rabiš ji več povedati zgodbice, da jo spraviš v posteljo    Pri 38 -- Ona tebi pove zgodbico, da te spravi v posteljo    Pri 48 -- Ona ti pove zgodbico, da ji ni treba s tabo v posteljo    Pri 58 -- Ostaneš v postelji, da se izogneš njenim zgodbicam     Pri 68 -- Če jo spraviš v posteljo - to bi bila zgodbica!!!    Pri 78 -- Kakšna zgodbica? Kakšna postelja? Kdo si ti???", CategoryId = 40 },
                new Joke() { Id = 170, Active = true, Title = "Pred smrtjo razkrita skrivnost", Description = "Babica stara 98 let leži na smrtni postelji in želi se pred smrtjo razkriti 99 letnemu možu, ki sedi žalosten ob njeni postelji, še zadnjo skrivnost.    Gerardo, moj mali Gege, preden bom za vedno zatisnila oči, ti želim razodeti mojo skrivnost. Pojdi na skedenj in pod tretjim stebrom na levi strani strehe, boš našel dve škatlji in jih prinesi. Gerardo gre na skedenj in se po petih minutah vrne noseč v rokah dve skatlji.    V prvi najde tri jajca, v drugi pa 250,000,00 evrov, kar oci se mu razsvetljijo.    Povej mi moja draga, kaj pomenijo ta tri jajca. Ves Gerardo, poročena sva že 78 let, in vsakič ko sva seksala in jaz nisem dosegla orgazma, sem položila v škatljo eno jajco.    Gerardo postane izredno zadovoljen in ponosen, v 78 letih ni uspel zadovoljiti svoje žene samo trikrat, nato pa še vpraša: in kaj pomeni 250,000,00 evrov?    Oh, vsakikrat, ko sem napolnila škatljo z dvanajstimi jajci, sem jih šla prodati na tržnico.", CategoryId = 11 },
                new Joke() { Id = 171, Active = true, Title = "Moški brez likalnika", Description = "Samski moški je stanoval v 4. nadstropju. Moral bi si zlikat srajco, zaradi sestanka naslednji dan, in ni imel likalnika.    Spomni se na sosedo iz pritlicja in sklene, da jo bo prosil, ce mu posodi likalnik.    Ko je bil v 3. nadstropju si misli  \"Ni slaba tale soseda, pravzaprav je kar dobra mrha. Mogoče me bo ogovorila, pa pade še kaksna kavica.\"    Ko je bil v 2. nadstropju si misli  \"Jah, kavica, pol pa tralala, pa vincka, pol smo pa tam, jo bom moral povabiti še k sebi.\"    Ko je bil v 1. nadstropju si misli  \"Če jo povabim k sebi, bo pol prišla. Pol jo bom pa kresnu. Pa enkrat pri njej, pa spet pri meni, pol pa spet pri meni, pa spet.\"    Ko je bil v pritlicju si misli  \"Mater, pol bo pa že stvari začela gor nosit in pri meni spat, pa stvari urejat po svoje, pa pohištvo premikat, pa se psa ima, pol se je pa znebit ne bom mogel\"    In ko takole premišljuje že avtomatično pozvoni, soseda odpre vrata, se veselo nasmehne in zažvrgoli:  \"O sosed, kako ste kaj, vam lahko kako pomagam?\"    Moški pa reče:  \"Ma jebi se ti s tvojim likalnikom vred!!!\"", CategoryId = 17 },
                new Joke() { Id = 172, Active = true, Title = "Spanje", Description = "Na sprehajališču dregne študent prijatelja:  \"Ali vidiš tisto v mini krilu na oni strani ceste?\"  \"Vidim, dobra mačka. Kaj je z njo?\"  \"Z njo sem že večkrat spal...\"  \"Res? Kje pa?\"  \"Na predavanjih.", CategoryId = 43 },
                new Joke() { Id = 173, Active = true, Title = "Izgubljeni ptič", Description = "Duhovnik iz male slovenske vasi je bil velik ljubitelj ptic, ki jih je skrbno čuval v kletki za cerkvijo.  Neko nedeljsko jutro je ob običajnem sprehodu med perjadjo opazil, da je izginil njegov najlepši ptič in ker je vedel, da ga je moral ukrasti nekdo tik pred mašo, se je odločil nagovoriti svoje vernike.    \"Kdo ima tiča?!\"  Vstali so vsi moški.    \"Ne, nisem mislil tako. Je kdo videl tiča?\"  Vstale so vse ženske.    \"Ne, ne, tudi tega nisem mislil. Je kdo videl tiča, ki mu ne pripada?\"  Vstala je polovica žensk.    \"Neeee, ne in ne, mislil sem ali je kdo videl MOJEGA tiča?\"  Vstali so ministranti, dva duhovnika in koza.    \"Neee mislil sem ali ima kdo zdaj tiča v rokah?\"  Vstala je punca v zadnji klopi in rekla fantu: \"Sm ti rekla, da bo videl!\" ", CategoryId = 42 },
                new Joke() { Id = 174, Active = true, Title = "Poredna mlada grešnica", Description = "\"Gospod župnik, grešila sem!\"    \"Povej, dete moje, svoj greh.\"     \"Nosim prekratko mini krilo.\"    \"No, saj to pa ni tak greh.\"    \"Ampak, gospod župnik, jaz spodaj ne nosim hlačk.\"    \"Jezus Marija, to je pa hud greh. Za pokoro zmoli tri Oče naše, tri Zdrava Marije pa še deset prevalov po sredini cerkve boš naredila!\" ", CategoryId = 42 },
                new Joke() { Id = 175, Active = true, Title = "Chuck Norris prečka cesto", Description = "Ko Chuck Norris prečka cesto, morajo avtomobili pogledati levo in desno.", CategoryId = 6 },
                new Joke() { Id = 176, Active = true, Title = "Neozdravljiva bolezen", Description = "\"Za vas imam dobro in slabo novico\" reče doktor pacientu.  \"Najprej mi povejte slabo novico\" reče pacient.  \"Imate zelo redko, težko neozdravljivo bolezen!\"  \"Kaj pa dobra novica?\"  \"Poimenovali jo bomo po vas.\"", CategoryId = 39 },
                new Joke() { Id = 177, Active = true, Title = "Prepoved", Description = "Doktor izpolnjuje kartotečni list in vpraša:  \"Kadite?\"  \"Ne.\"    \"Pijete?\"  \"Tudi ne.\"    Doktor nekaj časa zre v pacienta, nato pa mu reče:  \"Nekaj bom že našel, da vam bom prepovedal.\"", CategoryId = 39 },
                new Joke() { Id = 178, Active = true, Title = "Prijatelj se je okužil", Description = "Pacient je vstopil v ordinacijo in rekel zdravniku:  \"Moj prijatelj je imel spolno razmerje z neznano žensko in zdaj se boji, da seje okužil s kakšno spolno boleznijo.\"    Zdravnik: \"Hmmmm, najbolje bo, da slečete hlače in mi pokažete vašega prijatelja.\" ", CategoryId = 39 },
                new Joke() { Id = 179, Active = true, Title = "Puljenje zoba", Description = "\"Zob ste mi izpulili v petih minutah pa za to hočete 50 Evrov!\"    \"Če bi želeli, bi vam ga lahko pulil tudi dve uri!\" ", CategoryId = 39 },
                new Joke() { Id = 180, Active = true, Title = "Odločitev o operaciji", Description = "Pacient: \"Ne morem se odločiti med tem da grem na operacijo ali da umrem!\" reče pacient doktorju.    \"Z malo sreče imate lahko oboje\" reče doktor. ", CategoryId = 39 },
                new Joke() { Id = 181, Active = true, Title = "Uspela operacija", Description = "Razgovor dveh kirurgov:  \"Teoretično pacient Mihec sploh ne bi smel preživeti operacije!\" je rekel prvi.    \"No, vidite kolega, kaj napravi močna volja do življenja. Proti njej je tudi moderna medicina nemočna.\" ", CategoryId = 39 },
                new Joke() { Id = 182, Active = true, Title = "Cena operacije", Description = "\"Gospod doktor, bo moja operacija zelo draga?\"    \"Nič ne skrbite, to skrb lahko prepustite vašim dedičem!\" ", CategoryId = 39 },
                new Joke() { Id = 183, Active = true, Title = "Pred operacijo", Description = "\"Gospod doktor, kaj pa če operacija ne bo uspela?\" je prestrašeni pacient vprašala doktorja tik preden so mu dali anestezijo.    \"Tega pa ne boste doživeli!\" ga je potolažil kirurg. ", CategoryId = 39 },
                new Joke() { Id = 184, Active = true, Title = "Pregled pri kardiologu", Description = "\"Kaj pravite?\" zaskrbljeno vpraša pacient kardiologa, ki mu je pregledal delovanje srca.    \"Hm. Nekoliko je res slabotno, vendar ste lahko mirni. Do konca bo že vzdržalo.\" ", CategoryId = 39 },
                new Joke() { Id = 185, Active = true, Title = "Hvaležna gospa", Description = "\"Doktor, prišla sem vam izreči iskreno zahvalo!\"   je rekla pacientka, ko je vstopila v doktorjevo ordinacijo in mu na mizo postavila steklenico konjaka in modro kuverto.    \"Oprostite..... \"je nekoliko zmedeno deloval doktor,  \"ne spominjam se vas več. Ste vdova ali pacientka?\" ", CategoryId = 39 },
                new Joke() { Id = 186, Active = true, Title = "Močne teablete", Description = "Doktor: \"Te tablete, ki sem vam jih predpisal, so tako močne, da jih lahko jemljejo le pacienti, ki so odličnega zdravja.\" ", CategoryId = 39 },
                new Joke() { Id = 187, Active = true, Title = "Bolezen", Description = "\"Gospod doktor, ali imam samo jaz to bolezen?\"    \"Kje pa, na pokopališču je polno takih.\" ", CategoryId = 39 },
                new Joke() { Id = 188, Active = true, Title = "Plačilo zdravljenja", Description = "\"Doktor, trenutno nimam denarja, da bi vam plačal zdravljenje. Vam bom pa v oporoki zapisal del premoženja. Ste za to?\"  \"Seveda sem! No, sedaj mi pa vrnite recept, ki sem vam ga napisal, da vam bom predpisal nekaj drugega.\"", CategoryId = 39 },
                new Joke() { Id = 189, Active = true, Title = "Direktor v boilnišnici", Description = "Direktor je, potem, ko je bil operiran, predsedniku sindikalne podružnice poslal e-mail:  \"Kako v podjetju poteka delo in poslovanje brez mene? Kdo opravlja moje delo? Pazite, da sedaj, ko me ni, ne bo kakšnega štrajka. Vrnem se hitro!\"    Predsednik sindikalne podružnice mu je odgovoril:  \"Vaše delo smo si razdelili takole:  - na poslovna kosila hodi Peter,   - golf igra Rajko,   - vašo tajnico pa položim kar sam.  Bodite brez skrbi: Stavkali ne bomo, dokler se ne vrnete. Zato nič ne hitite!\"", CategoryId = 29 },
                new Joke() { Id = 190, Active = true, Title = "Blondinka na banki", Description = "\"Dober dan. 300 € bi rada položila na svoj bančni račun.\"    Bančna uslužbenka pogleda v računalnik in presenečeno vpraša:  \"Ampak gospodična, denar ste ravnokar dvignili na bankomatu pred banko. Ste se morda zmotili pri dvigu?\"    \"Ne, pomislila sem, da bo moj denar bolj varen na banki, kot zunaj v avtomatu.\"", CategoryId = 4 },
                new Joke() { Id = 191, Active = true, Title = "Ivan, Zoki in Borči", Description = "Na odru, na totalno nabasani javni novinarski konferenci, Janez Janša, Zoran Jankovič in Borut Pahor.  En moški potrka po rami moškega pred sabo in mu reče: \"Oprostite, a lahko prosim snamete klobuk, nič ne vidim...\"  Moški vljudno sname klobuk in posluša naprej, ko čez nekaj trenutkov spet začuti trkanje po rami.  \"Oprostite, a lahko stopite malce bolj levo, še vedno nič ne vidim...\"  Moški, že malce nejevoljen, stopi bolj levo. A čez nekaj trenutkov spet začuti trkanje po rami.  \"Oprostite, a lahko...\"  Moški ga jezno prekine: \"Pa dobr no, a zdej bi radi pa še daljnogled, al kaj??\"    \"Ne ne, hvala, ni treba, ga mam na puški...,\"", CategoryId = 23 },
                new Joke() { Id = 192, Active = true, Title = "Blondinka je noseča", Description = "Blondinka pravi prijateljici: \"Danes sem bila pri ginekologu in sem izvedela, da sem noseča.\"    \"Oh, kako lepo, si že razmišljala o imenu?\"    \"Ne, zdaj razmišljam o priimku.\"", CategoryId = 4 },
                new Joke() { Id = 193, Active = true, Title = "Blondinka kontrolira promet", Description = "Blondinka je končala policijsko šolo in je na svoji prvi kontroli prometa.    Zaustavi vozilo, zahteva dokumente in vpraša voznika:  \"Boste kaj popili?\"", CategoryId = 4 },
                new Joke() { Id = 194, Active = true, Title = "Blondinka pri urarju", Description = "Pride blondinka do urarja zamenjati baterijo na uri.    Urar: Draga gospodična, ta ura ni na baterije, ampak na navijanje!    Blondinka začne skakati in ploskati: \"Dajmo ura, dajmo ura!!!\"", CategoryId = 4 },
                new Joke() { Id = 195, Active = true, Title = "Blondinka in ribolov", Description = "Gre blondinka pozimi na ribolov. V led zvrta luknjo in hoče začeti, ko z neba zasliši glas: \"Tukaj ni rib.\"Odide malo naprej, ponovno izvrta luknjo, da bo začela loviti in spet z neba: \"Tukaj ni rib.\"Ker gre v tretje rado, se odloči, da bo poskusila se na drugi strani ledene ploskve.  Izbere primeren kraj, zvrta luknjo, pripravi palico, skoraj vrže...  Z neba zadoni: \"Pravim ti, da tukaj ni rib.\"  Blondinki je prekipelo. Zadere se nazaj: \"Kdo mi to govori, da tuki not ni rib? A si bog, al kdo me prepričuje, da ni rib?\"  Z neba se zasliši: \"Ne, jaz sem napovedovalec v hokejski dvorani in pusti led pri miru.\"", CategoryId = 4 },
                new Joke() { Id = 196, Active = true, Title = "Blondinki o penisu", Description = "Prva: \"A veš, da lahko od trdega penisa dobiš raka na materničnem vratu?\"    Druga: \"Tega ne vem, vem pa, da se od mehkega lahko dobi živčni zlom!\"", CategoryId = 4 },
                new Joke() { Id = 197, Active = true, Title = "Blondinka v bolnici", Description = "Blondinka leži v bolnici in pravi zdravniku:  \"Gospod doktor, ali bi lahko dobila svežo prevleko za blazino?\"    \"Recite sestri.\"    \"Ampak jaz nimam sestre.\"", CategoryId = 4 },
                new Joke() { Id = 198, Active = true, Title = "Letalsko pismo", Description = "Poštar pozvoni pri vratih in blondinka odpre okno:  \"Letalsko pismo za vas, gospa!\"    Blondinka: \"Lažnivec! Videla sem vas, kako ste se pripeljali s kolesom.\"", CategoryId = 4 },
