                new Joke() { Id = 200, Active = true, Title = "Blondinka na vozniškem izpitu", Description = "Blondinka razlaga svoji blont prijateljici:  \"Padla sem na vozniškem izpitu. Zapeljala sem v krožišče in ker je pisalo 30, sem 30-krat peljala okoli. Pa me je vrgel.\"    Prijateljica: \"Sigurno si se zaštela.....\"", CategoryId = 4 },
