                new Joke() { Id = 202, Active = true, Title = "Blondinka s slabim spominom", Description = "Blondinka potuje z vlakom.  Odide na stranišče, nato pa ne najde več svojega kupeja.    Sprevodnik ji poskuša pomagati:  \"Pa se vsaj približno spomnite, kje ste sedeli?\"    Blondinka:\" Am....vem samo to, da je bila zunaj reka.\"", CategoryId = 4 },
                new Joke() { Id = 203, Active = true, Title = "Lepotica v restavraciji flirta", Description = "Lepotica je v restavraciji pristopila k bradatemu natakarju in mu rekla, da mu želi nekaj šepniti v uho.    Natakar je privolil, lepotica pa mu je s prstom začela ovijati brado in se igrati z njo ter rekla:  \"Ste vi tukaj šef?\" in še naprej z prsti šarila po bradi.    \"Ne, jaz nisem šef!\" je rekel natakar.    \"Ali ga lahko pokličete?\" je vprašala lepotica in mu prste, enega za drugim vtikala v usta.    \"Ne, ne morem ga poklicati, ker ga danes sploh ni tu!\"    \"Toda, jaz ga potrebujem, ker mu moram nekaj sporočiti!\" je rekla lepotica in spet s prsti ovijala natakarjevo brado.    \"Saj lahko meni pustite sporočilo!\" je rekel natakar.    \"No, prav, pa mu povejte, da v stranišču ni WC papirja, voda pa tudi ne teče!\"", CategoryId = 40 },
                new Joke() { Id = 204, Active = true, Title = "Nova okna", Description = "Dragi dnevnik,    lani sem dala na hiši zamenjati stara lesena okna z novimi PVC okvirji. Okna  so super, prišparamo na gretju,... in vse bi bilo super, ce me nebi pred  nekaj dnevi poklical lastnik firme, ki je vstavila nova okna, in me opomnil,  da okna po letu dni še vedno niso placana.    Bila sem zelo presenečena nad njegovo izjavo in sem ga opomnila kaj so mi  takrat, ko sem kupovala okna, rekli njegovi prodajalci.  \"Ta okna so tako dobra in varčna, da se že po letu dni sama poplacajo.\"  Halooooooooooooo !!!!!!!!!!!! Poteklo je leto dni !!!!!!!!!    Čeprav sem blond, se ne pomeni da sem glupa.  Na drugi strani slušalke je nastal molk, pa sem poklopila slušalko. Sigurno  se je tip počutil kot prava budala. ", CategoryId = 4 },
                new Joke() { Id = 205, Active = true, Title = "Babji čvek o otrocih", Description = "Črnolaska, rjavolaska in blondinka se pogovarjajo o otrocih.    Črnolaska pove, da je v reviji brala, da se spol otroka lahko načrtuje.    Tudi rjavolaska je to prebrala in sedaj razlagata blondinki: \"Jaz bom rodila punčko\", pravi črnolaska, \"ker med seksom ležim spodaj\".    Jaz bom pa dobila fantka, ker sem zgoraj, pove rjavolaska.    \"Torej bom jaz dobila psička?\" presenečeno vpraša blondinka.", CategoryId = 4 },
                new Joke() { Id = 206, Active = true, Title = "Dimnikarja je povozil avto", Description = "Dve blondini se pogovarjata:   \"Si slišala, da je našega dimnikarja povozil avto?\"    Druga: \"Strašno! Niti na strehi nismo več varni!\"", CategoryId = 4 },
                new Joke() { Id = 207, Active = true, Title = "Šefica predhodno iz službe", Description = "Tri ženske so skupaj delale v isti pisarni in so imele žensko za šefico.    Vsak dan je šefica odšla iz službe že precej pred iztekom delovnega časa. Punce so to opazovale kar dolgo in potem so sklenile, da bodo tudi one začele odhajati prej. Konec koncev, šefica ni nikoli poklicala nazaj v službo in le kako naj bi vedela, da jih ni tam?       Črnolaska je odšla prva. Napotila se je naravnost domov in se lotila vrtnarjenja. Presadila je nekaj zelenjave in obrezala vrtnice, potem pa je prišla njena hčerka iz šole in ji je pomagala napraviti domačo nalogo. Potemje skuhala kosilo in zvečer je šla zgodaj spat.       Rdečelaska je bila srečna, da je lahko odšla prej, kajti fant jo je povabil na večerjo in je imela tako dovolj časa, da se je lepo uredila in pripravila zanj. Šla je k kozmetičarki, potem sta šla na večerjo s svečami in potem k njemu in naravnost v posteljo.       Blondinka je bila zelo vesela, da bo lahko prišla domov prej in presenetila brezposelnega moža. Ampak ko je prišla domov, ga ni bilo nikjer. Potem je iz spalnice zaslišala čudne glasove. Potiho se je prikradla do vrat spalnice in potihoma odškrknila vrata. Imela je kaj videti... Njen mož je bil v postelji z njeno šefico. Ona je jahala na njem in iz grla so ji prihajali nerazločni zvoki. Prav potihoma je zaprla vrata in se kradoma izmuznila iz hiše.       Naslednji dan, ob opoldanski kavi, sta črnolaska in rdečelaska objavili, da bosta spet odšli prej iz službe. Vprašali sta blondinko, če bo prej odšla tudi ona.    \"Ni govora,\" je rekla blondinka: \"včeraj bi me šefica skoraj dobila!\" ", CategoryId = 4 },
                new Joke() { Id = 208, Active = true, Title = "Stava", Description = "Blondinka in rjavolaska gledata poročila ob 18h.  Novinarka je govorila o moškem, ki se je pripravljal da bo skočil z mosta in naredil samomor.  Rjavolaska se obrne k blondinki in reče: \"Stavim 50 EUR tisoč da bo skočil!\"  Blondinka odvrne: \"Ok velja!\"  Gledata naprej moški skoči z mosta in blondinka da rjavolaski denar.  \"Ne morem sprejeti tega denarja\" pravi rjavolaska.  \"Gledala sem že poročila ob 17h in sem vedela da bo moški skočil.\"  \"Ne ne! moraš vzeti. Tudi jaz sem gledala poročila ob 17h, ampak si nisem mislila da bo skočil še enkrat.\"", CategoryId = 4 },
