                new Joke() { Id = 213, Active = true, Title = "Mož in žena, pogovor", Description = "Zakonca, oba pri štiridesetih, se pogovarjata v spalnici. Ona si ogleduje svoje prsi.  Mož: \"Kaj se pa tako ogleduješ?\"  Žena: \"Včeraj sem bila pri zdravniku in je rekel, da imam joške kot 25-letnica.\"  Mož: \"Kaj pa je rekel za tvojo 40-letno rit?\"  Žena: \"Nič! Tebe sploh ni omenjal!\"", CategoryId = 40 },
