                new Joke() { Id = 217, Active = true, Title = "Prva maša", Description = "Mladi župnik je bil tako nervozen pred svojo prvo mašo, da ni mogel  spregovoriti niti besede. Vpraša škofa, kaj mu je storiti, le-ta pa mu  pove, naj naslednjič spije kozarec vode, v katerega naj kane dve kapljici vodke.  Takoj se bo počutil bolj sproščenega.  Mladi župnik stori, kot mu je svetoval škof. Potem se je župnik  počutil tako dobro, da ga ni moglo nič več vznemiriti.    Po končani maši najde škofovo sporočilo:  \"Naslednjič dajte dve kaplijici vodke v vodo in ne obratno.  Poleg tega je tu nekaj napotkov, da se ne bodo ponovno pripetili izpadi:  - ni potrebno dajati rezin limone na rob keliha,  - ne naslanjajte se več na kip device Marije, ne objemajte in ne poljubljajte je,  - obstaja 10 in ne 12 zapovedi,  - obstaja 12 apostolov in ne 7 in niti eden od njih ni Palček,  - Jezusa in njegove ucence ne nazivamo J.K. & Co.,  - David je premagal Goljata s fračo in kamnom, ni ga razbil kot kanto,  - Židov ne imenujemo kurbini sinovi,  - papeža ne smemo imenovati El Padrino,  - Bin Laden nima nobene veze z Jezusovo smrtjo,  - hostija ni prigrizek k vinu,  - grešniki gredo v pekel in ne v pizdo materino,  - tisti v vogalu, zraven zbora, ki ste ga imenovali travestit v obleki, sem bil pa jaz!", CategoryId = 42 },
