                new Joke() { Id = 222, Active = true, Title = "Jezen delavec", Description = "Delavec je na zid podjetja napisal: \"Naš šef je nor!\"    Na sodišču so ga obsodili na 1 dan, 1 mesec in 1 leto zapora.      1 dan,ker je popackal zid.  1 mesec, ker je pribor za pisanje in barve ukradel v podjetju.  in 1 leto pa zato, ker je razkril poslovno skrivnost!", CategoryId = 29 },
                new Joke() { Id = 223, Active = true, Title = "Mož sumi ženo, da ga vara", Description = "Mož se, iz letališča, s taksijem vrača domov s službenega potovanja.  Polnoč je že zdavnaj mimo.    Ker že dolgo sumi, da ga žena vara, ponudi taksistu 100€, če gre z njim v hišo za pričo, da ga žena vara.  Potiho sta se splazila do spalnice, mož prižge luč, odkrije posteljo in zagleda v njej ženo z ljubimcem.    Izza pasu potegne pištolo in jo nastavi ljubimcu na čelo.    Žena vzklikne: \"Ne streljaj, lagala sem ti, da sem denar podedovala.  ON je plačal tvojo Corvetto, ki sem ti jo podarila, ON je plačal jahto, ON je plačal letno karto za nogometne tekme, ON je plačal vikend ob jezeru. Celo mesečne kredite plačuje ON.\"    Mož spusti pištolo, pogleda taksista in ga vpraša: \"Kaj bi ti naredil?\"    Taksist odgovori: \"Hitro bi ga pokril z odejo, da se ne prehladi!\"  ", CategoryId = 11 },
                new Joke() { Id = 224, Active = true, Title = "Mujo in blondinke", Description = "Poletje, vročina, Mujo hodi po stari Ljubljani.  Pride do vodnjaka in mu pade na misel: \"Ooo, voda, kaj ko bi se osvežil?\"     Se sleče do nagega in hop v vodo.    Nato se spomni, da ima s sabo tudi milo in zakaj se ne bi še umil.    Pri tem prijetnem opravilu pridejo mimo tri blondinke. Mujo da milo med zobe in se postavi ves trd od strahu. Se pretvarja, da je kip.    Tudi blondinkam pade na pamet odlična ideja, da bi se osvežile.  In skočijo v vodo. Ena pride do Mujota in vidi milo, ter mu ga hoče izvleči iz ust.    Mujo pa ne da. Ona ga potegne za luleka in Mujo pregrizne milo na pol.    Vsa srečna, da je dobila milo, se začne umivati, nakar jo vpraša druga: \"Ja, kje pa si dobila milo?\"  Prva: \"Glej, tam na avtomatu.\"    Druga gre do Mujota, ga gleda in ga potegne za luleka. Mujotu pade iz ust še druga polovica mila.    Pride še tretja in tudi z namenom, da dobi milo.  Gleda Mujota, pa potegne za luleka in nič.  Pa potegne še enkrat, pa se dvakrat pa se trikrat... in vzklikne: \"Ooo, jaz sem pa dobila tekoče milo!\"", CategoryId = 4 },
