                new Joke() { Id = 237, Active = true, Title = "Blondinka se poroči", Description = "Moški se je poročil z blondinko.    Po dolgih letih zakona mož pride domov in v svoji postelji najde tujega moškega.    Odpre omaro, in se zadere na svojo ženo, ki je bila skrita v njej: \"Kolikokrat sem ti že povedal, da se mora skriti ON in ne ti!?!\"", CategoryId = 4 },
