                new Joke() { Id = 247, Active = true, Title = "Brodolomci na otoku", Description = "Trije brodolomci se znajdejo na samotnem otočku: Anglež, Nemec in Mujo.     Lovijo ribe in ulovijo zlato ribico.  Ribica jim reče, da vsakemu, v zameno za svojo svobodo, izpolni eno željo.    \"Rad bi bil s svojimi najdražjimi,\" reče Anglež in izgine.    \"Tudi jaz bi bil rad s svojimi najdražjimi,\" reče Nemec in izgine.    Tako Mujo zadnji ostane na samotnem otočku, malce pomisli in reče: \"Kaj bom jaz zdaj sam tu?. Pripelji mi on adva nazaj!\" ", CategoryId = 18 },
                new Joke() { Id = 248, Active = true, Title = "Janezek in poškodovano oko", Description = "Janezek, zakaj imaš pa povezano oko?    Janezek: \"Soseda me je vanj sunila s pletilko!\"    \"Ponesreči?\"    Janezek: \"Ne, skozi ključavnico.\" ", CategoryId = 15 },
                new Joke() { Id = 249, Active = true, Title = "Povišica", Description = "Mož: \"Žena, povej mi, kako to, da so ti že spet zvišali plačo?\"    Žena: \"Četudi ti povem si ti, s tem, ne bi mogel prav nič pomagati.\" ", CategoryId = 11 },
                new Joke() { Id = 250, Active = true, Title = "Gorenjc in taksi", Description = "Taksist pelje gorenjca po klancu navzdol in avto vedno bolj pridobiva na hitrosti. Vedno hitreje in hitreje. Na ovinkih že škripljejo gume. Taksist se obrne k potniku in mu zgroženo reče:  \"Ne morem ustaviti avta! Zavore so odpovedale!\"    Gorenjc: \"Potem pa vsaj ugasnite taksimeter!\" ", CategoryId = 12 },
                new Joke() { Id = 251, Active = true, Title = "Prevožen stop znak", Description = "Policaj ustavi voznika: \"Gospod, spregledali ste STOP znak!\"    Voznik: \"Oprostite, danes sem prvič v tem mestu.\"    Policaj: \"Kaj pa, če bi podrli kakšno žensko?\"    Voznik samozavestno: \"To pa ne bi bilo prvič, he, he...\"", CategoryId = 27 },
                new Joke() { Id = 252, Active = true, Title = "Tovornjak proti predoru", Description = "Tovornjak se bliža predoru.    Pred njim stoji ozorilna tabla: \"Višina 4 m!\"    Eden od voznikov reče: \"Kaj pa sedaj? Najin kamion je pol metra višji!!!\"    Drugi odvrne: \"Nič hudega! Saj ni nikjer nobenega policaja!\"", CategoryId = 43 },
                new Joke() { Id = 253, Active = true, Title = "Šofer in strelec", Description = "Kakšna je razlika med slabim strelcem in slabim šoferjem?    Slab strelec ne zadene ničesar.    Slab šofer pa vse.", CategoryId = 43 },
                new Joke() { Id = 254, Active = true, Title = "Razlika: pijanec - avto", Description = "Kakšna je razlika med avtom in pijancem?    Ko avto natanka, lahko pride skoraj do Frankfurta.    Ko pijanec natanka, pa ne more niti čez cesto.", CategoryId = 43 },
                new Joke() { Id = 255, Active = true, Title = "Način, kako umreti", Description = "Rad bi umrl mirno, v spanju. Tako, kot moj dedek.    Ne ipično in kričeče, kot njegov sopotnik.", CategoryId = 43 },
                new Joke() { Id = 256, Active = true, Title = "Lovci z ženami na lovu", Description = "Med lovom, na katerem imajo lovci tudi žene, se zgodi nesreča: lovec svojemu lovskemu prijatelju, po nesreči, ustreli ženo.    Vdovec: \"Ti bedak, a si ti nor?!? Kaj si zmešan??? Kako si mi lahko ustrelil ženo?\"    Strelec: \"Pa kaj se toliko dereš? Na, tu imaš puško, pa ti ustreli mojo!\"", CategoryId = 35 },
                new Joke() { Id = 257, Active = true, Title = "Lovec na skupnem lovu", Description = "Med organiziranim lovom lovec na robu gozda, v zasedi, čaka na strel.    Nakar iz grmovja prideta dva možakarja z nosili.     Začudeno ju vpraša: \"Kaj pa je to?\"    Možakarja: \"Enega izmed gonjačev so obstrelili.\"    Lovec: \"Kaj tudi njih lahko streljamo? Škoda, da tega nisem prej vedel.\" ", CategoryId = 35 },
                new Joke() { Id = 258, Active = true, Title = "Lovec, ki je vdovec, razlaga", Description = "Za šankom stoji lovec in razlaga svojemu prijatelju: \"Veš, zadnjič smo imeli skupni lov. In mojo ženo je lovski kolega ustrelili v prst. In zdaj je ni več!\"    Njegov prijatelj: \"Pa, saj zaradi tega ni mogla umreti? Prst poviješ, pa je!\"    Lovec: \"Ne, ne. Tako se je drla, da sem ji bil primoran dat milostni strel ...\"", CategoryId = 35 },
                new Joke() { Id = 259, Active = true, Title = "Janazek bi prodal mamo", Description = "Janezek: \"Ata, kaj, če bi midva prodala mamo?\"    Oče: \"Janezek, kaj si nor? Zakaj?\"    Janezek: \"Poglej:  - kuhat ne zna,  - jaz ne sesam več,  - ti fukaš tudi ne!  Torej, zakaj bi jo redila za soseda?\"", CategoryId = 15 },
                new Joke() { Id = 260, Active = true, Title = "Duhovnik na lovu", Description = "Sredi džungle se, iz oči v oči, srečata župnik in lev.    Župnik: \"Gospod moj, navdihni to žival s krščanskim duhom!\"    Lev pa nazaj: \"Gospod, blagoslovi hrano, ki jo bom zaužil!\"", CategoryId = 42 },
                new Joke() { Id = 261, Active = true, Title = "Cel v mavcu", Description = "\"Kaj pa je s tabo? Te je avto povozil, da si cel v mavcu in ves plav?\"    \"Ne. Žena se je prehitro vrnila z dopusta.\" ", CategoryId = 11 },
                new Joke() { Id = 262, Active = true, Title = "Zanič piščanec", Description = "Gost: \"Natakar, a vi temu rečete piščanec? Počil bom od smeha.\"    Natakar: \"Vi se kar smejte, ste zelo prijazni! Drugi so me preklinjali in za menoj metali krožnike.\"", CategoryId = 13 },
                new Joke() { Id = 263, Active = true, Title = "Mlad par v recepciji", Description = "Mlad par pride na recepcijo in naroči sobo.    Receptorka: \"Kakšno sobo želite? Z razgledom na morje, s tušem, telefonom in televizorjem?\"    Par hladno: \"Vseeno je! Glejte le, da postelja ne bo škripala!\"", CategoryId = 27 },
                new Joke() { Id = 264, Active = true, Title = "Nima rad stare mame", Description = "Sin: \"Mami, jaz pa nimam rad stare mame.\"    Mama: \"Tiho bodi, in pojej do konca!!!\"", CategoryId = 9 },
                new Joke() { Id = 265, Active = true, Title = "Blondinka in rane", Description = "Zakaj si je blondinka privezala uro na rano?    Slišala je, da čas celi vse rane.", CategoryId = 4 },
                new Joke() { Id = 266, Active = true, Title = "Blondinka in prometna kontrola", Description = "Ustavi policaj blondinko, rekoč: \"Dajte mi vaše ime in priimek.\"    Blondinka: \"A ste neumni? Ne morem! Kako bo pa potem meni ime?\"", CategoryId = 4 },
                new Joke() { Id = 267, Active = true, Title = "Blondinka v dvomih", Description = "Blondinka rodi dvojčke.    Po porodu začne razmišljati: le kdo bi utegnil biti oče od tadrugega otroka.", CategoryId = 4 },
                new Joke() { Id = 268, Active = true, Title = "Sarma", Description = "Upišite vaš password:  sarma    Žao nam je, password mora da sadrži više od 8 znakova:  kuvana sarma    Žao nam je, password mora da sadrži bar jednu brojku:  1 kuvana sarma    Žao nam je, password ne sme sadržavati razmake:  5jebenihkuvanihsarmi    Žao nam je, password mora sadržavati bar jedno veliko slovo:  5jebenihKUVANIHsarmi    Žao nam je, password ne sme sadržavati više od jednog velikog slova uzastopce:  5jebenihKuvanihsarmi, i da se nosiš u pičku materinu govno jedno    Žao nam je, password ne sme sadržavati interpukcijske znake:  5jebenihKUVANIHsarmi nabijem te na kurac i tebe i tvoj password mamicu ti jebem kretenčino    Žao nam je, taj password se već koristi!", CategoryId = 3 },
                new Joke() { Id = 269, Active = true, Title = "WC", Description = "Zakaj gre vedno več žensk skupaj na WC?    Da se ne ve, katera je srala.", CategoryId = 40 },
                new Joke() { Id = 270, Active = true, Title = "JC and The Gang", Description = "Novi župnik je bil pred svojim prvim bogoslužjem tako živčen, da iz sebe ni spravil niti besedice.     Tako je za nasvet vprasal škofa. Ta mu svetuje, naj pred mašo v kozarec vode kapne 2 kapljici Tequille, naj to spije in ne bo več živčen.     To novi župnik stori in izgubi nervozo. Šlo mu je dobro. Bil je tako miren, da ga tudi najhujše neurje ne bi moglo spraviti iz tira.     Ko je novi župnik hotel oditi iz zakristije, je na mizi našel napisan list, ki mu ga je napisal škof:     ----    Spoštovani župnik!     Imam nekaj pripomb glede vaše prve maše in upam, da se tak dogodek na naslednjem bogoslužju ne ponovi:     1. Na rob keliha ni potrebno zatikati nikakršnih limoninih rezin.     2. Kabinica poleg oltarja je spovednica in ne WC.     3. Božjih zapovedi je 10 in ne cirka 12.     4. Apostolov je bilo 12 in ne približno 7.     5. Jezusa in apostolov ne poimenujemo J.C. and the gang.     6. David je Goljata premagal z metom kamenja v glavo in ga ni nafiksal s kokainom do smrti.     7. Judasa ne poimenujemo kurbin sin in Papeža ne poimenujemo El Padrino.     8. Bin Laden ni imel nikakršnega opravka s smrtjo Jezusa.     9. Blagoslovljena voda ni tam za umivanje obraza in vratu, temveč za blagoslavljanje.     10. Zakaj ste mašno vino spili z enim požirkom, zatem polizali sol z roke in na koncu ugriznili v rezino limone, mi tudi ni čisto jasno.     11. Predvsem pa ne smete moliti tako, da se usedete na stopnico pred oltarjem in položite noge na Sveto pismo.     12. Hostije niso mišljene kot prigrizek k vinu, ampak so mišljene za vernike.     13. Noe je zgradil barko in ne >offshore-Boat<.     14. Abraham ni bil >Ata Smrk<.     15. Povabilo k plesu ni tako slaba zamisel, vendar pa je skakanje v koloni skozi celotno cerkev šlo predaleč.     16. >P... z majhnimi joški< je Devica Marija. Ni potrebe, da njen kip stalno objemate, poljubljate in ližete.     17. Tako imenovani >Freak< nad oltarjem je Jezus. In on tam tudi ne visi kar tako, temveč je pribit na križ.     18. Tisti, ki je stal v kotu cerkve pri pevskem zboru in katerega ste poimenovali >transvestitska pederčina v dolgi kikli< sem bil jaz!     19. Naslednjič vas prosim, da date 2 kaplji Tequille v kozarec vode in ne obratno. ", CategoryId = 5 },
                new Joke() { Id = 271, Active = true, Title = "Italijanski in ukrajinski mafijaš", Description = "Srečata se italijanski in ukrajinski mafijski boss.    Vpraša italijan ukrajinca:  - Ali imas štirinadstropno hišo?  - Nimam, odgovori ukrajinec.  - Potem se nisi pravi mafijaš!      Čez par dni se spet srečata:  - Ali imas črno limuzino, Mercedesa?  - Nimam, odgovori ukrajinec.  - Potem se nisi pravi mafijaš!      Pri naslednjem srečanju:  - Ali imas debelo zlato verižico?  - Nimam, odgovori ukrajinec.  - Potem se nisi pravi mafijaš!      Ukrajinec se razjezi, gre domov in izda ukaz pomočniku: \"Dva štuka na bajti dol porušit, helikopterje prodat in kupit Mercedesa, zlato ketno vzet s psa, jo bom odslej jaz nosil.\"", CategoryId = 43 },
                new Joke() { Id = 272, Active = true, Title = "Kdaj si dejansko pijan?", Description = "Kadar ležiš in se moraš za nekaj držati, ker si tako pijan.", CategoryId = 21 },
                new Joke() { Id = 273, Active = true, Title = "Laž ima kratke noge", Description = "Partizani vkorakajo v hišo, katere lastnica je bila stara žena.    Partizani: \"Hitro mamka, skrijte nas, nemci prihajajo!\"    Star žena jih skrije.    Pridejo nemci. Vprašajo po partizanih a mamka se dela, da nič ne ve. Odrežejo ji eno nogo, a mamka še zmeraj noče povedati. Odrežejo ji drugo nogo. Še zmeraj je tiho.    Nemci odidejo.     Pridejo partizani iz skrivališča smeje: \"Ha mamka, laž ima kratke noge!\" ", CategoryId = 9 },
                new Joke() { Id = 274, Active = true, Title = "Vrtičkanje", Description = "Janezek: \"Mama, mama, našel sem očeta!\"      Mama: \"Janezek, stokrat sem ti že rekla, da ne rovaj po vrtu!\" ", CategoryId = 9 },
                new Joke() { Id = 275, Active = true, Title = "Albanski in slovenski veleposlanik", Description = "Albanski veleposlanik pride k slovenskemu in reče: \"Prijatelj, daj nekaj ukreni, da nas ne bodo Srbi v Kosovu čisto potolkli.\"    Slovenec: \"Nimam zdaj časa. Imam druge skrbi.\"      Albanec: \"Če ne boš nič ukrenil, bom vse naše strokovnjake potegnil iz Slovenije nazaj v Albanijo!\"    Slovenec: \"Pa boli mene, jaz takaltak nimam rad sladoleda!\" ", CategoryId = 1 },
                new Joke() { Id = 276, Active = true, Title = "Prepir za šankom", Description = "\"Ne manjka ti dosti do kretena!\" je Jože zabrusil Marku, s katerim se je prerekal v gostilni.    Marko: \"Vem! Samo korak je do tebe.\"", CategoryId = 13 },
                new Joke() { Id = 277, Active = true, Title = "Nima rad soseda", Description = "Sosed se je napotil k sosedu Milanu, ki je imel na vrtu novega psa.    Pozvonil je pri vrtni ograji, Milan pa je rekel: \"Kar pridite in vstopite!\"    Sosed: \"Ne upam si! Ne vem, če me bo vas pes napadel!\"    Milan: \"Tega tudi jaz ne vem, sem pa res radoveden, kako se bo to končalo!\"", CategoryId = 28 },
                new Joke() { Id = 278, Active = true, Title = "Novo dekle", Description = "\"Slišim, da imaš novo dekle. Kako se kaj obnese?\"    \"Zelo samozavestna je. Na prvi zmenek je prišla kar v poročni obleki.\"", CategoryId = 40 },
                new Joke() { Id = 279, Active = true, Title = "Doma imajo meso", Description = "\"Pri nas imamo vsak dan meso!\" se pohvali Tine sosedu.    \"To pa ne bo res! Pri takšnih cenah je to praktično nemogoče!\"    \"Je mogoče! Kupimo ga, in ga imamo šest dni v zamrzovalniku. Sedmi dan ga pojemo in ga nato ponovno kupimo.\"", CategoryId = 43 },
                new Joke() { Id = 280, Active = true, Title = "Laško pivo in FRUC!", Description = "Se je odvijal simpozij pivovarjev in v odmoru se prijatelji in ostali odločijo nekaj popiti.  - Predstavnik Heinekena naroči pivo Heineken.  - iz Budweisera naroči pivo Budweiser.  - iz iz Stelle naroči Stella.  - Samo slovenec iz pivovarne Laško naroči FRUC.  Pa ga vprašajo ostali: “Pa dobro no, kako lahko na simpoziju pivovarjev naročiš FRUC?”  Pa odgovori Slovenec iz pivovarne Laško: “Pa… če vi nočete piva, potem ga ne bom tudi jaz.”", CategoryId = 13 },
                new Joke() { Id = 281, Active = true, Title = "Dobra bejba!", Description = "Gre Janez po mestu in mu nasproti pride ena dobra bejba.  Pa gleda in si misli.  \"Da bi moja imela take noge.\"  Potem ga ena dobra bejba prehiti in:  \"Da bi moja imela tako dobro tazadnjo.\"  Pride zopet ena dobra bejba nasproti, dekolte:  \"Da bi moja imela take prsi.\"  Na avtobusu ena dobra bejba in:  \"Da bi moja imela take dobre ustnice...\"  No in pride domov pa pravi ženi:  \"Veš, sem celo pot mislil nate!\"", CategoryId = 15 },
                new Joke() { Id = 282, Active = true, Title = "Karte na pregled", Description = "Človek teče za avtobusom in vpije: \"Počakajte prosim, zamudil bom v službo!\"  Potniki začnejo vpiti vozniku:   \"Počakaj ga, zaustavi!\"  Voznik: \"Ne smem na cesti...\"  Potniki: \"Ne bodi kreten, ustavi vendar!!!\"  Voznik res zaustavi in človek vstopi. Ko avtobus odpelje, se človek oddahne, potegene izkaznico in pravi:   \"Karte na pregled!\"", CategoryId = 28 },
                new Joke() { Id = 283, Active = true, Title = "Napil se je", Description = "\"Tone, poglej Gorana! Tako se je napil, da ddaj že osvaja svojo ženo!\"", CategoryId = 13 },
                new Joke() { Id = 284, Active = true, Title = "Žalosten lastnik psa", Description = "Grozno žalosten izgledaš! Kaj pa se ti je zgodilo?\"    nesrečni lastnik: \"Psa sem, tako kot ponavadi, spustil z vrvice, da bi se zdivjal, pa mi je ušel in se izgubil.\"    \"Daj oglas v časopis!\"    Žalostni lastnik: \"Saj je pameten, samo brati pa ne zna!\"", CategoryId = 41 },
                new Joke() { Id = 285, Active = true, Title = "Pogovor o dopustu", Description = "Prijateljici se pogovarjata:\"Na morju sem se imela čudovito!\"    \"Res?\"    \"Res! Kar tridesetim moškim sem morala reči ne.\"    \"Kaj so ti pa prodajali?\"", CategoryId = 40 },
                new Joke() { Id = 286, Active = true, Title = "Nenadoma postal veren", Description = "Do včeraj nisem vedel, da je Vinko tako močno veren!    \"Veren? Vinko? Nemogoče!\"    \"Pa je res. Včeraj sem ga videl pred izložbo mesnice, ko se je križal.\"", CategoryId = 43 },
                new Joke() { Id = 287, Active = true, Title = "Pije kri in ima krilca", Description = "Kaj je to? Pije kri, pa ni vampir, ima krila, pa ni ptica?    \"Komar!\"    \"Ne, to so damski vložki s krilci.\"", CategoryId = 43 },
                new Joke() { Id = 288, Active = true, Title = "Plešasta prijatelja", Description = "Prijatelja, oba plešasta, se prepirata: \"Ti si bolj plešast kot jaz!\"    \"Kako naj bom bolj plešast, ko pa nihče od naju nima niti enega lasu več na glavi?\"    \"Ti imaš večjo glavo!\"", CategoryId = 43 },
                new Joke() { Id = 289, Active = true, Title = "Plastične operacije", Description = "Za svoje dekle sem porabil cel milijon evrov!  Vse je šlo za lepotne operacije!    Zdaj mi je pa ušla.    Rad bi denar nazaj, toda ne vem kako baba zdaj izgleda!", CategoryId = 40 },
                new Joke() { Id = 290, Active = true, Title = "Sonja sreča Veroniko", Description = "Sonja je srečala Veroniko, ki jo je bilo kar precej skupaj in ji rekla: \"Ti si se pa zelo zredila, odkar se nisva videli!\"    \"Nisem se zredila, noseča sem!\" je pojasnila Veronika.    \"Da te ni sram! Zdaj bodo pa vsi vedeli, kaj si delala!\"", CategoryId = 40 },
                new Joke() { Id = 291, Active = true, Title = "Nehal je popivati", Description = "\"Peter, ali si že slišal, da je Uroš prenehal piti?\"    Peter: \"Nemogoče! Saj pije že vse življenje! Ali je šel na zdravljenje?\"    \"Ne, umrl je!\"", CategoryId = 21 },
                new Joke() { Id = 292, Active = true, Title = "Poln avtobus", Description = "Prijateljici sta se peljali v nabito polnem avtobusu mestnega prometa.    Prva: \"Joj, kakšna gneča!\"    Druga: \"Si pa res spremenljivega mnenja. Včeraj v disku, ko je tudi bila gneča si pa rekla: Kakšna atmosfera!\"", CategoryId = 40 },
                new Joke() { Id = 293, Active = true, Title = "Stanar Alzheimer", Description = "Zove baka unuka na mobilni:    Baka: \"Sine, kako se zove onaj Njemac što mi skriva stvari po kući?!\"  Unuk: \"Alzheimer baba, Alzheimer!\" :)", CategoryId = 3 },
                new Joke() { Id = 294, Active = true, Title = "Poroka", Description = "Biti poročen je isto, kot da bi polno karjolo vozil v hrib. Sam težko, dva pa ne moreta.", CategoryId = 17 },
                new Joke() { Id = 295, Active = true, Title = "Ženska po dolenjsko", Description = "Kako rečemo \"ženska\" po dolenjsko s 3 črkami?    QQŠ", CategoryId = 40 },
                new Joke() { Id = 296, Active = true, Title = "Ciganski pregovor", Description = "Pes ki laja, ni dovolj kuhan.", CategoryId = 7 },
                new Joke() { Id = 297, Active = true, Title = "Pes", Description = "Cigan je kuhal psa. Sosedje so ga prijavili, pride policija in društvo za mučenje živali.   Vprašajo ga: \"Kaj pa delaš s psom?!\"   Cigan pa odgovori: \"Jaz nic, sam je not skocu!\"", CategoryId = 7 },
                new Joke() { Id = 298, Active = true, Title = "Razšla sta se", Description = "\"Odkar sem se pred tednom dni razšla s svojim zaročencem, je vsak dan pijan.\" razlaga mlada punca svoji prijateljici.    Prijateljica: \"Ta pa res dolgo proslavlja!\"", CategoryId = 11 },
                new Joke() { Id = 299, Active = true, Title = "Resna zveza", Description = "Ženska 1: \"Zakaj si tako prepričana, da Jožef misli resno s teboj?\"    Ženska 2: \"Preprosto! Hodiva že pol leta pa se še niti enkrat ni nasmehnil!\"", CategoryId = 40 },
                new Joke() { Id = 300, Active = true, Title = "Počitnice na smučišču", Description = "jože: \"Kje si bil med zimskimi počitnicami ? Si bil z otroci na smučanju?\"    Franc: \"Da, smučali smo?\"    Jože: \"In? Je bilo lepo?\"    Franc: \"Najboljši občutek sem imel, ko so mi sneli mavec iz noge!\"", CategoryId = 11 },
                new Joke() { Id = 301, Active = true, Title = "Nekdanja sošolca se srečata", Description = "Nekdanja sošolca se srečata na peronu železniške postaje.    Eden je bil oblečen v generalsko uniformo in bil vitek in visok, drugi pa je bil kardinal, precej širok in seveda oblečen v cerkvena oblačila.    Ko je kardinal opazil, da ga general noče prepoznati, ga je vprašal: \"Oprostite, gospod sprevodnik, ali veste kdaj odpelje vlak proti Mariboru?\"    General ga je ostro pogledal in mu odgovoril: \"Čez deset minut! Toda, draga gospa, jaz v vašem stanju ne bi potoval tako daleč!\"", CategoryId = 43 },
