                new Joke() { Id = 384, Active = true, Title = "Kraja", Description = "Na Brezjah prileti iz cerkve starejši moški, pogleda okrog sebe in začne vpiti: »Spet bom hodil, spet bom hodil!«  Starejša ženička stopi k njemu in vpraša: »Gospod, a je čudež?«  »Kakšen čudež! Medtem ko sem bil v cerkvi, so mi ukradli moped!« ", CategoryId = 5 },
