                new Joke() { Id = 399, Active = true, Title = "Lekarnar", Description = "Pride Janezek v lekarno in rece lekarnarju da rabi kondom, saj ga je punca, s katero hodi ze pol leta, danes povabila na druzinsko vecerjo in kot posladek pricakuje nekaj akcije. Lekarnar mu da kondom in Janezek odide iz lekarne.  Cez pet minut se vrne po nov kondom in razlozi, da je tudi sestra njegove punce dokaj micna gospodicna, ki mu ze kar nekaj casa namiguje in vzbuja pregresne misli. Lekarnar mu da novi kondom in Janezek odide.  Ne traja dolgo, pa je Janezek spet v lekarni, ces, da rabi se tretji kondom. Lekarnarju razlozi, da je mama njegove punce kljub starosti se dobra mrha in da na tihem upa, da se mu bo tudi pri njej nocoj nasmehnila sreca. Tako odide iz lekarne zalozen s tremi kondomi.  Zvecer se vsa familija vsede za mizo in Janezek zacne z molitvijo. Moli 5 minut, 10 minut, 15 minut... Pa kar ne neha... Njegova punca se nagne k  njemu in ga vsa zacudena vprasa: \"Nisem vedela, da si tako veren?\"  Janezek pa ji odgovori: \"Tudi jaz nisem vedel, da je tvoj oce lekarnar.\"", CategoryId = 11 },
