                new Joke() { Id = 411, Active = true, Title = "Pogovor v restavraciji", Description = "Miha in Štefan sedita v restavraciji.    \"Kaj bo šele poleti.....?\" vpraša Miha.    \"Poleti bo politično mrtvilo\" reče Štefan.    \"Ne, mislim kaj bo šele poleti....\"    \"Na morje bomo šli.\" ga spet prehiti Štefan.    \"Ali bi me že prenehal prekinjati!? Hotel sem te vprašati kaj bo šele poleti, če ti že zdaj noge tako smrdijo!\"", CategoryId = 43 },
                new Joke() { Id = 412, Active = true, Title = "Dovolj spanca", Description = "\"Koliko pa spiš vsak dan?\"    \"Tri do štiri ure.\"    \"To pa še zdaleč ni dovolj!\"    \"Seveda ne! Zato pa spim še, najmanj, 8 ur ponoči.\"", CategoryId = 43 },
                new Joke() { Id = 413, Active = true, Title = "Pri jasnovidki", Description = "\"No, Nežka, kaj ti je povedala jasnovidka, ki si jo prejšnji teden obiskala?\"    Nežka: \"Sploh nisem vstopila v njeno stanovanje! Ko sem potrkala na vrata je vprašala: \"Kdo je?\", jaz pa sem se takoj obrnila in odšla domov.\"", CategoryId = 43 },
                new Joke() { Id = 414, Active = true, Title = "Bill Gates v postelji", Description = "Je šel Bill Gates prvič, s svojo bodočo ženo, v posteljo.    Ko sta končala, mu bodoča žena reče: \"Sedaj pa vem, zakaj se tvoje podjetje imenuje Microsoft.\"", CategoryId = 43 },
                new Joke() { Id = 415, Active = true, Title = "Samo prepričati se moraš", Description = "Ženo je močno bolel zob.    Odšla je k zobozdravniku, ta ji je izdrl zob in naslednji dan se je prebudila brez bolečin.    Po zajtrku je še mož začel stokati, da ga boli zob. Žena ga je napotila k zobozdravniku, ki ga je pregledal, mu slikal zobe in mu povedal, da ne najde vzroka bolečine.    Menil je, da gre za psihološko bolečino in mu svetoval naj se usede v čakalnico in pol ure ponavlja: \"Mene ne boli zob! Mene ne boli zob!\"    Po polurnem ponavljanju navedenih besed zobobola res ni več čutil. Mož se je odpravil domov in takoj po prihodu ženo nagovoril k posteljnim užitkom.     Po seksu se je odpravil v kopalnico, se vrnil čez pol ure in zopet seksal. Po seksu zopet v kopalnico in čez pol ure ponovno seks. Po tretjem seksu se je zopet odpravil v kopalnico, žena pa se je čudila, od kod mu moč, da je v tako kratkem času kar trikrat seksal, saj mu doslej to še ni nikoli uspelo.    Pokukala je v kopalnico in ga zaslišala, kako ponavlja besede: \"To ni moja žena! To ni moja žena!\"", CategoryId = 27 },
                new Joke() { Id = 416, Active = true, Title = "Ziher je ziher", Description = "Sta šla zakonca v sveto deželo Jeruzalem, kjer je žena nenadoma umrla.    Mimo je prišel katoliški duhovnik, ki je možu ponudil dve možnosti:  1. Ženo lahko pokopljete tukaj, v sveti zemlji za 200 EUR.  2. Lahko jo odpeljete domov, kar bi s prevozom in vsemi papirji stalo 3.000 EUR.    Možakar takoj: \"Kar spakirajte mi babo za domov, jaz vam bom pa plačal.\"    Duhovnik: \"Čudi me gospod, da ste se odločili za to varianto. Ali ne bi bilo lepše in ceneje, če bi bila pokopana v sveti zemlji ???\"    Možakar: \"Enkrat davno, vi to veste, je en človek umrl in je bil pokopan prav tu. Po treh dneh je vstal od mrtvih. Zeher je ziher!\"", CategoryId = 11 },
