                new Joke() { Id = 418, Active = true, Title = "Janez lovi ribe", Description = "Janez se odpravi lovit ribe in že čez uro se mu nasmehne sreča - ujame tolstega krapa. Teče domov in zavpije:    \"Marta, hočem ocvrtega za kosilo!\"    \"S čim pa?\" posmrkne Marta. \"Nimava ne za drobtine in ne za jajca.\"    \"Pa ga kar tako vrzi na olje.\"    \"Zadnje olje od Rdečega križa sva porabila predvčerajšnjim, saj veš ...\"    \"Pa naj bo kuhan!\"    \"Aja? Ta čas, ko si lovil, so bili tukaj od Elektra. Tri mesece že nisva plačala elektrike in so nama jo odklopili.\"    \"Potem pa je najbolje, da ga odnesem nazaj,\" ves razočaran reče Janez.    \"Bolje, bolje,\" zašepeta Marta.    Rečeno - storjeno. Janez izpusti krapa nazaj v vodo, ta veselo odplava, se na sredi reke obrne in zavpije:    \"Naj živi vlada Slovenije!!!!\"", CategoryId = 11 },
                new Joke() { Id = 419, Active = true, Title = "Blondinka in policaj", Description = "Se sprehaja blondinka po cesti, pa se ustavi pri obcestni luči.  Na drogu je obešen letak na katerem piše ODDAJAMO STANOVANJE.    Blondinka potrka na drog. Čaka, čaka pa nič.    Mimo pride policaj pa vpraša blondinko:\"Ja kaj pa počnete?\"    Blondinka: \"Tukaj piše, da oddajajo stanovanje. Trkam, pa se noben ne oglasi.\"    Policaj pogleda navzgor pa pravi: \"Ja, to je pa res čudno. Zgleda da so doma, saj imajo prižgano luč.\"", CategoryId = 4 },
