                new Joke() { Id = 421, Active = true, Title = "Punco nagovori manijak", Description = "Fant se sprehaja s punco po parku.    Nenadoma ji reče: \"Stopiva sem za grm, da ti nekaj pokažem.\"    Fant si odpne zadrgo in ji da roko v hlače in na tisto stvar. Dekle se ustraši! Obrne se in steče skozi grmovje.    Veje jo tolčejo po objokanih licih, oblekica se ji zatika v veje in se trga, visoke petke na čevljih se polomijo, toda ona teče dalje, ne ozirajoč se. Skozi glavo ji letijo misli: \"Ah... pa so me starši lepo opozarjali naj se pazim manijakov, le da jih jaz nisem poslušala. Samo da pridem domov...\"    Medtem priteče do stanovanjskega bloka,  vzame ključ in naenkrat začuti roko na ramenu.    Z grozo se obrne, ko zasliši zadihan glas, ki ji pravi: \"Prosim te, sam spust ga...\"", CategoryId = 43 },
                new Joke() { Id = 422, Active = true, Title = "Mož zbada ženo", Description = "Nekega jutra mož ženo, ki pripravlja zajtrk, uščipne v zadnjico in pravi: “Veš, če bi ti malo utrdila tole, bi se lahko znebila teh grdih spodnjic.”    Žena stisne zobe in ne reče ničesar.    Naslednje jutro jo mož zbudi s ščipanjem v prsi in pokomentira: “Veš, če bi si malo utrdila tele, bi se lahko znebila modrca.”    Tokrat žena ne more več biti tiho, zagrabi ga med noge in jezno zabrusi: “Veš, če bi ti utrdil tole, bi se lahko znebila poštarja, vrtnarja in tvojega brata.”", CategoryId = 11 },
