                new Joke() { Id = 448, Active = true, Title = "Pri frizerju", Description = "Moški pomoli glavo v frizerski salon: \"Koliko časa bi moral čakati na striženje?\"    Frizer se ozre po čakajočih v lokalu: \"Dobri dve uri.\"    Moški zapre vrata in ga tisti dan ni bili več nazaj.     Čez nekaj dni se zopet pojavi in kar na vratih vpraša: \"Čez koliko časa bom prišel na vrsto?\"    Brivec zopet pogleda po polnem lokalu in pravi: \"Ne prej kot čez tri ure.\"    Moški odide.    Čez teden dni pride spet: \"Kdaj bi lahko prišel na vrsto?\"    Frizer mu odgovori: \"Čez pol ure.\"    Možakar odide, brivec pa pravi svojemu vajencu: \"Joško, steci za njim in poglej, kam ta tip gre, ko zapre vrata lokala!\"    Vajenec se hitro vrne in komaj zadržuje smeh.    \"No, hudiča, ali si ugotovil, kam gre ta tip od tu!\"    \"K vam domov, šef!\"", CategoryId = 43 },
                new Joke() { Id = 449, Active = true, Title = "Nagovoril sem lepotico", Description = "Grem po mestu in srečam postavno dolgolasko.    Vprašala sem jo, če bi spala z mano za 200EUR.    Ogorčena je rekla ne in odvihrala.    Bil sem žalosten, nujno sem rabil denar.", CategoryId = 27 },
                new Joke() { Id = 450, Active = true, Title = "Samo tri dni življenja še ima", Description = "Kolega je razlagal lepotici, da ima samo še tri dni življenja.    Vprašal jo je, če bi spala z njim.    In glej, zlomka, od takrat so pretekla že tri leta pa je še vedno živ.    Zgleda, da ga je ozdravila!", CategoryId = 27 },
                new Joke() { Id = 451, Active = true, Title = "Neznanec na vratih", Description = "Ženska svoji prijateljici: Sedim v stanovanju... sama. Nekdo pozvoni na vrata.    Odprem in pred vrati stoji simpatičen mladec.    Vpraša me: \"Je vaš mož doma?\"    Odgovorim mu, da ga ni doma.    Mladenič vstopi, se sleče, me vrže na posteljo, me pošteno kresne, se obleče in odide.    Še do dandanes mi ni jasno zakaj je potreboval mojega moža?!", CategoryId = 27 },
                new Joke() { Id = 452, Active = true, Title = "Zdravniški pregled", Description = "Pri pregledu ženske pacientke, doktor pravi: \"Vaše srce, pljuča, utrip srca in pritisk so v redu. No, sedaj pa še poglejmo tisto fletno majhno stvar, ki vas ženske spravi v vse vrste problemov.\"    Ženska se nemudoma začne slačiti.    Doktor to prepreči rekoč: \"NE! NE! Kar oblecite se nazaj. Samo pokažite mi jezik.\"", CategoryId = 39 },
                new Joke() { Id = 453, Active = true, Title = "Kako se je izkazal", Description = "Mož: \"In ljubica, kakšen ljubimec sem bil tokrat? Trajalo je več kot eno uro!\"    Žena: \"Da, dragi. Pozabil si le, da smo danes premaknili uro nazaj.\"", CategoryId = 27 },
                new Joke() { Id = 454, Active = true, Title = "Rešite se iz puščave", Description = "Kaj moraš vzeti s sabo v puščavo?    Jabolko in vato.    Zakaj?    V puščavi te prične loviti lev. Vržeš jabolko v zrak in ker jabolko ne pade daleč od drevesa, splezaš na drevo. Ko si na drevesu, začneš drobiti vato na tla. Lev misli, da sneži, zato zmrzne. Ko vidiš, da je lev zamrznjen, se ti odvali kamen od srca in pade levu na glavo, da se mu pokažejo vse zvezde.    Nato poiščeš severnico in greš domov.", CategoryId = 43 },
                new Joke() { Id = 455, Active = true, Title = "Težko vprašanje", Description = "Eden tistih profesorjev matematike, ki radi izjavljajo: Le Bog zna za 5, jaz znam za 4, vi pa v najboljšem primeru lahko dobite 3.... se je odločil presenetiti svoje učence z nalogo, ki gre takole:    Predstavljajte si, da ste skupaj s še 25 timi potniki v avtobusu, ki vozi s hitrostjo 60 km/h v smeri jugozahoda, temperatura je +20 stopinj C, ob cesti teče potok v katerem je voda s temperaturo +14 stopinj C, šoferju manjkata dva sprednja zoba. Sobota je...  Koliko let imam?    V razredu zavlada tišina. Profesor se zmagoslavno reži.  Janezek dvigne dva prsta, profesor pa cinično: No, Janezek?    \"Stari ste 44 let!\"    Učitelj presenečeno: \"Bravo! Kako si pa prišel do tega?\"    Janezek: \"Enostavno: Pri nas imamo soseda Mihca, ki mu je 22 let, in zanj trdijo, da je na pol idiot.\"", CategoryId = 15 },
                new Joke() { Id = 456, Active = true, Title = "Mraz v Sibiriji", Description = "Gleda Rus v Moskvi poročila na TV, kjer poročajo, da je v Sibiriji - 55°C.    Seveda ne verjame in pokliče po telefonu sorodnika: \"Daj povej koliko je stopinj pri vas?\"  \"Čaki, da pogledam. . . - 35°C, zakaj vprašaš?\"    Rus: \"Pa teleta na TV nakladajo - 55°C!\"    \"A, to pa lahko - zunaj.\"", CategoryId = 43 },
                new Joke() { Id = 457, Active = true, Title = "Padel mu je cuker", Description = "Janezek: \"Mami mami, cukr mi je padu.\"    Mami: \"Pejd, pa pojej čokolado.\"    Janezek: \"Mami noooo, cukr.\"    Mami: \"Ja, pa pojej to čokolado !!!!\"     Po eni uri pride mami v kuhinjo in se dere: \"Madonca, kdo je stresu ceu cukr po tleh ??\"    Janezek: \"Ja pa sej sem ti reku, da mi je cukr padu, pa si rekla, da naj pojem čokolado.\"", CategoryId = 15 },
                new Joke() { Id = 458, Active = true, Title = "Nesreča v gozdu", Description = "Mica: \"Kok pa s' dobiva, ksta naša dva v hosti podirava smreke in je Tvoj France škripnu pod smreko.\"    Jožefa: \"Dva miljona.\"    Mica: \"Bog se me usmil! Moj bk Ivan je pa odskoču!\"", CategoryId = 11 },
                new Joke() { Id = 459, Active = true, Title = "Dobra pridiga", Description = "Po maši k župniku prihajajo farani, mu podajo roko in se mu lepo zahvalijo.    Pristopi tudi lepo oblečen moški in reče: \"Gospod župnik - za popizdit dobro pridigo ste imeli!\"    \"Me veseli, da vam je bila všeč, vendar bi vas prosil, da takih besed ne uporabljate, ker se to v cerkvi ne spodobi.\"    \"Kakorkoli že,\" nadaljuje možakar, \"vaša pridiga mi je bila tako všeč, da sem vam fuknil 100 evrov v puščico.\"    \"Ne me jebat?!\" odvrne župnik.", CategoryId = 42 },
                new Joke() { Id = 460, Active = true, Title = "Preroške besede", Description = "Pri Novakovih se rodi otrok.    Njegova prva beseda je: \"Babica\". Naslednji dan ta umre.    Njegova druga beseda je: \"Dedek\". Ta naslednji dan umre.    Otrokova tretja beseda je: \"Ati\". Ta celo noč ni mogel spati saj je mislil, da bo tudi on umrl.    Zjutraj se zbudi in spozna, da se mu to ni zgodilo. Ves vesel priteče ven in začne kričati: \"Nisem mrtev, nisem mrtev...!\" Žena priteče k njemu ter mu reče: \"TIHO BODI, SOSED JE UMRL!\"", CategoryId = 9 },
                new Joke() { Id = 461, Active = true, Title = "Kaj bo za večerjo", Description = "Janez se zvečer vrne domov iz druge “smene”, se sesede na stol v kuhinji in vpraša: \"Kaj bo za večerjo?\"    Žena se postavi v zapeljivo pozo in pravi: \"Mogoče jaz?\"    Janez: \"Saj veš, da ne smem nič mastnega.\"", CategoryId = 11 },
                new Joke() { Id = 462, Active = true, Title = "Sešteva na prste", Description = "Janezek je v šoli še vedno sešteval na prste. Učiteljica zahteva zdaj od njega, da s tem preneha in računa na pamet. In ga preveri.    \"No Janezek. Koliko je 2 plus 2?\"    Janezek takoj začne šteti prste: \"Štiri!\"    \"Janezek, rekla sva brez prstov. Roke za hrbet in poskusi znova. Koliko je 4 plus 4?\"    Janezek da roke za hrbet, a še vedno šteje s prsti:\"Osem!\"    \"Spet si štel s prsti. Tokrat roke v žepe. Koliko je 5 plus 5?\"    Janezek malce okleva:\"Enajst!\"", CategoryId = 15 },
                new Joke() { Id = 463, Active = true, Title = "Ženska roka", Description = "Janez si v nesreči odreže desno roko. Na urgenci mu rečejo, da njegova ne bo več uporabna, lahko mu pa prišijejo eno žensko roko.    \"Lahko\" se hitro odloči Janez. Bolje ženska, kot brez. Čez kak mesec pride na pregled in ga vpraša doktor, kako mu kaj služi.    \"Kar v redu! Samo po tem ko lulam, jo moram ugriszniti, da spusti...\"", CategoryId = 43 },
                new Joke() { Id = 464, Active = true, Title = "Kdo ima manjšega očeta", Description = "Trije fantje se pogovarjajo o svojih očetih.    Prvi reče: \"Moj oče je tako majhen, da lahko stoji pod mizo.\"    Drugi reče: \"Moj oči lahko stoji pod stolom.\"    Tretji začne jokati.    Druga dva ga vprašata, zakaj joče.    Tretji nato reče: \"Moj oče se je pa hudo poškodoval, ko je borovnice nabiral. Je dol z lestve padel.\"", CategoryId = 43 },
                new Joke() { Id = 465, Active = true, Title = "Katera bo izbranka", Description = "Mladenič navdušeno pove mami, da se bo kmalu poročil.    Reče ji: \"Za test bom domov pripeljal tri dekleta, ti pa poskusi uganiti, katere je moja izbranka!\"    Mama se strinja s predlogom in naslednji dan sin pripelje domov tri lepotice ter jih posadi na kavč.    Nekaj časa sproščeno kramljajo. Nato se sin obrne k mami in jo vpraša: !No, mami, s katero se bom poročil?\"    Ona izstreli: \"Rdečelaska na sredini.\"    Osupel, sin vpraša: \"To je neverjetno, kako si vedela??\"    Mama: \"Na živce mi gre kot hudič.\"", CategoryId = 11 },
