                new Joke() { Id = 467, Active = true, Title = "Izdelava rokavic", Description = "Zobozdravnik je opazil, da je njegov naslednji pacient, stara gospa, zelo živčna. Zato se je odločil, da ji bo povedal en vic , medtem ko je natikal rokavice.    \"Ali veste kako delajo latex rokavice?\" je vprašal.    \"Ne, ne vem.\" je odgovorila stara gospa.    \"Torej, na Kitajskem imajo tovarno, z velikim bazenom lateksa in delavci z različno velikimi rokami potopijo svoje roke v latex, počakajo da se posuši, jih zrolajo z rok in jih vržejo v škatlo.\"    Gospa se ni niti nasmehnila.    \"No, vsaj poskusil sem jo razvedriti\" si je rekel zobozdravnik.    Toda 5 minut kasneje, ravno sredi vrtanja, je gospa prasnila v neobvladljiv smeh.    \"Kaj je tako smešno?\" je vprašal zobozdravnik.    \"Ravno si hočem predstavljati, kako delajo kondome!\"", CategoryId = 39 },
                new Joke() { Id = 468, Active = true, Title = "Pijača je kriva", Description = "Bolnik pride k zdravniku. Ta ga preiskuje do onemoglosti, na koncu pa reče: \"Ne morem in ne morem odkriti kaj vam je! Ampak mislim, da je kriva pijača.\"    Pacient odgovori: \"Nič hudega, bom pa prišel, ko boste trezni.\"", CategoryId = 21 },
