                new Joke() { Id = 475, Active = true, Title = "Bog ne pozabi", Description = "Moža ni bilo doma in žena si je med tem privoščila ljubimca. Naenkrat zaškrta ključavnica, sliši se odklepanje.     Žena hitro skrije ljubimca v omaro, sklene roke k nebu in prosi: \"O Bog, naredi z menoj kar hočeš, samo ne dovoli, da naju najde moj mož. Grozno je ljubosumen in gotovo bi ubil ne samo mene, ampak tudi ljubimca.\"    Nebesa se odprejo in zasliši se zamolkel glas: \"Dobro, naj bo kot želiš, toda čez tri leta te pokličem k sebi…utopila se boš.\"     Žena: \"Dobro, dobro…samo da naju ne zaloti!\"    Kočljiva situacija se je razrešila popolnoma gladko.    Tri leta se nato žena ni kopala v banji, ni hodila v kopališča, toplice…vodam se je na daleč izogibala.    Tri leta so minila, minilo je četrto, peto. Na zaobljubo je žena pozabila. Po petih letih si je kupila vozovnico za križarjenje po morju okoli sveta.    Na ladji so bile same ženske, odlično so se zabavale. Kar naenkrat se začne ladja potapljati. Žena se je spomnila na božje besede: \"Torej nisi pozabil in me boš vzel k sebi!? Poglej malo naokrog koliko nedolžnih žensk bo umrlo skupaj z menoj!\"    Odprejo se nebesa in zasliši se strogi glas: \"Dve leti! Dve leti sem se mučil, da sem vas, prasice, spravil na eno ladjo!\"", CategoryId = 43 },
                new Joke() { Id = 476, Active = true, Title = "Stol za ženo", Description = "\"Oj stari, kaj pa delaš?\"    \"Stol za ženo.\"    \"Ajaaa! Pa gre?\"    \"Ooo ja gre gre, sam elektrika me še mal zajebava.\"", CategoryId = 11 },
