                new Joke() { Id = 485, Active = true, Title = "Oglas", Description = "Prodam rezervne dela za Audi A6, limuzina, črn, metalne barve, letnik 2012.     Dele si lahko ogledate v Ljubljani, od Celovške ceste 150 do 190.", CategoryId = 2 },
                new Joke() { Id = 486, Active = true, Title = "Ločevalna dieta", Description = "\"Ti si pa ful shujšal!\"    \"Ja, sem na ločevalni dieti.\"    \"Kako pa to zgleda?\"    \"Ločujem se, kuhat pa ne znam.\"", CategoryId = 11 },
                new Joke() { Id = 487, Active = true, Title = "Dieta", Description = "Pepca zavistno prijateljici Štefki: \"Ohoho, kako si lepo shujšala. Kakšna nova dieta?\"    Štefka: \"Kje pa? Le krompir, korenje in fižol.\"    \"A res? Pa si vse to kuhala ali pekla?\"    \"Okopavala.\"", CategoryId = 40 },
                new Joke() { Id = 488, Active = true, Title = "Klic v sili", Description = "\"Poklicali ste 113, Klic v sili, prosim.\"    \"Dve punci se tepeta zame!\"    \"Dobro...\" po krajšem premoru \"...in kje je tu problem?\"    \"Ta grda zmaguje!\"", CategoryId = 43 },
                new Joke() { Id = 489, Active = true, Title = "Sveti duh", Description = "Janez gre k spovedi. Župnik ga pričaka in mu reče, da lahko svoje kolo parkira pred cerkvijo in sveti duh ga bo čuval.  Možakar parkira kolo in gre v spovednico.    Tam mu župnik naroči, naj ponavlja za njim: \"V imenu očeta in sina in svetega duha, amen.\"    Janez ponovi: \"V imenu očeta in sina, amen.\"    Župnik: \"Kje pa imaš svetega duha?    Janez: \"Ja pred cerkvijo pazi na moje kolo.\"", CategoryId = 5 },
                new Joke() { Id = 490, Active = true, Title = "Planiranje dopusta", Description = "Se pogovarjata dva prijatelja, pa pravi prvi: \"Janez, si že naredil kakšen načrt za dopust?\"    Janez: \"Ne, čemu bi ga? Moja žena določi, kam bomo šli, moj šef določi, kdaj bomo šli, in moja banka določi, kako dolgo bomo na dopustu!\"", CategoryId = 11 },
                new Joke() { Id = 491, Active = true, Title = "Burek za na pot", Description = "Kupi Mujo burek za na pot. Komaj se malo oddalji od lokala se takoj vrne!    Mujo strogo: \"Je li, bolan, gdje ti držiš meso?\"     Mojster ga začudeno pogleda, in odgovori: \"U frižideru, gdje bi drugo ...\"    Mujo nejevoljno: \"Pa stavi malo i u burek, matere ti...\"", CategoryId = 18 },
                new Joke() { Id = 492, Active = true, Title = "Hoja po vodi", Description = "21. rojstni dan, Tine  iz Bohinja je slišal zgodbice o neverjetni družinski tradiciji.    Pravili so, da so njegov oče, dedek in pradedek na svoj 21. rojstni dan imeli  možnost hoditi po vodi čez Bohinjsko jezero, do oštarije, kjer so  si privoščili svojo prvo alkoholno pijačo.    Tako  je Tine na svoj 21. rojstni dan, skupaj s prijateljem Martinom, odveslal na sredo jezera. Tine je stopil iz čolna in se skoraj utopil. A Martin ga je uspel rešiti iz vode.    Besen in zmeden se je Tine odpravil do svoje babice.     \"Babica\", jo je vprasal, \"danes je moj 21. rojstni  dan. Zakaj torej ne morem hoditi po vodi, tako kot so lahko moj oče, dedek in pradedek?\"    Babica se je zazrla v Tinetove oči in odgovorila: \"Ker so se tvoj oče, dedek in pradedek rodili januarja. Ti pa si se rodil avgusta.\"", CategoryId = 11 },
                new Joke() { Id = 493, Active = true, Title = "Enostavna matematika", Description = "Koliko denarja imaš ti, in koliko ga ima žena, če imaš ti v žepu 25EUR in ona 5€?    Ti nimaš nič, ona ima pa 30EUR.", CategoryId = 11 },
                new Joke() { Id = 494, Active = true, Title = "Pozabila je povedati", Description = "Mlad moški z žensko v avtu ustavi vozilo na neki gozdni cesti, daleč ven iz mesta.    Preden začneta seksati, dekle reče: \"Pozabila sem ti povedati ... Sem prostitutka in računam 20 EUR.\"    Moški ji, obotavljaje, izroči denar, nakar opravita svoje.    Moški skadi cigaret in očitno se mu nikamor ne mudi.    \"Zakaj se ne odpeljeva?\" ga vpraša punca.    \"Pozabil sem ti povedati, a jaz sem taksist. Vožnja nazaj do mesta stane 25 EUR.\"", CategoryId = 27 },
                new Joke() { Id = 495, Active = true, Title = "Prisotnost pri pouku", Description = "Prvi dan šole nekje v Ljubljani, Slovenija, leta 2020.    Učitelj preverja prisotnost učencev:  \"Mustafa al Eih Zeri?\" - \"Ovdje.\"  \"Achmed El Kabul?\" - \" Ovdje.\"  \"Fatima Bin Pardin? \" - \" Ovdje.\"  \"Ali Abdul Olmi?\" - \" Ovdje.\"  \"Mohammed Bin Kadir?\" - \" Ovdje.\"  \"Al Jabla Zic?\" - Tišina v razredu.    \"Al Jabla Zic?\" - Tišina se nadaljuje,vsi gledajo okoli sebe po razredu.    Učitelj ponovi vprašanje:\"Al Jabla Zic?\"    Deklica v drugi vrsti se javi: \"Oprostite, učitelj, mislim da sem to jaz, ampak prebere se Alja Blažič\"", CategoryId = 28 },
                new Joke() { Id = 496, Active = true, Title = "ustrelila je moža", Description = "Sodnik vpraša obtoženko:  \"Torej ne zanikate, da ste med prenosom nogometne tekme ustrelili svojega moža?\"    Obtoženka: \"Ne, priznam, da sem to storila.\"    Sodnik: \"In katere so bile moževe zadnje besede?\"    Obtoženka:\"Streljaj! Streljaj!\"", CategoryId = 11 },
                new Joke() { Id = 497, Active = true, Title = "Invalid jo je udaril", Description = "Sodnik obtoženki: \"In vi pravite, da vas je tale gospod udaril? Saj je invalid, skorajda nepokreten!\"      Obtoženka: \"Ko me je udaril, še ni bil invalid!\"", CategoryId = 43 },
                new Joke() { Id = 498, Active = true, Title = "Grde besede", Description = "\"Obdolženi, tožniku ste rekli idiot. Ali bi radi kaj dodali?\"    \"Še veliko, pa bi me stalo preveč denarja.\"", CategoryId = 43 },
                new Joke() { Id = 499, Active = true, Title = "Prijeli so ga", Description = "Paznik je naročil zapornikom: \"Jetniške celice morajo biti čiste, kot nove! Prišel bo pravosodni minister!\"    \"Končno so prijeli to barabo!\" se je oglasil eden od zapornikov.", CategoryId = 43 },
                new Joke() { Id = 500, Active = true, Title = "zelo kratek vic", Description = ".", CategoryId = 1 },
                new Joke() { Id = 501, Active = true, Title = "Super duper sesalec", Description = "V novo naselje pride trgovski potnik, ki prodaja specialne sesalnike. Pozvoni pri prvi hiši in vrata mu odpre mlada, čedna ženska. - Dober dan, gospa. Prodajam najnovejše modele sesalnikov za mokro in suho sesanje. Povem vam, čudežni stroji, verjemite. Ženska sploh ni prišla do besede, ko je možak v predsobi že potresel kečap, polil sok, iz vrečke stresel pasji kakec, na vse skupaj zlil jogurt, potem pa vse potresel s kilogramom moke. Ženska se je zgrozila. Trgovski potnik pa jo je pomiril: - Gospa moja, ne razburjajte se. Če sesalnik ne bo te svinjarije popolnoma očistil, jo bom pojedel. - Ali naj vam prinesem žlico? - Zakaj? - Naselje še gradijo in še vedno nam niso priključili elektrike.", CategoryId = 31 },
                new Joke() { Id = 502, Active = true, Title = "JJ in teroristi", Description = "Na avtocesti je zastoj - vrsta dolga par kilometrov. Nihče ne ve, kaj se je pravzaprav zgodilo in nervozen voznik končno le zagleda nekoga, ki se mu približuje s kanto za bencin.   -Ja, kaj se je pa zgodilo?   -Skupina teroristov je ugrabila Janšo in zdaj zahtevajo odkupnino 10 milijonov evrov. Če ne bomo zbrali, ga bodo polili z bencinom in zažgali..   - In koliko ste uspeli zbrati doslej?   - 10 evrov, 500 litrov bencina in 30 vžigalnikov...!!!", CategoryId = 23 },
                new Joke() { Id = 503, Active = true, Title = "Cigo fajter", Description = "Zakaj se vsi bojijo malega cigota iz 1a razreda???    Zato ker ima fotra v 8b !!!", CategoryId = 7 },
                new Joke() { Id = 504, Active = true, Title = "Varen šport", Description = "Janezek: “Kateri šport je najbolj varen?”  Ata: “Šah.”  Janezek: “In kaj je najhujša poškodba pri šahu?”  Ata: “Izpah čeljusti zaradi zehanja.”", CategoryId = 15 },
                new Joke() { Id = 505, Active = true, Title = "Babica in dedek", Description = "Babica je imela tri odrasle vnuke, za katere je domnevala, da je nimajo preveč radi. Da bi ugotovila, kako radi jo imajo, jih je preizkusila.  Prvi dan je povabila prvega vnuka na sprehod ob reki. Naredila se je, kot da ji je spodrsnilo in “padla” v reko, nato pa zavpila na pomoč. Vnuk je skočil v reko in jo rešil. Naslednji dan je vnuka pred hišo čakal nov Mercedes, za brisalci pa je bil zataknjen listek z napisom: “Hvala, ker si me rešil! Tvoja babica.”  Drugi dan je na sprehod povabila drugega vnuka. Prav tako se je naredila, da ji je spodrsnilo in skočila v reko, nato pa poklicala na pomoč. Vnuk je skočil v reko in jo rešil. Naslednje jutro je drugega vnuka pred hišo čakal Mercedes z lističem za brisalci: “Hvala, ker si me rešil! Tvoja babica”.  Naslednji dan je preizkusila še tretjega vnuka. Povabila ga je na sprehod ob reki in se zopet naredila, da ji je spodrsnilo. Skočila je v reko in poklicala na pomoč, toda tretji vnuk se ni niti ozrl, temveč je nadaljeval svojo pot. Naslednje jutro ga je pred hišo čakal nov Ferrari, v njem je bil kovček z desetimi milijoni dolarjev, za brisalci pa je bil zataknjen listek z napisom: “Hvala, ker si me rešil! Tvoj dedek!”", CategoryId = 11 },
                new Joke() { Id = 506, Active = true, Title = "Zajček", Description = "Zajček se zadane in gre plavat v jezero. Mimo prideta medved in lisica, in rečeta zajčku, naj gre ven iz jezera, da se ne bo utopil. Zajček pa jima nazaj zabrusi: \"Izginite ve kopenske živali!\"", CategoryId = 41 },
                new Joke() { Id = 507, Active = true, Title = "Ločitev", Description = "\"Zakaj sta se razšla z Bogdanom?\"   \"Ali bi hotela hoditi z nekom, ki ima spolne odnose še s petimi drugimi?\"   \"To pa ne!\"   \"No, vidiš, Bogdan tudi ne!\"", CategoryId = 40 },
                new Joke() { Id = 508, Active = true, Title = "Mešanje dreka", Description = "Janezek sedi ob cesti in meša drek. Mimo pride župan in pravi:   \"Kaj pa delaš Janezek?\"   Janezek reče:   \"Župana\".   Seveda ga župan premlati.   Ista zgodba se ponovi z župnikom. Omenjena gospoda se nato posvetujeta s policajem, ki gre osebno v akcijo in zaloti Janezka, ko ob cesti še vedno meša drek. Pa ga policaj vpraša:   \"Kaj je Janezek? A policaja delaš?\"   Janezek:\"Ne, premau dreka!\"", CategoryId = 15 },
                new Joke() { Id = 509, Active = true, Title = "Pogreb", Description = "\"Zakaj si tako žalosten? Kaj se je zgodilo?\" vpraša Lojze prijatelja Marka.   \"Oh, moja tašča je umrla!\"   \"Moje iskreno sožalje,\" reče Lojze.   \"Hvala. Veš, mene je govor župnika tako pretresel. Rekel je, da bomo v nebesih spet skupaj.\" ", CategoryId = 34 },
                new Joke() { Id = 510, Active = true, Title = "Neaktraktivna ženska", Description = "Zelo neaktraktivna ženska, grobih obraznih gub, povrhu pa še neprijazna, pride v nakupovalni center z svojima sinovoma, na katera neprestano šraja in ju komandira.     Portir na vratih jo pozdravi: \"Dobro jutro gospa, imate čudovita otroka.   Ali sta dvojčka?\"     Takrat ženska neha šrajat na otroka, dvigne nos in odgovori.   \"Seveda nista, starejši ima 9 in mlajši 7 let.   Zakaj misliš da sta dvojčka? Ali sta videti ista, bedak?\"     \"Ne nikakor.\" odgovori portir.   \"Samo ne morem verjeti, da Vas je nekdo nategnil dvakrat.\" ", CategoryId = 40 },
                new Joke() { Id = 511, Active = true, Title = "Mrav i Fata", Description = "Haso: \"Mujo, znaš li da mrav može nositi teret, 20 puta veći od njegove težine?\"    Mujo: \"A Fata mi se pravila važna, kad je sama nosila veš mašinu na treći sprat!\"", CategoryId = 18 },
                new Joke() { Id = 512, Active = true, Title = "Ukrepi", Description = "Kdo si ves čas izmišljuje vse te nove gospodarske in politične ukrepe? Politiki ali znanstveniki?  “Verjetno politiki, saj, če bi si jih izmišljevali znanstveniki, bi jih prej preizkusili na podganah.”", CategoryId = 23 },
                new Joke() { Id = 513, Active = true, Title = "101 Evrov", Description = "Mujo je potreboval denar, zato je svojo Fato poslal na delo v javno hišo, da zasluži nekaj denarja.  Fata se zvečer vrne in prinese 101 evro.  “Svaka ti čast!” je bil navdušen Mujo in nadaljeval: “A zakaj tisti 1 evro?”  Fata: “Eh moj Mujo. Evro na evro!”101 E", CategoryId = 18 },
                new Joke() { Id = 514, Active = true, Title = "Trije netopirji", Description = "Na veji visijo trije netopirji in se hvalijo češ, kako oni pijejo kri.    Odličili so se, da bodo tekmovali v pitju krvi.    Odleti prvi in se vrne nazaj krvav okoli ust in reče: \"Vidita tisti travnik, na katerem so bile ovce?\"    \"Vidima.\" odgovorita druga dva.    Prvi: \"Vse je mrtvo! Vsem ovcam sem popil kri.\"    Odleti drugi in se vrne čez čas še bolj krvav, kot prvi: \"Vidita tisto vasico?\"    Druga dva: \"Vidima.\"    Drugi: \"Vse je mrtvo, vsem ljudem sem popil kri!\"    Odleti tretji in se dokaj hitro vrne, najbolj krvav in vpraša: \"Vidita tisti hrib tamle?\"    Druga dva: \"Vidima!\"    Tretji: \"Pa vidita tisto drevo na hribu?\"    Druga dva: \"Vidima.\"    Tretji: \"No, jaz ga pa nisem videl.\"", CategoryId = 41 },
                new Joke() { Id = 515, Active = true, Title = "Nima prsi", Description = "Poglej tole Tino! Saj sploh nima prsi!    \"Ne bodi tak! Veš, ona ima zelo stroge starše in ji ne dovolijo, da bi jih nosila naokoli.\"", CategoryId = 43 },
                new Joke() { Id = 516, Active = true, Title = "Alternativno ogrevanje", Description = "Primož svojemu sostanovalcu Mateju: \"Matej, ali si kaj videl knjigo o alternativnem ogrevanju?\"    Primož: \"Ja, vrgel sem jo v peč!\"", CategoryId = 43 },
                new Joke() { Id = 517, Active = true, Title = "Paln dela", Description = "\"Franci, kaj boš pa danes delal?\"    \"Nič!\"    \"No, potem ti pa lahko pomagam!\"", CategoryId = 43 },
                new Joke() { Id = 518, Active = true, Title = "Zapuščina", Description = "\"Slišal sem, da se z bratom tožarita za hišo, ki jo je zapustil dedek?\"    \"To je že zdavnaj mimo!\"    \"In kdo jo je dobil?\"    \"Odvetnik!\"", CategoryId = 11 },
                new Joke() { Id = 519, Active = true, Title = "Iste misli", Description = "\"Ali veš, da v našem mestu dva človeka nista istih misli?\"    \"Kako da ne? Kar k meni domov pridi, pa ti bom pokazala poročna darila!\"", CategoryId = 43 },
                new Joke() { Id = 520, Active = true, Title = "Lažnivec", Description = "\"Lojze mi je rekel, da je suh kot poper pa sem mu posodil deset tisočakov!\"    \"Lažnivec! Meni je pa rekel da mu voda teče v grlo, pa sem mu tudi posodil deset tisočakov!\"", CategoryId = 43 },
                new Joke() { Id = 521, Active = true, Title = "Študij", Description = "Soseda, kaj pa študira vaša hči?    \"Filozofijo.\"    \"Dober študij je izbrala. Zofe bodo šle vedno v promet!\"", CategoryId = 43 },
                new Joke() { Id = 522, Active = true, Title = "Ni je videl", Description = "Si že videl ženo od mojega slepega soseda?    \"Ne, še nikoli je nisem videl.\"    \"Nič hudega, saj je njen mož tudi še nikoli ni videl.\"", CategoryId = 43 },
                new Joke() { Id = 523, Active = true, Title = "Samostojni podjetnik", Description = "\"Gospod, ste vi samostojni podjetnik?\"    \"Ne, še vedno sem poročen!\"", CategoryId = 43 },
                new Joke() { Id = 524, Active = true, Title = "Idealni moški", Description = "\"Poročila se bom le, če najdem popolnega moškega mojih sanj.\"    \"Kakšen pa bi moral biti po tvojem mnenju popoln moški?\"    \"Biti mora zabaven, govoriti bi smel le takrat, ko bi meni to odgovarjalo, zvečer ne bo smel hoditi ven...\"    \"Rešitev zate je, da se poročiš s  televizorjem!\"", CategoryId = 40 },
                new Joke() { Id = 525, Active = true, Title = "Pričakuje otroka", Description = "\"Vi imate pa prekrasne otroke, gospa Kovačeva,\" je rekla nova soseda.    \"Ja, štirje so, peti je pa na poti!\"    \"Kaj? In kdaj ga pričakujete?\"    \"Čez pet minut pride iz šole!\"", CategoryId = 43 },
                new Joke() { Id = 526, Active = true, Title = "Pozna pradedka", Description = "\"Včeraj sem govoril s sosedom. Natvezil mi je da pozna tvojega pra-pra-pra-pra-deda. Nisem mu verjel!\"    \"Oh, kaj ne veš, da sosed jeclja?\"", CategoryId = 43 },
                new Joke() { Id = 527, Active = true, Title = "Obuja spomine", Description = "Jaka na sprehodu sreča zamišljenega prijatelja Toneta.    Jaka: \"Zakaj si pa tako zamišljen?\" ga vpraša.    Tone: \"Obujam spomine.\"    Jaka: \"Si že prišel do tam, ko sem ti posodil dvesto € ?\"", CategoryId = 43 },
                new Joke() { Id = 528, Active = true, Title = "Pojdi se solit", Description = "\"Suzana, zakaj pa ti je moški, s katerim si se pogovarjala, rekel da se pojdi solit?\"    \"Da drugi ne bi razumeli, povabil me je na morje.\"", CategoryId = 43 },
                new Joke() { Id = 529, Active = true, Title = "Mlad pastir na planini", Description = "Na planino so sprejeli mladega pastirja.    Starejši pastirji mu vse razložijo: vstajanje ob rani uri, kako se dela sir, kje je najboljša paša, itd.    Mladi pastir: \"Že, že, ampak ... kako bi rekel ... kaj pa spolno življenje?\"    Eden od starejših pastirjev brez zadrege: \"Hja, žensk ni, kot vidiš. Ovce natepavamo!\"    Mine kak teden in stari pastirji gredo po poti, ko zalotijo mladega pastirja, kako za grmom obdeluje ovco.  Vsi se začnejo na glas smejat.    Mladi pastir, užaljeno: \"Kaj se smejete, saj ste rekli, da ovce natepavate?!?\"    Eden od starih pastirjev: \"Žem že, samo ne takih grdih!\"", CategoryId = 43 },
                new Joke() { Id = 530, Active = true, Title = "Žaba in štorklja", Description = "Žaba pogleda štorklji iz riti.    Presenečena nad višino vpraša: \"Aaaaaaaaa, kako visoko sva?\"    Štorklja: \"2700 metrov!\"    Žaba: \"Ne seri!!!\"", CategoryId = 41 },
                new Joke() { Id = 531, Active = true, Title = "Podpis", Description = "Chuck Norris se lahko podpiše na zvočni zid!", CategoryId = 6 },
                new Joke() { Id = 532, Active = true, Title = "Pravi osel", Description = "Dva se prepirata za šankom.    Prvi: \"Ti si res pravi osel, samo da ti še rogovi manjkajo!\"  Drugi: \"Saj osli nimajo rogov!\"  Prvi: \"No, potem ti pa sploh nič ne manjka!\"", CategoryId = 21 },
                new Joke() { Id = 533, Active = true, Title = "Dopust in dež", Description = "Sosed vpraša soseda: \"Zakaj pa letos ne boš šel z družino na morje?\"    \"Ker so me dolgoletne izkušnje izučile, da doma ceneje dežuje.\"", CategoryId = 11 },
                new Joke() { Id = 534, Active = true, Title = "Ljubezenske avanture", Description = "Prijatelja se sprehajata po mestu in si pripovedujeta ljubezenske avanture.  Prvi: \"Včeraj sem doživel nekaj neprijetnega. V kinu sem spoznal čudovito žensko in odšla sva k njej domov. Začela sva se igrati, ko se je nenadoma na vratih prikazal njen mož. V trenutku sem se izmazal in sem se izgovoril, da sem z gospodinjskega servisa. Potem pa sem moral celo popoldne likati perilo.\"    Drugi: \"Kje pa je to bilo?\"    Prvi: \"V tisti stolpnici, v sedmem nadstropju!\"    Drugi: \"O hudiča, tam sem jaz prejšnji teden celo popoldne brusil parket!\"", CategoryId = 43 },
                new Joke() { Id = 535, Active = true, Title = "Tek po ulici", Description = "Ali si ti sinoči tekel po naši ulici?    \"Ja, hotel sem preprečiti pretep.\"    \"Kdo se je pa tepel?\"    \"Jaz in neka Baraba.\"", CategoryId = 43 },
                new Joke() { Id = 536, Active = true, Title = "Kuhano vino", Description = "Kaj je, v mrzli zimi, boljše od kozarca kuhanega vina?    Dva kozarca kuhanega vina!", CategoryId = 21 },
                new Joke() { Id = 537, Active = true, Title = "Rodila bo", Description = "\"Ali si že slišala, da Simona pričakuje otroka?\"    \"Ja, sem! In tudi mislim si, od koga bo ta otrok!\"    \"Potem jo pa pokliči in ji povej, da bo vedela, koga tožiti za očetovstvo!\"  ", CategoryId = 43 },
                new Joke() { Id = 538, Active = true, Title = "Zmenek z novim fantom", Description = "\"Je bil tvoj zmenek z novim fantom uspešen?\"    \"Tako ... nooo .... bolj polovičarsko!\"    \"Kako to misliš?\"    \"Jaz sem prišla, njega pa ni bilo!\"", CategoryId = 40 },
                new Joke() { Id = 539, Active = true, Title = "Tečejo za njim", Description = "\"Včasih so ženske vsakodnevno množično tekle za menoj!\"    \"In zakaj danes ni več tako?\"    \"Ne kradem jim več torbic.\"", CategoryId = 43 },
                new Joke() { Id = 540, Active = true, Title = "Cigoti in fičo", Description = "Kako spraviš? 15 ciganov v fičota?  V njega vržeš socialno pomoč!  Kako pa jih spraviš ven?  V njega vržeš prijavnico za delo!", CategoryId = 7 },
                new Joke() { Id = 541, Active = true, Title = "Popravilo avtomobila", Description = "Peter je v avtomehanično delavnico pripeljal na redno servisiranje. Ko se je popoldan vrnil po avto so mu izročili račun. Zrl je vanj in ni mogel verjeti temu kar je videl.  \"Je kaj narobe, gospod Peter?\" ga je vprašal mehanik.  \"Ne vem, ali je to račun za popravilo ali je predračun za nov avto!\"", CategoryId = 2 },
                new Joke() { Id = 542, Active = true, Title = "Konec sveta", Description = "Pride Konec sveta v Slovenijo.  Se malo razgleda naokoli in reče: \"Zgleda da sem tukaj že bil...\"  In gre naprej.", CategoryId = 28 },
                new Joke() { Id = 543, Active = true, Title = "Mož in zapor", Description = "Pride žena možu na obisk v zapor in ga vpraša:  - Kako se kaj počutiš, dragi?  - Glih tak, ko doma, pravi  - No, sem vesela, samo, kak to misliš, tak, ko doma?  - No, saj veš, hrana je neokusna, perilo ni glih speglano, seksa tudi ni, pa še vun me ne pustijo zvečer!", CategoryId = 37 },
                new Joke() { Id = 544, Active = true, Title = "Slovenija v krizi", Description = "Američan, Rus in Slovenec pred bogom.  Američan: \"Kdaj bomo mi prišli iz krize?\"  Bog: \"Čez 50 let!\"  Američan pade v jok: \"Tega jaz ne bom dočakal!\"  Rus: \"Kaj pa mi? Kdaj mi zlezemo iz krize?\"  Bog: \"Čez 70 let!\"  Rus obupano, v joku: \"Ajej, tega na bom dočakal!\"  Slovenec: \"Pa mi? Kako kaže Slovencem?\"  Bog pade v jok, solze lijejo, Slovenec ga začudeno gleda in vpraša: \"Ja zakaj pa ti jokaš???\"  Bog ihteče: \"Zato, ker tega pa niti jaz ne bom dočakal!!\"", CategoryId = 28 },
                new Joke() { Id = 545, Active = true, Title = "Avto mu škriplje", Description = "Peter je že večkrat potožil prijatelju, da v njegovem avtu nekaj čudno škriplje. Bil je že na servisu, toda avtomehaniki niso našli ničesar nenavadnega.    Končno je nekega dne veselo ogovoril prijatelja: \"Ugotovil sem, kaj tako škriplje v mojem avtu!\"    \"In kaj je to?\"    \"Rja ga tako naglas razjeda!\"", CategoryId = 43 },
                new Joke() { Id = 546, Active = true, Title = "Nuja je nuja", Description = "Marko in Peter se sončita na plaži, ko Marko naenkrat pograbi časopis in steče proti toaletnim prostorom.    \"Čakaj!\" zavpije Peter za njim. \"To je vendar današnji časopis!\"    Marko: \"Žal mi je, a do jutri ne morem zdržati!\"  ", CategoryId = 43 },
                new Joke() { Id = 547, Active = true, Title = "Dež na dopustu", Description = "\"Kako si se kaj imel na dopustu?\" Si imel lepo vreme?\" je France vprašal prijatelja.    \"Samo dvakrat je deževalo.\"    France: \"Potem si imel pa srečo!\"    \"Kakšno srečo, neki? Prvič je deževalo sedem, drugič pa pet dni!\"", CategoryId = 43 },
                new Joke() { Id = 548, Active = true, Title = "Klavir", Description = "\"Znaš igrati na klavir?\"    \"Ne vem!\"    \"Kako ne veš?\"    \"Nikoli še nisem poskusil.\"", CategoryId = 43 },
                new Joke() { Id = 549, Active = true, Title = "Nespečnost", Description = "\"Kako je kaj s tvojo nespečnostjo?\"    \"Vedno slabše! Zdaj še v službi ne morem več spati!\"", CategoryId = 29 },
                new Joke() { Id = 550, Active = true, Title = "Sprehajalna palica", Description = "\"Ta sprehajalna palica je vendar mnogo prevelika zate!\"    \"Res je! Ampak samo ne eni strani, zgoraj. Spodaj je ravno pravšnja!\"", CategoryId = 43 },
                new Joke() { Id = 551, Active = true, Title = "Obvezana", Description = "\"Zakaj imaš poviti obe ušesi?\"    \"Likal sem in je zazvonil telefon, pa sem dvignil likalnik namesto slušalke, pa sem ga prislonil na uho...\"    \"Kaj pa drugo uho?\"    \"Ja... no... hotela sem poklicati reševalce.\"", CategoryId = 40 },
                new Joke() { Id = 552, Active = true, Title = "Bral je", Description = "\"Vlado, zakaj si tako žalosten?\"    \"Čital sem knjižico, ki ima žalosten konec.\"    \"Katero knjižico?\"    \"Hranilno!\"", CategoryId = 43 },
                new Joke() { Id = 553, Active = true, Title = "Avtobus št. 12", Description = "Na avtobusni postaji sta stala moški in ženska.  Ženska vpraša moškega:”Na kater avtobus čakaš?”  Moški:”Avtobus številka 1”  Ženska:”Jaz pa na številko 2.”  Mimo pripelje avtobus številka 12, moški pa vzklikne:  “Zdaj se lahko peljeva oba hkrati!”", CategoryId = 2 },
                new Joke() { Id = 554, Active = true, Title = "Podnajemnika ve vrgla iz hiše", Description = "Francka: Marija, zakaj si pa vrgla podnajemnika iz svoje hiše?\"    Marija: \"Veš, da sem velikodušna, zaupljiva in nisem radovedna. Toda nekaj je bilo zelo narobe!\"     Francka: \"Kako veš?\"    Marija: \"Pokrival je luknjo od ključavnice\"", CategoryId = 43 },
                new Joke() { Id = 555, Active = true, Title = "Nakupovanje", Description = "Mož in žena v trgovini skupaj nakupujeta hrano, pijačo ipd.  Naenkrat mož zagleda napis “AKCIJA: Laško pivo (24 kom) samo 20 EURO” in takoj vzame en paket in ga položi v voziček.  Ko žena to zagleda ga vpraša zakaj je vzel pivo.  Njegov odgovor: “Draga, 24 pločevink je samo 20 EURO”    Ona: “Vrni ga nazaj, je treba šparati.”  Mož raje kot se prepirat ubogljivo vrne kišto piva nazaj.  Hodita naprej po trgovini in žena zagleda kremo za 40 EURO in jo brez premisleka položi v nakupovalni voziček.  Mož: “Draga, zakaj pa si ti lahko vzela kremo?”    Žena: “Dragi, to je zato, da se lahko namažem in da sem zvečer, ko se ljubiva vsa lepa samo zate.”  Mož: “To si tudi po 24 pločevinkah Laškega! In to za samo 20 EURO!”", CategoryId = 37 },
                new Joke() { Id = 556, Active = true, Title = "Težave z mačko", Description = "Na vrata je potrkala soseda in rekla: \"Rada bi vam povedala, da je vaša mačka danes pojedla mojo potico, ki sem jo hladila na okenski polici!\"    Soseda odgovori: \"Hvala, da ste mi povedala. Danes ne bo dobila nič več za jesti, saj je gotovo sita!\"  ", CategoryId = 43 },
                new Joke() { Id = 557, Active = true, Title = "Smrt tašče", Description = "Srečata se Edo in Jože.  Edo: Slišal sem, da ti je umrla tašča. Kaj pa je imela?  Jože: Eh, skromno hranilno knjižico, pa nič drugega.  Edo: Ne, mislim, kaj ji je manjkalo?  Jože: Aja, solidna penzija in lastno stanovanje.  Edo: Ma ne, človek, mislim, zakaj je umrla?  Jože: Ah, to... Rekel sem ji, naj gre v klet po krompir, da ga bomo imeli za kosilo, pa je padla po stopnicah in si zlomila vrat.  Edo: O, groza! Strašno! In kaj ste potem naredili?  Jože: Makarone.", CategoryId = 34 },
                new Joke() { Id = 558, Active = true, Title = "Hlače", Description = "\"Kaj bi naredil, če bi v hlačnem žepu našel 100€ ?\"    \"Vprašal bi se, čigave so hlače!\"  ", CategoryId = 43 },
                new Joke() { Id = 559, Active = true, Title = "Kako mu gre", Description = "Prijatelj prijatelju za šankom: \"Ti praviš, da si moj prijatelj, pa me nikoli ne vprašaš, kako mi gre!\"    \"No, kako ti gre?\"    \"Ah, ne sprašuj!\"", CategoryId = 43 },
                new Joke() { Id = 560, Active = true, Title = "Chuck Norris in konj", Description = "Za informacijo, žirafe so nastale, ko je Chuck Norris usekal konja v brado.", CategoryId = 6 },
                new Joke() { Id = 561, Active = true, Title = "Gorenjc in bankomat", Description = "Žena svojemu možu gorenjcu napiše SMS: “Dragi nujno potrebujem nekaj denarja... Bi lahko prosim šel na bankomat in dvignil 50€?”  Gorenjc nekaj časa razmišlja, kaj bi naredil nato pa ženi odgovori: “Napaka! Sporočilo ni bilo dostavljeno.”", CategoryId = 12 },
                new Joke() { Id = 562, Active = true, Title = "Dolg predor", Description = "Fant in dekle se peljeta z vlakom, ki zapelje v zelo dolg predor. Ko so spet prišli na svetlo, fant zašepeta dekletu:  \"Če bi vedel, da je tako dolg predor, bi seksal s tabo!\"  Dekle se zdrzne, pogleda potnike okoli sebe in prepadeno reče:  \"Kaj nisi bil ti?\"", CategoryId = 27 },
                new Joke() { Id = 563, Active = true, Title = "Nuna in javna hiša", Description = "V večernih urah nuna zaustavi taksi:  \"V javno hišo, prosim!\"  Taksist jo odpelje do javne hiše, nuna mu pravi, naj jo počaka in gre noter. Čez pet minut se vrne in pravi:  \"Do samostana, prosim!\"  Taksist ne more brzdati radovednosti in jo vpraša:  \"Zakaj ste pa šli v javno hišo?\"  \"Morala sem preveriti cenik, da nas duhovniki ne bi goljufali.\"", CategoryId = 42 },
                new Joke() { Id = 564, Active = true, Title = "Ženska ali vino?", Description = "Čemu bi se lažje odrekel: ženski ali vinu?  Odvisno od letnika", CategoryId = 40 },
                new Joke() { Id = 565, Active = true, Title = "Odpustili so ga", Description = "\"Včeraj so me odpustili iz službe, in to samo zato ker sem občasno izginil za kakšno urico v skladišče materiala.\"    \"In samo zato so te odpustili?\"    \"No... z menoj je bila vedno šefova žena!\"", CategoryId = 29 },
                new Joke() { Id = 566, Active = true, Title = "Trosijo laži", Description = "\"Grozno! Povsod bo širil laži o meni!\"    \"Bodi vesela! Huje bi bilo ko bi naokoli trosil resnico!\"", CategoryId = 40 },
                new Joke() { Id = 567, Active = true, Title = "Davek", Description = "Očka, ali imajo davki res usta in zobe?  \"Kje si pa slišal takšno neumnost?\"  \"V trgovini je neki gospod rekel, da mu davki požrejo ves dobiček.\"", CategoryId = 43 },
                new Joke() { Id = 568, Active = true, Title = "Hrupni otroci", Description = "Sosed, zdaj mi je pa že dovolj tega, kar počenjajo vaši otroci. Stalno navijajo glasbo tako, da sploh spati ne morem, včasih pa je slišati iz vašega stanovanja tak ropot, kot bi podirali stene! Če bi bili to moji otroci, bi že zdavnaj dobili krepke batine!    Sosed hladno odgovori: \"Prav imate, sosed! Če bi bili to vaši otroci, bi jih tudi jaz namlatil!\"", CategoryId = 43 },
                new Joke() { Id = 569, Active = true, Title = "Upokojil se je", Description = "\"Zdenko, kako se kaj počutiš zdaj, ko si se upokojil?\"    Zdenko: \"Kot pelinkovec: sladko-grenko.\"", CategoryId = 43 },
                new Joke() { Id = 570, Active = true, Title = "Rodil je otroka", Description = "Prijatelja, homoseksualca, sta se sprehajala po gozdu. Naenkrat je eden rekel: \"Moram opraviti veliko potrebo!\" in zginil v grmovju.    Ko se je vrnil k prijatelju je ves zgrožen rekel: \"Rodil sem otroka!\"    \"Nemogoče! To biološko sploh ni mogoče!\"    \"Pa je res! Ima glavo, roke in noge, pa še premika se! Pojdi za grmovje in preveri!\"    Prijatelj je stopil za grmovje, se vrnil in nasmehnil: \"Si pa res norec! Otroka nisi rodil, ježa si pa posral!\"  ", CategoryId = 43 },
                new Joke() { Id = 571, Active = true, Title = "Stava", Description = "\"Pred mesecem dni sem na sprejemu stavil da bom pojedel petdeset obloženih kruhkov.\"    \"In?\"    \"Stavo sem dobil!\"    \"Čestitam! Pa si imel kakšne posledice?\"    \"Seveda! Še danes jih imam!\"    \"Kakšne pa?\"    \"Od takrat naprej me nihče več ne povabi na zabavo!\"  ", CategoryId = 43 },
                new Joke() { Id = 572, Active = true, Title = "Brez pomoči nosi omaro", Description = "Sosed zagleda Milana, ki proti svoji hiši nosi težko omaro na ramenih. Pristopi k njemu in ga vpraša: \"Ti lahko pomagam? Kaj res nisi uspel dobiti nikogar, da ti pomaga z omaro?\"    Milan: \"Saj mi pomaga Jure!\"    \"Ja, kje pa je?\"    Milan: \"V omari drži predmete, da se ne bi razbili\"  ", CategoryId = 43 },
                new Joke() { Id = 573, Active = true, Title = "Skleroza", Description = "Strašna skleroza me muči. Včeraj sem šel v banjo kar oblečen.    \"To je bilo pa grozno, kajne?\"    \"Niti ne. Ampak, tudi pipo sem pozabil odpreti.\"", CategoryId = 43 },
                new Joke() { Id = 574, Active = true, Title = "Obisk v bolnici", Description = "Milan je iz vasi prišel v mesto in obiskal prijatelja Lojzeta, ki je hudo poškodovan ležal v bolnišnici.    Kakšno uro se je zadržal pri njegovi postelji, ko pa je odhajal mu je rekel: \"Dobro se imej! Za tvoj pogreb pa ne skrbi, vsi bomo prišli!\"", CategoryId = 43 },
                new Joke() { Id = 575, Active = true, Title = "Zdravnikov nasvet", Description = "\"Meni je doktor svetoval, da si bom revmatizem pozdravil, če se bom izogibal vode.\"    \"In?\"    \"Ja, prav bedasto se počutim, ko sedim v prazni banji in se drgnem po telesu!\"", CategoryId = 39 },
                new Joke() { Id = 576, Active = true, Title = "Pošten Hrvat", Description = "Slovenec in Hrvat stavita, kateri od njiju bo povedal bolj neverjetno zgodbo.  Hrvat je začel: \"Nekoč je živel pošten Hrvat.\"  \"Stavo si dobil!\" ga je prekinil Slovenec.", CategoryId = 14 },
                new Joke() { Id = 577, Active = true, Title = "Blondinka in vibrator", Description = "Blondinka dobi za darilo vibrator. Po vklopu se prične tresti, nakar mu blodinka pravi:  ?Kaj se treseš, saj je tudi zame prvič?!", CategoryId = 4 },
                new Joke() { Id = 578, Active = true, Title = "Delita si ribo", Description = "Jože in Franci sta odšla v ribjo restavracijo in naročila veliko ribo.    Ko jo je natakar postregel jo je Jože prerezal na večji in manjši kos in manjši kos postavil na Francijev krožnik večjega pa na svojega.    \"Zakaj si vzel večji kos?!\" je potarnal Franci.    Jože: \"Ja, če bi lahko izbiral, katerega bi pa ti vzel?\"    Franci: \"Manjšega!\"    Jože: \"No, saj si ga dobil.\"  ", CategoryId = 43 },
                new Joke() { Id = 579, Active = true, Title = "Požar v hiši", Description = "Hiša gori. Hrabri mož steče v hišo in privleče sina ven. Nato gre spet noter in prinese ženo. Potem gre še enkrat in privleče psa. Potem gre še enkrat in pride prazen ven, pa še enkrat tako. Gasilec ga čudno gleda in vpraša kaj zaboga počne. On pa: “Taščo obračam!”", CategoryId = 34 },
                new Joke() { Id = 580, Active = true, Title = "Nore sanje", Description = "\"Danes sem imel nore sanje!\" reče Jure Petru. \"Imel sem 12. rojstni dan in mama mi je dala tisoč tolarjev ter me poslala v zabaviščni park.\"    \"Jaz pa sem sanjal še bolj noro\" reče Peter. \"Ponoči je k meni v posteljo prišla Madonna. Komaj se je stisnila k meni, je v sobo stopila še Sharon Stone. Sploh nisem vedel kaj naj storim.\"    \"Butec! Mene bi poklical na pomoč!\"    \"Saj sem te, pa je tvoja mama rekla, da si v zabaviščnem parku!\"", CategoryId = 43 },
                new Joke() { Id = 581, Active = true, Title = "Janezek v šoli", Description = "Učiteljica vpraša Janezka: \"Janezek, kakšnega spola je veter ?\"  \"Moškega.\"  \"Pravilno. In zakaj ?\"  Janezek odgovori: \"Zato, ker ženskam krila dviguje.\"", CategoryId = 15 },
                new Joke() { Id = 582, Active = true, Title = "Tri vrsta sexa", Description = "V resnih, dolgoročnih in trajnih zvezah obstajajo tri vrste seksa:    1. faza: Stanovanjski seks traja prvo in drugo leto zveze. Seksa se povsod in vedno. Seksa se v postelji, na kavču, na stolu, mizi, pod mizo, na tleh, na pralnem stroju (ob centrifugi...), ob vseh mogočih urah, v vseh pozah in po celem stanovanju...    2. faza: Prostorski seks nastopi v tretjem in traja nekako do sedmega leta zveze. Seks je sedaj omejen samo na en prostor, vedno v postelji, vedno v spalnici vedno ena in ista rutina, vedno zvečer...    3. faza: Dnevnosobni seks traja od sedmega leta naprej (v določenih primerih lahko ta faza nastopi tudi prej!!!). To je zadnja stopnja v razvoju spolnega življenja med partnerjema, izgleda pa približno takole: slučajno gresta eden mimo drugega, ko se srečata na sredini sobe, se pogledata v oči in si mirno rečeta: \"Jebi se!!!\"", CategoryId = 27 },
                new Joke() { Id = 583, Active = true, Title = "Tašča v bolnišnici", Description = "Snaha obišče taščo v bolnici. Tašča ves čas pogovora stoka in joka:  “Umrla bom!”  Snahi je naenkrat dovolj in reče:  “Če je bilo doslej vse po vaše, pa naj bo še to!”", CategoryId = 34 },
                new Joke() { Id = 584, Active = true, Title = "Navzdol bo šlo", Description = "\"Se spominjaš, ko sem ti prejšnji teden rekel, da bo šlo z Markotom strmo navzdol?\"    \"Ja, spomnim se, da si rekel nekaj podobnega.\"    \"In zdaj se je moja napoved uresničila.\"    \"Kaj se je pa zgodilo?\"    \"Padel je z jablane!\"  ", CategoryId = 43 },
                new Joke() { Id = 585, Active = true, Title = "Pomlajevanla krema", Description = "Poglej tole pomlajevalno kremo! je Sonja rekla prijateljici. \"Kupila sem jo prejšnji teden. Resnično deluje.\"    Prijateljica: \"Kako veš?\"    Sonja: \"Vrnili so se mozolji, ki sem jih imela v puberteti.\"", CategoryId = 40 },
                new Joke() { Id = 586, Active = true, Title = "Smrt osla", Description = "Župnik pred cerkvijo najde mrtvega osla in gre na policijo da to prijavi. Policisti odidejo z župnikom na kraj, si ogledajo kraj dejanja, nato pa eden od policistov reče župniku:  \"Gospod, ga boste pokopali z vsemi častmi?\"  \"Svojce sem obvestil in s tem sem svoje opravil. Vi pa organizirajte pogreb sorodnika kakor vam paše!\"", CategoryId = 42 },
                new Joke() { Id = 587, Active = true, Title = "Blondinka in nagroben spomenik", Description = "Kaj piše blondinki na nagrobnem spomeniku ?  \"Prvic ležim sama.\"", CategoryId = 4 },
                new Joke() { Id = 588, Active = true, Title = "Janezek pijan", Description = "\"Janezek zakaj si direktorju povedal napačno ime, ko te je zalotil pijanega na delovnem mestu?\"  \"Veš, ko sem pijan, niti samega sebe ne prepoznam ...\"", CategoryId = 15 },
                new Joke() { Id = 589, Active = true, Title = "Pobeg iz norišnice", Description = "Deset norcev se odloči pobegniti iz norišnice. Natanko sto zidov morajo preplezati, pa bodo prosti. In gredo na delo preplezajo prvega, pa drugega, tretjega ... in tako naprej vse do devetindevetdesetega. Potem ugotovijo, da so vsi že pošteno utrujeni, pa njihov kolovodja pripomni: \"Fantje, jaz sem utrujen gremo nazaj.\"", CategoryId = 43 },
                new Joke() { Id = 590, Active = true, Title = "Nož zapičen v trebuh", Description = "Pacient, ki je imel zapičen nož v trebuh pride do zdravnika in reče: “Pomagajte mi. Umiram.”  Doktor pravi: “Ura je pet minut do treh, mi pa delamo samo do treh. Ne morem vas sprejeti. Pridite jutri.”  “Prosim pomagajte mi, ne bom zdržal do jutri”.  “Prav.” reče doktor, mu izpuli nož iz trebuha in mu ga zapiči v oko: “Pojdite k okulistu. On dela do štirih.”", CategoryId = 39 },
                new Joke() { Id = 591, Active = true, Title = "Dobar mobitel ;)", Description = "Srečata se dva cigota: »U jebote, dobar mobitel… kolko si dao?«  »Enemu malemu dva šamara.«", CategoryId = 7 },
                new Joke() { Id = 592, Active = true, Title = "Črv in tašča", Description = "Dva črva se pogovarjata. Eden vpraša: \"Zakaj si pa ti danes tako rsečen?\"  Pa odvrne drugi: \"Tašča je odšla na ribolov!\"", CategoryId = 34 },
                new Joke() { Id = 593, Active = true, Title = "Kmet in njiva", Description = "Ostareli kmet, ki je ostal sam na kmetiji, piše sinu v zapor: \"Dragi Matevž, tako žalosten sem, ker letos ne bom mogel posaditi krompirja. Moral bi prekopati njivo, pa me preveč boli hrbtenica.\" Sin odpiše: \"Oče, nikar ne koplji po njivi. Tam sem zakopal trupla.\" Naslednji dan na kmetijo pride 20 policistov, ki prekopljejo celo njivo. Oče pa dobi od sina pismo: \"Dragi oče, upam, da je njiva prekopana. To je bila edina pomoč, ki sem ti jo lahko ponudil v dani situaciji.\" ", CategoryId = 43 },
                new Joke() { Id = 594, Active = true, Title = "Prometna nesreča", Description = "Dva avta se zaletita. Šoferja izstopita, eden ima v roki steklenico, ki jo ponudi drugemu: “Namesto, da se prepirava, ga cukniva, ostala sva živa.” Drugi dobro potegne, jo vrne in vpraša: “Ali vi ne boste?” “Jaz bom potem, ko bo alkotest mimo.", CategoryId = 2 },
                new Joke() { Id = 595, Active = true, Title = "Vunshudiča žena", Description = "Policijo so poklicali zaradi nasilnega dogodka.  – Šef, prispeli smo na kraj incidenta.  – Kakšno je stanje?  – Žena je poškodovala moža. Osem vbodov z nožem, dve strelni rani, odprt zlom golenice, vržen po stopnicah dvonadstropne hiše, nato pa v jarek pred hišo. Stoka, res je v slabem stanju, ne verjamem, da bo preživel.  – O moj bog! In kaj je žena navedla kot razlog? Zakaj ga je tako brutalno obdelala?  – Pravi, da je njen mož začel hoditi po tleh v hodniku, ki jih je ravno obrisala in se še niso posušila.  – Hudo, res. In? Je prva pomoč že prispela? Ste obdolženko že odvedli na postajo?  – Eeee … nismo ... Ponovno je obrisala tla, pa čakamo, da se posušijo!", CategoryId = 9 },
                new Joke() { Id = 596, Active = true, Title = "Orel, zajček in lisica", Description = "Orel sedi in počiva na veji, čisto nič ne dela..  Majhen zajček zagleda orla in ga vpraša: \"Ali lahko tudi jaz tako sedim in nič ne delam?\"  Orel odvrne: \"Seveda, zakaj pa ne?\"  In tako sede zajček pod vejo na zemljo in tudi on počiva. Nenadoma plane iz grmovja lisica, zagrabi zajčka in ga poje.  Morala zgodbe:  Da bi lahko sedel in nič delal, moraš sedeti zelo, zelo visoko..", CategoryId = 41 },
                new Joke() { Id = 597, Active = true, Title = "V kotu", Description = "Kaj je modro in je v kotu? Poredna sliva!", CategoryId = 43 },
                new Joke() { Id = 598, Active = true, Title = "Lepotilni salon", Description = "Ljubi, oprosti, da sem tako pozno prišla domov, toda iz službe sem šla še v lepotilni salon.  Mož jo premeri od glave do peta in reče:\"A nisi prišla na vrsto?\" ", CategoryId = 11 },
