                new Joke() { Id = 600, Active = true, Title = "Dnevi kulinarike", Description = "Hitler v taborišču:   Hitler: \"Si zdrav?\"   Žid: \"ja.\"   Hitler: \"Levo za golaž.\"   Hitler drugemu: \"Si zdrav?\"   Žid: \"Ja.\"   Hitler: \"Levo za golaž.\"   Hitler tretjemu: \"Si zdrav?\"   Žid: \"Ne.\"   Hitler: \"Kaj ti pa manjka?\"   Žid: \"Sladkorno imam.\"   Hitler: \"Desno za kompot.\"", CategoryId = 9 },
                new Joke() { Id = 601, Active = true, Title = "Noseča nuna", Description = "Pride nuna h ginekologu na pregled.   \"Noseči ste,\" postavi doktor neverjetno diagnozo.   \"Kaj,\" je ogorcena nuna, \"kako je to mogoce?\"   Doktor jo le stežka prepriča, DA je njegova diagnoza pač pravilna in je res noseča.   Nuna odide iz ordinacije naravnost v cerkev, se postavi na sredino in se na ves glas zadere:   \"Kateri kurac si ga je drkal po svečah!?\"", CategoryId = 5 },
                new Joke() { Id = 602, Active = true, Title = "To je rop", Description = "V banko uleti tip z nogavico na glavi. Jasno, oropal bi jo rad.   Dekletu zagrozi s pištolo:   \"Odpri sef!\"   \"Napako delate!\" se upira ona.   \"Nič te nisem vprašal! Odpri!\"   Končno se ona loti sefa.   \"Ampak res ste se zmotili.\"   \"A si slišala, kaj sem rekel? Odpri sef in bodi tiho!\"   Končno deklina odpre sef - semenske banke.   \"Vidiš tisto največjo flaško tam?\"   \"Aha ...\"   \"Vzemi jo in jo popij!\"   Bejba gleda in nič ji ni jasno, a iz strahu vseeno zeksa tisto flašo sperme.   Tedaj strašni ropar sname masko:   \"No, vidiš, Majči, da lahko! Samo nočeš .........\" ", CategoryId = 43 },
                new Joke() { Id = 603, Active = true, Title = "Gas! Gas!", Description = "Dve blondinki vozita tovornjak in prispeta do podvoza, kjer je oznaka višine 3,60 metra.   Prva vpraša: \"Kako visok je najin kamion?\"   \"3,70.\"   \"Oh ... Vidiš kje policaje?\"   \"Ne!\"   \"Gas! Gas!\" ", CategoryId = 4 },
                new Joke() { Id = 604, Active = true, Title = "Led in ketne", Description = "Je bil župnik pred božičem na romanju, pa pride proti večeru do samostana in potrka ter prosi za prenočišče. Menih mu pove da posteljo še imajo prosto, da pa si bo moral sobo deliti z nuno.   Pa pravi župnik:   \"Brez panike, saj živimo v celibatu!\".   Pride čas za spanje, župnik je že v postelji, ko pride nuna. Nuna se sleče, odpre okno, si nagrabi snega in si ga začne ribati po mednožju.   Župnik jo vpraša, zakaj to počne. Pa pravi:   \"Zato, da imam v spominu, da je tam spodaj vse hladno in zamrznjeno...\"   Pa zgrabi župnik rožni venec in si ga namota okoli batine. Nuna ga vpraša, kaj naj to pomeni.   > Župnik: \"Ketne montiram!\" ", CategoryId = 5 },
