                new Joke() { Id = 606, Active = true, Title = "Pri spovedi", Description = "Pride mladenka v cerkev k spovedi.   -Oče, spala sem z župnikom iz sosednje fare, ali je to greh?   -Seveda je greh dete, ti pripadaš tej fari.", CategoryId = 5 },
                new Joke() { Id = 607, Active = true, Title = "Arašidek", Description = "Mala Tinca pride domov iz šole vsa nasmejana in reče mami:   \"Jurček mi je danes pokazal svojega lulcča!\"     Se preden se mama zaskrbljeno zave, Tinca nadaljuje:   \"Spomnil me je na arašid\"     Mama si oddahne in se nasmehne:   \"Tako majhen je bil?\"     Tinca odgovori: \"Ne.... slan!\"", CategoryId = 11 },
                new Joke() { Id = 608, Active = true, Title = "Pokvarjen avtobus", Description = "Se pelje avtobus z prizadetimi otroci, nakar se ta avtobus sredi gozda pokvari. Šofer seveda stopi ven in začne nekaj brskati po motorju. Čez nekaj čas pride iz avtobusa Gregor   Gregor: jAZ pa veeeeeem kUaaaa SSee je pOOkvarLLL.   Šofer: no Gregor pojdi noter bom že popravil zadevo   Čez petnajst minut pride Gregor zopet ven   Gregor: jAZ pa veeeeeem kUaaaa SSee je pOOkvarLLL.   Šofer: Gregor ne skrbi vsak čas bom popravil ti kar pojdi nazaj notr.   Čez petnajst minut pride Gregor ven še bol glasen kot prej.   Gregor: jAZ pa veeeeeem kUaaaa SSee je pOOkvarLLL.   Šofer ga ima dosti in reče   Šofer: no pa povej kaj se je pokvarilo   Gregor: AAAAAvtooobUUUs!!!", CategoryId = 43 },
                new Joke() { Id = 609, Active = true, Title = "Lepo je biti sosed", Description = "Vprašanje davčnemu inšpektorju:   Soseda me je sinoči zadovoljila. Ali sem jo dolžan prijaviti?     Težko vprašanje.     Če te je zadovoljila vaginalno in ni izstavila računa, potem je odgovor da.   Če te je oralno, potem ji moraš ti izstaviti račun za malico in prijaviti samega sebe, ker tega očitno še nisi storil.   Če ti ga je na roke, potem bosta zaradi razsipništva in neodgovornega odnosa do bodočih davkoplačevalcev kaznovana oba.   Če pa si jo analno pa nikome ništa, ker smo tako in tako vsi v riti.", CategoryId = 43 },
                new Joke() { Id = 610, Active = true, Title = "Ženske misli", Description = "Kaj mislijo ženske pri seksu?    Mlada dekleta mislijo: \"Upam, da ne bom dobila otroka!\"    Ljubice mislijo: \"Morda mi bo pa kupil krznen plašč!\"    Zakonske žene pa mislijo: \"Odejo bo potrebno zašiti!\" ", CategoryId = 27 },
