                new Joke() { Id = 613, Active = true, Title = "Pri pranju perila", Description = "Marija je ob potoku prala perilo. Ko je bila tako sklonjena je mimo prišel Janez, se ji potihem približal, nato pa ji hitro dvignil krilo in jo napadel od zadaj.    \"Kaj pa je zdaj to?\" je jezno vprašala Marija.    \"Ali hočeš, da ga dam ven?\" je vprašal Janez.    \"To ne, toda drugič me prej vprašaj!\" ", CategoryId = 27 },
                new Joke() { Id = 614, Active = true, Title = "Tank in fičo", Description = "Tank zajebava fičota in mu reče: \"Ti imaš pa motor v riti.\"    Fičo pa mu odvrne: \"Ti imaš pa kurca na glavi.\"", CategoryId = 43 },
                new Joke() { Id = 615, Active = true, Title = "Poslovno kosilo", Description = "Ravnatelj in ravnateljica sta šla skupaj na poslovno kosilo, na katerem so bili glavna specialiteta polži.    Drugi dan je tajnica razlagala blagajničarki: \"Naš ravnatelj pa res nič ne zna. Ali veš,da je jedel polže kar s hišicami vred!\"    Ravnatelj pa razlaga hišniku: \"Naša tajnica je nemogoče pohotna. Ves večer me je gledala globoko v oči, me brcala pod mizo in mi šepetala: ven ga daj!\"", CategoryId = 29 },
                new Joke() { Id = 616, Active = true, Title = "Nakup vibratorja", Description = "Mlado dekle si kupi vibrator.    Odločila se je, da ga takoj preizkusi.    Ko ga vključim se vibrator začne trest.    Punca: \"Kaj se treseš, saj zame bo tudi prvič!\"", CategoryId = 27 },
                new Joke() { Id = 617, Active = true, Title = "Poskuša zanositi", Description = "Fata in Mujo ne moreta imeti otrok.    Mujo se potoži Hasu in ta mu svetuje, da naj po seksu Fato obesi za noge, tako se bo reč bolje prijela.    Mujo se naslednje jutro drži nasveta in zatem oddide po opravkih. Med tem se oglasi Poštar in ko zagleda Fato ga popade poželenje in jo nagovarja naj mu dovoli, da jo poliže.    Končno mu Fata dovoli, a glej ravno tedaj vstopi Mujo in zakriči: \"Ti, baraba, mi torej požreš otroke!\"", CategoryId = 18 },
                new Joke() { Id = 618, Active = true, Title = "Lepinja sreča pico", Description = "Je šla lepinja čez cesto in vidi na drugi strani pico.    Se ustavi in reče: \"Poglej jo, kurbo, kako je namazana!\"", CategoryId = 43 },
                new Joke() { Id = 619, Active = true, Title = "Nuna in župnik v puščavi", Description = "Gresta župnik in nuna s kamelo po puščavi, pa kamela crkne.    Nuna: \"No zdej k sva sredi puščave, bi pa vsaj enkat rada vidla nagega moškega!\" Pa se župnik sleče.    Župnik: \"No prov. Se bom sleku.\"    Nuna: \" Ja kaj maš pa tist tam dol?\"    Župnik: \"lej. Če ti to zapičm u rit ti podarim življenje!\"    Nuna: \"Ja zakaj pa to nis že prej povedal! Dej ga zapič kameli u rit da greva lahko naprej!\"", CategoryId = 27 },
                new Joke() { Id = 620, Active = true, Title = "Neizkušen mož", Description = "Mladi, neizkušen v ljubezni, fant se poroči.    Po poročni noči se zbudi in zagleda zraven sebe nevesto, ki si češe lase.    Ko dvigne roke, pod pazduho mož zagleda dlake.    Pri sebi reče: \"Kako sem jaz srečen, kar tri pičke ima.\"", CategoryId = 27 },
                new Joke() { Id = 621, Active = true, Title = "Raziskava o seksu", Description = "Znanstvenik, ki z anketami raziskuje spolno življenje, pokliče eno od anketirank.    Veste , tu je pa nesporazum. Pod vprašanjem, kako pogosto seksata, je mož napisal dvakrat tedensko, vi pa večkrat dnevno, pretežno ponoči.    \"Ne, gospod! To je samo začasna situacija, dokler ne odplačava stanovanja\", mu odgovori žena .", CategoryId = 27 },
                new Joke() { Id = 622, Active = true, Title = "Pomagala je župniku", Description = "Mlada punca pride domov in razlaga mami: \"Mami, a veš, sem gospodu pomagala. Brisala sem porcelanast servis pa mi je padel na tra in sem vse razbila!\"    Mama zaprepadeno: \"PA je bil gospod župnik fejst jezen?\"    Punca: \"Niti ne! Naredla sva novi servis. Vidiš, da mi še zdaj porcelan teče po bedri.\"", CategoryId = 42 },
                new Joke() { Id = 623, Active = true, Title = "Nespodobne besede", Description = "V šoli so govorili o rimah.    Učiteljica je vprašala, če kdo ve kakšno rimo.    Janezek dvigne roko in pove rimo: \"Po morju plava kit, iz vode kaže rit.\"    Učiteljica ga poduči: \"Janezek, ne govorit tako grdo. Lahko bi rekel: po morju plava kit iz vode kaže R, pa bi vseeno vedeli, zakaj se gre.\"    Učiteljica: \"No, otroci, še kdo ve kakžno rimo?\"    Janezek: \"Se peljem mimo Bleda, iz hlač mi kurac G.\"", CategoryId = 15 },
                new Joke() { Id = 624, Active = true, Title = "Ne ve, kako izgleda", Description = "\"Kako to, da na roditeljskih sestankih še nisem videla tvoje mame? Sploh ne vem, kako izgleda!\" vpraša učiteljica Janezka.    \"Prinesel vam bom sliko,\" je odgovoril Janezek.  ", CategoryId = 15 },
                new Joke() { Id = 625, Active = true, Title = "Nič ni storil", Description = "\"Ali je pošteno, da je nekdo kaznovan za nekaj, česar ni storil?\" vpraša Janezek učiteljico.    \"Ne, to pa ne! To ne bi bilo pošteno!\"    \"Dobro, domače naloge nisem napisal,\" reče Janezek olajšano.", CategoryId = 15 },
                new Joke() { Id = 626, Active = true, Title = "Spolna vzgoja", Description = "Učiteljica je učencem hotela razložiti, kako na svet pridejo otroci.    Janezek neučakano: \"Tršica, kaj mi, ko že fukamo lahko gremo ven na en cigaret?\"", CategoryId = 15 },
                new Joke() { Id = 627, Active = true, Title = "Jedel je hruške", Description = "\"Učiteljica, jaz sem včeraj pojedel deset kilogramov hrušk!\" se je pohvalil Janezek.    \"No, to pa ne bo res!\" je rekla učiteljica. \"Verjetno jih je bilo nekoliko manj!\"    \"Ne, ne, res jih je bilo deset kilogramov, toda bile so zelo drobne!\"", CategoryId = 15 },
                new Joke() { Id = 628, Active = true, Title = "Ni lagal", Description = "\"Sram naj te bo, Janezek!\" se jezi učitelj.    \"Ko sem bi v tvojih letih, nisem nikoli lagal!\"    \"Kdaj pa ste začeli?\" je radoveden Janezek.", CategoryId = 15 },
