                new Joke() { Id = 633, Active = true, Title = "italijan", Description = "Marija je mami povedala,da ima   novega fanta.  Lepo,lepo.Iz kje pa je,kako mu je ime?  Izudin.  Kako?Iz udine je.Italijan?Cudovito,  Italijani so bili vedno premozeni  in uglajeni.  Ne.Tako mu je ime.", CategoryId = 40 },
                new Joke() { Id = 634, Active = true, Title = "Zgodaj zjutraj", Description = "Zakaj petelin kikirika tako zgodaj zjutraj?    Ker potem, ko se kure prebudijo, ne pride več do besede.", CategoryId = 41 },
                new Joke() { Id = 635, Active = true, Title = "Nekaj novega", Description = "Žena predlaga možu, da bi v spalnici, pri posteljnih užitkih, preizkusila kaj novega.    Mož predlaga, da bi on splezal na omaro, ona bi ležala na postelji na hrbtu in on bi skočil na njo.    Žena se takoj strinja.    Mož spleza na omaro in skoči na ženo.    Ona: \"Uuuuuuuuhhh, tole je bilo pa dobro, popolnoma nekaj novega! Daj še enkrat!\"    On: \"Počakaj, moram prvo nogo ven dobit.\"", CategoryId = 27 },
