                new Joke() { Id = 638, Active = true, Title = "zakonca", Description = "Zakonca na potovanju.  Ko potujeta po dolini nad katero  se vspenjajo mogocne gore,zena rece:  Dragi kako lepo!  Kar brez besed sem ostala!  \"Super!Potem bova kar tu ostala!", CategoryId = 11 },
