                new Joke() { Id = 640, Active = true, Title = "Podobnost politik in golob", Description = "Kakšna je podobnost med politikom in golobom?    Ko so od spodaj, ti oboji jedo iz roke, ko so pa odzgoraj, ti pa tudi oboji serjejo po glavi.", CategoryId = 23 },
                new Joke() { Id = 641, Active = true, Title = "Pridržanje", Description = "Policaja privedeta s patrulje sumljivega neznanca.    Komandir: “Kaj pa je ta naredil?”     Policaja: “Nič. Ta tretjega za tarok rabva.”", CategoryId = 22 },
                new Joke() { Id = 642, Active = true, Title = "Vabi jo", Description = "\"O, mlada gospodična. Vedno kadar vas vidim kako se smejite, vas želim povabiti k sebi.\"     Gospodična: \"Ste samski?\"     On: \"Ne, zobozdravnik sem.\"", CategoryId = 43 },
