                new Joke() { Id = 644, Active = true, Title = "Ni vedel", Description = "\"Zakaj si pa tako pozno prišel iz šole?\" je Janezka vprašal oče.     Janezek: \"Moral sem ostati po pouku v razredu, ker nisem vedel, kje so Azori!\"    Oče: \"Potem pa drugič bolj pazi na svoje stvari!\"", CategoryId = 15 },
