                new Joke() { Id = 647, Active = true, Title = "Odpustili so ga", Description = "\"Izgubil sem delo nočnega čuvaja.\"    \"So te zalotili, ko si spal?\"    \"Ne.\"    \"Kaj pa je potem bilo narobe?\"    \"Šef me je vprašal, kaj sem sanjal - in jaz, bedak, sem mu povedal.\" ", CategoryId = 29 },
                new Joke() { Id = 648, Active = true, Title = "Hčerka se je skregala z možem", Description = "Hči: \"Mama, spet sem se skregala z možem, tega ne zdržim več!! Prišla bom živet k tebi!\"    Mama: \"Ne, draga, nikakor; on mora plačat za svoje napake! Jaz bom prišla živet k vama!\"", CategoryId = 34 },
                new Joke() { Id = 649, Active = true, Title = "Mama na obisku", Description = "Štefan je povabil svojo mamo na večerjo v svoje študentsko stanovanje.    Med večerjo je njegova mama ugotovila, da je njegova sostanovalka Julija zelo lepo dekle. Že nekaj časa ji je po glavi rojila misel, da imata morda le tesnejši odnos.    Nenadoma se je počutila nesigurno...     Med večerjo ju je opazovala. Večkrat se je vprašala, ali ima Štefan z lepo sostanovalko mogoče le več skupnega, kot normalno oko lahko vidi.    Štefan je videl zamišljeno mamo in rekel: Draga mama, vem kaj misliš, ampak lahko mi verjameš, ona je samo moja sostanovalka in nič več!    Čez slab teden pravi Julija: Štefan, odkar je bila tvoja mama tu, pogrešam majhen lonec. Nikjer ga ne najdem!    Štefan pravi: Ne verjamem, da ga je mama nesla s seboj, vseeno pa ji bom pisal.    Usedel se je za mizo in pisal: Draga mama, ne rečem, da si vzela moj lonec s sabo, in tudi ne rečem, da ga nisi vzela. Dejstvo pa je, da odkar si bila pri nama na večerji, pogrešava lonec.  Tvoj Štefan.    Nekaj dni kasneje je dobil Štefan pismo.    Odpre ga in bere: Dragi Štefan, ne rečem, da ti z Julijo spiš, in tudi ne rečem, da ti z Julijo ne spiš. Dejstvo pa je, da če bi ona spala v SVOJI postelji, bi lonec že zdavnaj našla...  Tvoja mama", CategoryId = 11 },
                new Joke() { Id = 650, Active = true, Title = "Nizka plača", Description = "Delavec: \"Šefe, tako slabo plačo imam, da se še poročiti ne morem!\"    Šef: \"Ne sekirajte se. Čez nekaj let mi boste zaradi tega hvaležni.\" ", CategoryId = 29 },
                new Joke() { Id = 651, Active = true, Title = "Jabolka", Description = "Dve prijateljici, blondinki, se pogovarjata: “Zdravnik mi je svetoval, da dva tedna živim le na jabolkih.”    Druga: “Kaj pa če dol padeš?”", CategoryId = 4 },
                new Joke() { Id = 652, Active = true, Title = "Ura se prestavi", Description = "Mama pokliče hčerko blondinko: “Tina, si prestavila uro tako, kot sem ti naročila?”    Tina: “Sem! Iz kuhinje sem jo prestavila v kopalnico.”", CategoryId = 4 },
                new Joke() { Id = 653, Active = true, Title = "Ponosna na sina", Description = "\"Dragi, najin sin je postal diplomiran pravnik. Lahko sva ponosna na njega.\"    \"Super, pri njegovih tridesetih letih se ga bova končno znebila!\"    \"No, glede tega.... Zdaj je vpisal še podiplomski študij. Nekoč bo postal magister.\"", CategoryId = 11 },
                new Joke() { Id = 654, Active = true, Title = "Skače po razredu", Description = "\"Janezek, zakaj skačeš po učilnici!?\" jezno kriči učiteljica.    \"Učitelca, pa saj ste rekli včeraj …\"    \"Kaj sem rekla?\"    Janezek: \"Da, če se dovolj potrudim, lahko preskočim razred!\"", CategoryId = 15 },
                new Joke() { Id = 655, Active = true, Title = "Spregledal je", Description = "Policaj ustavi avto, ki pridrvi dvesto, omejitev pa štirideset: \"Vi, ali niste videli table z omejitvijo hitrosti?\"    Voznik protestira: \"Kako neki! Potem pa vi to poskusite pri tej brzini in še malo okajeni!\"", CategoryId = 21 },
                new Joke() { Id = 656, Active = true, Title = "Selitev", Description = "Sosedi se pogovarjata.    \"Kmalu bomo stanovali v lepšem okolju!\" se je pohvalila prva.    \"In mi v mirnejšem okolju!\" je rekla druga.    \"Ah, torej se boste tudi vi preselili?\"     \"Ne, mi ostanemo tukaj!\"", CategoryId = 43 },
                new Joke() { Id = 657, Active = true, Title = "Postal je očka", Description = "Jurij: \"Koširček moj, kako si kaj?\"     \"Slabo, zelo slabo, očka sem postal.\"     \"To je vendar čudovito. Čestitam. In kako je kaj Marta?\"    \"V redu je, ni še izvedela.\"", CategoryId = 11 },
                new Joke() { Id = 658, Active = true, Title = "Težave s puncami", Description = "Janezek se vrne iz kopališča in pravi očetu: \"Nobena punca se noče pogovarjati z mano!\"    Oče: \"Jutri vzami krompir in ga daj v kopalke, boš videl, da se bodo kar lepile nate!\"    Ko se Janezek drugi dan vrne, pravi: \"Danes je bilo še slabše, kar bežale so pred mano!\"    Oče ga pogleda: \"Seveda, sine, krompir je treba dati spredaj!\"", CategoryId = 15 },
                new Joke() { Id = 659, Active = true, Title = "Med kosiom", Description = "\"Očka, očka!\" je zavpil Andrej sredi kosila.    \"Med jedjo se ne govori.\" ga je ustavil očka.    Ko so pojedli ga je vprašal: \"Kaj si mi hotel povedati prej?\"     \"Zdaj je že vseeno, polža, ki je bil na solati si tako že pojedel.\"", CategoryId = 11 },
                new Joke() { Id = 660, Active = true, Title = "Poslovna ponudba", Description = "\"Očka mi je obljubil 50 evrov za vsako petico,\" je povedal Jure učitelju.    \"Saj nobene nimaš!\" je odvrnil učitelj.    \"Imam predlog: zapišite mi jih nekaj, denar si bova pa delila.\"", CategoryId = 32 },
                new Joke() { Id = 661, Active = true, Title = "Pozdrav", Description = "\"Zakaj si tega človeka pozdravil z dober večer, ko pa je šele jutro?\"    \"Zato, ker se mi stemni, ko ga vidim.\"", CategoryId = 28 },
                new Joke() { Id = 662, Active = true, Title = "Mastna klobasa", Description = "Tomaž slastno zagrize v klobaso in mast brizgne Petru po srajci.    \"Pacek!\" mu zabrusi Peter.    \"Jaz? Sebe poglej!\"", CategoryId = 43 },
                new Joke() { Id = 663, Active = true, Title = "Pleskanje stanovanja", Description = "Janez se odloči prebeliti stanovanje.    Spomni se, da je Miha, ki stanuje nad njim v enakem stanovanju, stanovanje prebelil lani, in ga vpraša: \"Miha, koliko barve si kupil?\"    \"50 kil.\"    Janez kupi 50 kg barve in prepleska stanovanje. Ko konča, pravi Mihi: \"Miha, kako si pa ti pleskal, meni je ostalo 35 kil barve!\"    Miha: \"Meni tudi.\"", CategoryId = 43 },
                new Joke() { Id = 664, Active = true, Title = "Blondinki čakajo na avtobus", Description = "Čakata blondinki na avtobus.    Prva vpraša drugo: \"Na kateri avtobus čakaš?\"     \"Na 1.\" pravi druga, \"na katerega pa ti ?\"    \"Na 3.,\" odvrne prva.     Nato se pripelje avtobus št.13.    \"SUPER!\" vzklikneta blondinki, \"zdaj pa lahko greva skupaj!\"", CategoryId = 4 },
                new Joke() { Id = 665, Active = true, Title = "Moč vode", Description = "Učitelj: \"Voda ima veliko moč. Kdo lahko navede primere?\"    Janezek: \"Če moja mama joka, lahko dobi od očeta kar hoče.\"", CategoryId = 15 },
                new Joke() { Id = 666, Active = true, Title = "Ločitev", Description = "\"Moj mož in jaz sva se dogovorila, da se bova ločila brez škandala in prepirov.\"     Odvetnik: \"Čudovito! Danes je malo zakoncev, ki se tako lepo razumejo.\"", CategoryId = 11 },
                new Joke() { Id = 667, Active = true, Title = "Zvonček in marjetica", Description = "Je vprašal zvonček marjetico: \"Marjetica, a bi mi dala?\"    Marjetica: \"Ne morem, imam fotosintezo.\"", CategoryId = 43 },
                new Joke() { Id = 668, Active = true, Title = "Posvet pred obravnavo", Description = "Advokat daje navodila svojemu klientu tik pred obravnavo: \"Nekaj si morate dobro zapomniti.\"    Klient: \"Poslušam.\"    Odvetnik: \"Ko boste pred sodnikom na vsako vprašanje odgovarjajte na dolgo in široko.\"    \"Zakaj pa?\"    \"Dlje kot boste odgovarjali, dlje boste na svobodi.\"", CategoryId = 43 },
                new Joke() { Id = 669, Active = true, Title = "V lekarni", Description = "Pride nekega dne ženska v lekarno pa reče lekarnarju: \"Jaz bi, prosim, kupila dozo arzena!\"    Pa pravi on: \"Gospa, arzen je hud strup. Kaj pa bi vi radi naredili z njim?\"    Ona: \"Ubila bom moža!\"    Lekarnar: \"Gospa, jaz vam arzena ne morem prodati, sploh pa ne za taksen namen!\"    Pa ona brez besed iz torbice potegne sliko in jo prisloni na steklo, ki loči lekarnarja in njo. Na sliki sta njen mož in lekarnarjeva žena v postelji.    Pa pravi on:\" Joj gospa, se opravičujem. Nisem vedel, da imate recept!\"", CategoryId = 43 },
                new Joke() { Id = 670, Active = true, Title = "Pot v vesolje", Description = "Reče Janezek učiteljici: \"Jaz bom prvi človek ki bo pristal na Soncu\".    Učiteljica mu odvrne: \"Kako!? To ja vendar ni mogoče te bo ja zažgalo.\"    Janezek: \"Jaz bom pristal ponoči.\"", CategoryId = 15 },
                new Joke() { Id = 671, Active = true, Title = "Pri aerobiki", Description = "Voditeljica aerobike se zasopihano dere: \"Dejmo punce, mejhne ritke, raven trebuh, to hočmo!\"    Se oglasi ena prešvicanih punc: \"Ne, to tipi hočjo, jst hočem čokolado!\"", CategoryId = 40 },
                new Joke() { Id = 672, Active = true, Title = "Posoja denarja", Description = "\"Mi posodiš 1000 Eurov?\"    \"Nimam toliko. Lahko ti posodim samo 300.\"    \"No, pa daj 300. 700 pa mi boš dolžan.\"", CategoryId = 43 },
                new Joke() { Id = 673, Active = true, Title = "Situacija na lovu", Description = "Dva lovca hodita po gozdu in eden od njih se kar naenkrat zgrudi na tla in negibno obleži.    Drugi lovec hitro potegne iz žepa svoj mobilni telefon in pokliče 112.    Ves razburjen pove operaterju, \"Moj prijatelj je mrtev! Kaj naj storim?\"    Operater ga miri: \"Pomirite se. Pomagal vam bom. Najprej, prepričajte se da je res mrtev.\"    Nastopi tišina, nato se zasliši strel. Spet se javi lovec \"OK, kaj pa zdaj?\"", CategoryId = 35 },
                new Joke() { Id = 674, Active = true, Title = "Dobre novice iz fronte", Description = "Janez je odšel na fronto in po nekaj tednih poklical ženo: \"Ljubica, veselo novico ti moram povedati.\"    Žena: \"Kakšno pa?\"    Janez: \"Prvega bom že doma.\"    Žena veselo: \"Lepo, kako pa to veš?\"    Janez: \"Poveljnik je rekel, da se bomo borili do zadnjega!\"", CategoryId = 36 },
                new Joke() { Id = 675, Active = true, Title = "Lekcija pri kemiji", Description = "Jan se vrne domov iz šole in oče ga vpraša: \"No kaj ste imeli danes na urniku?\"    \"Kemijo.\"    \"In kaj ste se novega naučili?\"    \"Kako lahko izdelamo dinamit.\"    \"Kaj se boste pa jutri učili v šoli?\"    \"Kakšni šoli?\"", CategoryId = 32 },
                new Joke() { Id = 676, Active = true, Title = "Razgled", Description = "Mornar pride v hotel in naroči: \"Enoposteljno sobo brez pogleda na morje, prosim. Sem na dopustu!\"", CategoryId = 29 },
                new Joke() { Id = 677, Active = true, Title = "Kolač", Description = "Gost: \"Ta kolač je od včeraj, hočem današnjega!\"    Natakar: \"Potem pa pridite jutri.\"", CategoryId = 13 },
                new Joke() { Id = 678, Active = true, Title = "V hotelski sobi", Description = "V hotelsko sobo vdre ženska srednjih let in na postelji zagleda par, kako si izkazuje ljubezen.    \"Kako si pa dovolita kaj takega? Je soba morda vaša?\" se brani mladenka.    \"Soba že ne, moški, ki je z vami, pa je!\"", CategoryId = 27 },
                new Joke() { Id = 679, Active = true, Title = "Nesreča", Description = "Steklenica: \"Jaz sem steklenica, kdor me razbije, bo imel eno leto nesrečo\"    Ogledalo: \"Jaz sem hujši, kdor razbije mene, bo imel sedem let nesreče!!!\"    Kondom: \"HA HA HA HA HA HA HA!!!!\"", CategoryId = 43 },
                new Joke() { Id = 680, Active = true, Title = "Teorija in praksa", Description = "Sin: \"Ati, kaj je to teorija in kaj praksa?\"    Oče: \"Uuu, velika razlika! Idi vprašat sestro, če bi šla seksat za 2000 evrov.\"    Sin odide in pride nazaj: \"Rekla je, da bi.\"    Oče: \"No, zdaj pa idi vprašat enako še mamo.\"    Sin odide in se čez nekaj trenutkov vrne, rekoč: \"Tudi mama je rekla da!\"    Iz sobe zavrešči še stara mama: \"Hja, za dva jurja bi pa še jaz lulo dala!\"    Oče: \"Vidiš, teoretično imava midva šest jurjev v žepu. Praktično pa tri kurbe v hiši.\"", CategoryId = 43 },
                new Joke() { Id = 681, Active = true, Title = "Miški in pralni stroj", Description = "Mož vstopi v kopalnico, ker želi oprati v pralnem stroju oprati majico.    Gleda gumbe, a po dveh minutah razmišljanja nima pojma kako.    Mož: \"Kateri program je potrebno vklopiti za pranje majice?\"    Žena: \"Ali je majica bombažna ali sintetična?\"    Mož: \"Ne vem!\"    Žena (znervirano): \"Kaj piše na majici?!\"    Mož: \"Laško je zakon!\"", CategoryId = 17 },
                new Joke() { Id = 682, Active = true, Title = "Ljubljančan in štajerc", Description = "V sosednjih hišah sta stanovala Štajerc in Ljubljančan.    Štajerc je imel kokoš, ki je na dvorišču vsako jutro znesla jajce, ki jo je Štajerc pobral in si pripravil zajtrk.    Neko jutro pa je kokoš znesla jajce na dvorišču Ljubljančana.    Ko je Štajerc krenil ponjo, jo je pobral Ljubljančan.    Štajerc: \"Daj mi jajčko!\"    Ljubljančan: \"Kako, saj je moja, kokoš jo je znesla na mojem dvorišču.\"    \"Ampak, kokoš je moja!\"    \"Dvorišče pa moje!\"    \"Vidim, da takole ne boma prišla nikamor ... pri nas na Štajerskem rešimo takšnele primere na zelo enostaven način ...\"    \"Kako reče Ljubljančan?\"    \"Najprej bom jaz tebe brcnil v jajca pa štopal, koliko boš rabil, da se pobereš, nato boš ti mene in štopal.    Kdo se bo prej pobral, njegova je jajčka!\"    \"Velja!\"    Gre Štajerc po najtežje delovne čevlje s kovinsko kapico, vzame zalet in v stilu Oliverja Birschoffa brcne Ljubljančana v moda, z vso močjo.    Ljubljančan pade in se v agoniji zvija 32 minut in 18 sekund.    Nato se Ljubljančan opremi, vzame zalet, nakar mu Štajerc pravi:    \"Ah, naj ti bo, obdrži jajčko, bom marmelado pa kruh jedel!\"", CategoryId = 28 },
                new Joke() { Id = 683, Active = true, Title = "V psihitrični bolnišnici", Description = "Med obiskom v psihiatrični bolnici v Begunjah raziskovalni novinar vpraša direktorja, na osnovi česa se odločijo, koga bodo sprejeli na zdravljenje.    \"Zelo enostavno je,\" pravi direktor. \"Postavimo ga pred kad, polno vode, in mu damo čajno žličko, skodelico in vedro ter naročimo, naj kar najhitreje izprazni kad.\"    \"Če prav razumem\", pravi obiskovalec, \"tisti, ki je normalen, začne vodo zajemati z vedrom...\"    \"Ne,\" pravi direktor. \"Tisti, ki je normalen, izvleče zamašek z dna kadi. Želite sobo z balkonom ali brez???\"", CategoryId = 39 },
                new Joke() { Id = 684, Active = true, Title = "Slovenec in hrvat se pogovarjata", Description = "Slovenec je zjutraj v nekem lokalu v Ljubljani pil kavo in jedel toast z maslom in marmelado, ko je k njemu prisedel Hrvat, ki je prav zoprno važno žvečil žvečilni gumi.    Slovenec ga je sicer ignoriral, ampak Hrvat je kljub temu začel s pogovorom.    \"A vi, Slovenci, pojeste ves kos kruha za zajtrk?\"    Slovenec je, nejevoljen zaradi vsiljivosti, odvrnil: \"Ja, seveda.....\"    Hrvat je iz žvečilca napihnil velik balon in potem nadaljeval: \"Mi pa ne. Na Hrvaškem pojemo le sredico. Skorje zbiramo v kontejnerjih, jih recikliramo, potem jih predelamo v toast kruhke in jih nazadnje prodamo v Slovenijo.\"  Hrvat je to rekel s porogljivim nasmeškom na obrazu, Slovenec pa ga je le tiho poslušal.    Hrvat je kljub temu vztrajal: \"A vi, Slovenci, pojeste tudi vso tisto marmelado na toastu?\"    Slovenec je spet mirno odvrnil: \"Seveda.\"    Hrvat, s čikgumijem med zobmi, je spet cinično dejal: \"Mi pa ne. Na Hrvaškem za zajtrk jemo sveže sadje. Vse olupke, koščke in ogrizke vržemo v kontejnerje, jih recikliramo, predelamo v marmelado in jo potem prodamo v Slovenijo.\"    Potem je Slovenec vprašal Hrvata: \"A vi na Hrvaškem kaj seksate?\"  Hrvat se je vzvišeno nasmehnil in dejal: \"Valjda!\"    Slovenec se je nagnil bliže k Hrvatu in vprašal: \"In kaj naredite s kondomi potem, ko jih uporabite?\"    Hrvat:\"Stran jih vržemo, kaj pa drugega?!\"    Slovenec: \"Mi pa ne! V Sloveniji jih vržemo v kontejnerje, jih recikliramo, pretopimo v žvečilne gumije in jih prodamo na Hrvaško!", CategoryId = 14 },
                new Joke() { Id = 685, Active = true, Title = "Blondinki in gumidefekt", Description = "Se peljeta dve blondinki v avtu, nakar poči guma.    Izstopita, da bi si ogledali situacijo.    Prva: \"Joj, guma je uničena.\"    Druga: \"A cela?\"    Prva: \"Ne, samo spodnji del.\"", CategoryId = 4 },
                new Joke() { Id = 686, Active = true, Title = "Zalotili so ju", Description = "Mlad par je bil v strastnem objemu, ko se je na vhodnih vratih zaslišalo škrtanje ključa.    Mladenka je prestrašeno odskočila in zakričala: \"O Bog, moj mož! Hitro, skoči skozi okno!\"    Mladi fant, tudi pošteno prestrašen, je planil proti oknu, nato pa se je ustavil. \"Ne morem\" je rekel, \"sva v trinajstem nadstropju!\"    \"Za božjo voljo,\" je obupano zakričala ženska, \"Ali misliš, da je sedaj čas za jebeno vraževernost?\"", CategoryId = 27 },
                new Joke() { Id = 687, Active = true, Title = "Kako to, da moški lulajo stoje", Description = "Ko je Bog ustvaril Adama in Evo, jima je želel pokloniti dva darova.  \"Dva darova bi vama poklonil; prvi dar je lulanje stoje...\"    Adam ga je takoj prekinil: \"Jaz bi to imel, bilo bi čudovito! Življenje bi bilo enostavnejše in zabavnejše!\"    Bog se je ozrl k Evi, ki je Adamovo željo podprla: \"Da, oče. Osreči Adama. Meni to ni tako zelo pomembno...\"    Tako je Bog prvi dar podaril moškemu, ki je jel od samega veselja skakati in lulati na vse strani. Razmočil je vsa drevesa in nato stekel do obale, koder se je bil znova polulal in občudoval vzorec, ki ga je uspel zarisati v peščena tla na obali.    Bog in Eva sta opazovala njegovo neizmerno veselje.    Navsezadnje pa je Eva le vprašala Boga:\"Katero je drugo darilo, oče?\"    Bog: \"Možgani, Eva... Možgani!!!\"", CategoryId = 17 },
                new Joke() { Id = 688, Active = true, Title = "Ljubljančan in štajerc", Description = "Srečata se Ljubljančan in Mariborčan.    Ljubljančan začne nagajati in dražiti Mariborčana. Ta se razhudi ...    Mariborčan: \"Čuj, imaš ti kaj proti Štajercem?\"    Ljubljančan: \"Ah, nekoč sem imel neke tablete pa, žal, niso nič pomagale ...\"", CategoryId = 28 },
                new Joke() { Id = 689, Active = true, Title = "Višje pokojnine", Description = "Pokojnine se bodo s 1. marcem dvignile za 3,6%.    Vlada sporoča,da denarja žal ne bo mogoče izplačati, lahko pa upokojenci koristijo ure.", CategoryId = 43 },
                new Joke() { Id = 690, Active = true, Title = "Prijateljica v kopalkah", Description = "Suzana je prvič videla novo prijateljico v kopalkah. Takoj prične kričati: \"Joj, kakšne grde noge imaš! In kako na \"O\" so oblikovane! Med njimi bi se lahko sprehajale svinje!\"    Prijateljica: \"No, kar sprehodi se!\"", CategoryId = 40 },
                new Joke() { Id = 691, Active = true, Title = "Krotilca levov", Description = "Na oglas iz cirkusa \"Iščemo krotilca levov\" sta se javila dva.    Eden je bil šestdesetletni igralec golfa, druga pa fantastična rjavolaska, dvajsetletna, s izjemno postavo.    Lastnik cirkusa je takoj povedal: \"Ne bom olepševal, lev je zelo nevaren, poslednjega krotilca je pojedel, zato bodita dobra - ali pa bosta zgodovina. Tu imata opremo - stol, bič in pištolo. Kdo bo prvi poskusil?\"    Čudovita rjavolaska je takoj rekla: \"Bom jaz prva.\"    Stopila je kar mimo stola, biča in pištole naravnost v kletko.    Lev je začel renčati, tolči z repom in jo izzivati.    Ko se je približal je čudovita rjavolaska odgrnila svoj plašč in razkrila prekrasno, popolno, golo telo.    Lev se je sunkovito ustavil, nakar pa se splazil do nje in ji začel lizati noge in gležnje. Nadaljeval je z lizanjem in poljubovanjem vsakega centimetra njene kože, potem pa legel pred njo in ji položil glavo na noge.    Lastnik cirkusa ni mogel niti zapreti ust. Rekel je: \"Pa to je izjemno. Še nikoli nisem videl nič podobnega v življenju.\"    Potem se je obrnil k golfistu in vprašal: \"Lahko vi napravite kaj podobnega?\"    Stari možakar je odgovoril:\"Možno... samo najprej boste morali spraviti leva ven.\"", CategoryId = 43 },
                new Joke() { Id = 692, Active = true, Title = "Predavanje", Description = "Policaj zaustavi pijanca ob 4 zjutraj.  \"Kam pa vi greste?\"  \"Na predavanje\" - odgovori pijanec.  \"A ti zajebavaš, kdo ima predavanje ob 4 ponoči ?!\"  \"Moja žena.\"  ", CategoryId = 13 },
                new Joke() { Id = 693, Active = true, Title = "Nesporazum", Description = "Policist se  razgleduje po mega centru, kjer prodajajo praktično vse in nato le reče  prodajalcu.     \"Mislim sem, da so CD plošče popolnoma zamenjale gramofonske  plošče, tamle pa vidim štiri. Kar vse štiri bom vzel!\"    \"Ste vi policist?\"     \"Ja. Kako pa veste?\"     \"Veste, to je električni  štedilnik ne pa gramofonske plošče!\" ", CategoryId = 22 },
                new Joke() { Id = 694, Active = true, Title = "Janezek postane atek", Description = "Janezek: »Janezek moj, kako si kaj?« »Slabo, zelo slabo, očka sem postal.« »To je vendar lepo. Čestitam. In kako je kaj Marta?« »V redu, še ni izvedela.«", CategoryId = 15 },
                new Joke() { Id = 695, Active = true, Title = "Strasna vojska++", Description = "General Glanckopf  je po pregledu svoje vojske   izjavil:    Ne vem sicer,ali bodo prestrasili  sovraznika,ampak mene je groza,  ko jih pogledam", CategoryId = 36 },
                new Joke() { Id = 696, Active = true, Title = "Mojca", Description = "Mojca doma vsa nervozna  hiti razlagati svoji mami:    Ves,srecala sem fanta,  zaprosil me je za roko,nevem,  kaj naj storim.  Nekam hitro je vse,sploh  me se ni dobro spoznal.  Mama:>>Poroci se,hcerka,cim  prej,nikar ne cakaj,da  te spozna!<<", CategoryId = 11 },
                new Joke() { Id = 697, Active = true, Title = "Tascin pogreb", Description = "Korel svojemu sefu:  >>Jutri bi sel rad na    tascin pogreb.<<  Sef:>>Jaz tudi.<<", CategoryId = 34 },
                new Joke() { Id = 698, Active = true, Title = "Bucek iz sole", Description = "Bucek pride iz sole domov  in se ze na vratih  pohvali mami:  >>Danes sem popravil dve enki in  eno dvojko.<<  Mama:>>Odlicno,sine,cestitam!  Pri katerih predmetih?<<  Bucek izstreli:>>Pri zobozdravniku.<<", CategoryId = 32 },
                new Joke() { Id = 699, Active = true, Title = "Spomin", Description = "80-letna Francka povabi svoji vrstnici na kavico. Da ne bo kaj pozabila, si pripravi listek ter si ga obesi v kuhinji:  1. SKUHAJ KAVO  2. POSTREZI PIŠKOTE  3. POSTREZI SADJE    Prijateljici prideta, Francka gre v kuhinjo in hitro preveri listek:  1. SKUHAJ KAVO -- in skuha kavo in jo postreže prijatejicima.   Kasneje se vrne v kuhinjo in ponovno preveri listek:  1. SKUHAJ KAVO -- in skuha kavo in jo postreže prijatejicima.   In tako še enkrat.    Ženičke se poslovijo in odpravijo domov. Pa komentirata obisk pred vrati in pravi prva:  - ti, ampak Francka bi nama pa lahko vsaj kavo skuhala!    Druga pa: Katera Francka ?!?!", CategoryId = 43 },
                new Joke() { Id = 700, Active = true, Title = "AMC", Description = "Moz mi je za rojstni dan  kupil komplet AMC.    Posode?  Ne,ajmar,metlo in cunjo", CategoryId = 43 },
                new Joke() { Id = 701, Active = true, Title = "SMEH", Description = "Londonski klubocar je v izlozbi  rastavil klobuk z napisom:  Nasi klobuki so najboljsi na  svetu.Nosil jih je celo Charli  Chaplin.  Ponoci je njegov konkurent  na steklo pripisal:  In zato se mu smeje ves svet.", CategoryId = 17 },
                new Joke() { Id = 702, Active = true, Title = "KAPITAL", Description = "Znani obrtnik se hvali  znani druzbi:  Ko sem sel na svoje,  nisem imel drugega kot  svojo pamet.  Pa se eden oglasi.  In s tako majhnim kapitaloom  ste prisli tako dalec.  Neverjetno.", CategoryId = 43 },
                new Joke() { Id = 703, Active = true, Title = "Streljanje rac", Description = "\"V nedeljo sem ustrelil pet rac!\" se hvali Polde.    \"So bile divje?\"    \"Race ne. Je pa bil divji njihov lastnik.\"", CategoryId = 35 },
                new Joke() { Id = 704, Active = true, Title = "Kje je najlepše?", Description = "\"Kje je najlepše?\" je vprašal učitelj učence.   \"V postelji z lepo žensko!\" se je oglasil Mihec.   \"Da te ni sram!\" je vzrojil učitelj. \"O tem bom obvestil tvojega očeta! \"je dejal in mu v beležko napisal, kaj se je zgodilo.   Ko je Mihec naslednji dan prišel v šolo, ga je učitelj vprašal: \"In kaj je rekel tvoj oče na tvoje včerajšnje obnašanje?\"  \"Moj oče se strinja z menoj. Rekel pa mi je tudi, da, če ste vi drugačnega mnenja, naj se vas pazim!!!!\"", CategoryId = 27 },
                new Joke() { Id = 705, Active = true, Title = "Dvojčici", Description = "Mati pride v trgovino z dvojčicama. Ko pomerita novi oblekici ju prodajalka napoti k ogledalu, toda mati pravi: \"Saj se lahko sami pogledata!!!!\"", CategoryId = 11 },
                new Joke() { Id = 706, Active = true, Title = "Roditeljski sestanek", Description = "Gre Janezek na roditeljski sestanek in s sabo pripelje dedka.Učiteljica mu reče: Zakaj si s sabo pripeljal dedka?  Edino on slabo sliši in hitro pozabi!!!", CategoryId = 15 },
                new Joke() { Id = 707, Active = true, Title = "Lasko je zakon", Description = "Kosir vstopi v kopalnico,zeli  oprati majco.  Gleda gumbe na pralnem stroju,a   mu nic ni jasno.  Zaklice Marti:Kateri program je  treba vklopiti za pranje majce?  Ona iz kuhinje:Je majca bombazna  ali sinteticna?  On:Ne vem!Marta nervozna:  Kaj pise na majci?  Kosir:Lasko je zakon!", CategoryId = 11 },
                new Joke() { Id = 708, Active = true, Title = "Omejitev 40", Description = "Policaj ustavi avto, ki pridrvi dvesto, omejitev pa štirideset:  “Vi, ali niste videli table z omejitvijo hitrosti?”  Voznik: “Kako neki! Pri tej brzini?”", CategoryId = 22 },
                new Joke() { Id = 709, Active = true, Title = "Krava in policijski avto", Description = "Zakaj krava leti za policijskim avtom?  Ker sta notri dva bika!", CategoryId = 22 },
                new Joke() { Id = 710, Active = true, Title = "Optimizem", Description = "Kaj je optimizem?  Ko vidiš klošarja v parku, ki bere revijo Moj dom!", CategoryId = 9 },
                new Joke() { Id = 711, Active = true, Title = "Vreme", Description = "Gresta prašič in pes po cesti, pa začne padat dež.  Reče prašič : “Pasje vreme”  Pa reče pes: “Ja, svinjsko lije”  ", CategoryId = 41 },
                new Joke() { Id = 712, Active = true, Title = "Mujo spi pri Hasotu", Description = "Nekega dne se gre Mujo učit k Hasotu. Ko se nauči in hoče oditi domov vidi, da zunaj močno dežuje. Zato mu Haso reče naj prespi pri njemu. In Mujo se strinja. Ko pa gre Haso pod tuš vidi Mujota zelo mokrega in ga vpraša: “Zakaj si pa moker ?” Mujo mu pojasni:”Šel sem domov po pidžamo.”", CategoryId = 18 },
                new Joke() { Id = 713, Active = true, Title = "Gate", Description = "Haso prinese Mujotu gate za rojstni dan.  Mujo vpraša: “Kaj pa je to?”  Haso pravi: “To so spodnje hlače. To obleci predno oblečeš hlače.”  Mujo pravi: “Jaz tega ne rabim. To je za mestne učene ljudi.”  Haso pravi: “Probaj. Boš videl. Je bolj higijenično in topleje ti bo.”  Naslednji dan zjutraj Mujo res prvič v življenju obleče gate.  Čez nekaj časa ga prime na stranišče. Normalno odide na stranišče, in sleče hlače, gate pa pozabi sleči.  Opravi potrebo in pogleda v školjko: “Pa je res bolj higijenično.”  Obleče hlače in odide iz stranišča, nato pa pravi: “Pa tudi bolj toplo je.”", CategoryId = 18 },
                new Joke() { Id = 714, Active = true, Title = "Spolna bolezen", Description = "Kliče Mujo Hasota: ‘Haso ali bi mi prišel pomagat drva cepit?’  Haso: ‘Ne ne morem imam spolno bolezen.  Mujo ga pokliče naslednji dan in ga ponovno vpraša: ‘Bi mi prišel drva cepit?’.  Ne morem imam spolno bolezen, Odgovori Haso. Nato ga pokliče tretjič in ga še zadnjič vpraša, če bi mu prišel pomagat drva cepit.  Haso: ‘Ne morem imam spolno bolezen. ‘  Mujo se razjezi: ‘Katera je potem ta tvoja spolna bolezen?’  Haso pa odgovori:’ Boli me k….za tvoja drva’.", CategoryId = 18 },
                new Joke() { Id = 715, Active = true, Title = "Mujo in pralno stroj", Description = "Fata pere perilo pod slapom. Pa prileti en kamen na Fato in jo ubije.  Mujo pa pravi: “Spet ta vodni kamen. Uničil mi je že tretji pralni stroj”.", CategoryId = 18 },
                new Joke() { Id = 716, Active = true, Title = "Povabilo", Description = "Haso povabi Mujota na večerjo. Mujo pride do Hasota in zagleda na vratih listek:  “Ha, ha, ha, Mujo, sploh me ni doma!”  Mujo se odloči, da mu bo to vrnil, zato pripiše na listek:  “Ha, ha, ha, Haso, sploh nisem bil tukaj!!”", CategoryId = 18 },
                new Joke() { Id = 717, Active = true, Title = "Puzzle", Description = "Mujo dobi puzzle. Pa sestavlja, pa sestalja,… mine devet dni, pa  še ni gotovo… Pa pride 10. dan, pa mu končno rata. Zlaufa k Hasotu,  ter se mu pohvali: “Jes vidio, pazl sam sastavio u 10 dana, a na  kutiji piše 4-5 godina!!!”  ", CategoryId = 18 },
                new Joke() { Id = 718, Active = true, Title = "Test za nosečnost", Description = "“Včeraj sem delala test za nosečnost.” pove prva blondinka.  “So bila težka vprašanja?” vpraša druga.", CategoryId = 4 },
                new Joke() { Id = 719, Active = true, Title = "Bomba", Description = "Blondinki sta se sprehajali ob obrežju reke in našli dve ročni bombi.”Odnesiva ju na policijo!” je rekla ena.”Kaj pa če ena bomba eksplodira?” je vprašal druga.”Bova pa policistom rekli, da sva našli le eno!”", CategoryId = 4 },
                new Joke() { Id = 720, Active = true, Title = "Smučanje", Description = "Prijateljica je blondinki pripovedovala, kako hudo je bilo na smučanju. “Padla sem po strmini in se tako polomila, da sem obležala za tri tedne.” “Ali si bila na tako zapuščenem kraju, da te niso mogli prej najti?” jo je vprašala blondinka. ", CategoryId = 4 },
                new Joke() { Id = 721, Active = true, Title = "Akvarijske ribice", Description = "Zakaj blondinkam umirajo akvarijske ribice? “Ker na škatli s hrano piše: “Hraniti na suhem!” ", CategoryId = 4 },
                new Joke() { Id = 722, Active = true, Title = "Morski pes", Description = "Srečajo se trije morski psi in se pogovarjajo: “Požrl sem rjavolasko, ki je bila tako pijana, da tri dni nisem mogel naravnost plavati,” je rekel prvi.  “Požrl sem rdečelasko, ki je bila polna tlablet, tako da se mi je tri dni dremalo,” je dejal drugi.  “Jaz sem pa požrl blondinko, ki je imela tako prazno glavo, da se tri dni nisem mogel potopiti,” je rekel tretji morski pes.", CategoryId = 4 },
                new Joke() { Id = 723, Active = true, Title = "psic", Description = "Par je šel zvečer na zabavo. Pokličeta taxi, peljeta psičko ven in  čakata na taxi. Psička medtem spizdi nazaj v hišo. Mož jo gre iskat,  ker ni hotel da ostane zaprta v hiši cel večer. Žena gre do  taksista, ki je že nestrpno čakal, da ju odpelje, ter zanj najde  izgovor. “Veste, samo k moji materi se je šel še poslovit!”, je  rekla. Mož čez nekaj časa pride, se vsede v taksi in pravi:  “Oprostite, ker je trajalo tako dolgo. Blesava kuzla se je skrila pod  posteljo, pa sem jo moral dvakrat mahnt z metlo, da je prilezla ven,  pol sem jo moral zavit v plašč, da me ni spraskala, ker se je upirala  ko sem jo vlekel po štengah in jo privezal na dvorišču. Tako da mi ne  bo spet srala po vrtu kot včeraj!”", CategoryId = 34 },
                new Joke() { Id = 724, Active = true, Title = "Biseri", Description = "Tašča gospoda Novaka je na počitnicah v Španiji utonila.  Čez dve leti je obalna straža našla truplo in poslala gospodu Novaku naslednji telegram: Našli mamo vaše žene, pokrito s školjkami, biseri so vredni 500.000,00 EUR.  Gospod Novak telegrafira nazaj:  Prodajte bisere, pošljite denar in znova nastavite vabo!", CategoryId = 34 },
                new Joke() { Id = 725, Active = true, Title = "Gospa vaših let", Description = "Mladoporočenca živita v isti hiši kot tašča. Nevesta je bila vajena malce dlje spati, počasi popiti kavo…    Nekega jutra začne tašča: “A veš da vse punce tvojih let vstajajo zgodaj. Ob tej uri imajo že kosilo skuhano in vse pospravljeno. Ne vem, kaj je s tabo.”  Pa reče nevesta vsa zaspana: “Ja draga tašča, tudi gospe vaših let so že vse pod zemljo, pa vam tega nikoli ne očitam.” ", CategoryId = 34 },
                new Joke() { Id = 726, Active = true, Title = "Načela", Description = "Milan vstopi v pisarno in presenečeno pogleda kolega Emila, ki sedi za pisalno mizo.  “Kaj pa ti delaš v službi?” ga vpraša.  “Kaj ni danes pogreb tvoje tašče?”  “Je, ampak moje načelo je: najprej delo, nato zabava!” ", CategoryId = 34 },
                new Joke() { Id = 727, Active = true, Title = "Nesreča", Description = "Avtobus tašč se pelje na izlet, zgodi se nesreča in vse umrejo.  Zeti nato naredijo veselico. Le en tam v kotu celi večer žalosten sedi in joče.  Le kaj te muči, ga vprašajo, ko jim je vsega dovolj. A ti nisi vesel?  Ne, jim odvrne, moja je odpovedala izlet. ", CategoryId = 34 },
                new Joke() { Id = 728, Active = true, Title = "Stekleno oko", Description = "V koncentracijskem taborišču. Četniški komandant ustavi jetnika in reče:  »Prost si, če uganeš, katero oko imam stekleno!«  »Ta levo.«  Četnik: »Kako si pa tako hitro uganil?«  »S ta levim ste me tako prijazno pogledali.«", CategoryId = 23 },
                new Joke() { Id = 729, Active = true, Title = "Goba", Description = "Gresta 2 kolega po gozdu pa reče en drugemu: Glej, goba! Pa reče goba: Ja in?", CategoryId = 43 },
                new Joke() { Id = 730, Active = true, Title = "Dreva", Description = "Gresta 2 kolega po gozdu pa reče en drugemu: Glej, dreva! Pa reče dreva: Ja in? Glej tam je goba.", CategoryId = 43 },
                new Joke() { Id = 731, Active = true, Title = "WC", Description = "V državnem zboru. Sprašuje opazovalec:  “Oprostite, prosim, kje pa je tukaj WC?”  “Kakšen sekret neki!” reče vratar. “Ga ne rabijo, drug po drugem serjejo.”", CategoryId = 23 },
                new Joke() { Id = 732, Active = true, Title = "Pretep", Description = "Pretep  Mlajši in starejši policist patruljirata po ulici. Dežurni jih po radijski zvezi napoti na intervencijo v gostilno, kjer je množični pretep.  Kar ti pojdi noter, ki si mlajši in poglej, če je gneča! reče starejši policist.  Mlajši se takoj vrne s krvavim nosom.  Nobene gneče, takoj sem bil na vrsti! ", CategoryId = 22 },
                new Joke() { Id = 733, Active = true, Title = "Plis not", Description = "Policaj je odšel na safari v Afriko. Ko se je vrnil so ga sodelavci spraševali kakšne živali je lovil. Odgovoril je, da slone, leve, tigre in plisnote. Ko so ga vprašali kaj je to plisnot jim pove, da so čudne črne živali, ki skačejo po zadnjih nogah s sprednjimi krilijo in kričijo: “plisnot!”", CategoryId = 22 },
                new Joke() { Id = 734, Active = true, Title = "Težja literatura", Description = "Policista v knjigarni kupujeta knjigo za komandirjev rojstni dan.  “Kaj pa želite?” vpraša prodajalka. “Leksikon, filozofijo ali kaj lažjega?”  “Lahko je tudi kaj težjega, saj sva prišla z avtom.”  ", CategoryId = 22 },
                new Joke() { Id = 735, Active = true, Title = "Problemi", Description = "Pri zdravniku  Gospod doktor,imam problem pri seksu. Moj lulček je kot pes.  Kako to mislite?  Moji ženi noče nič, a sosedo bi pa kr rastrgal! ", CategoryId = 37 },
                new Joke() { Id = 736, Active = true, Title = "Kakšne so ti všeč?", Description = "Žena vpraša moža: “Kakšne ženske so ti všeč lepe ali pametne?”  Mož:” Nobene izmed teh, samo tebe ljubim.”", CategoryId = 37 },
                new Joke() { Id = 737, Active = true, Title = "Klopca", Description = "Mlada punca je, utrujena od dolgega sprehoda po parku, sedla na klop in se zleknila nanjo. Mimo je prišel klošar, sedel poleg nje in jo vprašal:  “Punca, ali si razpoložena za kakšno igrico?”  “Sram naj vas bo. Kaj pa si mislite o meni?”  “Kaj neki pa naj bi si mislil, saj si vendar v moji postelji!”", CategoryId = 21 },
                new Joke() { Id = 738, Active = true, Title = "Microsoft", Description = "Ženska gre v posteljo z Billyem Gatesom. Ko opravita, mu ona reče: “Gospod, sedaj pa vem, zakaj se vaše podjetje imenuje Microsoft…", CategoryId = 26 },
                new Joke() { Id = 739, Active = true, Title = "Goreča rit", Description = "Dve vrani se pogovarjata in srečata reaktivca kako leti.Pa reče prva vrana:>Glej kako hitro leti!<  pa druga vrana reče:>Tudi ti bi tako hitro letela če bi ti rit gorela<", CategoryId = 41 },
                new Joke() { Id = 740, Active = true, Title = "Želvica", Description = "Želvica pleza na visoko drevo. Po dolgih urah mučnega plezanja pripleza na vejo in se požene v globino. Med padanjem na vso moč krili s sprednjima nogama. Z glasnim treskom prileti na tla in omedli.  Ko se zave, spet začne počasi plezati na drevo, spet skoči in ponovno trdo trešči ob tla. Toda po vsakem padcu želvica spet in spet spleza na drevo.  Z veje jo žalostno opazujeta dva ptička. Čez čas se samička obrne k samcu: “Veš, mislim, da je prišel čas, da najini želvici poveva, da je posvojena.!” ", CategoryId = 41 },
                new Joke() { Id = 741, Active = true, Title = "3 muhe v restavraciji", Description = "Pridejo tri muhe v restavracijo.  Prva naroči: “Drek s čebulo”.  Druga naroči: “Drek s česnom”.  Tretja pa pravi: “Jaz bom pa samo drek, da mi ne bo potem iz ust smrdelo”.", CategoryId = 41 },
                new Joke() { Id = 742, Active = true, Title = "Kikirikanje", Description = "Zakaj petelini tako zgodaj kikirikajo?  Ker, potem ko se zbudijo kokoši, ne pride do besede.", CategoryId = 41 },
                new Joke() { Id = 743, Active = true, Title = "Pijančevanje", Description = "Zajček gre zvečer pijan z žurke. Omaga pod drevesom in zaspi.  Mimo prideta medved in volk. Stepeta se kdo bo požrl zajčka in v pretepu oba obležita v nezavesti.  Ko se zajček prebudi ju zagleda in zakolne: “Porka madona, ne smem več piti, kadar sem pijan res nimam prave mere, da sem ju tako hudo prebutal!” ", CategoryId = 41 },
                new Joke() { Id = 744, Active = true, Title = "Zajčki", Description = "Zajček je svojo zajkljo odpeljal v cirkus in tam sta videla nenavadno čarovniško predstavo.  Čarovnik je iz klobuka vlekel majhne zajčke. Pa se je oglasila zajklja: “Ni slabo, toda meni je še vedno bolj všeč tako, kot to delava midva!” ", CategoryId = 41 },
                new Joke() { Id = 745, Active = true, Title = "Češnje na drevesu", Description = "Polž pleza po deblu češnje. Mimo prileti kos in mu reče:  “Nima smisla, da plezaš po drevesu, saj ni nič češenj!”  “Ko bom na vrhu bodo že!”", CategoryId = 41 },
                new Joke() { Id = 746, Active = true, Title = "Ježkova mama", Description = "Mlad ježek se je izgubil v puščavi. Ko se je zaletel v kaktus je vprašal:  “Si ti, mama?”", CategoryId = 41 },
                new Joke() { Id = 747, Active = true, Title = "Kdo bo koga?", Description = "Zakaj vedno moški zaprosi žensko?  Ker če bi ženska padla na kolena pred moškega, bi si ta začel odpenjat zadrgo.", CategoryId = 27 },
                new Joke() { Id = 748, Active = true, Title = "Žensko srce", Description = "Žensko srce je tako, kot avtobus: vedno je prostor še za enega.", CategoryId = 40 },
                new Joke() { Id = 749, Active = true, Title = "Suša", Description = "Kaj pomeni ekstremna suša?   Ko telegrafnica leti za psom, da bi jo poscal!", CategoryId = 43 },
                new Joke() { Id = 750, Active = true, Title = "Ven bi šla", Description = "Hčerka se hoče zvečer neopaženo izmuzniti iz hiše.    Oče jo zaloti in jo vpraša: \"Kam pa kam?\"    Hčerka zardi in reče: \"Samo pismo nesem v nabiralnik.\"    Oče: \"Potem pa pohiti. Nabiralnik je že dvakrat zažvižgal!\"", CategoryId = 11 },
                new Joke() { Id = 751, Active = true, Title = "Penzionisti", Description = "Upokojenci se ukvarjajo samo še s premičninami in nepremičninami.    Premičnine: proteza  Nepremičnenine: luleki", CategoryId = 43 },
                new Joke() { Id = 752, Active = true, Title = "Barva glavice", Description = "Zakaj je glavica od penisa roza barve?    Zato, ker se punčke igrajo z njo.", CategoryId = 27 },
                new Joke() { Id = 753, Active = true, Title = "Izmenjava ", Description = "Po Avstraliji skače kenguru in se vsakih sto metrov ustavi. Iz njegove vreče pokuka pingvinček in bruha kot nor.  Na Antarktiki med skupino pingvinov sedi kengurujček, občasno kihne in zagodrnja:  \"K***c pa taka izmenjava študentov!\"", CategoryId = 41 },
                new Joke() { Id = 754, Active = true, Title = "Brodolom", Description = "Zakaj iz potapljajoče ladje najprej rešijo ženske?    Da lahko moški potem v miru pridejo do rešitve", CategoryId = 43 },
                new Joke() { Id = 755, Active = true, Title = "Jagnje moje", Description = "Dragi,ali ves,da so ovce    bolj neumne kot krave?    Vem,jagnje moje...", CategoryId = 43 },
                new Joke() { Id = 756, Active = true, Title = "Velike ribe", Description = "Ucitelj vprasa Janezeka:    Povej mi,kje zivijo velike ribe?    V vikendih na morju.", CategoryId = 43 },
                new Joke() { Id = 757, Active = true, Title = "Kopalnica", Description = "Ucitelj verouka sprasuje otroke,  ali vedo,kje zivi bog.  Vsi so dajali obicajne odgovore,  razen malega Jozeta,ki je rekel:  Bog zivi v nasi kopalnici.  Kako pa ti je to padlo na pamet?  Zto,ker moj ati vsako jutro,  ko vstane,potrka na vrata  kopalnice in rece:  Ljubi bog,se vedno si notri.", CategoryId = 32 },
                new Joke() { Id = 758, Active = true, Title = "Matematik", Description = "Ali še hodiš z onim matematikom?    Ne, varal ma je!    Kako to?    Zadnjič sem ga, en večer, klicala.  Vprašala sem ga, kaj počne in je odvrnil, da se v postelji jebe z eno neznanko.  ", CategoryId = 43 },
                new Joke() { Id = 759, Active = true, Title = "Na predavanju", Description = "V kadetski šoli profesorica razlaga: \"Osebe z omrzlinami pozimi masiramo s snegom.\"    Eden od kadetov: \"Kaj pa poleti?\"", CategoryId = 22 },
                new Joke() { Id = 760, Active = true, Title = "Kot moški in ženska", Description = "Pisni izpit.  Profesor je opazil da mlada lepotička prepisuje iz manjšega plonkiča.    Ko je videla, da jo profesor opazuje je listek hitro vtaknila v svoj dekolte.    Profesor je pristopil k njej in rekel: \"Kot profesor tega ne smem, kot moški pa smem!\" ji vtaknil roko med prsi in ven potegnil plonkič.    Nato se je oglasila študentka:\"Kot študentka tega ne smem, kot ženska pa smem!\" in mu prisolila zaušnico.", CategoryId = 32 },
                new Joke() { Id = 761, Active = true, Title = "Izpitno vprašanje", Description = "Na testnih izpitnih polah je bilo tudi napisano:  \"Če je to tudi vprašanje, odgovorite nanj!\"    Eden od odgovorov se je glasil:  \"Če je to tudi odgovor, ga ocenite!\"", CategoryId = 32 },
                new Joke() { Id = 762, Active = true, Title = "Samo vznemirjen", Description = "Ustni izpit na faksu. Po izpitu je profesor pojasnil študentki, ki je na izpit prišla v mini krilu, ki je komaj kaj pokrivalo:   \"Vidiva se zopet čez dva meseca. Danes ste me sicer vznemirili, toda zadovoljili me niste!\"", CategoryId = 32 },
                new Joke() { Id = 763, Active = true, Title = "Poznanstvo", Description = "Profesor: \"Midva se pa že poznava, kajne?\"  Študent: \"Da, lani sem bil na izpitu. Takrat mi je spodletelo.\"  Profesor: \"No, ja, bo šlo pa danes bolj gladko. Se spomnite, kakšno je bilo lani moje prvo vprašanje?\"  Študent: \" Midva se pa že poznava, kajne?\"", CategoryId = 32 },
                new Joke() { Id = 764, Active = true, Title = "Pri spovedi", Description = "Moški je prišel k spovedi in povedal duhovniku:  \"Oče, jaz sem zelo grešil!\"  \"Sinko, kar povej mi!\"  \"Veste, neki dan je k meni prišla sestra moje žene. Saj veste.... malo sva se zaklepetala, nato pa sem seksal z njo!\"  \"Sinko, saj to niti ni tako velik greh!\" ga je potolažil duhovnik. \"Bog odpušča tudi večje grehe!\"  \"Toda, to ni vse!\" je nadaljeval moški. \"K meni na obisk je prišla tašča. Malo sva se zaklepetala in tudi z njo sem seksal!\"  \"Tudi to ti bo Bog odpustil!\" je rekel duhovnik.  \"Veste,\" je nadaljeval moški pri spovedi, \"nekega dne sem šel mimo polja, ki ga je obdeloval sosed. Malo sva se zaklepetala, potem sem pa seksal tudi z njim!\"  \"Prav sinko, tudi to ti bo odpuščeno. Zdaj pa počasi odidi, da se ne bova zaklepetala.\"", CategoryId = 42 },
                new Joke() { Id = 765, Active = true, Title = "Mujo in avtomat", Description = "Pride Mujo na železniško postajo in vidi nov avtomat. Na njemu piše: Ubaci novčič, stavi ovdje ruku I ti mašina kaže, tko si!     Mujo res poskusi in vrže kovanec. Avtomat mu reče: Ti si Mujo, čekaš vlak za Sarajevo.    Ker pa hoče pretentati avtomat, se našminka in spet vrže kovanec. Ti si Mujo, čekaš vlak za Sarajevo.    Potem mora na WC in tam vidi kondomat. Kupi kondom in si ga potegne preko glave in spet vrže kovanec: \"Ti si Mujo I dok glumiš kurca ode ti vlak za Sarajevo.\"", CategoryId = 18 },
                new Joke() { Id = 766, Active = true, Title = "Matrino mleko", Description = "Učiteljica vpraša Janezka: \"Zakaj je materino mleko za dojenčka boljše od kravjega mleka?\"    Janezek: \"Ker je vedno pravilno segreto, ne more se skisati, ker ga ni potrebno iti iskat v trgovino, pa še v lepi embalaži je.\"", CategoryId = 15 },
                new Joke() { Id = 767, Active = true, Title = "Scanje v snegu", Description = "Se Jože zjutraj zbudi, stopi na balkon in v snegu zagleda s scanjem napisano: \"Jože je prasec\"    To ga seveda močno razjezi. Pokliče šefa varnostne službe in mu naroči, naj takoj poišče storilca.    Policaji podpis fotografirajo in vzamejo vzorce urina...    Čez teden dni šef policije poroča rezultate, rekoč: \"Imamo popolne rezultate. V zvezi z njimi vam moram sporočiti eno dobro in eno slabo novico.\"     Jože reče: \"Povej najprej dobro novico!\"    Policaj odvrne: \"Urin je 100% od Hasota.\"    \"Saj sem vedel,\" odvrne Jože.    \"In kakšna je slaba novica?\"    \"Pisava pa je od vaše žene,\" odvrne policaj.", CategoryId = 11 },
                new Joke() { Id = 768, Active = true, Title = "Nova služba", Description = "V zavodu za zaposlovanje se je oglasil brezposelni, tam pa so ga usmerili v podjetje, kjer so potrebovali novo delovno moč njegovega profila.    Med razgovorom z vodjo kadrovske službe je kadrovik povedal: \"Pri nas vsak dan delamo od 7. do 16. ure, delo ni težko, delamo 35 ur na teden in vsi delavci pri nas imajo najmanj 35 dni letnega dopusta. Ste bili v prejšnjih službah kaj odsotni zaradi bolniškega staleža?\"    \"Ja, toda samo enkrat, ko so bi operativno odstranili jajca.\"    \"Kaj? Jajc nimate? Potem pa lahko hodite v službo šele ob 9. uri zjutraj. Pri nas si namreč do devetih praskamo jajca.\"", CategoryId = 29 },
                new Joke() { Id = 769, Active = true, Title = "Na plaži", Description = "Po končani ljubezenski igri na samotni plaži,vpraša mladi Dalmatinec v polomljeni angleščini svojo ljubico:\"Ju finiš?\"    Tudi dekle ni obvladalo angleščine in pravi:\"No, dojč\" ", CategoryId = 27 },
                new Joke() { Id = 770, Active = true, Title = "Ne more zanositi", Description = "Lepa,mlada ženska, leto dni poročena ne more zanositi in pride k zdravniku: \"Prosim,doktor,rada bi imela otroka,pa ne gre.Kaj mi je storiti?\",ga sprašuje.    \"To bomo uredili takoj\", pravi on ,\"slecite se prosim!\"    Mlada žena zardi in pravi: \"Lepo prosim ne... doktor,prvega otroka bo rada imela z možem!\" ", CategoryId = 39 },
                new Joke() { Id = 771, Active = true, Title = "Angeli letijo", Description = "\"Mami, ali res angeli letijo?\"    \"Ja, otrok moj.\"    \"Ampak naša Rozi ne zna leteti!\"    \"Ne, Rozi je naša gospodinjska pomočnica in ne zna leteti!\"    \"Ampak očka ji vedno reče, da je njegov angelček!\"    \"Potem bo pa letela!\" ", CategoryId = 11 },
                new Joke() { Id = 772, Active = true, Title = "Numizmatika", Description = "\"Moj oče je numizmatik!\"    \"Kaj pa je to?    \"To je tisti, ki zbira kovance.\"    \"Včasih takim rekli klošarji!\"", CategoryId = 43 },
                new Joke() { Id = 773, Active = true, Title = "Sveže modrice", Description = "\"Kako pa to, da imaš toliko modric po obrazu?\"    \"Pred dvema meseci sem imel prometno nesrečo.\"    \"Da se modrice tako dolgo poznajo, je pa le malo čudno, se ti ne zdi?\"    \"Pešec, ki sem ga podrl se je šele včeraj vrnil iz bolnišnice.\"", CategoryId = 43 },
                new Joke() { Id = 774, Active = true, Title = "Bled človek", Description = "Na nebeška vrata je potrkalo. Sv. Peter jih je odpel in pred vrati je stal bled moški.    \"Dober dan!\" je rekel. \"Jaz sem To...\" in že je izginil.    Sveti Peter se je začudil in zaprl vrata, toda nekaj sekund kasneje se je ponovilo isto.    \"Dober dan!\" Jaz sem To...\" in človek je izginil.    Sveti Peter se je pritožil Bogu, da se nekdo norčuje iz njega.    \"Ne, ne!\" je dejal Bog. \"Tega moškega poznam! Ime mu je Tomaž in v bolnici ga ravnokar oživljajo!\"", CategoryId = 43 },
                new Joke() { Id = 775, Active = true, Title = "Policaj rešuje križanko", Description = "\"Svečana obleka (4 črke)?\"......... \"Črna!\"    \"Mesto v Italiji (3 črke)?............. \"Trs!\"    \"Ženin brat (4 črke)?\"................ \"Mare!\"    \"Del jedilnega pribora (3 črke)?\"... \"Zob!\"    \"Najmanjše trištevilčno število (3 črke)?\".... \"000!\"    \"Utežna mera (4 črke)?\"............. \"Utež!\"    \"Zdrava pijača (3 črke)?\"........... \"Pir!\"    \"Hladno orožje (3 črke)?\"........... \"Top!\"    \"Neozdravljiva bolezen (4 črke)?\".... \"Smrt!\"    \"Mera za dragocenosti (5 črk)?\"...... \"Denar!\"", CategoryId = 22 },
                new Joke() { Id = 776, Active = true, Title = "Pri spovedi", Description = "Bogdan je prišel s spovedi in rekel župniku:    \"Včeraj sem sedemkrat seksal!\"    \"Si prevaral svojo ženo?\"    \"Ne, seksal sem s svojo ženo!\"    \"To pa ja ni greh! Zato ti pa ne bi bilo potrebno priti k spovedi!\"    \"Ja, nekomu se pa le moram pohvaliti!\" je rekel Bogdan.", CategoryId = 42 },
                new Joke() { Id = 777, Active = true, Title = "Porjavelost", Description = "Živel je moški, ki je zelo lepo skrbel za svojo postavo. Vsak dan je pretekel 10 km, potem je dvigal uteži, se razgibaval, šel v savno in se na koncu še malo posončil na plaži.    Nekega dne, ko se je spet vase - zagledano občudoval v ogledalu, je opazil, da je zelo lepo porjavel, vendar pa je njegov ponos bil povsem bel.    Zato je naslednji dan odšel na plažo, se zakopal v pesek in pustil samo svojega tiča zunaj, da se je ta nastavljal soncu in rjavel.    Čez nekaj časa sta prišli mimo dve zelo stari gospe. Ugledata čudno stvar,ki se je vzpenjala iz mivke in je ena otožno zavzdihnila:  Ko sem bila 20, sem bila radovedna glede tega.  Ko sem bila 30, sem uživala v tem.  Ko sem bila 40, sem spraševala za to.  Ko sem bila 50, sem plačevala za to.  Ko sem bila 60, sem molila za to.  Ko sem bila 70, sem pozabila na to.  In sedaj, ko sem 80, te preklete stvari divje rastejo naokoli kot plevel, jaz pa še počepnit ne morem, da bi ga pobrala!\"", CategoryId = 43 },
                new Joke() { Id = 778, Active = true, Title = "Idealen mož ", Description = "Ko je Bog ustvarjal ženam može ... je ženam obljubil, da bodo lahko dobre in idealne može našle v čisto vsakem kotu sveta.  In potem je naredil Zemljo okroglo.", CategoryId = 11 },
                new Joke() { Id = 779, Active = true, Title = "Služba ", Description = "70-letna  babica okara 25-letno vnukinjo: \"Da boš vedela, jaz sem pri TVOJIH   letih že hodila v službo!\"Vnukinja ji odvrne: \"So what, jaz bom pa pri   TVOJIH", CategoryId = 29 },
                new Joke() { Id = 780, Active = true, Title = "Kri iz nosa", Description = "Vesela druzba sodelavcev  popiva na sindikalni  zabavi.  Le Janez je nekako  neraspolozen in ne pije.  Zato ga sodelavec vprasa:  Kaj ti ne pijes?  Ne.Ce prevec popijem,mi  iz nosa zacne teci kri.  Poznam to.  Tudi jaz sem nekoc  imel tako zeno.", CategoryId = 13 },
                new Joke() { Id = 781, Active = true, Title = "Nadlegovanje", Description = "Tone se pelje s traktorjem  na njivo in dohiti  sosedo Reziko.  Sedi k meni na traktor,  bos hitreje na cilju.  Seveda,da me bos potem  nadlegoval.  Ne bom te,castna beseda.  Zakaj me pa potem vabis k sebi  na traktor.", CategoryId = 27 },
                new Joke() { Id = 782, Active = true, Title = "Sovrazniki", Description = "Ostostrelec prihiti  k polkovniku v kasarno:  Pulkovnik,ustrelil sem  poveljujocega oficirja pri enotah,  ki nas oblegajo s severa.  Kako to mislis?  Sovraznike imamo na jugo,  nasi prijatelji pa so na  severu.  Tam vendar nimamo sovraznikov.  Zdaj jih imamo.", CategoryId = 36 },
                new Joke() { Id = 783, Active = true, Title = "Demokracija", Description = "Maja si je pred pisanjem  kontrolne naloge nalepila listice  po nogah in si je ceznje potegnila  krilo.Med pisanjem naloge je   ucitelj opazil,da si nenavadno  dviguje krilo, in je zato stopil   k njej in rekel;  Kot moski tega nebi smel,  kot profesor pa lahko.  Ter ji dvignil krilo.  Maja ga pogleda in mirno rece;  Kot dijakinja tega nebi smela  kot zenska pa lahko.  In mu primaze klofuto.", CategoryId = 32 },
                new Joke() { Id = 784, Active = true, Title = "Novinarka", Description = "Novinarka slovenskih novic  v bezigrajskem domu starejsih   sprasuje varovanca Korla:  Koliko pa jih stejete,gospod?  On:Ja,draga dama,ze 87 jihbo.  Ona;Nikoli vam nebi dala!  Korel:Saj tako ali tako   nebi mogel.", CategoryId = 43 },
                new Joke() { Id = 785, Active = true, Title = "Kriza", Description = "Gredo pred Boga Anglez, Francoz in Slovenec.   Prvi ga vprasa Francoz:\"Bog, kdaj no konec krize v Franciji?\"  Bog:\" Cez 100 let.\"  Francoz:\"Jaz tega ne bom docakal!\"  Drugi pred Boga stopi Anglez in vprasa:\"Kdaj bo konec krize v Angliji?\"  Bog:\"Cez 200 let.\"  Anglez:\"Jaz tega ne bom docakal.\"  Nazadnje stopi pred Boga se Slovenec in vprasa:\"Kdaj se bo koncala kriza v Sloveniii!\"  Bog:\"Jaz tega ne bom docakal!\"", CategoryId = 43 },
                new Joke() { Id = 786, Active = true, Title = "Janezek in ata", Description = "Pravi Janezek ateju: \" Ata, jaz vec ne zizam, ti  vec ne seksas. Kaj, ce bi midva prodala mamo?\"", CategoryId = 15 },
                new Joke() { Id = 787, Active = true, Title = "Oce in sin ljudozerca", Description = "Gresta ata in sin ljudozerca po ulici in zagledata lepo zensko. Pa pravi ata sinu:\"Ta je pa lustna. Bi jo lahko pojedla!\"  Sin:\" Ne, ata, peljiva jo raje domov in pojejma mamo!\"", CategoryId = 43 },
                new Joke() { Id = 788, Active = true, Title = "Noce jesti", Description = "Oce se razjezi na sina, ko se sprehajata po mestu pa ga prijatelj vprasa zakaj se je razjezil. Oce odgovori:\"Prstek tu, prstek tam, potem pa doma noce jesti!\"", CategoryId = 43 },
                new Joke() { Id = 789, Active = true, Title = "Fata gre sluzit ", Description = "Fata in Mujo sta v financni stiski, zato se odlocita, da bo Fata poskusila zasluziti s prostitucijo. Fata se odpravi na delo in ko se zjutraj vrne domov, jo Mujo vprasa, koliko je zasluzila. Fata:\"101 evro!\"  Mujo:\"kako 101 evro, ne razumem.\"  Fata:\" Evro po evro, pa se nabere!\"", CategoryId = 18 },
                new Joke() { Id = 790, Active = true, Title = "Tasca", Description = "Lojze in Korel sta udarila  po pivu.  Vmes seveda po mosko  debatirata.  Korel:Kako bi ti,opisal,  kaj so to mesani obcutki?  Pojma nimam.  Mesani obcutki so,  ce se tasca ubije za volanom  tvojega novega beemveja.", CategoryId = 17 },
                new Joke() { Id = 791, Active = true, Title = "Tasca", Description = "Koliko je idealna teza tasce?  1,5 kg z zaro vred!", CategoryId = 34 },
                new Joke() { Id = 792, Active = true, Title = "Bucek", Description = "V soli pozvoni telefon.  Glas na oni strani zice:  Danes pa nasega Bucka ne bo v solo.  Ucitelica:Kdo pa klice?  Moj oce,se zaslisi iz slusalke.", CategoryId = 32 },
                new Joke() { Id = 793, Active = true, Title = "Sklece in trebusnjaki", Description = "Koliko sklec naredi Chuck Norris?  Vse!  Koliko pa naredi trebusnjakov?  Se enega vec!", CategoryId = 6 },
                new Joke() { Id = 794, Active = true, Title = "Luna", Description = " Se dve blondinki pogovarjata.  Vprasa prva:\"Kaj je blizje Luna ali London?\"  Druga:\" Normalno, da Luna. Ali lahko London vidis od tukaj.\"", CategoryId = 6 },
                new Joke() { Id = 795, Active = true, Title = "Blondinka nakupuje", Description = "Zakaj gre blondinka v trgovino s pistolo?  Ker na vratih pise AKCIJA!", CategoryId = 4 },
                new Joke() { Id = 796, Active = true, Title = "Tasca gre v klet", Description = "Se srecata dva prijatelja. In prvi vprasa drugega:\"Je kaj novega?\"  Drugi:\"Ja, tasca mi je umrla.\"  Prvi:\" Kaj ji je bilo?\"  Drugi:\" Nic, ko je sla v klet po krompir je  padla po stopnicah.\"  Prvi: \"In kaj ste naredili?\"  Drugi:\" Jedli smo riz.\"", CategoryId = 34 },
                new Joke() { Id = 797, Active = true, Title = "Kino", Description = "Joze gre z prijatelico Tinko v kino,  pred vhodom si kupi  cokolado,med filmom jo odvije  in zacne grizljati.  A je dobra?ga vprasa Tinka.  Jozek:Odlicna.  Skoda,da si je nisi kupila se ti. ", CategoryId = 43 },
                new Joke() { Id = 798, Active = true, Title = "Tasca", Description = "Kosir obupan stece na ulico  in nagovori prvega  mimoidocega pesca:  Poslusajte,prodam tasco,koliko  daste zanjo?  Mimoidoci:Nic!  Kosir:Dogovorjeno,prodano!", CategoryId = 11 },
                new Joke() { Id = 799, Active = true, Title = "Kikiriki", Description = "Kako Chuck Norris je kikiriki?  Tako, da tocno ve, kateri je kiki in kateri riki.", CategoryId = 6 },
                new Joke() { Id = 800, Active = true, Title = "Polozaji", Description = "Se pogovarjajo Anglez, Francoz in Bosanec kateri polozaj imajo najraje pri seksu.  Anglez: Meni je najbolj vsec, da sem jaz na vrhu, da gledam njen angelski obraz.  Francoz: Meni je najbolj vsec, da je ona na vrhu, da lahko obcudujem njene bozanske prsi.  Bosanec: Meni je najbolj vsec od zadaj, da lahko zraven gledam nogometno tekmo.", CategoryId = 27 },
                new Joke() { Id = 801, Active = true, Title = "Crnogorski policaj", Description = "Vprasajo Crnogorca, kaj bi najraje delal pri policiji. Crnogorec odgovori: Bil bi lezeci policaj.", CategoryId = 38 },
                new Joke() { Id = 802, Active = true, Title = "Katastrofa in skoda", Description = "Vprasa uciteljica ucence, naj povedo primer katastrofe.  Janezek: Katastrofa je, ce bi zajec na vrtu pojedel zelje!  Uciteljica: Ne, Janezek, to bi bila skoda. Katastrofa bi na primer bila, ce bi strmoglavilo vladno letalo in bi bili vsi mrtvi.  Naslednji dan je pri pouku prisoten ravnatelj.  Uciteljica ponovno nagovori ucence naj povedo primer katastrofe.  Janezek: Katastrofa bi bila, ce bi strmoglavilo vladno letalo in bi bili vsi clani posadke mrtvi.  Uciteljica: Odlicno, Janezek!  Janezek: Ne bi pa bila to skoda. Skoda bi bila, ce bi zajec na vrtu pojedel zelje.", CategoryId = 32 },
                new Joke() { Id = 803, Active = true, Title = "Zivalski vrt", Description = "V zivalskem vrtu so imeli razpis za sluzbo.   Franc se je prijavil na oglas. Na razgovoru mu je direktor zivalskega vrta razlozil, da iscejo nekoga, ki bo zamenjal majmuna, ki je crknil.  Franc: In kaj bom moral delati?  Direktor: Preoblekel se bos v majmuna in v kletki skakal z veje na vejo.  Franc je sluzbo sprejel. Naslednji dan se je oblekel v majmuna in se vihtel z veje na vejo. Ker se je prevec vzivel v nalogo, je izgubil nadzor nad sabo in se zavihtel v klerko, v kateri je bil lev.   Franc se je v levji kletki zacel dreti na vec glas, ko je lev rekel: Ne deri se tako glasno. Bi rad, da oba zgubima sluzbo.", CategoryId = 41 },
                new Joke() { Id = 804, Active = true, Title = "Zlata jajca", Description = "Mujo in Haso lovita ribe in ujameta gosko, ki jima obljubi, da ce jo spustita bo vsakemu znesla eno zlato jajco. Ko bosta imela jajco, si zazelita tri stvari in vrzeta jajco na tla.  Mujo in Haso ponudbo sprejmeta in se odpravita domov. Mujo pride domov, si zazeli, da bi namesto stare bajte zrasla vila, v kateri bi bilo 100 lepih punci, da bi imel steklenico vina, ki ne bi bila nikoli prazna in da bi imel denarnico, v kateri bi bil vedno denar. Mujo vrze na tla jajco in pred njim stoji vila, v njej je 100 mladih, lepih zensk. V vili je steklenica z vinom, Mujo si nalije vino in steklenica je zopet polna, odpre denarnico, iz nje vzame ves denar in denarnica se zopet napolni. Mujo tako uziva mesec dni, nato pa se le spomni na Hasota in se odloci, da ga obisce.  Ko pride do Hasota, se vedno stoji stara kocura, v njej je 100 moskih z velikimi batinami, v kotu pa Haso joce od obupa.   Mujo: Pa, Haso, pa sta si to ti zazelio.  Haso: Dodem ja kod kuce, pa mislim: fali meni tisocu nekih kuraca, kad mi izpadne jaja. ", CategoryId = 18 },
                new Joke() { Id = 805, Active = true, Title = "Bill Gates lovi ribe", Description = "Bill Gates je lovil ribe in ujel zlato ribico ter jo vrgel nazaj v vodo. Zlata ribica je skocil iz vode: kaj pa tri zelje?  Bill Gates: Ja, povej, kaj bi rada mela!", CategoryId = 41 },
                new Joke() { Id = 806, Active = true, Title = "Orgazem", Description = "Mami, mami kaj je to orgazem?  Ne vem, vprasaj ateja.", CategoryId = 11 },
                new Joke() { Id = 807, Active = true, Title = "Kit", Description = "Mujo in Haso lovita ribe in ujameta zlatega kita.   Kit: Ce me spustita, vama izpolnem tri zelje.   Mujo in Haso: Jebes ti tri zelje, ti gres z nama k zlatarju.", CategoryId = 18 },
                new Joke() { Id = 808, Active = true, Title = "Zivljenjska doba", Description = "Zakaj zenske zivijo v povprecju 7 let dalje od moskih?   Zato ker toliko casa porabijo za parkiranje.", CategoryId = 40 },
                new Joke() { Id = 809, Active = true, Title = "Skripanje v zakonu", Description = "V vsakem zakonu kdaj pa kdaj zaskiplje.   Najbolje pa je da skriplje postelja.", CategoryId = 11 },
                new Joke() { Id = 810, Active = true, Title = "Sank", Description = "Zakaj moski umrejo prej kot zenske?  Ker cas za sankom hitreje tece!", CategoryId = 17 },
                new Joke() { Id = 811, Active = true, Title = "Adam in sreca", Description = "Zakaj je bil Adam najsrecnejsi moski?  Ker ni imel tasce!", CategoryId = 5 },
