                new Joke() { Id = 878, Active = true, Title = "Pod tusem", Description = "Se dve najstnici tusirata in prva pravi drugi: Tvoji opicji glavi pa so ze pognali laseki.  Druga odgovarja: To ni se nic, tudi banane ze je!", CategoryId = 27 },
                new Joke() { Id = 879, Active = true, Title = "Korel in Polde", Description = "Korel in Polde bi na Hrvasko.  Prideta do meje,ko ugotovita,  da sploh nimata potnih listov.  Nekaj casa gruntata,nakar se  odlocita,da se bosta zaprla v  zaboje na bliznjem tovornjaku.  Na meji.Policija potrka po enem  od zabojnikov.  Oglasi se Korel in zakurika.  Policija gre dalje,mislec,  da so v njem res kokosi.  Potrka se na zadnji zaboj.  Glej ga,zlomka,v njem je Polde.  Ta se oglas:  Tukaj krumpir.  ", CategoryId = 14 },
                new Joke() { Id = 880, Active = true, Title = "Moderni zakon", Description = "Mladi par se poroci.  Prvo noc se ne zgodi nic,drugo,  tretjo noc nic in tako   mesec dni.  Pa rece nevesta:  Zdaj grem na cesto in pripeljem  v posteljo prvega,ki ga srecam.  Moz ji ponizno odgovori:  Prosim,pripelji se meni enega.", CategoryId = 11 },
                new Joke() { Id = 881, Active = true, Title = "Dobrota moskega sveta", Description = "Ko nag moski vstopi v zensko  garderobo,zacnejo zenske vpiti  nanj in ga rinejo ven.  Ko pa naga zenska vstopi v mosko  garderobo,so vsi moski veseli  in gostoljubni.  Kaj govori vse to?  To jasno pokaze vso dobroto  moskega srca", CategoryId = 17 },
                new Joke() { Id = 882, Active = true, Title = "Prisrcen sprejem", Description = "Moz se vrne s sluzbene poti  in najde zeno,kako pripravlja  romanticno vecerjo za dva.  O,to je pa presenecenje!  pripomni zadovoljno.  Zena:  Ja,pa res.Nisem te pricakovala  pred petkom.", CategoryId = 11 },
                new Joke() { Id = 883, Active = true, Title = "Spis", Description = "Učiteljica: \"Peter, tvoj spis o vašem psu Rolfiju je popolnoma enak, kot od tvojega brata. Ali si ga prepisal?\"    Peter: \"Ne, nisem ga prepisal, samo pes je isti.\"", CategoryId = 32 },
                new Joke() { Id = 884, Active = true, Title = "Odkrivanje Amerike", Description = "Učitelj: \"Marija, na zemljevidu poišči Severno Ameriko.\"    Marija: \"Tukaj je.\"    Učitelj: \"Zelo dobro. Razred, kdo je odkril Ameriko?\"    Razred v en glas: \"Marija.\"", CategoryId = 32 },
                new Joke() { Id = 885, Active = true, Title = "Črkovanje", Description = "Učitelj: \"Janezek, kako črkuješ besedo petdeset?\"    Janezek: \"P-E-D-E-S-E-T\"    Učitelj: \"Napačno!\"    Janezek: \"Ampak, vprašali ste me kako jo JAZ črkujem.\"", CategoryId = 32 },
                new Joke() { Id = 886, Active = true, Title = "Govorjenje", Description = "Kako pravimo osebi, ki govori tudi po tem, ko nismo več zainteresirani?    Učitelj!", CategoryId = 32 },
                new Joke() { Id = 887, Active = true, Title = "Priprava za posteljo", Description = "Ne morem razumeti ljudi, ki pravijo, da se pripravljajo za v posteljo.    Jaz sem vedno pripravljen za v posteljo.", CategoryId = 43 },
                new Joke() { Id = 888, Active = true, Title = "Božiček", Description = "Božiček je obstajal.    Potem pa je, nekega dne, pozabil Chucku Norrisu nesti darilo.", CategoryId = 6 },
                new Joke() { Id = 889, Active = true, Title = "Bosanc v gozdu", Description = "Gre bosanec v gozd in ga začne lovit medved pa spleza bosanec na bukev pa začne govorit: \"mama pomagaj mi\"    Reče bukev \"sve je v redu sine, tata se samo šali\"", CategoryId = 3 },
                new Joke() { Id = 890, Active = true, Title = "Težave z zanositvijo", Description = "Prvo leto zakona, 60 letnega bogatega gospoda z mlado ženo, je bilo vse v najlepšem redu.    Potem je nekega dne gospod odšel k zdravniku:  - Želiva imeti otroka, ampak bolj ko se trudiva, nama nikakor ne uspe!  - V Vaših letih je to pogost pojav, zato Vam svetujem, da vzamete podnajemnika.    Tri mesece kasneje pride gospod k zdravniku in se pohvali:  - Hvala vam za nasvet, moja žena je noseča.  - No, a sem Vam rekel? Kako je pa kaj podnajemnik??  - Tudi ona je noseča!", CategoryId = 11 },
                new Joke() { Id = 891, Active = true, Title = "Vedno isto kosilo", Description = "- Bemti, vsak dan isto za kosilo!!! Daj, sine, pojdi in reci mami, da ima kuharska knjiga čez 200 strani!  - Oči, sem že povedal.  - In,... kaj je rekla???  - Da ima Kamasutra tud toliko strani!", CategoryId = 11 },
                new Joke() { Id = 892, Active = true, Title = "Sabljanje", Description = "V dnevni sobi se dva geja sabljata z lulčki.  Po dvajsetih minutah se en od niju ves zmatran skloni in reče:  \"Ne morem več, ubij me!\"", CategoryId = 27 },
                new Joke() { Id = 893, Active = true, Title = "Nevednost", Description = "Če bi ženske vedle, koliko stanejo traktorji, ne bi več palile na šminkerske BMW-je in Mercedese.", CategoryId = 40 },
                new Joke() { Id = 894, Active = true, Title = "Začetek zgodbe", Description = "Zakaj je črnogorec postal len?    Bosanc mu je rekel \"sedi, da ti nekaj razložim\"", CategoryId = 3 },
                new Joke() { Id = 895, Active = true, Title = "Umor ptice", Description = "Kako je blondinka poskusila ubiti ptico?    Vrgla jo je v prepad.", CategoryId = 4 },
                new Joke() { Id = 896, Active = true, Title = "Definicije", Description = "AVTOBUS - vozilo, ki gre dvakrat hitreje kadar tečete za njim, kot če se v njem peljete  PULOVER - oblačilo, ki ga mora nositi otrok, kadar mamo zebe  PLES - vertikalna projekcija horizontalne želje  EKONOMIST - ekspert, ki bo jutri vedel, zakaj se tisto, kar je včeraj predvidel, ni zgodilo danes  GINEKOLOG - oseba ki dela tam kjer se drugi zabavajo  INTELEKTUALEC - oseba, ki je dve uri v stanju misliti še na kaj drugega razen na seks  MIGRENA - največkrat uporabljena kontracepcija pri ženskah  ZAKON - skupnost v kateri dva rešujeta probleme, ki jih ne bi imela, če bi ostala samska  ZOBOZDRAVNIK - čarovnik, ki vam v usta vstavlja tisto, kar vam je pobral iz žepa  PESIMIST - optimist, ki ima izkušnje  PROGRAMER - oseba, ki na nepojasnjen način reši probleme, za katere nisi vedel, da si jih imel  PSIHOLOG - oseba, ki gleda ostale, ko v prostor stopi lepa ženska  BUDILKA - inštrument, ki je bil narejen za bujenje tistih, ki nimajo majhnih otrok  ZVEZDA - oseba, ki celo življenje težko dela, da bi bila slavna, ko pa to doseže, nosi velika črna očala, da bi je nihče ne prepoznal", CategoryId = 43 },
                new Joke() { Id = 897, Active = true, Title = "Spat je treba", Description = "Mama je sina za kazen predčasno poslala v posteljo, toda kmalu se je sin zadrl:  \"Mami!\"  \"Kaj je?\"  \"Žejen sem! Prinesi mi kozarec vode!\"  \"Nič ne bo! Ugasni luč in zaspi!\"  \"Mami!\" se je še bolj zadrl.  \"Kaj je spet?\"  \"Žejen sem! Ali grem lahko sam popit kozarec vode?\"  \"Rekla sem, da bodi tiho in zaspi! Če ne boš dal miru in se boš še enkrat oglasil, boš dobil batine!\"  \"Mama!\"  \"Kaj?\"  \"Ko boš prišla v mojo sobo, da mi daš batine, mi prosim prinesi še kozarec vode!\"", CategoryId = 11 },
                new Joke() { Id = 898, Active = true, Title = "Zadnji preizkus", Description = "V srednji šoli profesorica napoveduje zadnji preizkus znanja v šolskem letu: \"Nihče ne sme manjkati! Ni opravičila, razen za težje bolezni ali smrt v ožji družini.\"    Seveda se vedno najde kakšen pameten provokator v zadnji klopi: \"Kaj pa v primeru seksualne izčrpanosti?\".    Smeh v razredu.    Profesorica mrtvo hladno: \"Boš pa z drugo roko pisal.", CategoryId = 32 },
                new Joke() { Id = 899, Active = true, Title = "Predsedniški govor", Description = "So olimpijske igre pa ima bosanski predsednik govor.    Pa govori:\"ooo...ooo\".    Pa ga vsi čudno gledajo.Pa pride do njega njegova žena,pa gleda v besedilo,pa mu reče:\"Ne moj muž,ovo so olimpijski krugovi\"!", CategoryId = 23 },
                new Joke() { Id = 900, Active = true, Title = "Fant in dekle prvič skupaj na morju", Description = "Ko ga ona zagleda v kopalkah, mu reče: \"Oh, kakšna ramena!\"     \"Na služenju vojaškega roka sem nosil strojnico\" je povedal fant.     \"Pa kakšna močna, mišičasta stegna imaš!\" ga je pohvalila.     \"Ja, veš, v vojski smo veliko pešačili.\"     Zvečer ga je prvič videla popolnoma golega.     \"Lulali ste pa v vojski bolj malo, kajne?\"", CategoryId = 11 },
                new Joke() { Id = 901, Active = true, Title = "Janezek in mamin ljubimec v omari", Description = "Žena in njen ljubimec se predajata strastem v spalnici, ko mimo nje pride ženin 9-letni sin Janezek.  Brez da ga parček opazi, se Janezek skrije v omaro in ju gleda.    Nenadoma pride domov mož. Moški skoči iz postelje in se skrije v omaro, kjer naleti na Janezka.  Janezek začne: ”Mater je temno tuki.”  Ljubimec: ”Ja pa je res.”  Janezek:”Imam fuzbal žogo..kupiš?”  Ljubimec: ”Ne, hvala.”  Janezek: ”Moj oče je zuni..”  Ljubimec: ”Kolk hočeš za njo?!”  Janezek: ”250 evrov.”  Ljubimec kupi žogo in sin je tiho do odhoda očeta, ko lahko ljubimec pobegne.    Čez par tednov znova nastane ista situacija, znova naletita drug na drugega v omari.  Janezek:”Mater je temno tuki..”  Ljubimec odvrne ”Ja, pa je res.”  Janezek: ”Kupiš kopačke?”  Ljubimec, vedeč kaj se zgodi, če jih ne: ”Koliko hočeš za njih?”  Janezek: ”500 evrov.”  Ljubimec jih kupi in sin je znova tiho.    Naslednji dan oče povabi Janezka igrat nogomet. Pove mu, da nima kopačk in žoge. Na očetovo vprašanje, kam jih je dal odvrne, da jih je prodal. ”Za koliko?” vpraša oče. ”750 evrov” odvrne. Oče ga karajoče pogleda. ”To ni vredu, sine. to je preveč. Nekoga si grdo nategnil. Greva v cerkev, to je greh.”    In tako gresta v cerkev. Janezek vstopi v spovednico in zamrmra:  ”Mater je temno tuki.”  Župnik: ”Pa ne me jebat, a spet ti!?!”", CategoryId = 27 },
                new Joke() { Id = 902, Active = true, Title = "Mož zasači ženo v postelji s črncem", Description = "Mož se je predčasno vrnil domov in pri ženi v spalnici odkril črnca.    \"Zdaj imam pa črno na belem, da me varaš!\" je vzkliknil mož.", CategoryId = 27 },
                new Joke() { Id = 903, Active = true, Title = "Pračlovek", Description = "Zakaj je pračlovek svojo žensko vlekel za lase?    Če bi jo vlekel za noge, bi imela pizdo polno prahu in zemlje.", CategoryId = 43 },
                new Joke() { Id = 904, Active = true, Title = "Moski in E.T.", Description = "Kaksna je razlika med moskim in E.T.jem?  E.T. Poklice domov.", CategoryId = 17 },
                new Joke() { Id = 905, Active = true, Title = "Kokosi", Description = "Se pogovorjata dve kokosi.  Nekam zalostna se mi zdis danes. Je kaj narobe?  Ja, vrocina me kuha.  Si si jo izmerila?  Ne. Ze tri dni nesem kuhana jajca!", CategoryId = 41 },
                new Joke() { Id = 906, Active = true, Title = "Rešitelj", Description = "Dva prijatelja se pogovarjata.    Prvi: \"Danes sem eno luštno punco rešil pred posilstvom!\"    Drugi: \"Kako?\"    Prvi: \"Samokontrola, prijatelj, samokontrola.\"", CategoryId = 43 },
                new Joke() { Id = 907, Active = true, Title = "Želi si, da bi bil policaj", Description = "Pripelje mama sina na policijsko postajo in reče: \"Želim, da bi moj sin bil policaj.\"    Zakaj pa, gospa, vpraša policaj.     Zato, ker je neumen, mu odvrne mama.     To pa morate dokazati ...     Sine, pojdi pogledat, če je tvoja mami zunaj, reče gospa.     Sin gre ven in pogleda, nato pa policaj reče:     Je pa res neumen, lahko bi tudi čez okno pogledal!", CategoryId = 22 },
                new Joke() { Id = 908, Active = true, Title = "Če bo na aparatih", Description = "Včeraj zvečer sva z ženo sedela na kavču in se pogovarjala o življenju.    Pogovor je nanesel tudi na pomen dostojanstva človeškega življenja, pa sem ji rekel:     \"Draga, če bi se meni kdaj zgodilo, da bi bil v stanju vegetiranja, odvisen od aparatov in tekočin, prosim, da odklopiš vse tisto, kar bi me ohranjalo pri življenju.\"     Žena je v trenutku vstala, izklopila televizijo in mi vzela pivo. ", CategoryId = 11 },
                new Joke() { Id = 909, Active = true, Title = "Žene debatirajo o svojih moških", Description = "Štiri prijateljice so se pogovarjale o svojih soprogih.    \"Jaz sem pri svojem možu našla ženske spodnje hlačke!\" je rekla prva.    \"Jaz pa sem v njegovem suknjiču odkrila fotografijo, na kateri je v družbi s pomanjkljivo oblečeno žensko\" je rekla druga.    \"Jaz sem pa svojemu preluknjala kondom!\" se je oglasila še tretja.    Ob zadnjih besedah je četrta padla v nezavest.", CategoryId = 40 },
                new Joke() { Id = 910, Active = true, Title = "Po tampone je šel", Description = "Nek moški je iskal pomoč v trgovini in je vprašal prodajalko, kje so tamponi. Ta mu razloži in moški jih gre iskat.     Nakar pride do blagajne s polnim velikim vozičkom vate in zavojem vrvice.     Pa ga prodajalka začudeno gleda in vpraša, če ni našel tamponov.       Pa reče moški: \"Včeraj sem poslal ženo po škatlico cigaret, pa mi je prinesla tobak in papirčke, ker je to VEEELIKO CENEJE. Pa sem si rekel, če moram jaz zvijat svoje, pa naj še ona zvija svoje.", CategoryId = 17 },
                new Joke() { Id = 911, Active = true, Title = "Pohvali se, da je dobro izpadlo", Description = "Žena pogosto gnjavi moža, češ da mu nič ne uspe v življenju.    Nekega dne, po obilnem kosilu pa se mož, ko čuti, da je žena dobre volje, ojunači in reče:     \"Žena, dve stvari pa sta mi v življenju zelo dobro izpadli!\"     \"Kaj le?\" vpraša žena.     Mož odgovori: \"Zobje in lasje!", CategoryId = 11 },
                new Joke() { Id = 912, Active = true, Title = "Kupil je kmetijo na gorensjekm", Description = "Uspešen poslovnež živi izjemno stresno življenje v mestu in nekega dne se odloči temu narediti konec. Vzame vse svoje prihranke in kupi veliko kmetijo nekje na samem na Gorenjskem.    Po par mesecih prijetnega življenja v samoti zasliši bobnenje kopit pred svojo hišo. Pograbi lovsko puško in jo usmeri proti moškemu na konju.    \"Počasi, počasi, sosed,\" mu reče moški. \"Posprav puško. Jaz sem tvoj sosed. Moja kmetija je samo 10 kilometrov stran in rad bi te povabil na zabavo za dobrodošlico, ki ti jo bom priredil naslednjo soboto. Imeli bomo glasbo, plesalo se bo, objemalo, poljubljalo, pilo, teplo … Skratka, super žur.\"    Ker noče biti nesramen, spusti puško in vpraša: \"Aha, no, kako pa naj se oblečem za ta super žur?\"    \"Hja, kokr češ,\" mu odgovori, \"itak bova samo jst in ti.\"", CategoryId = 12 },
                new Joke() { Id = 913, Active = true, Title = "Lakota", Description = "V ljudozerski vasi je vladala lakota, noben tujec ni prisel v vas, skratka ni bilo kaj jesti. Zaradi tega so se ze spravili na kosti.  Prvi ljudozerec pravi drugemu: Daj mi malo kosti, da jo vsaj polizem.  Drugi: Ne dam ti.  Daj no, prosim.  Ne dam ti, sem prevec lacen.  Dobro, saj bo meni tudi umrla mama, pa jaz tebi tudi ne bom nic dal vstran.", CategoryId = 9 },
                new Joke() { Id = 914, Active = true, Title = "Počasi bodo trije", Description = "Mož sedi pred televizijo, ko do njega pristopi žena. Prične ga masirati, medtem pa mu šepne na uho: \"Dragi, nekaj ti moram povedati. Kmalu ne bova več sama v hiši … trije bomo!\"    Mož se navdušeno ozre proti njenemu trebuščku, ga poboža ter pravi: \"Ljubica, naj te poljubim. Kako veš?\"    Žena še malo tišje reče: \"Zjutraj me je klicala mami in rekla, da pride na večdnevni obisk\".", CategoryId = 11 },
                new Joke() { Id = 915, Active = true, Title = "Klepetanje", Description = "\"Janezek, ti pa preveč klepetaš.\"     \"To je pri nas družinska tradicija.\"     \"Kako to misliš?\"     \"Dedek je bil učitelj, ata je pa pevec.\"     \"Kaj pa mama?\"    \"Ona je pa itak baba.\"", CategoryId = 15 },
                new Joke() { Id = 916, Active = true, Title = "Mladoporočenca na Havajih", Description = "Mladoporočenca sta na poročnem potovanju, prispeta na Havaje.     Po nekaj dneh zvečer delata načrt za drugi dan. On bi šel na bazen, ona pa raje na kak izlet po otoku. Beseda da besedo in pride do prvega prepira.      On: \"Če ne bi bilo mojega denarja, midva sploh ne bi bila na Havajih!\"      Ona: \"Če ne bi bilo tvojega denarja, ne samo da MIDVA ne bi bila na Havajih, MIDVA ne bi bila niti na poročnem potovanju, sploh pa ne bi bilo nobenega MIDVA!\"", CategoryId = 11 },
                new Joke() { Id = 917, Active = true, Title = "Zmanjkalo mu je en cent", Description = "Človek pride v salon Mercedes, na mizo položi torbico z denarjem, da bi kupil avto znamke Mercedes.      Blagajničarka prešteje denar, vendar mu manjka 1 cent.      Jezen gre iz salona, stopi do berača in mu pravi: \"Daj mi prosim en cent, da kupim mercedesa.\"      Berač mu pomoli dva centa: \"Evo ti dva, pa kupi še meni enega.\"", CategoryId = 43 },
                new Joke() { Id = 918, Active = true, Title = "Mujo in državljanstvo", Description = "Mujo na upravni enoti zaprosi za slovensko državljanstvo.    Po končanem postopku vpraša uslužbenko:    \"Na katerem okencu pa dobim slovenske značilnosti?\"    \"Prosim?\"    \"Saj veste: jamranje, nevoščljivost...\"", CategoryId = 18 },
                new Joke() { Id = 919, Active = true, Title = "Preprečila bi ločitev", Description = "Vinko se je odločil, da se bo ločil od svoje žene Polonce. Njena mati jo je vprašala: \"Polonca, pa si res poskusila vse, da bi ga prepričala, da ostaneta skupaj?\"     \"Vse, mama, vse! Niti en krožnik ni ostal cel!\"", CategoryId = 11 },
                new Joke() { Id = 920, Active = true, Title = "Malo, a poživi", Description = "Mož jo ogleduje in reče: \"Moja tajnica ima tudi tako, toda s pet centimetrov globjim dekoltejem. Saj ni veliko, toda poživi!\"    Naslednjič žena kupi novo krilo in ga pokaže možu.     Mož si ga zopet ogleda in reče: \"Moja tajnica ima prav tako krilo, toda deset centimetrov krajše. Saj ni veliko, toda poživi.\"    Zvečer v spalnici opravljata zakonsko dolžnost, ko se oglasi žena:    \"Sosedov Francelj ima tudi takega, toda deset centimetrov daljšega. Saj ni veliko, toda poživi!\"", CategoryId = 11 },
                new Joke() { Id = 921, Active = true, Title = "Blondinka in puzzle", Description = "Blondinka pokliče svojega fanta v službo: \"Dragi, tu imam ene puzzle, ampak mi zlaganje ne gre in ne gre. Vsi deli izgledajo enaki.\"    Njen fant pravi: \"Imaš sliko?\"    \"Ja, na škatli je narisan en rdeči petelin. Ampak vseeno ne gre.\"    Fant: \"Ne vznemirjaj se, bova zvečer skupaj poskusila.\"    Zvečer si fant ogleda škatlo. Sledi dolg pomenljiv molk in nato reče: \"Tako, zdaj bova pa te koruzne kosmiče lepo pospravila nazaj v škatlo, potem pa nobene besede več o tem.\" ", CategoryId = 4 },
                new Joke() { Id = 922, Active = true, Title = "Poskusite juho", Description = "\"Poskusite juho!\" je rekel gost.      \"Je prevroča ali prehladna?\"      \"Poskusite juho!\" je spet vztrajal gost.      \"Je preslana?!\"      \"Poskusite juho!\" je zakričal gost.      Natakar: \"Aja, žlice nimate!\"", CategoryId = 13 },
                new Joke() { Id = 923, Active = true, Title = "Napaka pri plači", Description = "Janez pride s plačilnim listom v šefovo pisarno: \"Šef, pri seštevanju ste se zmotili in mi nakazali 200 evrov premalo.\"      \"Vem,\" pravi šef, \"prejšnji mesec sem se tudi zmotil in ti nakazal 200 evrov preveč. Takrat se pa nisi pritožil.\"      Janez: \"Poglejte, ena napaka se še oprosti, ampak dve so pa že preveč!\"", CategoryId = 29 },
                new Joke() { Id = 924, Active = true, Title = "Znorel je", Description = "\"Zadnjič sem pa čisto ponorel...\"     \"Ja, kaj pa je bilo?\"     \"Pridem domov in najdem soseda na ženi.\"     \"Aha, in potem si znorel?\"    \"Ah, kje pa. Kaj pa naj reva počne. Mene cele dneve ni, ker delam, in ko se vrnem, sem utrujen, padem in zaspim. Naj si da duška.\"    \"Kaj pa je bilo potem?\"    \"Grem v sobo od hčere in jo najdem z dvema.\"    \"Aha, to je bilo.\"    \"Ne, ne. Saj mora punca eksperimentirati, bo potem bolj umirjena.\"    \"Grem v sobo od mulca in si ravno iglo v žilo rine.\"    \"In potem si imel dosti?\"    \"Kje pa. Sem si mislil, da je to nekaj modernega in da pač mora tako biti.\"    \"Ja, kaj pa je bilo potem?\"    \"Pridem v dnevno sobo, nobenega tam, radiator pa na maksimumu in prižgana luč... pol se mi je pa čist utrgal!!!\"", CategoryId = 12 },
                new Joke() { Id = 925, Active = true, Title = "Prepozno je prišel domov", Description = "Jure je prišel s potepanja s prijatelji prepozno domov. Pred vrati ga je pričakal oče in se razjezil: \"Obljubil si mi, da boš ob osmih doma!\"     \"Ja, očka, res sem obljubil\"     \"Jaz pa sem ti obljubil, da boš tepen, če boš zamudil!\"     \"Ja, res je, očka! Ampak če jaz nisem držal besede, je tudi tebi ni treba!\"", CategoryId = 11 },
