                new Joke() { Id = 939, Active = true, Title = "3oo % impotenten", Description = "Pepca na stopniscu sreca sosedo  Stefko.  Nemudoma ji potozi:  Ves,moj Ferdo je ze 300 odstotno  impotenten.  Soseda:Kako 300,se vceraj si mi  zaupala,da je 100 odstotno?  Pepca:Ze,ampak sinoci je padel  po stopnicah in si zlomil  sredinec ter pregriznil jezik.", CategoryId = 27 },
                new Joke() { Id = 940, Active = true, Title = "Cigani se hvalijo", Description = "Berto, Stojan in Branimir se pogovarjajo v romski beznici.  Sama hvala jih je.    Prvi: \"V petnajstih dneh sem dal dol 35 kilogramov.\"    Se pohvali Stojan: \"Kaj to, jaz sem jih v devetih dneh 40.\"    Branimir je še boljši: \"Kar 40 kilogramov sem dal dol v osmih dneh!\"    Natakar, ki vse to posluša, ne more brez komentarja: \"Lažete, nemogoče je v tako kratkem času toliko shujšati! Poleg tega se vam sploh ne vidi.\"    Nakar vsi trije v en glas: \"Idiot, kdo pa govori o hujšanju? Mi smo se pogovarjali o bakrenih žlebovih.\"", CategoryId = 7 },
