                new Joke() { Id = 945, Active = true, Title = "Ocenas", Description = "Luka iz cerkve,kjer je bil  pri spovedi,prijoka domov.  Mama ga vprasa:  Ja kaj pa je?  Zupnik mi je narocil,naj  zmolim tri ocenase,jaz  znam pa samo enega.", CategoryId = 11 },
                new Joke() { Id = 946, Active = true, Title = "Dlake", Description = "V soli.Ucitelica pise z levo roko   po tabli,ko Bucek vsklikne:  Ucitelica,nimate dlak pod  levo pazduho!  Ona:Bucek,pospravi stvari in pojdi  domov za danes.  Naslednji dan ucitelica med razlaganjem  snovi dvigne desno roko in Bucek  kajpak opazi,da pod pazduho nekaj manjka.  Njej prekipi:Bucek,pospravi stvari  in ostani doma do konca tedna.  Naslednji teden je Bucek znova  v soli,ko uciteljici pade iz rok kreda.  Nagne se,da bi jo pobrala.  Nagne se tudi Bucek,a hip zatem vstane  in zacne pospravljati stvari  Uciteljica ga zacudeno vprasa:  Kam pa ti?  Bucek:Zame je solsko leto koncano.", CategoryId = 32 },
