                new Joke() { Id = 950, Active = true, Title = "Blondinka na zmenku", Description = "Blondinka gre na zmenek z novim fantom. Po obisku kina fant zapelje na zapuščeno parkirišče, kjer se začneta mečkati.    Ker so stvari postale dokaj vroče, jo fant ogovori: \"A bi rada šla na zadnji sedež?\"    \"Ne.\" odgovori blondika.    Situacija se še bolj razvname in fant ponovno vpraša, če bi želela na zadnji sedež.    \"Ne, nočem na zadnji sedež!!\" začne ipično kričati blondinka.    Fant: \"Zakaj ne?\"     Blondinka: \"Ker bi rada ostala tu spredaj, s tabo.\"", CategoryId = 4 },
                new Joke() { Id = 951, Active = true, Title = "Pijana na cesti", Description = "Dva pijana prijatelja se vozita po cesti.    Šofer, koma pijan: \"Daj odlepi nalepke iz pivovskih flaš, pa nama jih nalepi na čelo.\"    Sopotnik takoj uboga in nalepi etikete obema na čelo in še na vsako lice po eno.    Nedolgo zatem ju ustavi policija.    Policaj: \"Prometno in vozniško, prosim.\"    Šofer, opotekajoče: \"Izvolijo.\"    Policaj: \"Gospod, ali ste kaj popil?\"    Šofer: \"Ne, nisem. Niti videl nisem alkohola!\"    Policaj: \"Kaj pa imate to nalepljeno na čelu?\"    Šofer obmolkne, nakar se oglasi sopotnik: \"Oba sva alkoholika, pa sva si nalepila obliže.\"", CategoryId = 21 },
