                new Joke() { Id = 966, Active = true, Title = "Pacient", Description = "Pride pacient k čedni sestri na odvzem krvi. Dogovorita se, da bo kri dal iz prsta...  Sestra piči v prvi prst... nič  Piči v drugega.... nič  Piči v tretjega, spet nobene krvi....  Sestra vzame prst v usta in močno potegne vase in kri priteče iz prsta.  Pacient vse to gleda in reče: \"Sestra ravnokar sem se spomnil, da mi je zdravnik rekel naj dam tudi vodo.\"", CategoryId = 39 },
