                new Joke() { Id = 971, Active = true, Title = "Klofuta pri maši", Description = "Župnik sprašuje Micko:  \"Mici, zakaj ste pa možu sredi maše primazali klofuto?\"  \"Gospod župnik, res se vam opravičujem,  ampak zadosti sem ga imela, ker me je  pogledal vsakokrat, ko ste rekli: \"In reši nas vsega hudega!\"", CategoryId = 42 },
                new Joke() { Id = 972, Active = true, Title = "Strojna fakulteta", Description = "Profesorski zbor Strojne fakultete so odpeljali na letališče in jih posadili v letalo.  Ko so vsi posedli, so jim po zvočniku povedali:  \"To letalo so v celoti konstruirali študenti naše Strojne fakultete.\"  Profesorji poskačejo pokonci in v paniki zbežijo iz letala, samo eden obsedi.  Vprašajo ga, kako to.  Pravi: \"Če so ga konstruirali naši študenti, zagotovo ne bo niti štartal.\"", CategoryId = 26 },
                new Joke() { Id = 973, Active = true, Title = "Partizani v zasedi", Description = "Čakajo partizani nemce v zasedi.  Mine 1 ura nič.  Minejo 2 ure, še vedno nič.  Minejo 3 ure pa še vedno nič.  Pa se oglasi en partizan: \"Menda se jim ja ni kaj zgodilo\".", CategoryId = 36 },
