                new Joke() { Id = 975, Active = true, Title = "Uspešni poslovneži", Description = "Učitelj: \"Gospod Novak je uspešen poslovnež. Janezek, povej mi ta stavek v prihodnjem času.\"  Janezek: \"Gospod Novak je v arestu.\"", CategoryId = 23 },
                new Joke() { Id = 976, Active = true, Title = "Moški in nogomet", Description = "Ženska na sodišču.  Sodnik:\" Priznate,da ste ustrelili moža med gledanjem nogometne tekme?\"  Ženska:\" Priznam.\"  Sodnik:\" Katere so bile njegove zadnje besede?\"  Ženska:\" Streljaj,streljaj!\"", CategoryId = 37 },
