                new Joke() { Id = 978, Active = true, Title = "Znižanje cene", Description = "Pride Gorenjc domov ves besen in pojamra ženi:  - A veš, da se je pocenil autobus za petdest centov.  - Pa zakaj si potem jezen?  -Zato, ker bom manj prišparal, ko bom šel peš.", CategoryId = 12 },
