                new Joke() { Id = 1044, Active = true, Title = "Blondinka ", Description = "Kaj pomeni, ce vidis blondinko, ki ima eno boso nogo?  Da je racunala do 15!", CategoryId = 4 },
                new Joke() { Id = 1045, Active = true, Title = "Regrat", Description = "Ali ves, zakaj Gorenjci jedo regrat sele ko dobi rumene cvetove?  Da jim na solato ni treba rezati jajc.", CategoryId = 12 },
                new Joke() { Id = 1046, Active = true, Title = "Mujo Slovenec", Description = "V šoli se učenci pogovarjajo o svojem izvoru.  In vpraša učiteljica malega Mujota:  Mujo kje si ti rojen?  Mujo: V Kopru.  Učiteljica: Torej si Slovenec Mujo?  Mali Mujo: Seveda.  Čez 5 sekund se sliši iz zadnje vrste glas malega Janezka:  Gospa učiteljica, to torej pomeni, da če je osel rojen v Lipici,  je potem Lipicanec?", CategoryId = 18 },
                new Joke() { Id = 1047, Active = true, Title = "Dieta", Description = "Kaj je to uravnovešena dieta?    Kos torte v levi in desni roki. ", CategoryId = 43 },
                new Joke() { Id = 1048, Active = true, Title = "Sina pelje v šolo", Description = "Janez pelje sina v šolo. Preden gre Miha v šolo, ga oče povabi na en sok v gostilno čez cesto.    Ko sedita na terasi se mimo pripelje zjahan Clio star 15 let.    Miha vpraša očeta: \"Oči, kdo je ta stric?\"    Oče odgovori: \"To je Franc, garač in poštenjak ki že celo živjenje gara in ni nikdar prekršil nobenega pravila.\"    Nakar se mimo pripelje velik svetleč mercedes.    Miha vpraša očeta: \"Oči kdo je pa ta stric?\"    Oče odgovori: \"To je sin od Zokija, nikoli v življenju ni nič kaj pametnega delal. Ogoljufal je veliko ljudi in krši vsa pravila.\"    Miha se zamisli in reče: \"Oči, ko bom velik bom sin od Zokija.\" ", CategoryId = 43 },
                new Joke() { Id = 1049, Active = true, Title = "Ženska nepotrpežljivost", Description = "Kako vemo, da so ženske zelo nepotrpežljive?    Lepo ji poveš, da prideš čez 5 minut, potem te pa vsakih 15 minut vseeno kliče.", CategoryId = 40 },
                new Joke() { Id = 1050, Active = true, Title = "Denar", Description = "Denar ni vse.    Tu je še Mastercard in Visa.", CategoryId = 43 },
                new Joke() { Id = 1051, Active = true, Title = "Ljubezen do živali", Description = "Zelo rad imam živali.    Če so pa tako okusne!", CategoryId = 43 },
                new Joke() { Id = 1052, Active = true, Title = "Moški in varčevanje", Description = "Moški, varčujte z vodo!    Tuširajte se skupaj s svojo prijateljico.", CategoryId = 43 },
                new Joke() { Id = 1053, Active = true, Title = "Moški uspeh", Description = "Za vsakim uspešnim moškim je ženska.    Za vsakim neuspešnim moškim sta dve ženski.", CategoryId = 40 },
                new Joke() { Id = 1054, Active = true, Title = "Nauk", Description = "Ljubi tudi svojo sosedo.    Ampak pazi, da te ne dobijo!", CategoryId = 43 },
                new Joke() { Id = 1055, Active = true, Title = "Medvedov rojstni dan", Description = "Medved je praznoval rojstni dan.  Na zabavo je povabil vse živali iz gozda, hkrati pa jim ukazal, da mu morajo prinesti lepa darila.  Medved se odloči, da bo tistega, ki mu ne bo prinesel dovolj dobro darilo pretepel s svojim kurcem.    Prva prideta volk in lisica ter medvedu prineseta videorekorder.  Medved je bil z darilom zadovoljen.    Nato pride zajček.  Ker je bil bolj reven in si ni mogel privoščiti dragega darila je medvedu prinesel korenček.    Medved je bil vidno razočaran, hkrati pa tudi jezen zato vzame svojega korenjaka v roke in začne udarjat po zajčku. Udarja ga po glavi, po hrbtu...zajček pa umira od smeha.    Ga medved vpraša: \"Zajček, kaj je pa tako smešnega?!\"    Zajček, ki umira od smeha, odgovori: \"Ježek ti bo hruško prinesel...\" ", CategoryId = 41 },
                new Joke() { Id = 1056, Active = true, Title = "Kako bruhati", Description = "Kaj narediš, če ne moreš bruhati?  - Vtakneš si desni kazalec v usta!    Kaj pa, če še ne gre?  - Vtakneš še levi kazalec v rit!    Kaj pa, če res ne gre in ne gre?  - Zamenjaš kazalca", CategoryId = 43 },
                new Joke() { Id = 1057, Active = true, Title = "Mama razlaga hčerki", Description = "Pelje mamica hčerkico po parku. Pa opazita, da dva seksata na klopci.  Punčka vpraša: \" Mami, kaj delata?\"    Mami (najprej premišljuje): \"Ja, tortice delata, veš.\"  Potem gresta v živalski vrt in vidita dve opici, ki seksata v  kletki.    Punčka:\"Mami, a ta dva tudi tortice delata?\"  Mami: \"Ja, miškica moja, tud tadva delata tortice.\"    Naslednji dan punčka vpraša mamico: \"Mami, a sta vidva z očijem tudi včeraj delala tortice v dnevni sobi?\"  Mami (zardi in zgroženo vpraša): \"Ja, kako pa to veš?\"    Sledi malo tišine, nato pa punčka pravi: \"Vem, ker sem smetanco polizala s kavča.\" ", CategoryId = 27 },
                new Joke() { Id = 1058, Active = true, Title = "Pregovori in resnice", Description = "Ko je princ spustil hlače, je Sneguljčica zagledala osmega palčka.  Zakonska zveza je grob poseg v moško zasebnost!  Zakaj hudiča je beseda \"moškost\" ženskega spola?  Liter vina žensko zelo polepša, še posebej, če ga spije moški!  Zaradi lepih nog je postala slavna. Njena slava se širi!  Zvesta žena spi samo z možem! Z ostalimi je budna!  Pri sodobnih Julijah ima največ uspeha Alfa Romeo!  Žeja me je napadla, pil sem v samoobrambi!  Če se hočete poročiti, vzemite lepotico. Lažje se je boste potem znebili!  Če želite videti prijazni nasmeh svoje žene, jo peljite k fotografu.  Nekatere ženske imajo hladne trajne, druge pa so trajno hladne.  Nevesta v belem, vdova v črnem, vse je to isto. Spet je eden moški nehal živeti.", CategoryId = 43 },
                new Joke() { Id = 1059, Active = true, Title = "K njemu pride", Description = "Mož: \"Žena! Ti prideš k meni le takrat, kadar rabiš denar!\"    Žena pravi: \"Dragi! A to ni dovolj pogosto?!\" ", CategoryId = 11 },
                new Joke() { Id = 1060, Active = true, Title = "V psihiatrični bolnici", Description = "Doktor v psihiatrični bolnici je vstopil v bolniško sobo in zagledal pacienta, ki je sedel na stolu in zamišljeno vrtel volan ter govoril: \"Brrrrr...brrrrr...\"    \"Kaj pa delaš?\" ga je vprašal doktor.    \"S tovornjakom se peljem v Pariz!\" je dejal pacient.    V sosednji postelji je pod odejo ležal popolnoma gol pacient, ki je skakal po postelji.    \"Kaj pa ti delaš?\" ga je vprašal psihiater.    \"Medtem, ko je on na službenem potovanju jaz seksam z njegovo ženo!\" ", CategoryId = 39 },
                new Joke() { Id = 1061, Active = true, Title = "Tasca za portret", Description = "Snaha pravi tasci: Vi tako dobro izgledate, da bi bili odlicni za portret kaksnemu kitajskemu slikarju.   Tasca: Hvala! Ampak zakaj ravno kitajskemu?  Snaha: Veste, on tako rad slika zmaje!", CategoryId = 34 },
                new Joke() { Id = 1062, Active = true, Title = "Imam rad samo tebe", Description = "Marta in Kosir srkata popoldansko  kavo.  Marta zlepa:  Povej prosim posteno, kaksne zenske  imas rad.  Pametne ali lepe?  Kosir brez premisleka:  Ne enih ne ndrugih.Dobro ves, da  imam rad samo tebe!", CategoryId = 11 },
                new Joke() { Id = 1063, Active = true, Title = "Klosar", Description = "V parku sredi ljubljane klosar  prisede k Mojci:  Kaj je bejba, bova seksala?  Mojca zgrozeno: Kaj si pa domisljate,   seveda ne!  Klosar: Ah, sem mislil, ko ze   sedis na moji postelji...", CategoryId = 27 },
                new Joke() { Id = 1064, Active = true, Title = "Teroristi in Janez Jansa", Description = "Na avtocesti je zastoj in kolona je dolga vec kilometrov. Nihce ne ve, kaj se je zgodilo. Koncno pridem mimo nekdo s kanto bencina. Cakajaci v koloni ga vprasa kaj se je zgodilo.   \"Teroristi so ujeli Janeza Janso in zanj zahvetajo 10 milijonov evrov. Ce denarja ne zberemo, ga bodo zasgali.\"  \"In koliko ste uspeli zbrati?\"  \"10 evrov, 500 litrov bencina in 30 vzigalnikov...\"", CategoryId = 23 },
                new Joke() { Id = 1065, Active = true, Title = "Tusiranje po seksu", Description = "Polde in Ferdo tolceta runde  za sankom.  Kar naenkrat Polde: Ti, Ferdo, se  kaj tusiras po seksu?  Ferdo izstreli:  Seveda, logicno!  Polde:  Potem pa pogosteje seksaj", CategoryId = 27 },
                new Joke() { Id = 1066, Active = true, Title = "Izobrazba", Description = "\"A ti ves, kaj je to policaj?\"  \"Ne.\"  \"Policaj je zakon!\"  \"Kaj pa je potem policistka?\"  \"Policistka je luknja v zakonu.\"  \"Kaj pa policijski pes?\"  \"No, vidis, to pa je solani kader!\"", CategoryId = 22 },
                new Joke() { Id = 1067, Active = true, Title = "Pralni stroj", Description = "Janek v soli opazi, da uciteljica nima sposnjih hlack in jo vprasa kaj ima med nogami. Uciteljica mu odgovori, da pralni stroj. Janezek zgodbo doma pove ocetu, ki mu pravi, da naj vprasa uciteljico, ce lahko pride oprat kaj perila. Janezek naslednji dan vprasa uciteljico kaj mu je narocil oce.   Uciteljica: Ja, lahko, ce ga ima veliko. Ce ga ima malo, pa ga naj kar na roke opere!", CategoryId = 32 },
                new Joke() { Id = 1068, Active = true, Title = "Lekarna", Description = "Maja stopi v lekarno:  Imate kondome XXL?   Lekarnar: Imamo. Jih   boste vzeli?  Maja: Ne, bom pa pocakala, da  vidim, kdo jih bo kupil.", CategoryId = 43 },
                new Joke() { Id = 1069, Active = true, Title = "Gospodar v svoji hiši", Description = "Košir v enem zamahu prebere knjigo Bodi gospodar v svoji hiši.    Primerno opogumljen stopi v kuhinjo do Marte: \"Vedi, da sem jaz gospodar te hiše in, da je moja beseda poslej vselej zadnja! Danes boš skuhala večerjo, ki ti jo bom jaz naročil, zatem spekla moje najljubše kolače, potem greva za eno uro v spalnico. Po seksu me mora čakati brezova kopel, na obešalniku pa sveža pižama. Postrigla mi boš še nohte na rokah in nogah ter zmasirala stopala. Le uganeš lahko, kdo me bo po vsem tem še počesal...\"    Marta še tisto sekundo: \"Nekdo iz pogrebnega zavoda.\"", CategoryId = 11 },
                new Joke() { Id = 1070, Active = true, Title = "Slovenec, Hrvat in Srb oropajo banko", Description = "Slovenec, Hrvat in Srb družno oropajo banko. Pregledajo plen in vidijo, da imajo kup evrov, kun in dinarjev.    Naredijo tri kupe, po valutah, nato začne Janez deliti: \"Tisoč evrov meni, tisoč kun tebi, tisoč dinarjev tebi.\"  Pa spet: \"Tisoč evrov meni, tisoč kun tebi, tisoč dinarjev tebi.\"    In tako še večkrat.    Onadva ga gledata, čez nekaj časa se Hrvat obrne k Srbu: \"Ta Janez mi gre že nekaj časa na jetra, a nekaj morava priznati - pošten pa je\"", CategoryId = 3 },
                new Joke() { Id = 1071, Active = true, Title = "Nenadno povabilo", Description = "Košir: \"Draga, danes sem povabil Janeza na kosilo.\"    Marta: \"Si znorel, norec blesavi!?! Bajta je razmetana, kopalnica ni očiščena, včerajšnja posoda še ni pomita, jaz pa tudi ne bom ne vem kaj kuhala! Le zakaj si ga povabil?\"    Košir: \"A veš, da revež razmišlja, da bi se oženil.\"", CategoryId = 11 },
                new Joke() { Id = 1072, Active = true, Title = "Na mirovni misiji", Description = "Med slovensko mirovniško vojaško odpravo v Bosni se, bolj ali manj naključno, znajde tudi Korel.    Gleda, kako vojak Nata dela sklece.    Nekaj časa opazuje, nakar reče: \"Naj me vrag, če ti ona ni pobegnila\"", CategoryId = 43 },
                new Joke() { Id = 1073, Active = true, Title = "V peklu", Description = "Nadzornik pride k hudiču, ki upravlja kotle, v katerih se cvrejo nesrečniki. Pri vseh kotlih so stražarji, ki budno pazijo, da kdo iz kotla ne uide. Le pri enem ni niti enega stražarja.    Nadzornik takoj: \"Aha, kaj pa je s tem kotlom? Zakaj tukaj ni stražarjev?\"    Upravljavec mirno: \"V tistem so Slovenci, ko eden malce zleze ven, ga drugi hitro potegnejo nazaj notri.\"", CategoryId = 28 },
                new Joke() { Id = 1074, Active = true, Title = "Marta kupuje papigo", Description = "Prodajalec ji pokaže čudovito araro: \"Vam je všeč, gospa?\"    Marta: \"Res je lepa, a nisem zadela na lotu. Ne morem si je privoščiti.\"    Prodajalec obljubi, da ji jo bo dal po polovični ceni, ker je živela v bordelu in ima zelo sočen besednjak.    Marta je zelo navdušena in takoj sklene kupčijo.    V varnem zavetju novega doma pernato bitje ni dolgo tiho: \"Hej, nov bordel in nova madam!\"    Marta nazaj: \"To ni bordel in jaz nisem madam, jasno?\"    Čez eno uro pride domov hčerki, in papiga takoj: \"Hej, nov bordel, nova madam in nove kurbe!\"    Hčerki užaljeno pokarata papigo, a se sprijaznita z novo pridobitvijo.    Popoldne se iz službe vrne Košir. Papiga ga zagleda in zavrešči: \"Hej, nov bordel, nova madam, nove kurbe pa iste stranke. Kak se maš, Košir?\"", CategoryId = 11 },
                new Joke() { Id = 1075, Active = true, Title = "Nakup zlata", Description = "Možakar pride s prelepo žensko k zlatarju, nabereta za več kot 50.000 evrov draguljev in nakita.    Kupec mirno vzame ček in nanj zapiše zahtevani znesek. A zlatar je nezaupljiv.    Takrat neznanec: \"Vem, skrbi vas, če je ček pokrit. Takole bova napravila: ker je danes petek in so banke že zaprte, obdržite ček in dragulje. V ponedeljek, ko boste ček unovčili, pa nakit pošljite h gospodični. Velja?\"    Zlatar je vidno olajšan.    Pride ponedeljek, zlatar hoče unovčiti ček, a ta nima kritja. Nemudoma pokliče kupca, ta pa: \"Ček kar vrzite, tri noči z gospodično so mi bile povsem dovolj.\"", CategoryId = 43 },
                new Joke() { Id = 1076, Active = true, Title = "Razlog za slavje", Description = "Lojze stopi v vaško gostilno, sede na stol zraven neke gostje in naroči šampanjec.  Ko se ona naenkrat obrne proti njemu: \"Zanimivo, tudi jaz sem naročila šampanjec.\"  On: \"Kakšno ujemanje! Zame je danes poseben dan, proslavljam pomemben dosežek.\"  Ona: \"Tudi jaz imam danes razlog za slavje.\"  Lojze: \"Kakšno sovpadanje! Kaj pa proslavljate?\"  Ženska: \"Z možem sva se dolgo neuspešno trudila, danes pa mi je ginekolog povedal, da sem naposled noseča.\"  On znova: \"Neverjetno ujemanje. Moje kokoši na farmi so bile dolgo neplodne, danes pa se vse znesle oplojena jajca.\"  Ona: \"Sijajno. Kako pa je to uspelo?\"  Lojze: \"Zamenjal sem petelina.\"  Gostja: \"Kakšno ujemanje!\"", CategoryId = 43 },
                new Joke() { Id = 1077, Active = true, Title = "Na tržnici", Description = "Novinarka hodi po tržnici, pripravlja reportažo o sobotnem utripu.    Sprašuje ljudi in stopi tudi do branjevke: \"Mi lahko poveste, zakaj je vaša roba tako draga?\"    Ženica: \"Ni draga, dete moje, ni, le ti si se slabo omožila.\"", CategoryId = 43 },
                new Joke() { Id = 1078, Active = true, Title = "V čakalnici", Description = "Košir se odpravi k zdravniku. V čakalnici sedi uro, dve, tri, ura kaže že pozno popoldne.    Naenkrat se na vratih pojavi zdravnik: \"To bi bilo vse za danes, moram na sestanek, tisti, ki niste prišli na vrsto, se oglasite jutri.\"    Takrat se oglasi Košir: \"Kaj pa naj jaz z mojim pečenjem?\"     Doktor se zdrzne in mu namigne: \"Dobro, vas še vzamem, vsi ostali pa domov.\"    Kmalu ostaneta sama, zdravnik ne izgublja časa: \"Kje je pečenje?\"  Košir: \"Ko lulam, me strašno peče ...\"", CategoryId = 39 },
                new Joke() { Id = 1079, Active = true, Title = "Plastična operacija", Description = "V prometni nesreči se Pepca hudo poškoduje po obrazu.    Potrebna je plastična operacija, kožo zanjo s svoje zadnjice daruje kar njen Polde.    Po nekajtedenskem okrevanju je vse okej, koža se je lepo presadila, na obrazu ni brazgotin.    \"Oh, dragi moj,\" je hvaležna Pepca, \"zelo si mi pomagal, sploh ne vem, kako se ti naj oddolžim.\"    \"Ni vredno besed, draga, dovolj bo, da bom videl, ko te bo tvoja mama poljubila na lice.\" ", CategoryId = 34 },
                new Joke() { Id = 1080, Active = true, Title = "Pilota pilatusov", Description = "Korel in Polde se po opravljenem tečaju zaposlita kot pilota bojnih pilatusov Slovenske vojske.    Čaka ju prvi polet.    Vzlet uspe, tudi polet od Brnika do Cerkelj opravita brez težav, potem pa gorje! Pristajalna steza je nenadoma velika krajša od tiste na simulatorju, kjer sta vežbala.    Napneta vse moči, posrkata vse znanje in še več, aktivirata vse zavore in se spustita na asfalt. Od gum na kolesih se kadi, a sreča jima je mila, nepoškodovana se ustavita na bližnji njivi med koruzo.    \"Idioti neumni, kako se naredili to stezo,\" benti Korel in snema čelado. \"Saj nima več kot sto metrov!\"     \"Točno,\" ves preznojen doda Polde, \"glavno jim je, da je široka skoraj kilometer ...\"", CategoryId = 43 },
                new Joke() { Id = 1081, Active = true, Title = "Bunee jumping", Description = "Korel gre s prijateljem v hribe pa nabašeta na skupino, ki se je šla bungee jumping.    \"A poskusiva še midva?\" vpraša Korel.    \"Ni šans!\" je odločen kamerad. \"Na ta svet sem prišel zaradi ene strgane gume. Ne bom tudi šel z njega zaradi istega razloga.\"", CategoryId = 43 },
                new Joke() { Id = 1082, Active = true, Title = "Nakup nove omare", Description = "Marta se odpelje v Celovec in v Ikei kupi omaro.    Doma jo sama sestavi, a kaj, ko omara takoj, ko mimo pripelje avtobus, ob tresenju razpade.    Besna pokliče v trgovino, od koder ji na pomoč pošljejo delavca montažerja. Ta se loti posla in v pol ure je omara znova sestavljena.    A ker je natančen, hoče preveriti, kaj se bo zgodilo, ki mimo znova pripelje avtobus.    Stopi v omaro in čaka.    Takrat se doma nenadoma pojavi Košir. Ne more verjeti svojim očem, gleda delavca v omari, gleda ženo, lovi sapo, Marta ga prehiti: \"Ne boš verjel, čaka na avtobus ...\"", CategoryId = 11 },
                new Joke() { Id = 1083, Active = true, Title = "Razlika", Description = "Kaksna je razlika med  Bosanko in Slovenko?  Bosanka ti opere noge,  Slovenka pa mozgane.", CategoryId = 40 },
                new Joke() { Id = 1084, Active = true, Title = "Faze ljubezni", Description = "Razvojne faze neke ljubezni:    1.romanticna,    2.eroticna,    3.nevroticna,    4.skleroticna.", CategoryId = 43 },
                new Joke() { Id = 1085, Active = true, Title = "Domaca", Description = "Moz in zena se kregata:    Druga zenska je vedno boljsa  kot domaca.  Samo tebi sem domaca, vsem  ostalim sem druga.", CategoryId = 37 },
                new Joke() { Id = 1086, Active = true, Title = "Sreca", Description = "\"A ves, da je Janezova zena padla po stopnicah in ostala brez jezika?\"  \"Vidis, nekateri moski pa res imajo sreco!\"", CategoryId = 17 },
                new Joke() { Id = 1087, Active = true, Title = "Gripa", Description = "Korel prijatelju Poldetu:  Slisal sem, da je zavest nasih  drzavljanov o koristnosti  cepljenja proti gripi zadnje tedne  skokovito narasla.  Polde: Bo drzalo.  Sinoci sem videl enega, ko se je  za garazo kar sam cepil.", CategoryId = 28 },
                new Joke() { Id = 1088, Active = true, Title = "Vulkan", Description = "Polde in Pepca sta po dalsem   casu znova v spalnici.  Ko opravita, je on po mosko  radoveden:  Povej mi, draga, kaksen sem v postelji?  Se vedno dober?  Pepca: Si kot vulkan.  Polde: Uf, to pa je lepo slisati.  Tako vroc, tako eksploziven, kajne?   Pepca:Ne, ne, aktiviras se na  vsakih 5 do 7 let.", CategoryId = 11 },
                new Joke() { Id = 1089, Active = true, Title = "Velikost", Description = "Dva mulca se pogovarjata.  \"Ves, skoda, da nisem pritljikavec. Imel bi zelo lepo zivljenje!\"  \"Aja, zakaj pa?\"  \"Poglej naokoli. Skoraj vse nosijo minice. Zdaj pa si zamisli, da si manjsi od enega metra!\"", CategoryId = 43 },
                new Joke() { Id = 1090, Active = true, Title = "Gostje v hisi", Description = "Gostje pridejo v hiso. Mihec opazuje strica, ki si prizge cigareto.  Stric:\"Mihec, ali ti ze kaj kadis?\"  Mihec:\"Ce jo dobim, jo pokadim!\"  Oce nato odgovori:\"Pravilno je, ce jo pokadim, jih dobim!\"", CategoryId = 11 },
                new Joke() { Id = 1091, Active = true, Title = "Dobre volje", Description = "Tone sreca pred vasko gostilno  prijatelja Lojzeta.  Ta je nenavadno dobre volje,   kmalu raskrije tudi razlog za  to: Ta dez je prisel kot narocen.   Vse, kar je v zemlji, bo sedaj  ozivelo.  Tone: Si nor? Ne ga srat, ravnokar  sem pokopal tasco.", CategoryId = 13 },
                new Joke() { Id = 1092, Active = true, Title = "Darilo", Description = "Moz pride v trgovino in mlado trgovko prosi za pomoc.   \"Rad bi kupil darilo za zeno. Mi lahko pomagate?\"  \"A je lepa?\"  \"Ne prevec.\"  \"A je mlada?\"  \"Je ze v letih.\"  \"Je bogata?\"  \"Ne, ni.\"  \"No, potem vam svetujem, da darilo kupite kateri drugi!\"", CategoryId = 11 },
                new Joke() { Id = 1093, Active = true, Title = "Na letaliscu", Description = "Mujo in Haso na letaliscu opazujeta letala.  \"Haso, kako lahko nekdo ugrabi letalo, ko pa so tako velika?\"  \"Tepec\", odgovori Haso. \"Ugrabijo jih, ko so v zraku in so cisto majhna!\"", CategoryId = 18 },
                new Joke() { Id = 1094, Active = true, Title = "Mujo dobi dvojcka", Description = "Mujo je dobil dvojcka in je obema dal ime Suljo.  Fata:\"Budalo, zakaj si dal obema ime Suljo?\"  Mujo: \"Ko se bom zadrl: Suljo prinesi pivo, bom takoj imel pred seboj dva piva!\"", CategoryId = 18 },
