                new Joke() { Id = 1096, Active = true, Title = "Sosedova zena", Description = "\"Sosed, zakaj si spal pri moji zeni, ko sem bil tri na sluzbenem potovanju?\"  \"Zanimalo me je, ce je kaksna razlika med mojo in tvojo zeno!\"  \"No, to bi lahko tudi mene vprasal...\"", CategoryId = 27 },
                new Joke() { Id = 1097, Active = true, Title = "Cigan", Description = "Na ulici se srecata Cigana.  Berto: Halo, prijatelj, imas  res lepo jakno.  Brajdimir: Hvala, kupil sem  jo na popust.  Kako na popust?  Lepo, prodajalki je popustila  pozornost.", CategoryId = 7 },
                new Joke() { Id = 1098, Active = true, Title = "Vzgaja otrok", Description = "Vprasa Kosir svojega prijatelja  Janeza:  Zaupaj mi, kako ti vzgajas svoje  otroke. Ali z lepimi besedami  ali z udarci?  Janez: Z lepimi besedami, seveda.  Kosir: Pa udarci?  Uporabim jih le tu in tam, pa se   to izkljucno v samoobrambi.", CategoryId = 17 },
                new Joke() { Id = 1099, Active = true, Title = "Matematika", Description = "Med uro matematike se ucitelj zgrozi nad odgovori ucenca. V besu:\"Eden od naju je popolni bedak!\"  Ucenec se mirno vrne v klop. Naslednji dan ucenec ucitelju izroci modro kuverto. Ucitelj: \"Kaj je to?\"  \" Potrdilo solskega psihologa in pedagoga, da sem jaz cisto normalen!\"", CategoryId = 32 },
                new Joke() { Id = 1100, Active = true, Title = "Medved", Description = "Medved se odloci da gre pogledat  zlahto v Ameriko.  Na avijonu postane lacenin gre  v pilotsko kabino pojest pilota.  Pilot: Ne mene, jaz upravljam ,   avion, ce me pojes bomo   strmoglavili.  Obrne se k kopilotu: Bom pa tebe,   umiram od lakote.  Kopilot: Ne mene, jaz pomagam  pilotu, najmanj skode bo ce pojes  stevardeso!  Medo odlaca do stevardese, z njo  spregovori nekaj besed in gre  sedet na svoj sedez.  Gre pilot cez cas preverit stanje  v avionu. Vidi stevardeso zivo,  medveda pa na svojem mestu in   gre do njega.  Kako to, da nisi pojedel stevardese  ko si pa lacen za umret?  Ja, a pol bosta pa mene kavsala....", CategoryId = 41 },
                new Joke() { Id = 1101, Active = true, Title = "Poroka", Description = "Franci, kako si lahko dovolil, da se je tvoja hcerka porocila s Slavkom, saj ga vendar ne maras?  Tako sem se mu lahko masceval.  Kako neki?  Mojo zeno je dobil za tasco!", CategoryId = 34 },
                new Joke() { Id = 1102, Active = true, Title = "Garaza", Description = "\"Aha, dobili smo vas. Garazo ste zgradili brez gradbenega dovoljenja.\"  Joze se izmotava:\" To pa ni res. Saj imamo gradbeno dovoljenje za hiso, ampak je zaradi vseh podrazitev res nastala garaza.\"", CategoryId = 43 },
                new Joke() { Id = 1103, Active = true, Title = "Studentka", Description = "Profesor med predavanjem na  faksu. Njegove oci ves cas pocivajo  na micni plavolaski Maji.  Tej je spogledovanja pocasi dovolj,   zato dvigne roko in vprasa:  Gospod profesor, zakaj ves cas tako  buljite vame?  On: Veste draga studentka, med predavanji   vedno gledam najbolj neumnega studenta,  in ce vidim, da je on razumel snov, ki jo   predavam, potem vem, da so razumeli  tudi drugi!", CategoryId = 32 },
                new Joke() { Id = 1104, Active = true, Title = "Starejsi par", Description = "Ostareli parcek lezi v  postelji.  Ona: Vcasih si me nezno pobozal,   preden sva zaspala.  On se obrne, jo poboza po rami in   hoce zaspati.  Takrat spet ona: Nato si me nezno  poljubil...  On se dvigne, ji da poljupcek na   lice ter se obrne, da bi saspal.  Pa mu se ne da miru:  Potem si me grizljal po vratu.  On jezno vstane in odkoraka iz  spalnice.  Ona: Ja, kam pa gres?  On sikne: V kopalnico po zobe!", CategoryId = 11 },
