                new Joke() { Id = 1106, Active = true, Title = "Ljubezen na prvi pogled", Description = "Mlad fant se je v trgovini zagledal v prodajalko, ki je nosila zlato verizico, na kateri je bil obesek letala.   Dekle:\"Ste se zaljubili v avioncek?\"  Fant:\" Ne, v letalisce!\"", CategoryId = 17 },
