                new Joke() { Id = 1132, Active = true, Title = "Na letalu", Description = "Na letalu se peljejo American, Rus in Afganistanec. Stevardesa vprasa Americana kaj bo pil in on odvrne da viski. Nato vprasa Rusa in on odgovori da vodko. Na koncu ponudi pijaco se Afganistancu. Afganistanec odgovori:\"Nic, hvala, jaz se bom vozil.\"", CategoryId = 43 },
