                new Joke() { Id = 1135, Active = true, Title = "Pepca me vara", Description = "Polde v gostilni utapla zalost.  Tolce pivo za pivom.  Pa ga zagleda Korel.  Kaj ti je, prijatelj?  Polde: Moja pepca me vara.  Kako? Od kod ti to?  Polde: Vracal sem se s poti,   poslal sem ji telegram, da pridem  domov, a sem jo vseeno v postelji  ujel z sosedom.  Takrat Polde nekaj presine, sam  pri sebi zamomlja: Mogoce pa le   ni tako hudo.  Kaj pa ce sploh ni dobila telegrama?", CategoryId = 13 },
                new Joke() { Id = 1136, Active = true, Title = "Zastrupitev", Description = "Ferdo pride ves bled k zdravniku.  Potozi, da ga boli trebuh, da je   bruhal in driskal.  Zdravnik ga nekaj casa poslusa,   nakar ga pretipa in pregleda.  Nobenega dvoma ni, bili ste   zastrupljeni.   Ferdo: Kako? S cim?  Doktor: To pa bo pokazala sele  obdukcija.", CategoryId = 39 },
