                new Joke() { Id = 1138, Active = true, Title = "Otroka in tehtnica", Description = "Bratec in sestrica drug drugega prepričujeta, naj stopi na tehtnico.    Nakar se starejša sestrica opogumi in stopo nanjo. Takoj za tem reče: \"Pa saj nič ne boli!\"    Bratec: \"Zakaj pa potem mamica joče vsakokrat, ko stopi nanjo?\"", CategoryId = 43 },
