                new Joke() { Id = 1140, Active = true, Title = "Žena se pritožuje", Description = "Žena možu, nejevoljno: \"Saj to ni res! Zdaj, ko sem s tabo samo še kuham, perem, likam, ribam in brišem!\"    Mož: \"Vidiš, sem ti rekel, da ti bo z mano, kot v pravljici!\"    Žena še bolj jezno: \"Kako to misliš?\"    Mož: \"Si kot Pepelka.\"", CategoryId = 11 },
                new Joke() { Id = 1141, Active = true, Title = "Modra misel", Description = "Pred seksom slečemo eden drugega.    Po seksu se moramo obleči sami.    Nauk: nihče ti noče pomagati po tem, ko si zjeban!", CategoryId = 27 },
                new Joke() { Id = 1142, Active = true, Title = "Nemogoče je mogoče", Description = "Obstaja ženska, ki ve, kaj bo jutri oblekla.    Res!    Reče se ji: nuna.", CategoryId = 40 },
                new Joke() { Id = 1143, Active = true, Title = "Pravilna uporaba sloveščine", Description = "Žalostno!    Dnevi, ko so ljudje znali pravilno uporabljati slovenščino, ni nič več.", CategoryId = 43 },
                new Joke() { Id = 1144, Active = true, Title = "Ena žena", Description = "Pri nas imajo lahko moški samo eno ženo.    To se imenuje: monotonija.", CategoryId = 43 },
                new Joke() { Id = 1145, Active = true, Title = "Krave in tek", Description = "Zakaj krave ne tečejo hitro?    Da ne polijejo mleka.", CategoryId = 41 },
                new Joke() { Id = 1146, Active = true, Title = "Učiteljica, Janezek in očitno", Description = "Učiteljica sprašuje otroke, kaj pomeni beseda \"očitno\".    Javi se mali Marko: \"Moj oče vozi Mercedesa, mama vozi Jaguarja, babica pa džipa - očitno imamo denar.\"    Učiteljica pohvali Marka in vpraša, če še kdo hoče kaj povedati.    Janezek se javi: \"Moja babica vsako jutro odide na travnik. Pod levo roko nosi Allgemeine Zeitung, pod desno pa Washington Post.\"    \"Ja, in ... kaj je s tem,\" je nestrpna učiteljica?    \"Ja, nič,\" odvrne Janezek. \"Babica ne zna ne nemško ne angleško - očitno gre srat.\"", CategoryId = 15 },
                new Joke() { Id = 1147, Active = true, Title = "Moški o prijateljstvu", Description = "Mož se šele zjutraj vrne domov in žena ga vpraša: \"Kje si spal?\"    \"Pri prijatelju,\" ji odgovori mož.    Žena se odloči, da bo zadevi prišla do dna in pokliče deset njegovih prijateljev. Nazadnje ugotovi, da je pri šestih zares prespal, pri štirih pa tisti hip še vedno spi na kavču.", CategoryId = 17 },
                new Joke() { Id = 1148, Active = true, Title = "Računstvo z zajci", Description = "Učitelj: \"Če ti dam dva zajca in še dva zajca in potem še dva zajca, koliko zajcev imaš?\"  Janezek: \"Sedem!\"  Učitelj: \"Ne, poslušaj pazljivo še enkrat. Če ti dam dva zajca in še dva zajca in potem še dva zajca, koliko zajcev imaš?\"  Janezek: \"Sedem!\"  Učitelj: \"Poskusiva malo drugače. Če ti dam dve jabolki in še dve jabolki in potem še dve jabolki, koliko jabolk imaš?\"  Janezek: \" Šest!\"  Učitelj: \"Dobro. No, zdaj pa še enkrat z zajci. Če ti dam dva zajca in še dva zajca in nato še dva zajca, koliko zajcev imaš potem?\"  Janezek: \"Sedem!\"  Učitelj: \"Kako, za boga, lahko po tem, ko ti trikrat dam po dva zajca, prideš do sedmih?\"  Janezek: \"Enega imam doma.\"", CategoryId = 15 },
                new Joke() { Id = 1149, Active = true, Title = "Telefon", Description = "Sredi noci zazvoni telefon.  Kosir se v postelji obrne k Marti.  Ce je zame, reci, da me ni doma.  Marta vstane, dvigne slusalko in   po dveh sekundah izusti:   Doma je.  Kosir slisi in glasno zagodrnja:  A ti nisem rekel, da pove, kako  me ni doma.   Marta: Saj ni bilo zate.", CategoryId = 43 },
                new Joke() { Id = 1150, Active = true, Title = "Dieta", Description = "Pepca zavistno prijateljici Stefki:  Madona, kako si lepo shujsala.  Kaksna nova dieta?  Stefka: Kje pa?   Le krompir, korenje, fizol.  A res? Pa si vse to kuhala ali pekla?  Okopavala.", CategoryId = 40 },
