                new Joke() { Id = 1155, Active = true, Title = "Menstruacija", Description = "Zakaj imajo zenske menstruacijo?    V raju je Eva Adamu ponudila jabolko. Bog se je zelo razjezil:\"To bos krvavo placala!\"  Eva:\"Lahko v vec vojnah?\"", CategoryId = 40 },
