                new Joke() { Id = 1157, Active = true, Title = "Izostanek od pouka", Description = "Janezek, vceraj si zopet manjkal v soli? Kaj se dogaja?  Babica je zbolela.  Vsakic, ko manjkas v soli, je tvoja babica bolna. Ne verjamem ti!  Veste, uciteljica, tudi mi doma smo zaceli sumiti, da babica le igra.", CategoryId = 15 },
