                new Joke() { Id = 1172, Active = true, Title = "Blondinke", Description = "Tri blondinke ujamejo zlato ribico.  Ta jih prosi, naj jo vrnejo v reko  in vsaki bo izpolnila eno zeljo.  Receno, storjeno.  Prva si je zazelela rokavcke, da bi  z njimi preplavala reko.  Dobila jih je, a se vseeno utopila  sredi reke. Druga je hotela plavalni  obroc, a tudi njej ni pomagal. Na   tricetrt poti je izginila pod   recno gladino.  Tretja si je zazelela rjave lase in  jih tudi dobila.Sedaj, ko ni bila vec   blond, se je odlocila, da bo reko  preckala cez most.", CategoryId = 40 },
