                new Joke() { Id = 1174, Active = true, Title = "Kosir", Description = "Kosir v gostilni po tretji rundi  zbada druscino:  Mi lahko kdo od vas pove, ali je na   Kitajskem ze srecal kakega potepuskega  psa? Pa se eden le ojunaci:  Povej mi, Kosir, ali si v Srbiji ze  kdaj videl potepuskega prasca?", CategoryId = 41 },
                new Joke() { Id = 1175, Active = true, Title = "Glista", Description = "Ucitelica prinese v razred dve steklenici  in glisto. V eni steklenici ima  vodo, v drugi pa alkohol.  Glisto vrze v steklenico z vodo in ta   v njej veselo zaplava.  Nato jo vrze v steklenico z zganjem,   glista dvakrat zamiga in crkne.  Ucitelica:No, otroci, kaj se lahko iz  tega naucimo?  Prva je v zraku Buckina roka: Pijemo  alkohol, da ne bomo imeli glist.", CategoryId = 32 },
