                new Joke() { Id = 1177, Active = true, Title = "Zenin SMS", Description = "Kaksen je najlepsi SMS, ki ga lahko prejmes od  zene?  Dragi, popila sem zadnje pivo. Po sluzbi se ustavi v gostilni.", CategoryId = 40 },
