                new Joke() { Id = 1180, Active = true, Title = "Pojma nimam", Description = "Polde in Korel osamljeno debatirata  za sankom. Korel: A ti ves, kdo je bil  Aleksander Veliki?  Polde: Pojma nimam.  To je bil veliki vojskovodja, pred katerim  je trepetalo pol sveta.  A si nemara ze slisal za Napoleona?  Polde molci. Vidis, tudi on je bil veliki  vojskovodja, ki je poraz dozivel sele v  bitki pri Waterlooju.  Polde ne more, da nebi vprasal:  Od kod tebi nenadoma toliko znanja?  Korel ponosno: Hja, vsak dan med sedmo in  deseto hodim v vecerno solo.  Polde je nekaj casa tiho, nakar prijavi:  Prijatelj, a ti ves, kdo je Pero Komadina?  Korel se zacudi in skomigne z rameni:  Pojma nimam.  Polde: To je tisti tip, ki je vsak vecer med  sedmo in deseto, ko si ti v vecerni soli,  pri tvoji Stefki.", CategoryId = 13 },
                new Joke() { Id = 1181, Active = true, Title = "Policiski vici", Description = "Notranji minister je na sprejemu pri  predsedniku republike.  Sledi vecerja, po kateri zeli na vsak  nacin zaplesati s prvo damo.  Po uvodnih ritmih ji zasepeta:  Gospa predsednikova, a se vam ne zdi,  da je ze cas, da prepovemo policijske  vice?   Ona: Ce sem iskrena, mislim, da je v teh  vicih vendarle nekaj resnice. Vi ste prvi,   ki me je ob igranju himne povabil na ples.", CategoryId = 23 },
