                new Joke() { Id = 1185, Active = true, Title = "Racun", Description = "Janez stopi iz trgovine, v eni roki  ima dve pasteti, v drugi cokolado...  Ustavi ga gospod:  Dober dan, sem davcni inspektor.   Imate racun?  Nimam.  A veste, da je kazen 40€, ker za robo,   ki ste jo kupili, nimate racuna?  Saj nisem kupil... Ukradel sem...  Ah, potem pa je v redu.", CategoryId = 43 },
