                new Joke() { Id = 1192, Active = true, Title = "Lasje", Description = "Kaj naredi Primorec, ce mu izpadejo vsi lasje? Kupi lasuljo.  Kaj naredi Gorenjec, ce mu izpadejo vsi lasje? Proda glavnik.", CategoryId = 12 },
