                new Joke() { Id = 1195, Active = true, Title = "Jaz sem Stajerc", Description = "Na zdravniskem pregledu zdravnik  ocita Korelu:  Kar naravnost vam bom povedal.  Navadni pijanec ste. Ali se   zavedate, da zaradi pijace vsako  leto umre 5000 Slovencev?  Korel: Briga me! Jaz sem itak  Stajerc.", CategoryId = 39 },
                new Joke() { Id = 1196, Active = true, Title = "Polde iz gostilne", Description = "Stopi Polde nakresan iz gostilne in  se takoj zaleti v mimoidoco zensko.  Ta mu primaze eno okoli uses.  Polde pa: Madonca, tako hitro pa   se nikoli nisem prisel domov.", CategoryId = 13 },
                new Joke() { Id = 1197, Active = true, Title = "Nesrecen Gorenjc", Description = "Gorenjc pride ves nesrecen v gostilno in ga vprasajo, kaj je narobe.   \"Pred tremi dnevi mi je umrl dedek in mi zapustil 10 milijonov, predvcerajsnjim mi je umrla babica in mi zapustila 25 milijonov. Vceraj mi je umrla mama in mi zapustila 30 milijonov. Danes pa je ura ze sedem zvecer in mi ni se nihce umrl.\"  ", CategoryId = 12 },
