                new Joke() { Id = 1207, Active = true, Title = "Mujo dela v Nemciji", Description = "Mujo se odpravi delat v Nemcijo, da bi dokazal, da se da na posten nacim zasluzit. Po desetih letih koncno zasluzi dovolj, da si lahko kupi mercedesa in se odpravi v Bosno, da bi ga pokazal. Na poti mu poci guma. Ko menjava gumo, pride mimo Haso in ga vprasa kaj dela.   Mujo:\"Gumo jemljem dol.\"  Haso pobere kamen in ga vrze v sipo:\"Dobro, ti vzami gumo, jaz bom pa avtoradio!\"", CategoryId = 18 },
                new Joke() { Id = 1208, Active = true, Title = "Pri zdravniku", Description = "Zdravnik je vprašal ženo: \"Kako, da niste opazili, da je vašega moža infarkt?\"    \"Saj je bilo res nekaj čudnega! Po dvajsetih letih mi je spet enkrat rekel: Žena, moje srce!\"", CategoryId = 11 },
                new Joke() { Id = 1209, Active = true, Title = "Mali vragec", Description = "Mali vragec prileti v New York in reče: \"Jaz sem mali vragec, imam mali kuferček in prišel sem krast.\"    Takoj na letališču ga pristojni obrnejo in rečejo: \"Tu ne moreš krasti, pojdi v Anglijo.\"    Poleti tja in spet ista zgodba: \"Jaz sem mali vragec, imam mali kuferček in prišel sem krast.\"    Organi ga takoj obrnejo in pošljejo v Nemčijo: \"Pojdi tja pa tam kradi, tam se krade.\"    In poleti v Nemčijo ... Prileti na letališče in reče: \"Jaz sem mali vragec, imam mali kuferček in prišel sem krast.\"    Tamkajšnji ga takoj dajo v rikverc in rečejo: \"Obstaja ena država tam doli nižje, Slovenija, tam se krade na veliko, nihče ne odgovarja za nič in ne gre v zapor. Tja pojdi.\"    Vragec res takoj poleti v Slovenijo, pristane na aerodromu na Brniku in reče: \"Jaz sem mali vragec, imam ... mali ... mali ...,,kje je moj kuferček, mater vam lopovsko ... !!!\"", CategoryId = 43 },
                new Joke() { Id = 1210, Active = true, Title = "8. marec", Description = "Zena:Ce mi za 8. marec  ne bos nic kupil, mi vsaj  reci, da sem lepa.  Moz: To bom naredil 1. aprila.", CategoryId = 11 },
                new Joke() { Id = 1211, Active = true, Title = "Loto", Description = "Profesor studentu: Za tukajsnjo fakulteto  vasi rezultati ne zadostujejo, zato  bi na vasem mestu poskusil raje z lotom.  Kako to mislite?  No, od 39 izpitnih vprasanj ste na sedem  odgovorili pravilno.", CategoryId = 32 },
                new Joke() { Id = 1212, Active = true, Title = "Zateče se v cerkev", Description = "Ferdo se primerno okajen opoteče v cerkev in sede v spovednici na klop.    Župnik čaka, da bo kaj rekel, a se nič ne zgodi. Zato nekajkrat diskretno zakašlja, vendar z druge strani nobenega odziva.    Nazadnje potrka na predelno steno.    \"Ne trkajte,\" se naposled oglasi Ferdo, \"tudi na tej strani ni papirja.\"", CategoryId = 21 },
                new Joke() { Id = 1213, Active = true, Title = "Novopečeni zet", Description = "Polde svojemu zetu: \"Upam, da se boš sedaj, ko si se poročil, zresnil in prenehal z neumnostmi.\"    Zet: \"Obljubim, ta neumnost je bila zadnja.\"", CategoryId = 11 },
                new Joke() { Id = 1214, Active = true, Title = "Polde sreča klošarja", Description = "Polde se sprehaja po mestu, ko ga ogovori klošar. Prosi ga za drobiž.    Polde ima poseben dan, zares izvleče iz žepa denarnico in vpraša klošarja: \"A boš denar porabil za viski?\"    Klošar: \"Ne, piti sem nehal že pred leti.\"    Polde naprej: \"A ga boš porabil za hazardiranje?\"    \"Za hazardiranje? Tudi tega nisem počel že celo večnost,\" de klošar.    Polde vrta naprej: \"A ga boš nemara porabil za igro golfa?\"    Brezdomec: \"Ne, ne spomnim se, kdaj sem nazadnje igral golf.\"    Takrat Polde: \"Potem ti pa ne dam denarja. Namesto tega te vabim k sebi domov na večerjo, ki jo bo skuhala moja žena.\"    Klošar je šokiran: \"A ne bo vaša žena jezna? Ne oddajam najprijetnejših vonjav in sem groznega videza.\"    Polde ga že vleče za seboj in vmes razlaga: \"Ne skrbi! Rad bi ji samo pokazal, kako je videti nekdo, ki se je odpovedal pijači, hazardiranju in igranju golfa.\"", CategoryId = 11 },
                new Joke() { Id = 1215, Active = true, Title = "Doktorjev nasvet", Description = "Korel Poldetu: \"Zdravo, prijatelj! Ti pa ne izgledaš najbolje.\"    Polde: \"Mogoče res, a sem že bil pri zdravniku. Priporočil mi je več zelenjave.\"    \"In kaj si ukrenil?\"    \"Namesto ene olive dam sedaj v martini po dve ali tri.\"", CategoryId = 21 },
                new Joke() { Id = 1216, Active = true, Title = "Križanje ras", Description = "Kaj dobimo, če križamo japonca in črnogorca?    Človeka, ki bi rad delal, a se mu ne ljubi vstat.", CategoryId = 38 },
                new Joke() { Id = 1217, Active = true, Title = "Pozirek", Description = "Medicinska fakulteta.  Profesor vprasa studentko Majo,  koliko sperme se izlije pri enem  orgazmu.  Bodoca zdravnica butne:  Pozirek, mogoce pozirek in pol.", CategoryId = 32 },
                new Joke() { Id = 1218, Active = true, Title = "Krivica", Description = "V soli se otroci pogovarjajo o krivicah.  Pa uciteljica vprasa:  Kdo mi zna povedati kak primer krivice?  Jasno, prvi se oglasi Bucek:  Velika krivica je, ce mi oce napise domaco  nalogo, zanjo dobim cvek, oce me pa potem  doma se natepe.", CategoryId = 32 },
                new Joke() { Id = 1219, Active = true, Title = "Kuharska oddaja", Description = "Francka gleda kuharsko  oddajo, Miran pa se spotakne  ob to:  Zakaj to gledas, itak ne znas  kuhati...  Saj tudi ti gledas pornice...", CategoryId = 3 },
                new Joke() { Id = 1220, Active = true, Title = "Cvetica", Description = "Uciteljica naravoslovja je ucencem  narocila, naj vsak nasteje vsaj   eno cvetico.  Tulipan se je oglasil Peter.  Cudovito!  Metka je nadaljevala: Nagelj.  Uciteljica: Cudovito!  Oglasi se Janezek: Narcisa.  Cudovito! pripomni uciteljica.  Roko dvigne Bucek: Marihuana!  Kaksna roza pa je to? ga strogo  opomni uciteljica.  Bucek: Vem, to ni cvetica,je  pa cudovito!", CategoryId = 32 },
                new Joke() { Id = 1221, Active = true, Title = "Student", Description = "Sredi studentskega naselja dregne  student prijatelja:  A vidis tisto v mini krilu na oni  strani ceste?  Vidim, dobra macka. Kaj je z njo?  Z njo sem ze veckrat spal...  Res? Kje pa?  Na predavanjih.", CategoryId = 32 },
                new Joke() { Id = 1222, Active = true, Title = "Zajcek", Description = "Zajcek gre zvecer pijan z zurke.  Omaga pod drevesom in zaspi.  Mimo prideta medved in volk.   Stepeta se, kdo bo pozrl zajcka,   in v pretepu oba oblezita v nezavesti.   Ko se dolgouhec prebudi, ju zagleda  in sam pri sebi zakolne:  Porka madona, ne smem vec piti.  Kadar sem pijan, res nimam prave mere,   poglej, kako hudo sem ju premlatil!", CategoryId = 41 },
                new Joke() { Id = 1223, Active = true, Title = "Blondinka", Description = "Bozicek, zlobna vila, butasta   blondinka in pametna blondinka  hodijo po cesti in zagledajo  bankovec za 500 evrov.  Kdo ga pobere?  Jasno, butasta blondinka,   preostali trije namrec ne  obstajajo.", CategoryId = 4 },
                new Joke() { Id = 1224, Active = true, Title = " Kavc", Description = "Kje je pa vas moz, gospa  Cilka? Doma s svojim stirinoznim   prijateljem.  O, nisem vedla, da ste kupli psa.   Saj ga nismo, mislila sem kavc  pred televizorjem.", CategoryId = 43 },
                new Joke() { Id = 1225, Active = true, Title = "Kava in caj", Description = "Korel in Polde za sankom.  Polde:Ves, pri nas je tako, jaz  imam za zajtrk raje caj, moja  Pepca pa kavo.  Korel: O, to pa je res nerodno,   potem morate pripravljati za zajtrk   kavo in caj. Kdo pa vse to kuha?  Polde zacudeno: Zakaj bi bilo nerodno?  Saj pijemo zmeraj kavo.", CategoryId = 11 },
                new Joke() { Id = 1226, Active = true, Title = "Srce me boli", Description = "Ucitelj v soli ucencem:  Ce kdo misli, da je neumen, naj  vstane.  Nic. Cez nekaj minut pa le vstane   Bucek.  Ucitelj ga vprasa:   A ti toraj mislis, da si nor?  Bucek: Ne, me pa srce boli, ko  vidim, da samo vi stojite.", CategoryId = 32 },
                new Joke() { Id = 1227, Active = true, Title = "Ne sekiraj se", Description = "Polde pusti avto na parkiriscu.  Ker so mu vanj ze veckrat   vlomili, na vetrobransko steklo  nalepi listek z napisom:  Ne vlamaj nimam avtoradia!  Cez poldrugo uro se vrne, avta pa  nikjer. Na tleh opazi listek, na njem  pa napisano: Ne sekiraj se, ga bomo ze   sami zmontirali!", CategoryId = 43 },
                new Joke() { Id = 1228, Active = true, Title = "Lenobe", Description = "Tri lenobe so lezale v sadovnjaku.  Z drevesa je padel sadez in   prvi rece: Z drevesa je padlo jabolko!  Nato sledi enourna tisina, nakar se  oglasi drugi:   Ne, ni bilo jabolko, bila je sliva!  Zopet ura tisine, nato pa tretji  vstane in rece: Jaz grem!  Ne morem vaju poslusat, kako se  stalno prepirata.", CategoryId = 43 },
                new Joke() { Id = 1229, Active = true, Title = "Neverjetno", Description = "Ali ste vedeli, da je več letal v morju, kot podmornic v zraku?", CategoryId = 43 },
                new Joke() { Id = 1230, Active = true, Title = "Nov zakon o otrocih", Description = "Pride Mujo domov in začne razlagat: \"Fata, si slišala, da so izglasovali novi zakon?\"    Fata: \"Nisem, kakšen zakon?\"    Mujo: \"Ženska, ki ima štiri otroke lahko gre v pokoj.\"    Fata: \"Pa kaj nas to briga? Imamo tri otroke in četrtega ne bomo imeli!!!\"    Mujo: \"Že, že. Ampak, jaz imam enega nezakonskega. Grem po njega, bomo imeli štiri in lahko greš v pokoj in dobiš pokojnino.\"    Fata nejevoljno: \"Vredu, pripelji ga!\"    Mujo se odpravi in čez pol ure se že vrne s svojim zunajzakonskim sinom.    Fata pa sama doma.    Mujo: \"Kje so najini trije otroci?\"    Fata: \"Drugi so tudi slišali za ta zakon, pa so prišli vsak po svojega.\"", CategoryId = 3 },
                new Joke() { Id = 1231, Active = true, Title = "Hitra aferica", Description = "Jože v pubu naleti na lepotico.    Ker je preteklo že kar nekaj alkohola se po kratkem flirtanju odpravita k njej.    Ker sta oba okajena, hitro zaspita.    Drugi dan se Jože, ko je bilo sonce že visoko, prebudi. Na nočni omarici zagleda sliko bradatega moškega.    Jože: \"Kaj?!? Pa ti si poročena! Kako si lahko to storila?\"    Lepotica: \"Sprosti se, nisem poročena.\"    Jože: \"Kdo pa je potem to?\"    Lepotica: \"Jaz, pred operacijo.\"", CategoryId = 27 },
                new Joke() { Id = 1232, Active = true, Title = "Prava ljubezen", Description = "Kako veš, da si srečal pravo ljubezen?    Ko ti ženska izprazni jajca in ne denarnice.", CategoryId = 40 },
                new Joke() { Id = 1233, Active = true, Title = "Vsaka ima nekaj seksi", Description = "Vsaka ženska ima nekaj seksi.    Nekatere oči, nekatere telo, nekatere noge in nekatere prijateljico.", CategoryId = 40 },
                new Joke() { Id = 1234, Active = true, Title = "Srečanje vžigalic", Description = "Pet črnih, ožganih, vžigalic sreča eno neuporabljeno, z rdečo glavo.    Na glas se začnejo krohotati.    Rdeča vžigalica: \"Kaj je narobe?\"    Črne: \"A tebe pa še nobeden ni kresnil?\"", CategoryId = 43 },
                new Joke() { Id = 1235, Active = true, Title = "Janezek pokonci do pozne ure", Description = "Janezek je ostal pokonci do pozne ure. Tako dolgo, da so na TVju so začeli oddajati program za odrasle.    Janezek z zanimanjem opazuje, ko se glavna akterja začneta slačiti.    Mama v zadregi: \"Janezek, hitro spat! Vidiš, da se stric in teta tudi odpravljata v posteljo.\"", CategoryId = 15 },
                new Joke() { Id = 1236, Active = true, Title = "Časi se spreminjajo", Description = "Pri mladih parih dekleta jemljejo tableto.    Pri starih parih pa moški.", CategoryId = 43 },
                new Joke() { Id = 1237, Active = true, Title = "Poimenovanje", Description = "Striptizete se, pri nas, imenujejo \"eksotične plesalke\".    Tako bi se lahko dilerji imenovali \"eksotični farmacevti\".", CategoryId = 43 },
                new Joke() { Id = 1238, Active = true, Title = "Žena rešuje križanko", Description = "Mož pomiva posodo, med tem pa žena rešuje križanko.    Ker ne ve, kaj je to \"človek pripravljen na poroko\" na pet črk, vpraša moža, kaj je to.    Mož, kot iz topa: \"I-D-I-O-T\"", CategoryId = 11 },
                new Joke() { Id = 1239, Active = true, Title = "Lovljenje velikih rib", Description = "Policijska ministrica na glas: \"Mi lovimo tudi ta velike ribe!\"    Državni tožilec, malo bolj potiho: \"A jih, kot pravi športni ribiči, potem takoj izpustimo.\"", CategoryId = 23 },
                new Joke() { Id = 1240, Active = true, Title = "Ženski slovar", Description = "DOBRO  To je beseda, ki jo ženske uporabijo, ko želijo končati prepir, v katerem imajo one prav in hočejo, da utihnete.    PET MINUT  Če se oblačijo, to pomeni pol ure. Pet minut pomeni pet minut samo takrat, ko gledate tekmo in prav toliko prostega časa vam še odmeri, preden ji morate začeti pomagati pri hišnih opravilih.    NIČ, NIČ...  To je zatišje pred viharjem. To običajno pomeni \"nekaj\" in morali bi biti previdni. Prepiri, ki se pričnejo s to frazo, se običajno končajo z \"Dobro\".    SAMO POIZKUSI  To je izziv, a ne dovoljenje. Ne poizkušajte!    GLASEN VZDIH  To ni beseda, temveč neverbalna izjava, ki jo moški pogosto narobe razumejo. \"Glasen vzdih\" običajno pomeni, da ona misli, kako ste neumni in kako se sprašuje, zakaj sploh zapravlja čas z vami. Razpravlja se tudi okoli \"Nič, nič…\".    V REDU JE...  To je ena najnevarnejših ženskih izjav. \"V redu je\" pomeni, da že razmišlja o tem, kako bi vas kaznovala za vašo napako.    HVALA  Žena se vam zahvaljuje. Ne sprašujte se zakaj , ampak samo recite \"Ni za kaj\".    VSEENO  Ženski način, da vam reče \"Jebi se\"!", CategoryId = 40 },
                new Joke() { Id = 1241, Active = true, Title = "Pogovor dveh kirurgov", Description = "Pogovarjata se dva kirurga.    Prvi: \"Teoretično pacient Mihec sploh ne bi smel preživeti operacije.\"    Drugi: \"Vidite, kolega. Proti močni volji do življenja je še moderna medicina nemočna.\"", CategoryId = 39 },
                new Joke() { Id = 1242, Active = true, Title = "Muckanje v parku na klopci", Description = "Starejša ženska se sprehaja po parku. Srečala je mlad par, ki se je muckal na klopci.    Ne more si kaj, da ju nebi ogovorila: \"Joj, kako lep par sta! Kako dolgo sta že poročena?\"    Fant: \"Pet let.\"    Punca: \"Jaz pa tri.\"", CategoryId = 43 },
                new Joke() { Id = 1243, Active = true, Title = "Laži", Description = "Kdaj se bolj lažemo?    1. aprila ali 14. februarja?", CategoryId = 43 },
                new Joke() { Id = 1244, Active = true, Title = "Obletnica", Description = "Žena se, iz kuhinje zadere možu v dnevno sobo: \"Danes je najina obletnica!\"    Mož, ležerno, na kavču. Z daljincem v roki: \"A res? Na katerem programu?\"", CategoryId = 11 },
                new Joke() { Id = 1245, Active = true, Title = "Pri zdravniku", Description = "Zdravnik: \"Ali se držite mojih navodil nove tabletki zjutraj, pri kosilu pa kozarček rdečega?\"    Pacient: \"še kar! S tabletami sem v zaostanku, pri rdečem pa prehitevam za dva tedna, pa se zgliha!\" ", CategoryId = 39 },
                new Joke() { Id = 1246, Active = true, Title = "Tri faze v ženskem življenju", Description = "1) Gre na živce očetu.    2) Gre na živce možu.    3) Gre na živce zetu.", CategoryId = 40 },
                new Joke() { Id = 1247, Active = true, Title = "Vražji preizkus", Description = "Z deklico svojega srca sem hodil že več kot leto dni, ko sva sklenila, da se poročiva. Moji starši so nama v vseh pogledih pomagali, prijatelji so me spodbujali, moja deklica pa... Bila je sanjska.    Samo ena stvar me je malce vznemirjala - moja bodoča tašča. Bila je uspešna poslovna ženska, bistra, predvsem pa lepa in seksi. Včasih se je z menoj čisto očitno spogledovala, kar me je spravljalo v zadrego.    Nekega dne me je poklicala, naj se oglasim, da bova pregledala seznam gostov. Šel sem. Bila je sama in ko sem prišel, mi je zašepetala, da se bom kmalu poročil, njej pa sem všeč in si me želi. Rada bi se z menoj ljubila, samo enkrat, preden se poročim in se zapišem njeni hčeri.    Kaj naj bi ji rekel?    Bil sem tako presenečen, da nisem mogel izustiti niti besede.\"Grem v spalnico,\" je rekla, \"in če si pripravljen, pridi za menoj.\"    Ko je odhajala po stopnicah v spalnico, sem gledal za njo in občudoval njeno graciozno zadnjico. Samo trenutek sem premišljeval,potem sem pa šel k vhodnim vratom, jih odprl in stopil iz hiše...    Pred hišo je stal njen mož, me s solznimi očmi objel in rekel: \"Zelo smo srečni in zadovoljni, da si opravil našo malo preizkušnjo..Ne bi si mogli želeti boljšega moža za svojo hčer, kot si ti.Dobrodošel v družini.\"    Iz tega sem se naučil: kondome imej vedno v avtu.", CategoryId = 11 },
                new Joke() { Id = 1248, Active = true, Title = "Švica in Slovenija", Description = "Razlika med Švico in Slovenijo:  - Švicarji imajo luknje v siru  - Slovenci pa na cestah", CategoryId = 43 },
                new Joke() { Id = 1249, Active = true, Title = "Ogenj", Description = "Mujo vstopi v avtobus poln  crncev.  Pogleda naokoli in rece:  Ali je tukaj morda gorelo?", CategoryId = 43 },
                new Joke() { Id = 1250, Active = true, Title = "Kmet pri zdravniku", Description = "Kmet: \"S postelje sem padel pri divjem seksu z deklo in sl zlomil roko.\"    Zdravnik: \"No no, tole pa povejte malo bolj lepo. Bo v kartoteki.\"     Kmet: \"V redu! Pri polaganju semena v brazdo sem padel z delovnega stroja!\"", CategoryId = 39 },
                new Joke() { Id = 1251, Active = true, Title = "Tri cuda sveta", Description = "Zenska je vlazna, pa ne gnije.  Penis je trd, pa nima kosti.  Svet je okrogel, seksajo pa  na vsakem vogalu.", CategoryId = 43 },
                new Joke() { Id = 1252, Active = true, Title = "Bazen v Bohinju", Description = "V Bohinju so hoteli zgraditi plavalni bazen.    Predsednik krajevne skupnosti je obiskal bogatega kmeta, da bi kaj prispeval.    Predsednik krajevne skupnosti: \"France boš kej prispevu za bazen?\"     France \"Bom ja! Mica dej gvaž frišne vode.\" ", CategoryId = 12 },
                new Joke() { Id = 1253, Active = true, Title = "Mladoporočenca v postelji", Description = "Po opravljenem delu, na poročno noč, se mladoporočenca odpravita spat.    Mladi ženin zapre oči in si misli: \"Od danes naprej bom lahko seksal kadar koli bom hotel in koliko bom hotel.\"    Mlada nevesta si pa misli: \"Od danes naprej bom dobila karkoli bom hotela, ko si bo zaželel seksa.\"", CategoryId = 11 },
                new Joke() { Id = 1254, Active = true, Title = "Nedolznost", Description = "Mama se zelo boji za nedolznost  svoje osemnajstletne hcere in v  pogovuru rece prijateljici:  Ves Lizika, ce tako pomislim,   se mi otrok kar smili. Pri teh  letih, pa bi ze igrala posteljne  igrice. Bi bila najraje kar sama  na njenem mestu.", CategoryId = 11 },
                new Joke() { Id = 1255, Active = true, Title = "Kapljice za oči", Description = "Punca si daje kapljice v oči.    V levo oko dve kapljici, v desno oko dve kapljici.    Potem pa še na tamalo tri kapljice, rekoč: \"Aaaaa, ti tudi že dolgo nisi nič videla.\"", CategoryId = 40 },
                new Joke() { Id = 1256, Active = true, Title = "Rojstni dan", Description = "Zena poslje mozu SMS sporocilo:  Danes imam rojstni dan.  On ji odgovori:  Joj draga, ti pa res na vse   mislis.", CategoryId = 11 },
                new Joke() { Id = 1257, Active = true, Title = "Poraba kalorij pri seksu", Description = "Dokazano je, da moški, pri seksu, porabi 3100 kalorij.    100 pri samem dejanju. 3000 pa pri tem, ko se hvali naokoli.", CategoryId = 27 },
                new Joke() { Id = 1258, Active = true, Title = "Sekira", Description = "Rudi seka drva in k njemu   pride zena;  Ali te zanima, koliko sem vceraj  zapravila po nakupih?  Lepo te prosim, ne zdaj, ko  imam sekiro v rokah.", CategoryId = 11 },
                new Joke() { Id = 1259, Active = true, Title = "S težavo so ga odpustili", Description = "Direktor delavca odpusti z besedami: \"Res mi je žal, bili ste mi, kot sin.\"    Delavec: \"Ne razumem, kako to mislite?\"    Direktor: \"Predrzen, zadirčen, nehvaležen, nesposoben in len.\"", CategoryId = 29 },
                new Joke() { Id = 1260, Active = true, Title = "Direktor in mašinerija", Description = "Direktor stoji pred uničevalcem dokumentov s šopom papirjev v rokah.    Mimo pride ena uslužbenka in vpraša: \"Lahko pomagam?\"    Direktor: \"Moja tajnica je na bolniški, pa ne vem, kako to deluje?\"    \"Preprosto,\" pravi uslužbenka, vtakne papirje v režo in požene stroj.    Ko stroj konča, direktor pravi: \"Pa je res preprosto. In kje so zdaj kopije?\"", CategoryId = 29 },
                new Joke() { Id = 1261, Active = true, Title = "Crnogorski virus", Description = "Kaj pocne crnogorski   virus v racunalniku?  Ne vem.  Nic.", CategoryId = 43 },
                new Joke() { Id = 1262, Active = true, Title = "Zavarovanje", Description = "Marta! zaklice Kosir, ko se   vrne iz sluzbe.  Danes sem bil v zavarovalnici in  sklenil zivljensko zavarovanje  za 150.000 evrov!  Marta: Super! Zdaj ti vsaj ne bo  treba vec za vsako malenkost  hoditi k zdravniku.", CategoryId = 11 },
                new Joke() { Id = 1263, Active = true, Title = "Cvek", Description = "Mama se dere na Bucka:  Le kako si lahko spet dobil  cvek?  Bucko nazaj: Preprosto, uciteljica   je spet sprasevala.", CategoryId = 11 },
                new Joke() { Id = 1264, Active = true, Title = "Pogovor med spermiji ", Description = "Spermiji veselo plavajo proti jajčnikom.    Ker je eden že utrujen, vpraša: \"Jaz sem že čisto izmučen! Kako daleč je še do jajčnikov?\"    Eden izmed množice mu odgovori: \"Uuuu, še dolgo! Šli smo komajda mimo mandljev.\"", CategoryId = 27 },
                new Joke() { Id = 1265, Active = true, Title = "Izgubil je stare starše", Description = "\"Janezek, ali še imaš dedka in babico?\"  \"Ne, umrla sta od seksa.\"  \"Kako pa je to mogoče?\"  \"Babica se je zjebala po stopnicah.\"  \"Kaj pa deda?\"  \"Deda pa je nekaj drkal okrog elektrike.\"", CategoryId = 15 },
                new Joke() { Id = 1266, Active = true, Title = "Pri maši", Description = "Starejši par sedi v cerkvi pri maši.    Žena se nagne k možu. \"Potiho sm prdnla a bo ok?\"     Mož odgovori: \"Zamenjaj si batarije v slušnem aparatu!\"", CategoryId = 5 },
                new Joke() { Id = 1267, Active = true, Title = "Pijan je prišel domov", Description = "\"Kako te je pa včeraj zvečer sprejela žena, ko si prišel tako nabrgljan domov?\"    \"Vame je metala rožice.\"    \"Kaj takega!\"    \"Ja, samo iz lončkov jih pa ni dala.\" ", CategoryId = 21 },
                new Joke() { Id = 1268, Active = true, Title = "Poslala ga je kupiti polže", Description = "Žena pošlje moža na tržnico, naj kupi kilogram polžev, da bodo imeli za kosilo francosko specialiteto.    Mož se odpravi na pot, vendar na poti iz tržnice sreča prijatelja, ki se že dolgo nista videla. Po kratkem pogovoru zavijeta v bližnjo gostilno in se ga napijeta.    Pozno zvečer se mož z vrečko polžev vrne domov pred vhodnimi vrati zloži polže na tla in pogumno pozvoni.    Žena vsa razjarjena odpre  vrata  in  še  preden  odpre  usta, mož pogleda polže in reče: \"No pojdite polžki moji, že tako smo pozni!\"", CategoryId = 11 },
                new Joke() { Id = 1269, Active = true, Title = "Klic v sili", Description = "Poklicali ste 113, klic v sili,   prosim.  Dve punci se tepeta zame!  In kje je tu problem?  Grda punca zmaguje!", CategoryId = 43 },
                new Joke() { Id = 1270, Active = true, Title = "Plaz v gorah ju je zasul", Description = "Gorenjec  in  Štajerc  se  odpravita  v  gore.    Bila je zima in zgodilo se je, da ju je zasul snežni plaz.    Po dolgem razkopavanju snega, se nekako prebijeta na površje in tam ju je čakal  velik  bernardinec  z  sodčkom ruma okoli vratu.    Gorenjec ves vesel vzklikne: \"Oh, poglej, človekov najboljši prijatelj!\"    Štajerc pa takoj za njim: \"Pa kako lepi pes ga je prinesel!\"", CategoryId = 28 },
                new Joke() { Id = 1271, Active = true, Title = "  Obletnica poroke", Description = "Kosir se zacuda spomni obletnice  poroke in Marto preseneti z darilom.  In to kaksnim! Podari ji zlato  zapestnico.  Marta kar ne more verjeti.  Nejeverno vprasa: Ali je zapestnica   cisto zares iz pravega zlata?  Kosir: Seveda je! Ce ni, so me  nategnili za 10 evrov!", CategoryId = 11 },
                new Joke() { Id = 1272, Active = true, Title = "Blondinka in Zorro", Description = "Je pritekel mimo blondinke Zorro in na zid vgraviral črko Z.    Po njegovem odhodu blondinka reče poglej Zuperman je bil tu!", CategoryId = 4 },
                new Joke() { Id = 1273, Active = true, Title = "Novo stanovanje v bloku", Description = "Janezek je dobil stanovanje v 3. nadstropju, a ni bil prav nič zadovoljen.    \"Kaj ti ni všeč?\" so ga vprašali.    \"Dvigalo je nerodno. V njem piše SAMO ZA 4 OSEBE.\"    \"In kaj potem?\"    \"Veliko časa traja, da zjutraj zbudim še 3 sosede in jih prepričam, da se skupaj odpeljemo.\"", CategoryId = 15 },
                new Joke() { Id = 1274, Active = true, Title = "Delam za tri", Description = "Korel se oglasi pri svojem sefu:  Sef, ze dvajset let delam pri vas  in ves cas delam za tri.  Ali mi res ne bi mogli povisati  place?  On: Ne, ni sans! Povejte mi raje   imena tiste dvojice, namesto katerih  delate, da ju bom postavil na cesto!", CategoryId = 29 },
                new Joke() { Id = 1275, Active = true, Title = "Naravoslovje", Description = "Ucitelica pri naravoslovju:  No, Bucek, povej, koliko kosti  imas v telesu?  On: Najmanj dva tisoc petsto.  Uciteljica: Zakaj pa me nisi vceraj  poslusal, ko sem razlozila, da je v  cloveskem telesu dvesto kosti.  Bucek: Saj sem! Ampak danes zjutraj   sem jedel sardine.", CategoryId = 32 },
                new Joke() { Id = 1276, Active = true, Title = "Locitev", Description = "Maja obisce odvetnika.  Zeli se cim prej lociti od moza,   temu primerno ga ves cas kritizira.  Po desetih minutah jo odvetnik  le prekine: Oprostite, a nekaj je   pa le bilo pozitivnega na njem, da  ste se z njim porocili. Kajne?  Maja: Ja, je bilo, toda vse do  zadnjega evra sva porabila.", CategoryId = 11 },
                new Joke() { Id = 1277, Active = true, Title = "Trkanje", Description = "Babica in dedi se odlocita,   da bo on preiskusil viagro.  Ona zvecer leze v posteljo,  dedi pa pride do vrat spalnice  in potrka. Ona vprasa:  Zakaj pa trkas?  Ne vprasa se, zakaj, ampak  s cim trkam.", CategoryId = 11 },
                new Joke() { Id = 1278, Active = true, Title = "Podedovanje pameti", Description = "Žena: \"Najin sin je zelo inteligenten, zagotovo je dobil pamet od mene!\"    Mož: \"Se strinjam, meni je pamet ostala.\"", CategoryId = 11 },
                new Joke() { Id = 1279, Active = true, Title = "Obrila si je muco", Description = "Zvečer v postelji.    Žena: \"Obrila sem si muco, ali veš, kaj to pomeni?\"    Mož, nejevoljno: \"Vem, hudiča! Vem! To pomeni, da je odtok spet zamašen.\"", CategoryId = 11 },
                new Joke() { Id = 1280, Active = true, Title = "Rešitelj", Description = "Gorenjec vpraša mladeniča: \"Ste vi tisti mladenič, ki je rešil mojo hčer izpod ledene skorje, ko je drsala na zamrznjenem jezeru?\"    \"Ja, jaz sem tisti.\"    \"In kje so njene drsalke?\"", CategoryId = 12 },
                new Joke() { Id = 1281, Active = true, Title = "Cik cak vožnja", Description = "\"Gospod, po cesti ste vozili cik-cak. Ste mogoče kaj pili?\" zanima policaja.    \"Hk, jest nejsm, hk, n'č pil.\"    \"Zakaj ste pa potem tako vozili?\"    \"Da ne bi povozu belih miši.\"", CategoryId = 21 },
                new Joke() { Id = 1282, Active = true, Title = "Vedno se isto oblači", Description = "\"France, zakaj v gostilno vedno prideš v tej stari oguljeni obleki?\"    \"Ker je žena rekla, da z mano ne bo šla nikamor, dokler se bom tako oblačil!\"", CategoryId = 11 },
                new Joke() { Id = 1283, Active = true, Title = "Čaka moža", Description = "Ko mine polnoč, pozvoni soseda pri vratih svoje znanke: \"Marija, a mi boš, prosim, posodila nudel' valjar?\"    \"Žal ne morem. Tudi mojega moža še ni od nikoder!!!\"", CategoryId = 40 },
                new Joke() { Id = 1284, Active = true, Title = "Sprehod po Ljubljani", Description = "Joža pelje svojo izbranko v Ljubljano.    Ko se nekaj časa sprehajata, jo vpraša: \"Draga, bi se hotela peljati po Ljubljani z velikim Mercedesom in šoferjem?\"    \"Seveda, zelo rada.\"    \"Prav. Pa pejva na avtobus!!!\"", CategoryId = 43 },
                new Joke() { Id = 1285, Active = true, Title = "Malica", Description = "Korel pride v gostilno na   malico.  Natakar mu prinese izbrano jed,   Korel pa:  Ta zrezek smrdi po zganju.  Natakar stopi dva metra stran in  vprasa:   A se vedno?", CategoryId = 13 },
                new Joke() { Id = 1286, Active = true, Title = "Pitje alkohola", Description = "\"France, le kako lahko popiješ toliko alkohola?\"    \"Plačaj mi en liter vina - pa ti takoj pokažem!\"", CategoryId = 21 },
                new Joke() { Id = 1287, Active = true, Title = "Pije vsaki dan", Description = "France se pijan vrne domov in žena ga jezna pričaka na vratih: \"Nikar se ne jezi, ljubica. Veš, da imam rad samo tebe!\"    \"Figo me imaš rad. Če bi me imel rad, ne bi pil vsak dan.\"    \"Motiš se, draga. Ko sem pijan te imam dvakrat bolj rad.\"    \"Kako pa to?\"    \"Ker te pijan dvojno vidim!\"", CategoryId = 21 },
                new Joke() { Id = 1288, Active = true, Title = "Na iztreznitvi", Description = "Jože se zjutraj zbudi v celici za streznitev.   Ko zagleda policaja, ga vpraša: \"Zakaj ste me pa pripeljali sem?\"    Policaj: \"Zaradi pijače.\"    Jože, veselo: \"Krasno! Kje jo pa imate???\"", CategoryId = 21 },
                new Joke() { Id = 1289, Active = true, Title = "Nima za pijačo", Description = "\"France, posodi mi no 5 eurov za en liter pa še malo. Mi plačo dobimo šele jutri,\" fehta Jože.    \"Žal ne morem. Veš, mi smo jo dobili že včeraj.\"", CategoryId = 21 },
                new Joke() { Id = 1290, Active = true, Title = "Nalita na cesti", Description = "Prijatelja, ki sta preveč pogledala v kozarec, se peljeta domov od Višnje Gore proti Ivančni Gorici. Avto drvi od bankine do bankine, pa reče prvi: \"Paz', kaku voziš!\"    \"Jest? A ne šofiraš ti?\"", CategoryId = 21 },
                new Joke() { Id = 1291, Active = true, Title = "Štajerc, dolenjc in pijača", Description = "Štajerec: \"Jaz pijem le takrat, kadar nimam drugega dela!\"    Dolenjec: \"Jaz pa delam le takrat, kadar nimam nobene pijače!!!!\"", CategoryId = 21 },
                new Joke() { Id = 1292, Active = true, Title = "Uleti iz gostilne", Description = "Dolenjec gre iz gostilne in se zaleti v mimoidočo žensko.    Ta mu takoj primaže eno okrog ušes, on pa se strese in reče: \"Madonca, taku hitru pa še nikul nej s'm pr'šu damu!!!\"", CategoryId = 21 },
                new Joke() { Id = 1293, Active = true, Title = "Očitno je pijan", Description = "\"Kako si ugotovil, da je Branko pijan?\"    \"Kako pa ne bi? Saj je začel govoriti, da se ne boji žene in da se s taščo odlično razume!!!\"", CategoryId = 21 },
                new Joke() { Id = 1294, Active = true, Title = "Razšla sta se", Description = "\"Zakaj sta se z Ireno razšla?\"    \"Nisva več zdržala skupaj!\"    \"Kaj pa je bilo tako hudega?\"    \"Ona me ni prenašala, ko sem bil pijan, jaz pa nje ne, ko sem bil trezen!!!\"", CategoryId = 21 },
                new Joke() { Id = 1295, Active = true, Title = "Dogodivščine s taksijem", Description = "France, ki se ga je precej nalezel, ustavi taksi. Ko odpre vrata na drugi strani avtomobila, pade ven. S težavo vstane in skozi okno reče vozniku: \"To je pa bila zelo hitra vožnja! Koliko sem pa dolžan????\"", CategoryId = 21 },
                new Joke() { Id = 1296, Active = true, Title = "Ženska debata o moških", Description = "Štiri žene modrujejo: \"Moj pride iz gostilne po enem vrčku piva.\"    \"Moj po dveh.\"    \"Moj po treh.\"    \"Moj pa običajno po vseh štirih!!!\"", CategoryId = 11 },
                new Joke() { Id = 1297, Active = true, Title = "Čudna gravitacija", Description = "France se vrača iz gostilne in le s težavo lovi ravnotežje.    Sam pri sebi naglas razmišlja: \"Neverjetno! Le kako lahko vse vino steče na eno stran, da me vleče malo v levo, pa potem spet vse na desno, da me vleče malo v desno!!!\"", CategoryId = 21 },
                new Joke() { Id = 1298, Active = true, Title = "Nakup krave", Description = "Oče in sin, oba Gorenjca, gresta na trg. Oče si nekaj časa ogleduje kravo, jo otipava.    Sin to gleda in vpraša: \"Očka, kaj pa delaš?\"    \"Morali bomo kupiti eno, pa se hočem prepričati, da bo dobra in vredna svojega denarja.\"    Čez nekaj dni, ko se oče vrača s polja, mu sin pride nasproti in reče: \"Očka, kmalu se bomo znebili mamice!\"    \"Zakaj?\"    \"Ko te ni bilo doma, si jo je ogledoval in otipaval sosedov Joža. Morda jo bo pa kupil!!!????\"", CategoryId = 11 },
                new Joke() { Id = 1299, Active = true, Title = "Ne da se kar tako", Description = "\"Joža, ne grem s tabo v posteljo, preden mi ne obljubiš, da se boš poročil z menoj!\" se upira Micka.    \"Toda, Micka, saj veš, da te ljubim!\"    \"Micka gor, Micka dol. Obljubi! Doslej sem to zahtevala še od vsakega, ki je hotel spati pri meni, pa bom še od tebe!\"", CategoryId = 27 },
                new Joke() { Id = 1300, Active = true, Title = "Skopuh", Description = "\"Nočem skopuha! Vračam ti prstan, baraba!\"    \"Kje je pa škatlica????\"", CategoryId = 43 },
                new Joke() { Id = 1301, Active = true, Title = "Želja", Description = "Ko se Joža znajde v skupini lepih deklet, zavzdihne in komentira: \"Moral bi biti ginekolog.\"    \"Zakaj pa?\" ga vpraša Anže.    \"Vsa dekleta bi se slačila pred menoj pa še plačevala bi mi za to!\"", CategoryId = 43 },
                new Joke() { Id = 1302, Active = true, Title = "Hotela se je prepričati", Description = "\"Joža, a me imaš ti sploh kaj rad?\"    \"Micka. Če na tem svetu ne bi bilo nogometa, televizorja in alkohola, bi ti bila za mene najpomembnejša stvar na tem svetu!!!\"", CategoryId = 11 },
                new Joke() { Id = 1303, Active = true, Title = "Diagnoza pri zdravniku", Description = "Zdravnik pregleda Anžeta in mu reče: \"Anže, tole pa ne izgleda ničkaj rožnato. Izogibati se boš moral vinu, tobaku in ženskam.\"    \"Vinu in tobaku se lahko odpovem, ženskam pa nikakor ne!\" se brani Anže.    \"Zakaj pa ne?\"    \"Ja, kdo mi bo pa kuhal in pral umazane gate???\"", CategoryId = 17 },
                new Joke() { Id = 1304, Active = true, Title = "Hitra vožnja", Description = "Dolenjca se zbašeta v taksi.    Voznik: \"Do kod?\"    Prvi Dolenjec: \"Do kolodvora!\"    Voznik: \"Saj smo vendar že tukaj!\"    Drugi Dolenjec: \"Tu 'mate denar, drugič pa nikar tako ne divjajte!!!\"", CategoryId = 10 },
                new Joke() { Id = 1305, Active = true, Title = "Roke se mu tresejo", Description = "\"Vidim, da se vam zelo tresejo roke,\" komentira zdravnik. \"France, povejte mi po resnici a preveč pijete?\"    \"Kej pa, gaspud dohtar,\" odvrne France. \"Preveč palijem ... \"", CategoryId = 21 },
                new Joke() { Id = 1306, Active = true, Title = "Poboljšal se je", Description = "\"Mici, tvoj mož France se je očitno poboljšal. Videla sem, da je včeraj kar precej zgodaj šel iz gostilne.\"    \"Nič se ni poboljšal!\"    \"Kaj pa se je potem zgodilo?\"    \"Zmanjkalo mu je denarja.\"", CategoryId = 11 },
                new Joke() { Id = 1307, Active = true, Title = "Tak, kot oče", Description = "\"Jej, jej! Kako lepega sina imaš!\"    \"Ja, lep je. Tak je kot njegov očka!\"    \"Po čem pa to sklepaš?\"    \"Takoj ko mu vzamem stekleničko, se začne dreti na vse grlo!!!\"", CategoryId = 11 },
                new Joke() { Id = 1308, Active = true, Title = "Test sape, ko pride domov", Description = "France prizna, da mora vsak večer, ko se pozno vrača domov, dahniti skozi ključavnico. In če žena ugotovi, da je v njegovi sapi preveč vinskih hlapov, ga ne spusti v stanovanje.    Prijatelj pa mu takole svetuje: \"Vsak večer, preden greš domov, pojej malo gorgonzole! \"    Rečeno - storjeno. France poje gorgonzolo in ko se vrne pred domača vrata, se izza njih oglasi žena: \"France! Pihni!\"    France pihne.    \"O ti prasec, ne prdaj skozi ključavnico!\"", CategoryId = 21 },
                new Joke() { Id = 1309, Active = true, Title = "Ima zelo pridno ženo", Description = "Dolenjčki se pogovarjajo v gostilni: \"Moja žena je zelo pridna.\"    \"Kako to misliš?\"    \"Kadarkoli pridem domov, ima kaj v roki. Kuhalnico, valjar, metlo ... \"", CategoryId = 21 },
                new Joke() { Id = 1310, Active = true, Title = "Gledata boks", Description = "Mož in žena ležita na kavču in gledata boks.    Mož: \"Kako dolgočasno! Vse se je končalo v dveh minutah.\"    Žena: \"Hja, no, zdaj vidiš, kako je meni!\"", CategoryId = 11 },
                new Joke() { Id = 1311, Active = true, Title = "Na letalu ne nekomu slabo", Description = "V letalu neki moški stopi k stevardesi in jo prosi: \"Gospa, a bi lahko dobil tamajhno stekleničko kakršnega koli alkohola?\"    \"Seveda. Kaj se je pa zgodilo?\"    \"Neki ženski je postalo slabo!\"    Stevardesa odhiti v prostor s pijačo in ko se vrne, ji moški dobesedno strga steklenico iz rok in začne piti.    Stevardesa: \"Kaj pa zdaj to pomeni?\"    \"Šele zdaj mi je odleglo! Veste, ne prenesem, če vidim koga, ki mu je slabo!!!!\"", CategoryId = 43 },
                new Joke() { Id = 1312, Active = true, Title = "Lezbijka", Description = "Zena hoce narediti moza ljubosumnega:  Kaj bi rekel, ce bi ti priznala,   da sem spala z clovekom, ki ga  imas najraje?  Da si lezbijka.", CategoryId = 27 },
                new Joke() { Id = 1313, Active = true, Title = "Ura", Description = "Mladenica se pogovarjata:  Ali imas radi prestavljene  ure kaj problemov?  Pa se koliko.  Prej mi je stal v postelji,   zdaj pa mi na avtobusu.", CategoryId = 17 },
                new Joke() { Id = 1314, Active = true, Title = "Podobnost", Description = " Prijatelja sedita preed   lokalom in eden rece:  Ej, ali vidis tista dva plesca?  Ja. In kaj je z njima?  Na las sta si podobna.", CategoryId = 43 },
                new Joke() { Id = 1315, Active = true, Title = "Ni se koncal", Description = "Milivoj pride mimo hise  Radkomirja in ga zagleda,   kako ob 12. uri sedi na terasi   pred hiso:  Ka pa delas?  Nic.  To si rekel tudi vceraj.  Pa se nisem dokoncal...", CategoryId = 17 },
                new Joke() { Id = 1316, Active = true, Title = "Oddih na jezeru", Description = "Zakonca sta odšla na počitnice v ribiški rezervat na severu.    Mož je užival v ribarjenju v zgodnjih jutranjih urah.  Žena je uživala v branju.[o:p][/o:p]    Nekega jutra si je mož po večurnem ribarjenju privoščil kratek dremež. Čeprav še nikdar ni bila na jezeru, se je žena odločila in vzela njegov čoln. Nekaj časa je veslala, nato pa iz torbe potegnila knjigo in začela brati.    Mimo je priveslal šerif. Ko je videl žensko v čolnu, je zaveslal tik k njenemu čolnu in jo pozdravil: \"Dobro jutro, gospa! Kaj pa delate?\"    \"Knjigo berem!\" mu je odgovorila ... in si mislila: \"Halo - a ni očitno?\"    \"Ste na območju, kjer je prepovedano ribariti,\" jo je seznanil šerif.    \"Toda, mar ne vidite, da ne lovim rib?\"    \"To že, ampak imate pa vso opremo. Moral vas bom prijaviti.\"    \"Če boste to storili, vas bom tudi jaz prijavila - zaradi posilstva!\" se je razhudila ženska.    \"Toda, saj se vas še dotaknil nisem!\" se je uprl šerif.    \"Ja, to je že res,\" mu je odvrnila, \"vendar pa imate vso opremo.\"     NAUK: Nikdar se ne prepiraj z žensko, ki zna brati. Po vsej verjetnosti zna tudi razmišljati. ", CategoryId = 40 },
                new Joke() { Id = 1317, Active = true, Title = "Mujo na potovanju okoli sveta", Description = "Preko Atlantika pluje ladja in mornarji naenkrat opazijo v vodi Mujota, ki plava sem in tja.    Potegnejo ga na krov in kapitan ga vpraša, kaj dela sredi Atlantika.  Mujo pravi: \"Dobio sam nagradil put oko svjeta za dvije osobe. Ja uzeo sa sobom svoju majku.\"    Kapitan ga vpraša, kakšno zvezo ima to z njegovim plavanjem po Atlantiku.    Mujo pojasni: \"Letimo ti mi nekim Boingom, kad ti ona stevardesa kaže: Vankufer. I ja uzmem kufer, te ga bacim van. Nije prošlo ni pola sata, kad ona kaže: Jamajka. Bacim ja i majku. Opet ni bilo ni pet minuta, kaže ona: Hajiti. I eto ti mene tu.\"", CategoryId = 18 },
                new Joke() { Id = 1318, Active = true, Title = "Miks jezikov", Description = "Kdo je največji angleški pizdun? Johny Šemedej    Najbolj potrebna Romunka? Scuro Popesku    Štajerc po kitajsko? ČujTi KjeJešankčuj    Kitajski minister za šport? Do Ping ", CategoryId = 43 },
                new Joke() { Id = 1319, Active = true, Title = "Po romantičnem večeru", Description = "Ona: \"Joj, dragi! Samo še en poljub mi daj, in ostanem tvoja celo življenje!\"    On: \"Hvala za opozorilo.\"", CategoryId = 17 },
                new Joke() { Id = 1320, Active = true, Title = "Fata je umrla", Description = "Mujotu je umrla žena. Odloči se, da bo dal osmrtnico v časopis.    Uslužbenka mu razloži: \"Pet besed je zastonj, za vsako nadaljnjo pa bo treba plačat\"    Mujo misli in premišljuje in se odloči: \"Dajte napisati UMRLA FATA\".    Uslužbenka pravi: \"To sta samo dve besedi, lahko dodate še tri in osmrtnica bo še vedno brezplačna!\"    Mujo spet misli in misli pa ji reče: \"Dodajte še PRODAJEM GOLF DIZEL!\"", CategoryId = 18 },
                new Joke() { Id = 1321, Active = true, Title = "Mož in žena v trgovini", Description = "On: \"Če bi ne imela nog, ali bi si kupila čevlje?\"    Ona: \"Seveda ne!\"    On: \"Zakaj si potem kupuješ modrček?\"", CategoryId = 11 },
                new Joke() { Id = 1322, Active = true, Title = "Varna voznica", Description = "Kaj pokaže moški ženski, ki je 10 let vozila brez nesreče?    Kako se prestavi v 2. prestavo! ", CategoryId = 40 },
                new Joke() { Id = 1323, Active = true, Title = "Idealni moški", Description = "Kako dobiš idealnega moškega?    Z genetskim inženiringom: križaš vibrator z bankomatom.", CategoryId = 17 },
                new Joke() { Id = 1324, Active = true, Title = "Agresivni moški kriči", Description = "Moški se dere: \"Pobil bom vse cigane!\"    Nihče mu ne oporeka.    Moški zopet: \"Pobil bom vse cigane!\"    Zopet mu nihče ne oporeka.    Moški zakriči: \"Pobil bom vse cigane in enega klovna!\"    Nekdo ga vpraša: \"Zakaj pa klovna?\"    Moški: \"Vidite, nikomur ni mar za cigane!\"", CategoryId = 9 },
                new Joke() { Id = 1325, Active = true, Title = "Vzdevki", Description = "Vpraša Mujo Fato: \"Fato, mogu li te zvati Eva?\"    Fata: \"Pa zašto?\"    Mujo: \"Ti si mi prva i jedina!\", ji razloži mujo.    Potem fata vpraša Mujota: \"A mogu li ja onda tebe zvati Peugeot?\"    Mujo: \"A zasto?\"    Fata: \"Jer si mi 607!\"", CategoryId = 18 },
                new Joke() { Id = 1326, Active = true, Title = "Privošči si starejšo", Description = "Janezek se odloči da bo končno seksal. Odpravi se v javno hišo, pa gleda izbiro in vidi same lepe prostitutke, vmes pa tudi eno staro kot zemlja.    In si reče: \"Use sem že podrl sam stare pa še ne!\"    In tako si kupi pravo babico za 1 noc.    Ko konča jo vpraša: \"Babica zakaj je bilo na začetku, ko sem prodrl vate tako grobo pa hrapavo, kasneje pa je šlo vse tako gladko?\"    Stara gospa mu odvrne: \"Janezek, veš najprej so kraste, pol globlje je pa gnoj.\" ", CategoryId = 9 },
                new Joke() { Id = 1327, Active = true, Title = "Janezek in posebne zahteve v bordelu", Description = "8-letni Janezek pride v javno hišo: \"Takoj zdele hočem kurbo z AIDSom, denar ni problem!\"    Prostitutke planejo v smeh, nakar pristopi glavna in ga poskuša pregovoriti, češ, premlad si za take zadeve, pojdi raje na igrišče brcat žogo.    Janezek je seveda vztrajen, denar ni problem, zato teži toliko časa, da res dobi okuženo kurbo.    Gresta v sobo in opravita svoje.    Po končanem opravilu pride najstarejša do njega in ga pobara: \"Poglej, toliko lepih in zdravih deklet je tu, zakaj si zahteval ravno okuženo?\"    Janezek mirno razloži \"No, takole je: danes zvečer sta me starša pustila samega z mojo varuško. Varuška je pedofilka in bo hotela seksati z menoj, ko bom prišel domov. Tako bo dobila AIDS.  Ko se bosta starša vrnila, bo oče varuško odpeljal domov, nakar bosta seksala. Tako bo še on dobil AIDS.  Ko se bo vrnil domov, bo seksal z mamo, ki se bo tako okužila z AIDSom.  Zjutraj bo šel oče v službo in takrat bo prišel poštar. Seveda bo seksal z mojo mamo...    No, on je tisti prasec, ki je zjutraj, s svojim kolesom, povozil mojo žabo!\" ", CategoryId = 15 },
                new Joke() { Id = 1328, Active = true, Title = "Polži", Description = "Kako se parijo polži?    S kropom. ", CategoryId = 41 },
                new Joke() { Id = 1329, Active = true, Title = "Zemlja", Description = "Zakaj je zemlja ženskega spola?    Ker nihče ne ve, koliko je stara. ", CategoryId = 43 },
                new Joke() { Id = 1330, Active = true, Title = "Jamar in orientacija", Description = "Kako se jamarji orientirajo v jami, kadar vse drugo odpove?    Z glavo močno trešči v zid in potem se lahko orientira po zvezdah. ", CategoryId = 43 },
                new Joke() { Id = 1331, Active = true, Title = "Pozdraviti AIDS", Description = "Kako se pozdravi AIDS?    Zdravo, AIDS!", CategoryId = 43 },
                new Joke() { Id = 1332, Active = true, Title = "Gorenjc in poslovni prtner", Description = "Poslovni partner pride h Gorenjcu na obisk.    Naposled ga Gorenc vpraša: \"A ste za osvežitev?\"    Poslovnež reče: \"Seveda\"    Gorenc pa zavpije: \"Marta, odpri malo okno, prosim!\" ", CategoryId = 12 },
                new Joke() { Id = 1333, Active = true, Title = "Gorenjci in velik nos", Description = "Zakaj imajo Gorenjci tako velik nos?    Zato ker je zrak zastonj. ", CategoryId = 12 },
                new Joke() { Id = 1334, Active = true, Title = "Ženska in orgazem", Description = "Kako žensko pripraviš do orgazma?    Pa koga to briga?", CategoryId = 40 },
                new Joke() { Id = 1335, Active = true, Title = "Križanje", Description = "Kaj dobiš, če križaš črnca in hobotnico?    Zaboga, da ne vem! Ampak, a si predstavljaš kako ta niger pobira bombaž?", CategoryId = 9 },
                new Joke() { Id = 1336, Active = true, Title = "V verigah", Description = "Kakšna je razlika med avtomobilsko pnevmatiko in nigerjem?    Guma ne tečnari, ko jo daš v verige.", CategoryId = 9 },
