                new Joke() { Id = 1338, Active = true, Title = "Torta na ciganski poroki", Description = "Zakaj je torta na ciganski poroki narejena iz dreka?    Da se muhe ne zbirajo na nevesti.", CategoryId = 9 },
                new Joke() { Id = 1339, Active = true, Title = "Jezus na križu", Description = "Jezus visi na križu in v urah, ko čaka na smrt, pogleda v nebo in reče: \"Oče, priporočam se ti! Če si lahko v teh mučnih urah dovolj milosten, da umakneš te žeblje iz mojih dlani!\"    Poof! In žeblji izginejo!    Jezus se počasi začne spuščati iz križa, vmes pa vpije: \"Še noge! Noge!\"", CategoryId = 43 },
                new Joke() { Id = 1340, Active = true, Title = "Povozi ga", Description = "Kaj nastane če cigana povozi valjar?    CD-rom", CategoryId = 7 },
                new Joke() { Id = 1341, Active = true, Title = "Hitro se mu je maščevalo", Description = "Janezek vidi očeta piti laško pivo in ga vpraša, če lahko tudi on dobi en požirek.    Oče ga pa vpraša: \"Sine, a se ti lahko z lulčkom dotakneš ritke?\"    Janezek poskusi in pravi da ne gre.    \"No, potem si pa še premajhen,\" mu reče oče.    Po dveh tednih je Janezek dobil na lotu sedmico in oče ga zaprosi, če odstopi tudi njemu kakšen milijonček, da bo zamenjal avto.    Janezek pa ga vpraša: \"Oči, a se ti lahko z lulčkom dotakneš ritke?\"    \"Seveda se lahko\" mu ponosno odvrne oče.    \"No, potem se pa jebi!\" ", CategoryId = 15 },
