                new Joke() { Id = 1344, Active = true, Title = "Zamudil v solo", Description = "Bucek zamudil v solo:  Oprostite, ker sem zamudil.  Veste, na avtobuso je negdo  zgubil 500 evrov.  Uciteljica: Priden, in ti si   pomagal iskati, kajne?  Bucek: Ne, ne, jaz sem drzal   nogo na bankovcu. ", CategoryId = 32 },
                new Joke() { Id = 1345, Active = true, Title = "V parku krmi golobe", Description = "Starejša gospa je sedela na klopci v parku in s kruhom krmila golobe.    Drobne koščke belega kruha je metala okoli sebe in klicala ptice.    Mimo je prišel mladenič, jo nekaj časa opazoval, nato pa pristopil k njej in ji očital: \"Vi mečete hrano stran, v Afriki pa otroci stradajo!\"    \"O, mladenič, jaz sem pa že prestara, da bi kruh lahko vrgla tako daleč!\"", CategoryId = 43 },
                new Joke() { Id = 1346, Active = true, Title = "Policaj in trenirka", Description = "Zakaj nosi policaj trenirko na glavi.    Ker na njej piše Kappa. ", CategoryId = 22 },
                new Joke() { Id = 1347, Active = true, Title = "Brezžično in žično", Description = "Komandir razlaga policistu, ki je komaj zapustil kadetnico, kaj so žične in kaj brezžične zveze.    Fant ne razume razlike, zato se komandir odloči, da mu bo zadevo pojasnil bolj preprosto in nazorno: \"Predstavljaj si mačka. Ko ga potegneš za rep, bo spredaj rekel miiijaaaau. Vidis, tako je pri žičnih zvezah, pri brezžičnih pa je isto, samo brez mačka.\" ", CategoryId = 22 },
                new Joke() { Id = 1348, Active = true, Title = "Obupal je", Description = "Francelj je imel prometno nesrečo. Zaradi poškodb so mu morali odstraniti moda. Nekaj časa je še šlo, nato pa je imel zaradi izgube moškosti vse več težav.    Po pomoč se je zatekel k psihiatrom, a prepričevanje, da zadeva ni tako huda, kot se mu zdi, ni zaleglo. Rešitev je videl samo še v samomoru.    Odpravi se na most, da se bo vrgel v reko. Kmalu se okoli njega nabere gruča ljudi in celo najboljši psihiatri ga ne morejo odvrniti od namere. Policist, ki patruljira v bližini, se približa množici in ko mu povejo, da hoče Francelj narediti samomor in zakaj, stopi k njemu, pogleda v globino in mu nekaj reče.    Francelj se enkrat pogleda v reko, stopi z roba mostu in se odpravi domov.    \"Kako vam ga je uspelo prepričati, kaj ste mu rekli?\" je radoveden psihiater. \"Nič posebnega. Samo doli sem pogledal in mu rekel:\" Za to, da se vržeš tu dol, moraš pa res imeti jajca.\" ", CategoryId = 43 },
                new Joke() { Id = 1349, Active = true, Title = "Blondinka in prometna kontrola", Description = "Policist ustavi blondinko: \"Vozniško in prometno, prosim.\"  \"Kaj pa je to?\"  \"Ja, gospodična, vozniška je taksna rdeča knjižica, ki jo mora imeti vsak voznik, dobi pa jo, ko naredi izpit\"  Blondinka živčno brska po torbici in privleče rdečo knjižico: \"Je to vozniška?\"  \"Je ja, še prometno prosim?  \"Kaj pa je to?\"  \"To je pa siva knjižica, ki jo mora imeti vsako vozilo.\"  Blondinka strese vsebino torbice na sedež in izbrska sivo knjižico: \"Je ta prava?\"  \"Je in vaši dokumenti so v redu, vendar vas prosim, da malo stopite iz avta,\" reče policist in si pri tem popravlja zadrgo.  \"Joj, pa ja ne bo spet alkotest?\" ", CategoryId = 4 },
                new Joke() { Id = 1350, Active = true, Title = "Železničar in policaj", Description = "Železničar na železniški postaji vpraša policista: \"Ali ves, kakšna je razlika med tem vagonom in teboj?\"    \"Ne vem!\"    \"Vidiš, ta vagon ima dva razreda, ti pa samo enega.\"    \"Pa mi ti povej, kakšna je razlika med tem vagonom in teboj?\"    \"Ne vem!\"    \"Vagon bo ostal tukaj, ti greš pa z mano na postajo.\" ", CategoryId = 22 },
                new Joke() { Id = 1351, Active = true, Title = "Lisica je zvita zver", Description = "\"Lisica je najbolj zvita zver!\" razlaga lovec Miha.    \"Si prepričan?\"    \"Sem. Ko sem jo ustrelil - se je pri priči spremenila v mojega psa.\"", CategoryId = 35 },
                new Joke() { Id = 1352, Active = true, Title = "Kakšen mora biti lovec", Description = "Predsednik lovske družine sprašuje kandidata za sprejem med lovce: \"Kaj je potrebno, da postaneš dober lovec?\"    \"Mirna roka, bister pogled in močan glas ... \"    \"Zakaj pa močan glas?\"    \"Da te slišijo, ko pri lovu na divje prašiče z drevesa kričiš na pomoč!\" ", CategoryId = 35 },
