                new Joke() { Id = 1361, Active = true, Title = "Večerja ob glasbi", Description = "\"Natakar, ali vaš ansambel zaigra tudi kaj po želji gostov?\"    \"Seveda!\"    \"Potem pa članom ansambla povejte, naj zaigrajo biljard, da bom lahko v miru pojedel večerjo.\" ", CategoryId = 13 },
