                new Joke() { Id = 1363, Active = true, Title = "Prazen kozarec", Description = "Gorenjca Kosirja obisce prijatelj  Korel s stajerskega konca.  S tresocimi se rokami mu Kosir  nalije kozarec piva, Korel ga  seveda urno zvrne.  Nato pa pol ure vrti prazen kozarec  v roki, naposled mu prekipi:  Cuj, imam prazen kozarec, mi   das se enega?  Kosir:Kaj pa ti bosta dva prazna  kozarca?", CategoryId = 12 },
