                new Joke() { Id = 1367, Active = true, Title = "Vročina na avtobusu", Description = "Se vozita Mujo in Haso v avtobusu.    Vročina za popizdit in šofer ju vpraša: \"Hočete li, da vam pustim air condition?\"    Haso: \"Ma daj rađe neke narodnjake nismo mi za taj hard rock.\"", CategoryId = 18 },
                new Joke() { Id = 1368, Active = true, Title = "Mož jo je kresnil", Description = "Pride možakar k spovedi: \"Včeraj se žena nagne v hladilno skrinjo, mene pa prime in jo kresnem od zadaj, a je to greh?\"    Župnik: \"Ne, to je naravno, tako mora biti.\"    Naslednji dan pride žena k spovedi: \"Gospod župnik, jaz grem v hladilno skrinjo iskat meso, naš pa mene od zadaj, a je to greh?\"    Župnik: \"Ne, saj je že včeraj vaš mož spraševal isto in sem mu povedal, da je to naravno in tako mora biti.\"    Ženska pa: \"A sva še naprej dobrodošla v cerkvi?\"    Župnik: \"Seveda...\"    Ženska. \"Dobro, ker v Merkatorju nisva več.\"", CategoryId = 5 },
