                new Joke() { Id = 1377, Active = true, Title = "Poročil se bo", Description = "\"Kaj??? Osemdeset let si star pa se boš poročil? Koliko jih ima pa tvoja zaročenka?\"    \"Šestnajst jih bo prihodnji mesec.\"    \"In kdaj bo poroka?\"    \"Ne vem še, ker njeni stari nekaj brez veze komplicirajo.\"", CategoryId = 43 },
