                new Joke() { Id = 1379, Active = true, Title = "Nakup kart", Description = "Na železniški postaji: \"A moram za otroke tudi plačat'?\" zanima žensko.    \"Pod sedem ni treba,\" odvrne blagajničarka.    \"Dobro. Jaz imam samo tri!\" ", CategoryId = 40 },
                new Joke() { Id = 1380, Active = true, Title = "Ne počuti se dobro", Description = "Mlado dekle zaupa svojemu zdravniku: \"Ne vem, kaj je z mano, ampak že tri mesece imam težave. Ne počutim se najbolje, ne morem jesti, večkrat bruham. Skratka same težave!\"    \"Po izvidih sodeč se boste morali kmalu poročiti.\"    \"Poročiti? Zakaj pa?\"    \"Da bodo vaše težave dobile tudi očeta!\"", CategoryId = 40 },
                new Joke() { Id = 1381, Active = true, Title = "Je le dočakal", Description = "\"Končno sem dosegel, da mi je Urška rekla DA!\"    \"Krasno, čestitam! Kdaj bo pa poroka?\"    \"Kakšna poroka?\" ", CategoryId = 17 },
