                new Joke() { Id = 1384, Active = true, Title = "Prevarala ga je", Description = "Potem ko je mož izvedel, da ga je žena prevarala z beračem, jo vpraša: \"Le kako si me lahko prevarala z beračem?\"    \"Prišel je pred vrata in me prosil, če mu lahko dam tisto, česar moj mož več ne rabi.\"", CategoryId = 40 },
                new Joke() { Id = 1385, Active = true, Title = "NAkup obleke za pudla", Description = "V trgovino z opremo za domače živali vstopi fina dama in reče: \"Rada bi oblekico za mojega pudel'čka?\"    \"Kakšne velikosti pa?\"    \"Joj, pozabila sem ga izmeriti.\"    \"Pa pojdite ponj.\"    \"Ne, to pa ne! Rada bi ga presenetila za rojstni dan!\"", CategoryId = 40 },
