                new Joke() { Id = 1387, Active = true, Title = "Vsi moški so enaki", Description = "\"Vsi moški so enaki!\"     \"Vsi bi od mene radi isto stvar.\"    \"Še sreča, da jo imam.\" ", CategoryId = 40 },
