                new Joke() { Id = 1393, Active = true, Title = "Vzvratna vožnja", Description = "Ženska je res čudna bitja!    Kar naprej gleda v ogledalo, samo takrat ne, ko z avtom vozi vzvratno! ", CategoryId = 40 },
                new Joke() { Id = 1394, Active = true, Title = "Opremljanje", Description = "Z avtom in žensko je popolnoma enako.    Neguješ ju in skrbiš zanju, kupiš ima razne luksuzne dodatke.    In ko sta popolno opremljena ti ju nekdo rukne od zadaj!\" ", CategoryId = 40 },
