                new Joke() { Id = 1396, Active = true, Title = "Ženske in ura", Description = "\"Zakaj ženskam ni potrebno nositi ročnih ur?\"    \"Ker je ponavadi v vsaki kuhinji obešena stenska ura!\" ", CategoryId = 40 },
                new Joke() { Id = 1397, Active = true, Title = "Ločitev in skrbništvo", Description = "Vprašaj žensko naslednje: \"Če dobiš otroka in se potem ločiš od moža, kdo naj bi po tvojem mnenju dobil otroka?\"    \"Seveda jaz!\" bi se oglasila ženska.    No, zdaj pa je čas za drug primer: \"V avtomat s pločevinkami vržeš pet evrov. Avtomat ti da pločevinko. Komu pripada pločevinka pijače: tebi ali avtomatu?\" ", CategoryId = 40 },
