                new Joke() { Id = 1406, Active = true, Title = "V muzeju", Description = "Vodič razlaga: \"Tu je okostje dinozavra, ki je staro tri milijone in petindvajset let.\"    \"Ste pa strokovnjak! Kako pa veste tako natančno?\"    \"Enostavno. Ko sem prišel sem delat, so mi rekli, da je staro tri milijone let, jaz pa tu delam že petindvajset let.\" ", CategoryId = 43 },
