                new Joke() { Id = 1422, Active = true, Title = "Na sodišču", Description = "\"Ste bili že kdaj kaznovani?\"    \"Da, enkrat že.\"    \"Zakaj pa?\"    \"Z glavo sem butal ob zid.\"    \"Zaradi tega pa že niste bili kaznovani!\"    \"Seveda sem bil! Veste, glava ni bila moja!\"", CategoryId = 43 },
