                new Joke() { Id = 1426, Active = true, Title = "Rabil je nasvet", Description = "\"Daj, Marko, svetuj mi. Ali naj vzamem bogato vdovo, ki je ne ljubim, ali revno študentko, s katero se ljubiva?\"    \"Vzemi študentko, saj denar tudi ni vse.\"    \"Tako bom tudi storil! Hvala za nasvet.\"    \"Malenkost. Kje pa stanuje tista vdova?\" ", CategoryId = 43 },
