                new Joke() { Id = 1440, Active = true, Title = "Na novo omožena", Description = "V mestu sta se srečali prijateljici in ena je ogovorila drugo:  \"Slišala sem, da si se poročila. Si srečna v zakonu?\"    \"Kje pa! Moj mož je impotenten. Ne more ne seksati ne imeti otrok.\"    \"Pa tega nisi vedela že prej?\"    \"Pred poroko je sicer večkrat govoril o nepremičnini, toda jaz sem mislila, da ima hišo ali pa vikend.\"", CategoryId = 43 },
