                new Joke() { Id = 1466, Active = true, Title = "Na poti", Description = "Soseda vprasa sosedo:\" Od kod ta modrica okoli ocesa?\"  \"Od moza.\"  \"Sem mislila, da je na potovanju.\"  \"Jaz tudi!\"", CategoryId = 40 },
                new Joke() { Id = 1467, Active = true, Title = "Pamet", Description = "Zena pravi mozu: Najin sin je zelo inteligenten. Pamet je prav gotovo podedoval po meni.   Moz: S tem se pa strinjam, meni je pamet ostala.", CategoryId = 11 },
