                new Joke() { Id = 1470, Active = true, Title = "Poklici", Description = "Se prepirajo zdravnik, arhitekt in politik cigav poklic je najstarejsi.  Zdravnik: Bog je Evo ustvaril iz Adamovega rebra. To je kirurski poseg.  Arhitek: Ja, toda pred tem je Zemljo ustvaril iz kaosa.   Politik: No, vidita vidva, kdo pa mislita, da je ustvaril kaos?", CategoryId = 29 },
                new Joke() { Id = 1471, Active = true, Title = "Sprevodnik", Description = "Maja, prikupna blondinka, potuje  z vlakom. Odide na stranisce, nato  pa ne najde vec svojega kupeja.  Sprevodnik ji poskusa pomagati:   Pa se vsaj priblizno spomnite,   kje ste sedeli?  Maja: Hm, vem, da je bila zunaj  reka.", CategoryId = 4 },
                new Joke() { Id = 1472, Active = true, Title = "Neumnica", Description = "Marta se vrne domov in Kosirju   zabrusi:  Bila sem pri jasnovidki.  Placala sem ji 50 evrov in povedala  mi je, da me ne ljubis vec!   Kosir: Neumnica,to bi ti jaz lahko   povedal brezplacno.", CategoryId = 11 },
                new Joke() { Id = 1473, Active = true, Title = "Prazna baterija", Description = "Mici je hotela poklicati moza pa se ji je spraznila baterija na mobilniku, zato je prosila sina naj poklice oceta. Sin Janezek je poklical:\"Mami, klical sem trikrat in se je vedno oglasila neka zenska.  Ko moz pride domov, ga zena pricaka pri vratih in mu prisoli zausnico.   Moz zacudeno:\"Zakaj pa zdaj to?\"  Zena:\"Janezek pravi, da se na tvoj telefon oglasa zenska. Kdo je?\"  Moz:\"Janezek, potem pa povej, kaj je rekla!\"  Janezek:\"Stevilka trenutno ni dosegljiva, prosimo poklicite kasneje.\"", CategoryId = 11 },
                new Joke() { Id = 1474, Active = true, Title = "Pri zgodovini", Description = "Uciteljica zgodovine je vprasala Mihca:\"Kaj se je dogajalo po Titovi smrti?\"  \"Po Titovi smrti je bil pogreb.\"", CategoryId = 32 },
                new Joke() { Id = 1475, Active = true, Title = "Poročena z boksarjem", Description = "\"Slišala sem, da si se poročila z boksarjem. Si srečna?\"    \"Seveda, čudovit je. Nikoli ni dolgočasen.\"    \"Kako to misliš?\"    \"Vsak večer, ko se vrne domov, izgleda drugače.\"", CategoryId = 43 },
                new Joke() { Id = 1476, Active = true, Title = "Sveža ljubezen", Description = "\"Odkar te poznam ne morem več ne piti in ne jesti!\" je zavzdihnil mladenič svojemu dekletu.    \"Kaj? Tako zelo me ljubiš?\"    \"Ne, bankrotiral sem!\" ", CategoryId = 43 },
                new Joke() { Id = 1477, Active = true, Title = "Grožnje", Description = "\"V zadnjem času prejemam grozilna pisma,\" se potoži Milan prijatelju.    \"Povej policiji, pa ti bodo pomagali!\"    \"Ne verjamem. Pisma so namreč iz davčne uprave.\"", CategoryId = 43 },
                new Joke() { Id = 1478, Active = true, Title = "Pri kosilu", Description = "Žena je opazovala moža pri jedi in ga vprašala: \"Kako ti je kaj všeč moje kosilo?\"    Mož je samo pokimal z glavo in jedel naprej, žena pa je dejala:    \"Moja mama pravi, da obe jedi, ki jih znam pripraviti, jagodni kolač in morsko solato, pripravim res zelo okusno!\"    Mož je nenadoma dvignil pogled od krožnika in vprašal: \"In kaj od tega zdaj jem?\" ", CategoryId = 11 },
                new Joke() { Id = 1479, Active = true, Title = "Otroško razmišljanje", Description = "Metka iz spalnice: \"Mami, mami! Ali je človek res prah in v prah se povrne?\"    \"Ja, tako uči krščanska vera. Zakaj me to sprašuješ?\"    \"Če je vse to res, je pod našim kavčem najmanj pet mrtvih.\"", CategoryId = 11 },
                new Joke() { Id = 1480, Active = true, Title = "Ločitev samo zaradi tašče", Description = "Francelj svoji tašči: \"In če že želiš vedeti, nameravam se ločiti od tvoje hčerke samo zaradi tebe!\"    Tašča je šokirana, zardi in reče: \"Ampak, Franceljček moj ...\"", CategoryId = 34 },
                new Joke() { Id = 1481, Active = true, Title = "Možje na potovanju", Description = "Srečajo se trije, ki so zaradi službe veliko odsotni od doma.    Pilot: \"Ko se vračam domov, najprej nizko in glasno preletim nad hišo.\"    Kapetan ladje: \"Ko plujem v domači pristan, v bližini doma trikrat zatrobim z ladijsko sireno.\"    Polde, šofer tovornjaka, prijavi: \"Jaz pa parkiram že kilometer pred domom, grem peš do hiše, se odplazim na dvorišče, s pajserjem odprem okno spalnice in skočim noter. Povem vama, še nobeden mi ni ušel.\"", CategoryId = 17 },
                new Joke() { Id = 1482, Active = true, Title = "Pravi kavboj", Description = "Star kavboj gre v bar in naroči pijačo.  Sedi in srka svoj viski, poleg njega sede mladenka.    Obrne se k njemu in ga vpraša: \"Si ti pravi kavboj?\"    Tip: \"No, že vse življenje živim na ranču, kjer pasem konje, popravljam ograjo in žigosam živino. Bo že držalo.\"    Nakar dekle prostodušno: \"Jaz sem pa lezbijka. Ves dan mislim na ženske. Takoj, ko vstanem, mislim na ženske. Kadar se tuširam ali gledam televizijo, mislim na ženske.\" In odide.    Čez nekaj časa poleg starega kavboja sede par srednjih let in ga vpraša: \"Si pravi kavboj?\"    Ta: \"Doslej sem bil prepričan, da sem, zdaj sem pa odkril, da sem lezbijka.\"", CategoryId = 17 },
                new Joke() { Id = 1483, Active = true, Title = "Mož in žena, oh kako lepo", Description = "Mož brez žene je kot pes brez bolh.    Živi, ampak dolgočasno.    ​​    Žena brez moža je kot bolha brez psa.    Živi, ampak nima nikogar za žret.", CategoryId = 11 },
                new Joke() { Id = 1484, Active = true, Title = "Na pijačo gre", Description = "Gorenjec pravi ženi: \"Obleci se plašč, jaz grem na pivo.\"    Žena reče: \"Menda me ne boš na pijačo povabil?\"    Gorenjec: \"Ne trapa, samo peč bom ugasnil!\"", CategoryId = 12 },
                new Joke() { Id = 1485, Active = true, Title = "Hudo škili", Description = "Zadnjič sem videl eno punco. Tako zelo je škilila, da so ji, ko je jokala, solze po hrbtu tekle.", CategoryId = 43 },
                new Joke() { Id = 1486, Active = true, Title = "Ulovil je zlato ribico", Description = "En model ulovi zelo debelo zlato ribico in jo vpraša: \"zakaj si tako debela?\"    Ribica : \"Me je Mujo ujel in sem mu rekla, da mu izpolnim 3 želje, če me izpusti. Pa me je vrgel nazaj v vodo in rekel: ajd ne seri.\"", CategoryId = 18 },
                new Joke() { Id = 1487, Active = true, Title = "Zajec in konoplja", Description = "Išče zajec nekoga k bi kadil travo z njim. Išče išče pa ne najde.    Potem pa najde kuro, ki je privolila. Zvija, zvija prižge in pravi: \"Kura čutiš kaj, stara?\"    Kura pravi: \"Nič.\"    Zajec še enkrat potegne: \"Kura čutiš zdej kej?\"    Kura: \"Nič\"    Zajec še enkrat potegne. Že ves zelen v faco se mu že zelo vrti: \"Kura čutiš zdej kej?\"    Kura: \"Nič! Niti kljuna niti nog niti kril, nič\"", CategoryId = 41 },
                new Joke() { Id = 1488, Active = true, Title = "Nerodnost", Description = "En tip je tako neroden, da je zadnjič padel, pa je še tla zgrešil.", CategoryId = 43 },
                new Joke() { Id = 1489, Active = true, Title = "Trije fantje v petem razredu", Description = "V 5. razredu so belec, črnc in Azijec!    Kdo ima najdaljšega tiča?    Črnc!    Zakaj? Zato ker je star 18 let!", CategoryId = 8 },
                new Joke() { Id = 1490, Active = true, Title = "Podobnost", Description = "Kaj je podobnost med WCjem in smrtjo?    Ko moraš it, moraš it.", CategoryId = 43 },
                new Joke() { Id = 1491, Active = true, Title = "Nima sreče", Description = "Bliža se večer in nekega moškega zabodejo z nožem v hrbet.    Pride k zdravniku in ta mu reče: \"Mi delamo samo do sedmih,\" vzame nož, mu ga zapiči v oko in doda še: \"Okulist dela do osmih.\"", CategoryId = 39 },
                new Joke() { Id = 1492, Active = true, Title = "Mešani občutki", Description = "Kaj so to mešani občutki?    Punca ti pošlje SMS, da sta končala.    Čez čas ti pošlje še enega, da SMS ni bil poslan na pravo številko.", CategoryId = 43 },
                new Joke() { Id = 1493, Active = true, Title = "Mešani občutki", Description = "Mešani občutki so, če izveš, da se ti je tašča smrtno ponesrečila.    S tvojim novim avtomobilom.", CategoryId = 34 },
                new Joke() { Id = 1494, Active = true, Title = "Najditelj pokliče na radio", Description = "On: Na radio Velenje med oddajo \"v živo\" nekdo pokliče:    \"Dobar dan, tukaj Safet iz Veleja.\"    \"Pozdravljeni, Safet, kaj bo dobrega?\"    \"Danas zjutra sam u Velejaparku našu denarnico z dost denara i dokumenti.\"    \"Koliko pa je denarja?\"    \"Malo više čez tri tisuč evrov, i kartice.\"    \"A se da iz dokumentov razbrati, kdo je lastnik?\"    \"Da, to je neki Karl Benko, iz Veleja.\"    \"In kako lahko gospod pride do vas?\"    \"Jok, ne zovem radi toga. Zavrtite čoveku jedan dobar komad!\"", CategoryId = 43 },
                new Joke() { Id = 1495, Active = true, Title = "Mučenje živali", Description = "Kaj je mučenje živali?    Če daš kači viagro.", CategoryId = 41 },
                new Joke() { Id = 1496, Active = true, Title = "Predrzen rop sredi belega dneva", Description = "Se sprehaja želva po cesti in jo oropa pet polžev.    Pride policija in vpraša želvo, kaj se je zgodilo.    Želva: \"Joj, kaj pa vem ... Vse se je dogajalo tako hitro\"", CategoryId = 41 },
                new Joke() { Id = 1497, Active = true, Title = "Najslabša stvar", Description = "Kaj je najslabša stvar ki se lahko zgodi spečemu netopirju?    Driska!", CategoryId = 41 },
                new Joke() { Id = 1498, Active = true, Title = "Nov prijatelj", Description = "Blondinki Maja in Mojca se pogovarjata:    Maja: \"Slišala sem, da imaš novega prijatelja.\"    \"Ja, enkraten je. Bogat je in avto ima.\"    \"Kako pa izgleda?\"    Mojca: \"Kabrio, kovinsko rdeče barve.\"", CategoryId = 4 },
                new Joke() { Id = 1499, Active = true, Title = "V razredu obupuje", Description = "Učiteljica je nemočna, vsa znervirana reče Bučku: \"Vsaj en teden bi si želela biti tvoja mama.\"    Buček mirno: \"Bom vprašal očeta, mogoče se bo pa dalo urediti.\"", CategoryId = 32 },
                new Joke() { Id = 1500, Active = true, Title = "Na parkirišču", Description = "Košir sedi v avtu na parkirišču.    Zagleda ga prijatelj in vljudno vpraša, če sme prisesti, saj ju pot vodi v isto smer.    Košir velikodušno prikima.    Urno odpre vrata in prisede, a Košir se ne premakne.    Nekaj časa še čaka nato pa obzirno vpraša: \"Ali še koga čakaš?\"    Košir: \"Ja, čakam, da poteče čas na parkirni uri.\"", CategoryId = 17 },
                new Joke() { Id = 1501, Active = true, Title = "V veleblagovnici", Description = "V veleblagovnici sredi Kranja: \"Potrebujete prodajalke?\"    \"Ne, dovolj jih imamo.\"    \"Potem mi pa pošljite kakšno, že pol ure čakam na postrežbo.\"", CategoryId = 43 },
                new Joke() { Id = 1502, Active = true, Title = "Tovornjak na meji", Description = "Na meji, tovornjak pelje iz Hrvaške v Slovenijo, carinik vpraša šoferja: \"Kaj prevažate?\"    Šofer: \"Nič, v tovarno grem po novo pošiljko kondomov.\"    Carinik: \"Odprite cerado.\"    Šofer odpre, carinik pokuka notri in ga skoraj kap; kamion je poln nosečih žensk.    Takrat se voznik udari po čelu: \"Oh, seveda, oprostite, pozabil sem, danes je petek in v firmo vračamo reklamacije.\"", CategoryId = 43 },
                new Joke() { Id = 1503, Active = true, Title = "V postelji", Description = "Žena mesarja Toneta zahrope v zakonski postelji: \"Ravnaj z menoj tako, kot s svojimi strankami v mesnici!\"    On začudeno: \"In kako je to?\"    Ona: \"Vprašaj me, če je lahko malo več.\"  ", CategoryId = 40 },
                new Joke() { Id = 1504, Active = true, Title = "Kdo spi z mamo", Description = "Oče sedi v kavču in uživa ob gledanju nogometne tekme, njegovemu mulcu pa je bilo neizmerno dolgčas, zato ga je kar naprej neuspešno nagovarjal.    Nakar mali nenadoma reče: \"Oči, če mi daš 10€ ti povem kdo spi z mami v vajini postelji medtem ko te ni doma.\"    Končno je zadel na pravo točko pri svojem starem in ta se je nemudoma ves razjarjen obrnil k njemu in mu rekel: \"Mulc, tu imaš 50€, pa da mi takoj po resnici poveš.\"    Mali prešteje denar, potem pa ves nasmejan: \"Jazzzzz spim pri njej, ko te ni\"", CategoryId = 11 },
                new Joke() { Id = 1505, Active = true, Title = "Mož obleži v komi", Description = "Mož je že kar nekaj mesecev v komi, žena mu nenehno stoji ob strani.    Ko se končno zbudi, ji pomigne, naj se mu približa.    Ko se žena usede zraven njega, ji reče: \"Veš kaj, z menoj si bila skozi vse slabe čase. Ko sem bil odpuščen, si me podpirala, ko mi je propadel posel prav tako, ko sva izgubila hišo si še vedno stala ob meni, ko mi je začelo pešati zdravje, prav tako. Veš kaj, draga?\"    \"Kaj, srce?\", ga vpraša nežno.    \"Mislim, da mi prinašaš smolo.\"", CategoryId = 11 },
                new Joke() { Id = 1506, Active = true, Title = "Nova tamlada je od hudiča", Description = "Mlada ženska se primoži v revno družino.    Ugotovi, da je hiša umazana, pa nikjer nobene krpe za čiščenje zato odreže rokave moževi srajci in počisti stanovanje.    Naslednji dan sklene, da bo prebelila stene, pa tudi čopiča nimajo, zato moževemu očetu Jožetu odreže brado in z njo nanaša barvo.    Naslednji dan pride na obisk sosed in vidi Jožeta na drevesu.    Vpraša ga, če se mu je zmešalo, da pri takem mrazu čepi zunaj na drevesu?    Jože: “Danes bo naša ta mlada palačinke pekla, pa ne vem, če imamo jajca pri hiši!”", CategoryId = 11 },
                new Joke() { Id = 1507, Active = true, Title = "Pridobivanje gradbenega dovoljenja", Description = "Srečali so se  medved, lisica in osel.    Skovali so načrt, da si začnejo graditi skupni domek, za katerega potrebujejo, gradbeno dovoljenje.    Najprej se na Upravno enoto odpravi medved in zaprosi za gradbeno dovoljenje.  Upravni možje mu zavrnejo vlogo za gradnjo.    Nato sta medved in osel poslala v akcijo na Upravno enoto lisico, katera bo sigurno uspela pridobiti dovoljenje s svojimi zvijačami.  Toda zaman, tudi njej ni uspelo prelisičiti upravne može.    Na koncu se odpravi še osel. Na upravni enoti se zadržki kar dolgo, zato sta bila medved in lisica prepričana, da ne bo nič uspel.    Po dolgem času se vrne osel, medved in lisica ga radovedno izprašujeta kaj je bilo in kakšen je odgovor.  Osel počasi odgovarja in na koncu pride k bistvu.  Prijatelja moja pridobil sem kar tri gradbena dovoljenja, zate medved - gradiš brlog, lisica gradiš svoj domek in jaz osel bom imel tudi svojo štalco.    Medved in lisica ga začudeno vprašata, \"Kako ti je pa to uspelo?\"    Ja prijatelja moja, na Upravni enoti sem srečal vse svoje sošolce!", CategoryId = 41 },
                new Joke() { Id = 1508, Active = true, Title = "Letalo bo strmoglavilo", Description = "Visoko nad Atlantikom leti letalo, polno slovenskih potnikov.    Miren let prekine močna turbulenca, iz stropa padejo kisikove maske, po zvočniku pa se zasliši obvestilo, da letalo strmoglavlja.    Marta, ženska srednjih let, panično skoči iz svojega sedeža in zakriči: \"Bogpomagaj, če bom umrla, si pred tem želim še enkrat počutiti se kot prava ženska!\"    Po izrečenih besedah odvrže svoje obleke in vpraša sopotnike: \"Je na letalu kakšen moški, ki mi lahko pomaga, in mi da občutek, da sm ženska?!\"    Vstane še Štefan, si odpne srajco in jo vrže v njeno smer: \"Evo, speglaj mi tole!\"", CategoryId = 43 },
                new Joke() { Id = 1509, Active = true, Title = "Neposlušna pri verouku", Description = "Mala Urška ni bila ravno najbolj zgledna učenka pri verouku. Pravzaprav je večino časa med poukom kar prespala.  Nekega dne, pa jo je duhovnik poklical ravno, ko je že zapadla v svoj dremež.    Duhovnik: \"Povej mi, Urška, kdo je napravil vesolje?\"  Je pa za Urško sedel Tomaž in, da bi jo opozoril jo je v hrbet špiknil s svojim svinčnikom.   \"JEZUS KRISTUS!\", je takoj zavpila Urška in duhovnik je bil presenečen ampak jo je vseeno lepo pohvalil. Tudi Urška je   bila presenečena nad pohvalo, vendar se s tem ni ravno preveč obremenjevala in je kmalu spet padla v svoj spanec.    Duhovnik je tako nadaljeval s svojim predavanjem ampak čez nekaj časa je spet prišel do Urška in jo vprašal:\"Urška, povej mi,  kdo je naš gospod in odrešenik?\"  Ker se Urška spet ni odzvala jo je Tomaž zopet rahlo premočno s svinčnikom zabodel v hrbet in Urška je spet na glas zavpila:\"O MOJ BOG!\"    Duhovnik je bil že navdušen nad njenim entuziazmom, Urška pa se ni pustila motiti in je spet kmalu zadremala. No, duhovnik pa se je odločil,  da je Urška pripravljena na bolj težko vprašanje, zato jo je vprašal:\"Kaj je Eva rekla Adamu potem, ko je rodila že njegovega 23. otroka?\"  Najprej je bilo vse tiho, potem pa jo je Tomaž hitro spet zabodel s svinčnikom, tokrat pa res premočno...  Urška:\"JEBEMTIŠ, SAMO ŠE ENKRAT VAME ZARIJ TOLE JEBENO TRDO STVAR, PA TI JO BOM POLOMILA NA POL, PA TI JO ZABILA V RIT!\"", CategoryId = 5 },
                new Joke() { Id = 1510, Active = true, Title = "Prometna nesreča", Description = "Moški in ženska na cesti trčita drug v drugega. Oba avta sta povsem razbita, ampak čudežno nobenemu od njih ni bilo nič!     Ko jima uspe splezati ven iz razbitih avomobilov ženska takoj reče:\"Uau, poglej najina avta - od njih ni ostalo prav nič! Hvala bogu, da sva midva v redu! To mora biti njegov znak, da nama usojeno živeti kot prijatelja.\"    Moški si jo na hitro ogleda in ker je bila res postavna, on pa samski ji hitro potrdi, čeprav se je zavedal, da je ona pripeljala po njegovi strani: \"Seveda gospodična, če bog tako želi je prav tudi meni...\"    Potem pa se spet oglasi ženska:\"Uau, poglej, steklenica viskija iz mojega avtomobila je poleg naju še edina stvar, ki je ostala cela. Tudi to mora biti sporočilo boga, da naj ga skupaj spijeva in se ob pijači pobližje spoznava.\"    Moški je zdaj že dojel, da sta si z dekletom res všeč in, da bi lahko to peljalo kam naprej in tako je vzel steklenico, ki mu jo je podala in spil kar tretjino viskija , potem pa jo podal nazaj ženski.    Na njegovo presenečenje pa je ženska na steklenico nazaj nadela zamašek in mu jo vrnila v roke, zato je je začudeno vprašal:\"Ti pa ne boš nič spila?\"    Ženska mu odgovori: \"Ne hvala, bom kar počakala policijo, pa da oni razjasnijo kdo je bil kriv, da imava razbite avtomobile.\"", CategoryId = 40 },
                new Joke() { Id = 1511, Active = true, Title = "Ima težavo", Description = "Moški je vstopil v doktorjevo ordinacijo in v zadregi dejal: \"Doktor, kožice mojega spolnega uda ne dobim nazaj!\"    \"Kožice se pa vendar ne posoja!\" ", CategoryId = 39 },
                new Joke() { Id = 1512, Active = true, Title = "V ugledni restavraciji", Description = "Mož je ženo, svakinjo in taščo povabil na večerjo v ugledno restavracijo. Pristopil je natakar in mož je naročil: \"Jaz bom goveji zrezek v gobovi omaki.\"    \"Kaj pa nore krave?\" ga je začudeno vprašal natakar.    \"One bodo pa kar same naročile.\" ", CategoryId = 11 },
                new Joke() { Id = 1513, Active = true, Title = "Pol viagre", Description = "Zakaj se poje samo pol viagre?    1) Da ne lulaš po čevljih.    2) Če želiš samo malo podjebavati.", CategoryId = 27 },
                new Joke() { Id = 1514, Active = true, Title = "Če slučajno pade v vodo", Description = "Kaj vpije ciganka, ki pade v vodo?    \"Na pomoč! Na pomoč, ne znam se kopati.\"", CategoryId = 7 },
                new Joke() { Id = 1515, Active = true, Title = "Cigan v slaščičarni", Description = "Pride cigo v slaščičarno in reče: \"Dajte mi ljimunadu.\"    Punca, ki streže: \"Ne morete je dobiti.\"    Cigan: \"Zakaj?\"    \"Ne reče sa ljimunada ampak limonada.\"    \"Dobro, dajte limonado.\" In jo dobi.    Cigan: \"Mi daste bakljavu\".    \"Ne, ne morete.\"    Cigan: \"Zakaj?\"    Punca: \"Ne reče se bakljava, apmapk baklava.\"    Cigan: \"OK, baklavo, dajte mi baklavo.\" In jo dobi.    Ko je pojedel in spil je rekel: \"Lahko pljačam?\"    Punca: \"Ne, ne morete.\"    Cigan: \"Ooooo, najlepša hvala!\" In odide iz slaščičarne.", CategoryId = 7 },
                new Joke() { Id = 1516, Active = true, Title = "Rojstnodnevna torta", Description = "Zakaj mora mali cigan za 4. rojstni dan na torti upihniti kar 40 svečk?    Ker ga oče testira, če ima pljučno kapaciteto za igranje trobente.", CategoryId = 7 },
                new Joke() { Id = 1517, Active = true, Title = "Ne spusti je", Description = "Zakaj cigan ne spusti žene na Kubo?    Čegavara!", CategoryId = 7 },
                new Joke() { Id = 1518, Active = true, Title = "Mali cigo se kopa", Description = "Mama ciganka je dala malega cigota kopat.    Po petih minutah že sili ven iz banje, a mu stara naroči, naj se še umiva.    Ko mine pol ure zakriči: \"Mama, mama, en sloj umazanije je že odstopil.\"    Mama: \"Dobro! Ampak še ni dovolj. Še se umivaj.\"    Mali cigo se umiva še eno uro, nakar zakriči: \"Mama, drugi sloj je tudi že šel dol!\"    Mama: \"Dobro, še malo.\"    Čez eno uro: \"Mama, našel sem majico, ki sem jo izgubil pred tremi leti.\"", CategoryId = 7 },
                new Joke() { Id = 1519, Active = true, Title = "Cigo obišče bratra", Description = "Cigo se odloči, da bo obiskal brata v Nemčiji.    Ker je imel brat malo stanovanje, ga je namestil v hotel.    Cigo stopi v kopalnico. Gleda bano, tuš, umivalnik in vse ostalo. Vse je čisto, da se kar sveti. Nakar reče: \"Eh, škoda, da ni sobota, da bi se umil.\"", CategoryId = 7 },
                new Joke() { Id = 1520, Active = true, Title = "Čas za menjavo", Description = "Ata cigo: \"Otroci, pridite sem.\"    Ko se zberejo, jim reče: \"Danes je čas za menjavo gat.\"    Otroci: \"Huraaaaaa!\"    Oče: \"OK, ti zamenjaš z njim, ti z njim...\"", CategoryId = 7 },
                new Joke() { Id = 1521, Active = true, Title = "Cigan in umivanje rok", Description = "Kdaj si cigan umije roke? Pred scanjem ali po scanju?    Med scanjem.", CategoryId = 7 },
                new Joke() { Id = 1522, Active = true, Title = "Vprašanje, kako se obleči", Description = "Mali cigo vpraša starega cigana: \"Kako oblečem gate?\"    Tastari: \"Rumeno spredaj, rjavo odzadaj.\"", CategoryId = 7 },
                new Joke() { Id = 1523, Active = true, Title = "Na kateri WC naj gre", Description = "Ciganka vpraša svojega moža: \"Na kateri WC naj grem?\"    Mož jo takoj okara: \"Joj, si pa res neumna! Vse je jasno, saj ti piše! Ti greš na M, ker si madam, jaz pa na Ž, ker sem žentlemen!\"", CategoryId = 7 },
                new Joke() { Id = 1524, Active = true, Title = "Pogovor po telefonu", Description = "Pokliče cigo svojega prijatelja: \"Kaj je stari, kaj počneš?\"    Tadrugi: \"Nič, prejle sem si glavo opral, zdaj pa malo svojo sestro porivam.\"    Prvi: \"Kaj??? Glavo si si opral?\"", CategoryId = 7 },
                new Joke() { Id = 1525, Active = true, Title = "Redkost", Description = "Kaj je bolj redko od siamskih dvojčkov?    Cigan edinec!", CategoryId = 7 },
                new Joke() { Id = 1526, Active = true, Title = "Breja krava", Description = "Mujo toži Fati: \"Fata, kaj je to? Že šest dni ležim zraven krave in čakam, da bo povrgla, pa nič!\"    Fata: \"Logično, ko te vidi ležat poleg nje misli, da se je tele že povrglo.\"", CategoryId = 18 },
                new Joke() { Id = 1527, Active = true, Title = "Kotracepcija", Description = "Mujo: \"Haso, koliko otrok imaš ti?\"    Haso: \"Pet.\"    Mujo: \"Kako to, saj si star šele 21 let?\"    Haso: \"Saj vem. Zdaj niti iz hrenovke ne slečem več ovoja.\"", CategoryId = 18 },
                new Joke() { Id = 1528, Active = true, Title = "Sprehod po plaži", Description = "Mujo pelje svojo ženo po plaži na sprehod.    Srečata slikarja, ki na platno riše sončni zahod.    Mujo: \"Fata, a vidiš kako se matra, ker nima fotoaparata?\"", CategoryId = 18 },
                new Joke() { Id = 1529, Active = true, Title = "Optimizem", Description = "Kaj dela narkoman pod božično jelko?    Paket čaka.", CategoryId = 43 },
                new Joke() { Id = 1530, Active = true, Title = "Po japonsko", Description = "Kako se po japonsko reče gej?    Na kitu mi najaši.", CategoryId = 43 },
                new Joke() { Id = 1531, Active = true, Title = "Nadlegovanje v kinu", Description = "Se pogovarjate dve blondikne.    Prva: \"Kako je bilo v kinu?\"    Druga: \"Grozno, trikrat sem se morala presesti.\"    Prva: \"Kaj, a so te otipavali?\"    Druga: \"Da! Ampak šele, ko sem se vsedla na četrti stol.\"", CategoryId = 4 },
                new Joke() { Id = 1532, Active = true, Title = "Pedifila na ulici", Description = "Gresta dva pedofila po ulici in srečata sedemletno deklico.    Ko jo vidita, reče eden: \"A veš, kako je bila tale mala dobra pred par leti.\"", CategoryId = 43 },
                new Joke() { Id = 1533, Active = true, Title = "Sladkorni bolniki", Description = "Kdaj umirajo sladkorni bolniki?    Takrat, ko jim je najslajše.", CategoryId = 9 },
                new Joke() { Id = 1534, Active = true, Title = "Noseča je", Description = "Hčerka: \"Mama, noseča sem.\"    Mama jo okara: \"Pa kje hudiča si imela glavo?\"    Hčerka: \"Na havbi, mama, na haubi.\"", CategoryId = 11 },
                new Joke() { Id = 1535, Active = true, Title = "Šansa za pobeg", Description = "V celici v zaporu sta bila skupaj gobavec in narkoman.    Nekega dne, ko so pazniki imeli obhod, je en paznik izgubil ključe malo stran od njunih vrat.    Gobavec se stegne, da bi jih pobral, pa mu odpade roka. Poskusil je z drugo roko in mu je tudi ta odpadla.    Nato je poskusil še z nogo, de bi jih potegnil k sebi, da bi lahko narkoman odklenil vrata in bi skupaj pobegnila. A mu je tudi noga odpadla.    Narkoman stoji v kotu in se smeji: \"Hehehe, staaaari, še malo, pa boš ti zunaj.\"", CategoryId = 9 },
                new Joke() { Id = 1536, Active = true, Title = "Sprehod mimo umobolnice", Description = "Moški se sprehaja po potki mimo umobolnice.    Naenkrat zasliši: \"Štirinajst, štirinajst, štirinajst, ...\"    Ne ozira se in gre dalje.    Glas postaja vse glasnejši in moški opazi luknjico v zidu. Ker ga je zanimalo, kaj se dogaja na drugi strani je pokukal skozi luknjico.    V tistem trenutku ga nekdo močno, s prstom, piči v oko.    Glas na drugi strani: \"Petnajst, petnajst, petnajst, ...\"", CategoryId = 43 },
                new Joke() { Id = 1537, Active = true, Title = "Zasačil ju je", Description = "Podjetnik se je predčasno vrnil s službenega potovanja in z ženo v postelji odkril svojega namestnika.    \"Milan, kaj pa ti delaš v postelji z mojo ženo?\" je presenečeno vzkliknil.    \"Isto kot v podjetju!\" se je oglasila žena. \"Popravlja tvoje napake!\" ", CategoryId = 27 },
                new Joke() { Id = 1538, Active = true, Title = "Zanima jo, ali jo ljubi", Description = "Eva: \"Adam, ali me ljubiš?\"    Adam: \"Kdo drugi pa naj bi te?\"", CategoryId = 40 },
                new Joke() { Id = 1539, Active = true, Title = "Plačilo za taksi vožnjo", Description = "Stara mama se pelje s taksijem.    Ko prispe na cilj ga mamica vpraša: \"Sine, koliko stane ta vožnja?\"    Taksist: \"10EUR, gospa.\"    Ženica mu izroči petaka in hoče izstopiti.    Taksist: \"Gospa, vožnja ni 5EUR, ampak 10!\"    Ženica: \"Saj pa si se ti tudi peljal.\"", CategoryId = 43 },
                new Joke() { Id = 1540, Active = true, Title = "Po govorilnih urah", Description = "Sin: \"Ata, so končane govorilne ure?\"    Oče: \"Srečo imaš, da si pozitiven vsaj pri verouku! Ker zdaj ti lahko samo še Bog pomaga!\"", CategoryId = 32 },
                new Joke() { Id = 1541, Active = true, Title = "Groza, kakšne cene", Description = "Ko sem videl, kakšne so cene v apoteki sem prišel na idejo, da je bolj poceni odditi in kar umreti.", CategoryId = 43 },
                new Joke() { Id = 1542, Active = true, Title = "Obisk živalskega vrta", Description = "Janezek: \"Mami, a bomo danes, ko obiščemo živalski vrt, videli tudi štorkljo?\"    Mama: \"Da, Janezek.\"    Janezek: \"Čudovito, prav zanima me, če me bo prepoznala.\"", CategoryId = 15 },
                new Joke() { Id = 1543, Active = true, Title = "Janezek na carini", Description = "Janezek gre peš čez carino in ima na prtljažniku kolesa privezano veliko vrečo.    Carinik ga vpraša: \"Kaj imaš v vreči?\"    Janezek: \"Pesek!\"    Cariniku je bilo sumljivo, zato je vsebino vreče pregledal. Ugotovil je, da je v vreči res samo pesek.  \"Lahko greš!\", mu reče.    Drugi dan Janezek zopet pride čez carino z istim tovorom.    Carinik: \"Kaj imaš v vreči?\"    Janezek: \"Pesek!\"    Carinik zopet pregleda vsebino in res je bil v vreči samo pesek.    Tretji dan Janezek zopet pride na carino in vozi isti tovor.    Carinik: \"Pa dobro, kaj hudiča ti švercaš?\"    Janezek: \"Kolesa.\"", CategoryId = 15 },
                new Joke() { Id = 1544, Active = true, Title = "Razlaga", Description = "Janezek: \"Ata, kaj je to strup za miši?\"    Oče: \"Joj, kako bi ti to razložil? Sine, to je mačka v prahu.\"", CategoryId = 15 },
                new Joke() { Id = 1545, Active = true, Title = "Sodijo mu zaradi kraje", Description = "Sodnik obravnava obtoženca, ki je ukradel mobilni telefon: \"A vas ni sram, da pri vaših letih ukradete tak mobilni telefon?\"    \"Nič me ni sram. Le zakaj bi me bilo? V mojih mladih letih takega telefona sploh še ni bilo!\" ", CategoryId = 43 },
                new Joke() { Id = 1546, Active = true, Title = "Bolje in bolje", Description = "Kaj je boljše od litra vina?    Dva litra vina!", CategoryId = 21 },
                new Joke() { Id = 1547, Active = true, Title = "Kašelj", Description = "Pride moški v apoteko: \"A imate kaj proti kašlju?\"    Lekarnar: \"Ne, nič nimam proti. Vi kar kašljajte.\"", CategoryId = 43 },
                new Joke() { Id = 1548, Active = true, Title = "Povečala si je prsi", Description = "Po operaciji povečanja prsi se pogovarjata zdravnik in pacientka.    Zdravnik: \"Ali so vam všeč vaše nove prsi?\"    Pacientka: \"Da, zelo! Ampak, rada bi še en poseg.\"    Zdravnik: \"Kakšen poseg?\"    Pacientka: \"Rada bi imela večje oči.\"    Zdravnik: \"To lahko takoj uredimo. Sestra, prinesite naši pacientki račun.\"", CategoryId = 39 },
                new Joke() { Id = 1549, Active = true, Title = "Obiskale sta zdravnika", Description = "K zdravniku prideta mlada, postavna, gospodična in njena debela mama.    Zdravnik: \"Gospodična slecite se, prosim.\"    Mama: \"Gospod doktor, to je pomota. Prišli smo zaradi mene.\"    Zdravnik: \"Dobro. Odprite usta in pokažite grlo.\"", CategoryId = 39 },
                new Joke() { Id = 1550, Active = true, Title = "Ko je nuja, je nuja", Description = "Pijančka je, na sredi ulice, močno pritisnilo lulat.    Kar sredi ulice si odpre šlic in začne lulat na avtobusni postaji.    Mimo prihrumi policaj in ga opazi: \"Kaj? Uriniranje na javnem mestu? Tole bo 25€ kazni!\"    Pijanček ga komaj pospravi v hlače in začne iskati po žepih. Nakar izbrska 50€, ki jih izroči policaju.    Policaj jih vzame in začne po žepih iskati denar, da bi mu 25€ vrnil. In kar ne najde, in ne najde.    Pijanček: \"Hiiik vidim, da tole ne bo šlo. Dajte se polulat, jaz častim.\"", CategoryId = 21 },
                new Joke() { Id = 1551, Active = true, Title = "Policaj želi pomagati", Description = "Policaj se sprehaja po ulici in zagleda malčka, ki se trudi pritisniti na zvonec nekega stanovanja, a je premali.    Pristopi in reče: \"Ali lahko pomagam?\"    Malček: \"Da, pozvonite številko 14, prosim.\"    Policaj pozvoni, rekoč: \"Kaj pa zdaj?\"    Malček: \"Beživa!\"", CategoryId = 22 },
                new Joke() { Id = 1552, Active = true, Title = "Na policijski postaji", Description = "Obiskovalec na policijski postaji zagleda na stenah izobešene tiralice in vpraša: \"Kdo so pa tile ljudje?\"    \"To so kriminalci, ki jih iščemo?\"    \"Zakaj jih pa niste prijeli takrat, ko ste jih slikali?\"", CategoryId = 22 },
                new Joke() { Id = 1553, Active = true, Title = "Test nosečnosti", Description = "Se pogovarjata dve blondinki.    Prva: \"Včeraj sem naredila test nosečnosti.\"    Druga: \"A so bila težka vprašanja?\"", CategoryId = 4 },
                new Joke() { Id = 1554, Active = true, Title = "Cigo dela izpit", Description = "Dela cigo izpot za avto pa ga instruktov vprasa:\"Ti sploh ves, kaksen znak je to?\"  Cigo:\"Znam, znam...aluminjast!", CategoryId = 7 },
                new Joke() { Id = 1555, Active = true, Title = "Mujo na sodiscu", Description = "Vprasa sodnik Mujota na sodiscu: Zakaj ste povozili 52 ljudi?  Mujo: Odpovedale so mi zavore s hriba v dolino.  Zakaj pa niste kam zavili, da ne bi povozili toliko ljudi?  Saj sem. Na desni strani sta bila dva cloveka, na levi na avtobusni postaji pa 50. Pomislil sem, da je bolje, da povozim dva in zavil na desno. Toda, ko sem povozil prvega, je oni drugi idiot stekel med tistih 50!", CategoryId = 18 },
                new Joke() { Id = 1556, Active = true, Title = "Pretrgan himen", Description = "Na kmetiji hčerka prihiti do očeta: \"Ati, ati, hlapec mi je himen pretrgal!\"    Oče: \"Aja? Franček je res neroden, včeraj je grablje zlomil.\"", CategoryId = 11 },
                new Joke() { Id = 1557, Active = true, Title = "Nespodobno povabilo", Description = "V osamljeni ulici moški sreča prikupno gospodično.    Pristopi k njej in ji reče: \"Imam nož in tiča. Nekaj od tega bom zarinil vate.\"", CategoryId = 9 },
                new Joke() { Id = 1558, Active = true, Title = "Prihod muslimana v Slovenijo", Description = "Pride musliman, ves sestradan, v Slovenijo.    To opazi prijazen možakar in mu ponudi svinjski golaž.    Musliman: \"Opa, tole mi pa vera ne dovoljuje.\"    Možakar mu takoj zažuga nazaj: \"Aha! Še prišel nisi dobro, pa imaš že Slovenko za dekle.\" ", CategoryId = 43 },
                new Joke() { Id = 1559, Active = true, Title = "Hitro si je premislila", Description = "Fant: \"Vse geje in bi bilo potrebno obesit, in ženske nebi smele imet isti pravic kot moški.\"    Dekle: \"Kakšen primitivec, sigurno si desničar.\"    Fant: \"Pravzaprav sem musliman in to so moja verska prepričanja.\"    Dekle: \"Joj! Se opravičujem, upam da me nimaš za islamofobno.\"", CategoryId = 43 },
                new Joke() { Id = 1560, Active = true, Title = "Pogovor med tremi dečki", Description = "Trije dečki so se na igrišču pogovarjali o tem, kako je pri njih doma: \"Pri nas smo trije otroci in vsak ima svoj pribor za hrano!\" se je pohvalil prvi.    \"Pri nas je šest otrok in vsak ima svojo sobo!\" je rekel drugi.    \"Pri nas je sedem otrok in vsak ima svojega očeta!\" se je oglasil še tretji.", CategoryId = 43 },
                new Joke() { Id = 1561, Active = true, Title = "Patrulja ustavi voznika", Description = "Policaj: \"Gospod, ste kaj popili?\"    \"Ne, nič.\"    \"Bova testirala: povejte abecedo nazaj!\"    \"ž z v u t š s r p o n m l k j i h g f e d č c b a.\"    \"Neverjetno, jaz tega ne bi mogel niti trezen.\"    \"Jaz tudi ne.\"", CategoryId = 21 },
                new Joke() { Id = 1562, Active = true, Title = "Nakup čokolade", Description = "Suzana kupuje lutko iz čokolade.    \"Naj ti dam deklico ali dečka?\" vpraša prodajalka.    Suzana: \"dečka, ima več čokolade.\"", CategoryId = 43 },
                new Joke() { Id = 1563, Active = true, Title = "Razlika v ceni", Description = "Zakaj je modrček dražji od moških spodnjic?    Ker je mleko dražje od jajc.", CategoryId = 43 },
                new Joke() { Id = 1564, Active = true, Title = "Citroen C5 in parlament", Description = "Kakšna je razlika med Citroenom C5 in slovenskim parlamentom?    Slovenski parlament ima več konjev.", CategoryId = 23 },
                new Joke() { Id = 1565, Active = true, Title = "Mini krilo po italijansko", Description = "Kako se po italijansko reče mini krilo?    Panorama de pičoza.", CategoryId = 43 },
                new Joke() { Id = 1566, Active = true, Title = "Ginekolog po italijansko", Description = "Kako se italijansko reče ginekolog?    Remonti de pičoza.", CategoryId = 43 },
                new Joke() { Id = 1567, Active = true, Title = "Upokojenka in devica", Description = "Kakšna je razlika med upokojenko in devico?    Ni je!  Obe čakata prvega.", CategoryId = 40 },
                new Joke() { Id = 1568, Active = true, Title = "Z ali brez hlačk", Description = "Kako veste, katera punca nosi hlačke in katera ne?    Preprosto! Tista, ki jih ne nosi ima prhljaj na čevljih.", CategoryId = 40 },
                new Joke() { Id = 1569, Active = true, Title = "Trobec in ženske v avtu", Description = "Kako spravi Trobec 9 debelih bab v hrošča?    2 odspredaj, 2 odzadaj in 5 v pepelnik!", CategoryId = 40 },
                new Joke() { Id = 1570, Active = true, Title = "Seks robot na preizkušnji", Description = "Japonci so izumili robota za seks.    Za prvo testiranje so se prijavile: Ljubljančanka, Štajerka in Dolenjka.    Po eni uri preizkusa Ljubljančanka pride ven in reče: \"Kva je pa to dobr, mega kul!\"    Po dveh urah pride ven Mariborčanka in reče: \"Čuj, kaj toti mali dela! Takoj si ga bom nabavla.\"    Pa vstopi še Dolenjka in je ni in ni...po 3 urah pridirja ven robot, za njim pa dolenjka in kriči: \"Kurba, prid' nazaj! A za bejžat pa še maš baterije, a!?\"", CategoryId = 27 },
                new Joke() { Id = 1571, Active = true, Title = "Grajska zgodba", Description = "Nekoč je v deželi za devetimi gorami živela prelepa princesa.    Za njo se je govorilo da ima najlepše prsi pod soncem in tako je beseda o njih prišla tudi na uho Marjana, vaščana.  Ko je nekega dne videl princeso, je spoznal da so govorice resnične in da so njene prsi res popolne.  Njegov življenjski cilj je postal da jih nekoč boža in poljublja.  Za pomoč je prosil grajskega zdravnika, s katerim sta bila v dobrih odnosih.  Zdravilec: \"Poglej Marjan...lahko ti pomagam. Vendar to te bo stalo 1000 zlatnikov.\"  Marjan ni mislil na to kako bo dobil denar, želel je le prsi, zato je privolil.  Tako se je zdravilec na skrivaj splazil v sobo ko se je princesa kopala.  Potresel je nekaj prahu ki povzroča srbenje na njen modrček. Nato je šel iz sobe.  Pričakovano je naslednji dan princesa imela srbečico po celotnih prsih.  Zdravilec je stopil do kralja in mu rekel: \"Poznam vaščana, ki zna to ozdraviti. Marjan mu je ime.\"    In tako je kralj poslal po Marjana.  Ko je prišel na grad mu je zdravilec kot da se prvič vidita povedal:  \"Marjan. Princesa ima srbečico po prsih. Edini način da se ozdravi je, da jo ti po njih božaš in jih poljubljaš  s svojimi magičnimi usti.\"  Tako je naslednje 4 ure Marjan prebil v princesini sobi kjer se je igral z dojkama.  Zdravilec mu je povedal, da bo srbenje samo izginilo po 3 dneh.  Tako je naslednje 3 dni Marjan vsak dan prihajal na grad izpolnjevat svojo željo.  Po 3 dneh je srbenje izginilo in kralj je pohvalil Marjana: \"Dober človek si. Tvoja usta so magična!\"  Marjan je ves zadovoljen želel oditi vendar ga je zdravilec potegnil v svojo sobo.  \"Dolžan si mi 1000 cekinov!\"  Marjan: \"Ne, ne dobiš jih. Kar povej kralju, če si upaš!\"    Tako je Marjan pretental zdravilca.    A le na prvi pogled. Saj je, še isti večer, zdravilec šel v kraljevo spalnico in potresel prah po kraljevih gatah.    In kralj se je znova spomnil na Marjana...", CategoryId = 43 },
                new Joke() { Id = 1572, Active = true, Title = "Težko je pridobiti gradbeno dovoljenje", Description = "Starejši gospod je čakal leta in leta, da mu na Upravni enoti izdajo gradbeno dovoljenje.    Končno je dovoljenje dočakal in uradnik mu reče: \"Vse je gotovo, gradbeno dovoljenje je izdano, pojdite samo še v  tajništvo, da vam dajo pečat.\"    Ves srečen gre gospod v tajništvo po pečat, ko mu na drugi strani uradnik pove, da je ura pravkar odbila 12 in naj se vrne po kosilu.    Gospod ves žalosten pove: \"Oprostite, šest let čakam na to dovoljenje, potrebujem samo še vaš pečat. Prosim, udarite ta pečat, pa vam povem zgodbico o ženski in psu.    Uradnik zelo nejevoljen le pristane ter mu požigosa vse dokumente in nestrpno čaka na zgodbico.    Gospod vzame dokumente in reče: \"Jebo ti pas mater!\"", CategoryId = 43 },
                new Joke() { Id = 1573, Active = true, Title = "Ženica in dve vreči", Description = "Po cesti hodi starejša gospa in za sabo vleče dve veliki polni vreči za smeti.  V eni se ji naredi luknja in iz nje začnejo padati bankovci za 20 evrov, česar pa babica ne opazi. Zato pa nenavaden prizor pritegne pozornost policaja, ki pristopi k stari gospe.    \"Gospa, denar vam leti iz vreče,\" ji pove. Babica se obrne in res vidi, da je za sabo pustila pravo sled iz bankovcev.    \"Joj, hvala, da ste me opozorili,\" reče policistu.    \"Od kod pa taki stari ženici toliko denarja?\" je radoveden policist. \"Jah, veste,\" začne razlagati premetena gospa, \"živim čisto blizu nogometnega stadiona in obiskovalci tekem ves čas hodijo lulat k moji ograji. Ko si odprejo hlače in približajo svojega korenjaka k moji ograji, pa jaz nastavim škarje in rečem, plačaj 20 evrov, ali pa ti ga odstrižem.\"    \"A, tako, ja to ste se pa dobro spomnili,\" ji odvrne policist. \"Kaj imate pa potem v drugi vreči?\" jo še vpraša. Babica pa odgovori: \"Jah, veste, nočejo vsi plačati.\"", CategoryId = 43 },
                new Joke() { Id = 1574, Active = true, Title = "Janezek je zaprt", Description = "Pride mama z Janezkom k dotorju in pravi: \"Doktor pomagajte. Sin že cel teden ne more WC.\"    Pravi doktor: \"Naj sedi pred televizorjem in gleda sejo vlade ali parlamenta, sigurno ga bo pognalo.\"    Čez dve uri mama kliče doktorja. \"Gospod doktor, Janezek je posral celo stanovanje. Kaj naj storim?\"    Doktor: \"Kaj pa gleda?\"    Mama: \"Predsednika vlade.\"    Doktor: \"Ma neeeeee, on je doza za odrasle.\"", CategoryId = 15 },
                new Joke() { Id = 1575, Active = true, Title = "Nasvet za hujšanje", Description = "Predebela gospa je pri zdravniku in ta ji daje napotke za hujšanje.    Ona ga vpraša: \"Sem pa slišala, da pri hujšanju dosti pomaga olivno olje. Kako je s tem?\"    Zdravnik: \"Pomaga o ja, pomaga...\"    Ona: \"In kako se uporablja?\"    Zdravnik: \"Najbolj pomaga, če z njim na debelo namažete tla okoli hladilnika!\"", CategoryId = 39 },
                new Joke() { Id = 1576, Active = true, Title = "Poškodoval se je na delovnem mestu", Description = "Mož piše ženi SMS: \"Padel sem v službi. Zlomil sem si nogo na več mestih. Imam tudi zlomljen kolk. Ana me je odpeljala v bolnišnico.  Zdaj čakam na operacijo ampak zdravnik se boji, da mi bodo morali amputirati nogo.\"    Žena: \"Kdo za vraga je Ana?!?\"", CategoryId = 11 },
                new Joke() { Id = 1577, Active = true, Title = "Igračkanje v postelji", Description = "Žena pride izpod tuša in šepne možu na uho: \"Dragi, a te nocoj lahko zvežem?\"    Možu takoj začne delovati domišljija, zato takoj privoli. Med tem, ko ga žena trdno veže na posteljo postaja vedno bolj razgret.    Ko žena konča ves razburjen vpraša: \"In kaj zdaj?\"    Žena: \"Nič, lahko noč.\"", CategoryId = 11 },
                new Joke() { Id = 1578, Active = true, Title = "Srečnica", Description = "Ženska pri jutranji kavici bere časopis in ugotovi, da je srečna loto dobitnica. Rekorden dobitek, skoraj milijarda, pripada samo njej.    Vsa srečna gre v službo, direktno v direktorjevo pisarno, da bi dala odpoved, ko ji šef reče, da je vedno manj dela, da je tehnološki višek, se ji opravičuje, ampak jo potolaži, da bo dobila visoko odpravnino.    Tako srečna, se odloči, da si bo kupila nov avto. Vstopi v najbližji avto salon in v tem trenutku nad avto salonom ognjemet, vse bliska v salonu, fanfare.    Pristopi prodajalec in reče: \"Vi ste naš 10 000. obiskovalec. Za nagrado dobite najnovejši model Mercedesa brezplačno\"    Ženska, še v šoku, se z novim avtom odpelje domov. Natoči si kozarec penine, stopi k oknu in vidi, da se je domov pripeljal njen mož.    Mož odvihra v spalnico, spakira svoje stvari in pove ženi, da jo zapušča.    Ženska dvigne kozarec penine in si zamrmra: \"Madona, ko zalaufa, PA ZALAUFA!\"", CategoryId = 11 },
                new Joke() { Id = 1579, Active = true, Title = "Povpraševanje v lekarni", Description = "Starejša gospa, pri osemdesetih, vendar še precej živahna, vstopi v  lekarno:    - Dober dan, gospod, imate aspirine?    - Da, seveda, gospa!    - Kaj pa analgetike?    - Vsekakor, gospa!    - In antirevmatike?    - Gotovo, gospa!    - Kaj pa Viagro?    - Imamo, gospa, vendar je za viagro potreben zdravniški recept.    - In gel za hemoroide?    - Imamo, gospa.    - Kaj pa kaj zeliščnega za jetra in žolčnik?    - Vsekakor, gospa!    - In antidepresive?    - Imamo, gospa, ampak samo na recept.    - Pa uspavala?    - Ja, ampak že spet potrebujete recept.    - Kaj za izboljšanje spomina?    - Seveda, imamo tudi to.    - In plenice za inkontinenco?    - Seveda, tamle na polici so.    - Kaj pa...    - Poslušajte, gospa, to je najbolje založena lekarna v mestu z  najboljšo ponudbo daleč naokrog. Kaj pravzaprav potrebujete?    - Veste, konec meseca se poročim z Jožetom, ki jih ima petindevetdeset, pa sva želela vedeti, če bi lahko pri vas odprla knjigo mladoporočencev.", CategoryId = 11 },
                new Joke() { Id = 1580, Active = true, Title = "Nasvet za ženske", Description = "Ženske: moški se med seboj tako malo razlikujejo, da se vam ne splača ločiti in vzeti drugega.", CategoryId = 17 },
                new Joke() { Id = 1581, Active = true, Title = "Ravno nasprotno", Description = "Daljši kot je zakon bolj kratki so izrečeni stavki.", CategoryId = 37 },
                new Joke() { Id = 1582, Active = true, Title = "Popolni zakon", Description = "Kakšen je popolni zakon?    Takšen, da je žena slepa, mož pa gluh.", CategoryId = 11 },
                new Joke() { Id = 1583, Active = true, Title = "Hčerkica je priznala", Description = "12 letna hčerka je rekla svoji mami: \"V našem razredu je samo ena devica.\"    Mamo skoraj zadane kap. Cela omotična komajda obstoji na nogah.    Hčerka nadaljuje: \"Ostalo so tehtnice, kozorogi, vodnarji, ...\"", CategoryId = 11 },
                new Joke() { Id = 1584, Active = true, Title = "Vesela je, ker se bo poročila", Description = "\"Naslednji teden se bom poročila\", se pohvali mlada dama svojim sodelavcem v firmi.    \"Uganite, kaj dela moj mož?\"    Oglasi se eden od sodelavcev: \"Največjo bedarijo v njegovem življenju!\"", CategoryId = 11 },
                new Joke() { Id = 1585, Active = true, Title = "Dobro jo je zagodel", Description = "\"Kje sta oči in mami?\", vpraša fantek zjutraj babico, ko pride na zajtrk.    \"V postelji sta\", mu odgovori. Fantek se prične hihitati in se odide igrat.    Ko pride na kosilo spet vpraša babico: \"kje sta oči in mami?\"    \"Še vedno sta v postelji\", mu le-ta odgovori.    Fant se zahihita, poje kosilo in se odide igrat.    Ko pa pride na večerjo ponovno vpraša kje je sta starša. In ko dobi enak odgovor, se začne hihitat na vsa usta.    Babica ga začudeno pogleda in vpraša: \"Kaj pa se dogaja s tabo, fant?\"    Deček pove: \"Včeraj zvečer je prišel oče v mojo sobo in me prosil za vazelin, pa sem mu dal sekundno lepilo.\"", CategoryId = 11 },
                new Joke() { Id = 1586, Active = true, Title = "Kači v gozdu", Description = "Gredo dve kači po gozdu.    Prva: \"A sva me dve strupeni kači?\"    Druga: \"Ne, zakaj?\"    Prva: \"Uuuu, kaka sreča! Ugriznila sem se v jezik.\"", CategoryId = 41 },
                new Joke() { Id = 1587, Active = true, Title = "Petelin bi seksal", Description = "Petelin se je odločil, da bo dal nekaj pod jajca.    Leti za kuro, a ona beži pred njim in razmišlja:  - če mu takoj dam bodo rekli, da rada dam,  - če mu utečem ne bom dobila,  - najbolje bo, da se spotaknem.", CategoryId = 41 },
                new Joke() { Id = 1588, Active = true, Title = "Petelin lovi kure", Description = "Petelin je letel za dvema kurama.    Prva: \"Jaz ne morem več, jaz bom počakala, pa naj me nategne!\"    Druga: \"Jaz bom pa letela še en krog, da ne bojo rekli, da sem kurba.\"", CategoryId = 41 },
                new Joke() { Id = 1589, Active = true, Title = "Medved in borilne veščine", Description = "Kako je ime medvedu, ki trenira Kung fu?    Griz Li", CategoryId = 41 },
                new Joke() { Id = 1590, Active = true, Title = "Nogometno prvenstvo", Description = "Mravlje so igrale nogomet proti slonom.    Po končani tekmi mravlje pridejo do slonov in rečejo: \"Oprostite, če smo malo grobo igrale.\"", CategoryId = 41 },
                new Joke() { Id = 1591, Active = true, Title = "Bolhe", Description = "Mož brez žene je kot pes brez  bolh.Živi, ampak dolgocasno.  Žena brez moža je kot bolha  brez psa. Živi, ampak nima koga  žreti.", CategoryId = 43 },
                new Joke() { Id = 1592, Active = true, Title = "Ogledalo", Description = "Prijatelja sedita ob kozarčku v  gostilni za šankom. Na proti  njiju pa dva stara zanemarjena,  zapita tipa. Poglej Lojze, takšna  bova midva čez kakšnih trideset   let, ko bova stara! Lojze ga grdo   pogleda in reče:   To je ogledalo, butelj!", CategoryId = 13 },
                new Joke() { Id = 1593, Active = true, Title = "Sedim,kadim in razmišljam", Description = "Sedim, kadim, razmišljam...  Ko sem v postelji z ženo,  neprestano mislim na ljubico in  v mislih ponavljam njeno ime.  Da se ne bi zmotil in naglas  izgovoril imena ljhubice, sem  kupil mačko in ji dal ime po   ljubici.  Danes je prišla domov žena in   prinesla malega psa maltežana.   Dala mu je ime Joza.  Sedim, kadim, in razmišljam...", CategoryId = 11 },
                new Joke() { Id = 1594, Active = true, Title = "Na plesišču", Description = "Jože je svoji soplesalki, na plesišču, že tretjič stopil na nogo.    Soplesalka ga vpraša: \"Ali radi plešete?\"    \"Zelo rad!\" ji je odgovoril.    \"Zakaj se pa potem ne naučite?\"", CategoryId = 43 },
                new Joke() { Id = 1595, Active = true, Title = "Sprehod po mestu in nenavadna opazka", Description = "Špelca se z mamico potepa po mestu.    Ko zaideta mimo gostilne se Špelca oglasi: \"Mami, mami! Tu notri pa diši po očkovem parfumu!\"", CategoryId = 11 },
                new Joke() { Id = 1596, Active = true, Title = "Zanimiva mešanica potnikov na vlaku", Description = "Na vlaku v kupeju sedijo: prekrasna in postavna blondinka, nuna, Hrvat in Slovenec.    Ko vlak zapelje v tunel, nastane popolna tema in zasliši se, kako pade krepka zaušnica. Ko vlak pripelje iz tunela, se Hrvat drži za otečen obraz in zmedeno gleda okrog sebe.    Nuna si pri sebi misli: \"Sigurno je ta prostak otipaval blondinko, in mu je ta vrnila tako, kot se spodobi.\"    Si misli blondinka: \"Sigurno me je hotel otipavati, in je slučajno zgrabil nuno in logično, dobil po zobeh.\"    Hrvat razmišlja: \"Sigurno je ta Slovenec otipaval eno od teh, in sem jih namesto njega, nič kriv, dobil jaz.\"    Sam pri sebi pomisli Slovenec: \"Kdaj bo spet tunel, da mu primažem še eno krepko?\"", CategoryId = 43 },
                new Joke() { Id = 1597, Active = true, Title = "Res so lahko srečni", Description = "Blagor Kitajcem!    Kjerkoli kupujejo, kupujejo domače.", CategoryId = 43 },
                new Joke() { Id = 1598, Active = true, Title = "Javna uprava", Description = "Trije so v pisarni in eden dela. Kaj je to?    Dva uradnika in en ventilator.", CategoryId = 43 },
                new Joke() { Id = 1599, Active = true, Title = "Vzoren človek", Description = "Ne pijem drugega kot samo vodo. Ne kadim, jem skromno in nikamor ne grem, ne v kino, ne v gledališče, ne na nogometne tekme. Še v gostilno ne.    Ne družim se več z ženskami še pogledam jih ne.    Denarja ne zapravljam, pokra in biljarda ne igram več.    Spat grem ob osmih, vstanem se ob šestih, se umijem z mrzlo vodo in grem na delo.    Ko bom pa prišel iz zapora, bo pa spet malo drugače.", CategoryId = 17 },
                new Joke() { Id = 1600, Active = true, Title = "Starost", Description = "Kdaj si že res star?    Takrat, ko stanejo svečke na torti več, kot torta.", CategoryId = 43 },
                new Joke() { Id = 1601, Active = true, Title = "Starost inštrumenta", Description = "Kateri instrument je najstarejši?    Harmonika, ker je najbolj zgubana.", CategoryId = 43 },
                new Joke() { Id = 1602, Active = true, Title = "Tovornjakar in prostitutka", Description = "Tovornjakar, v pristanišču, nagovori prostitutko: \"Kaj narediš za 50 €?\"    Prostitutka: \"Vse!\"    Tovornjakar: \"Na, tu imaš 50€. Skoči gor, da te peljem do trgovine kjer bomo raztovarjali to težko robo.\"", CategoryId = 17 },
                new Joke() { Id = 1603, Active = true, Title = "Fata na zdravniškem pregledu", Description = "Po pregledu doktor reče Fati: \"Bojim se, da ne izgledate preveč dobro.\"    Ko hoče nadaljevati ga prekine Mujo: \"Vem, gospod doktor, tudi meni ni lepa, ampak dobro kuha, pere in zna z otroci.\"", CategoryId = 17 },
                new Joke() { Id = 1604, Active = true, Title = "Mlad lovec se oženi", Description = "Oženil se je mladi lovec, katerega žena je bila tudi lovka.    Imeli so pravo lovsko poroko, ki je trajala celo noč.    Proti jutro sta šla ženin in nevesta k \"počitku\" in tašča ,se je odločila, da jih bo opazovala skozi ključavnico,kako se bo njen ta mladi, prvo noč obnesel.    Seveda sta bila v trenutku že v \"elementu\". Ona je vzela tangice in mu jih je začela voziti mimo nosa sem cik-cak. Ta mladi jih zavoha, obrne ženo na hrbet in hop jo že napiči od zadaj.    Tašča to vidi in si misli: \"To je treba danes pri mojem dedcu poskusiti.\"    Rečeno storjeno! Pohiti v spalnico in vidi ta starega, kako že mrtvo pijan leži v postelji. Takoj se sleče in njene ogromne gate začne ujčkat ta staremu pred nos.    Stari rukne pokonci in pravi: \"Baba puško brž! Dihurja imamo v bajti!\"", CategoryId = 35 },
                new Joke() { Id = 1605, Active = true, Title = "Debeluška ima težave", Description = "Zelo debela ženska je vstopila v ordinacijo in doktorju potožila: \"Mislim, da me mučijo hemoroidi!\"    \"Prosim, spustite en kratek prdec!\"    \"Kaj? Ali to sodi k diagnozi?\"    \"Ne, sodi k orientaciji!\"", CategoryId = 39 },
                new Joke() { Id = 1606, Active = true, Title = "Huda laž", Description = "Štiri laži v enem stavku: cigan, edinec, se vstane zgodaj zjutraj in se, pred odhodom v  službo, stušira.", CategoryId = 7 },
                new Joke() { Id = 1607, Active = true, Title = "Mujo v bolnišnici", Description = "Haso je šel obiskat Mujota v bolnišnico.    Haso: \"Kako je, Mujo? Kaj pravijo zdravniki?\"    Mujo: \"Slabo, slabo.\"    Haso: \"Kako slabo?\"    Mujo: \"Zelo slabo! Imam kislino v želodcu, vodo v kolenu in sladkor v krvi.\"    Haco: \"Človek, pa ti si živa limonada!\"", CategoryId = 18 },
                new Joke() { Id = 1608, Active = true, Title = "Brčice", Description = "Milan je zelo ponosen na svoje brke. Nekega dne mu brivec reče: \"Če bi tele brčice ponesreči postrigel, te zagotovo ne bi nihče prepoznal.\"    Milan: \"Tebe tudi ne!\"", CategoryId = 17 },
                new Joke() { Id = 1609, Active = true, Title = "Nič dobrega se mu ne piše", Description = "\"Tri hude prekrške ste storili!\" je hud policist. \"Še tistega, ki vam je dal vozniško dovoljenje, bi bilo treba kaznovati!\"    Voznik: \"Saj so ga že, zaradi ponarejanja dokumentov!\"", CategoryId = 22 },
                new Joke() { Id = 1610, Active = true, Title = "Zelo sem zadovoljen", Description = "Sinoči sem spal s postavno gospodično.    Izgleda, da ji je bilo zelo všeč, saj je podala vsem: staršem, prijateljem, policiji, ...", CategoryId = 27 },
                new Joke() { Id = 1611, Active = true, Title = "Žena mu očita", Description = "Se pogovarjata dva moška: \"Žena mi očita, da se premalo ukvarjam z otroci.\"    \"Koliko jih pa imaš?\"    \"Pet ali šest ali nekaj takega.\"", CategoryId = 17 },
                new Joke() { Id = 1612, Active = true, Title = "Ptičja gripa", Description = "Dva goloba na veji.    Eden reče: “Mater, to je moč! Narediš se mrtvega, pa se pol mesta userje od strahu!” ", CategoryId = 41 },
                new Joke() { Id = 1613, Active = true, Title = "Previdnost ni odveč", Description = "Na terasi: \"Natakar, zakaj ribo držite s prstom?\"    \"Iz previdnosti.\"    \"Kakšne previdnosti?\"    \"Da mi ne bi še enkrat padla na tla in bi spet stopil nanjo!\" ", CategoryId = 13 },
                new Joke() { Id = 1614, Active = true, Title = "Vseskozi briše pizdo", Description = "Tilka piše prosti spis o tem, kaj dela čez dan.    Zjutraj vstanem, obrišem pizdo in si umijem zobe. Grem v šolo, se vrnem domov, obrišem pizdo, pojem, napišem domačo nalogo in obrišem pizdo. Potem se malo igram, gledam TV, povečerjam, obrišem pizdo in grem spat. Naslednje jutro pa spet vse od začetka.    Učiteljica je zgrožena in pokliče mamo na pogovor.    Mama pove: \"Tilka je vse prav napisala. Potem, ko se je mož včlanil v stranko SMC, nam stalno na garažna vrata pišejo PIZDA!\"", CategoryId = 32 },
                new Joke() { Id = 1615, Active = true, Title = "Pestro dogajanje v domu za ostarele", Description = "Štiri stare gospe so sedele za mizo v domu starejših, ko pride mimo njihov sovrstnik, starejši gospod.    Ena od njih mu zakliče: \"Stavimo, da točno uganemo, koliko si star!\"    Stari gospod odgovori: \"Tega pa ne boste uganile, vi stare bebaste koklje!\"    \"Ena od kokelj mu odvrne: \"Natančno ti lahko povemo. Spusti svoje hlače in gate, pa ti bomo povedale, koliko si star!\"    Malo presenečen, vendar trdno odločen, da jim dokaže svoj prav, stari gospod spusti svoje hlače in gate.    Stare gospe si ga z vseh strani dobro ogledajo, potem pa v zboru zakričijo: \"Star si točno 87 let!\"    Gospod s spuščenimi hlačami začudeno vpraša: \"Kako za vraga ste pa to uganile?\"    Z od smeha solznimi očmi mu stare gospe zakličejo: \"Včeraj smo bile na tvojem rojstnem dnevu!\"", CategoryId = 40 },
                new Joke() { Id = 1616, Active = true, Title = "uganka", Description = "Kaj postane daljše, kadar ga potegneš, se dobro prilagaja med joški, odlično se fiksira v luknjo in najbolje dela, kadar se nategne?      Ja varnostni pas v avtu, vendar!", CategoryId = 43 },
                new Joke() { Id = 1617, Active = true, Title = "Mačka v gostilni", Description = "Mačka vstopi v gostilno in se ustavi pri točilnem pultu.    \"Kozarec mleka kot običajno?\" vpraša natakar.    \"Ne, danes bi pa kar žganje!\" reče mačka.    \"Žganje?\" je presenečen natakar.    \"Ja, enkrat bi se zjutraj rada zbudila z mačkom.\" ", CategoryId = 41 },
                new Joke() { Id = 1618, Active = true, Title = "Zajela jih je nevihta", Description = "Strašna nevihta na morju. Kapitan vpije na krovu: \"Zna kdo moliti?\"    Javi se en mornar: \"Jaz znam moliti!\"    \"Čudovito!\" je rekel kapitan.    \"Vi boste ostali na krovu in molili. Imamo namreč en reševalni pas premalo.\" ", CategoryId = 36 },
                new Joke() { Id = 1619, Active = true, Title = "Blondinka in kokoš", Description = "Kako pravimo blondinki, kaj je kuro?    Kanibal !", CategoryId = 4 },
                new Joke() { Id = 1620, Active = true, Title = "Mož bi na hitro", Description = "Mož: \"Si za seks, tako na hitro?\"    Žena: \"Kako pa praviš temu, kar ponavadi delava?\"", CategoryId = 27 },
                new Joke() { Id = 1621, Active = true, Title = "Razšla sta se", Description = "\"Si pustil svoje dekle zato, ker je začela nositi očala?\"    \"Ne, ona me je zapustila, ko je začela nositi očala.\" ", CategoryId = 43 },
                new Joke() { Id = 1622, Active = true, Title = "Prva", Description = "\"Eva, prisegam ti, da si prva ženska, v katero sem se zaljubil!\" je rekel Adam.    \"Ali si imel izbiro?\" ", CategoryId = 43 },
                new Joke() { Id = 1623, Active = true, Title = "Ni vedno tako", Description = "\"Punčka, rad bi te povabil k sebi,\" reče mladenič prikupni deklici.    \"Hvala, toda nisem za!\"    \"Toda - jaz ne povabim vsake!\" je uporen fant še naprej.    \"Tudi jaz ne zavrnem vsakega povabila.\"", CategoryId = 43 },
                new Joke() { Id = 1624, Active = true, Title = "Dobro se je odrezal", Description = "Silvestrovo, v pričakovanju novega leta, v upravni stavbi podjetja.    V zatemnjeni pisarni ležita dva, moški in ženska, v udobnem naslonjaču. Sliši se nežno in strastno sopenje.    \"Joj, Tone, Tone, še nikdar me nisi tako ljubil! Ali je danes tako dobro zaradi novoletnega razpoloženja?\"    \"Ne, to je najbrž zato, ker jaz nisem Tone!\"", CategoryId = 27 },
                new Joke() { Id = 1625, Active = true, Title = "Sveža iz dopusta", Description = "Žena, ki se pozno ponoči po enem tednu vrne s službenega potovanja, tiho odpre vrata spalnice, odgrne pokrivalo na postelji in zagleda štiri noge, ki so molele izpod odeje.    V trenutku se ji zmegli pred očmi, pograbi baseball palico, ki je bila za vrati in prične udrihati po odeji.    Ko se je utrudila, odide v kuhinjo po pijačo, da si malo opomore od šoka.    Tam pa ponovno doživi šok, ko za mizo zagleda svojega moža, ki pije pivo in ji reče: \"Tvoji starši so prišli na obisk za vikend, pa sem jima odstopil najino posteljo. Pojdi ju pozdravit.\"", CategoryId = 11 },
                new Joke() { Id = 1626, Active = true, Title = "Dame imajo prednost", Description = "\"Dame imajo prednost\"    je samo moški izgovor za: \"Pejt naprej, da te v rit pogledam!\"", CategoryId = 17 },
                new Joke() { Id = 1627, Active = true, Title = "marsovci na vsakem koraku", Description = "Poklicni šofer je vozil s tovornjakom po podeželski cesti. Nenadoma se je prikazal ob cesti majhen zelen možiček in ga ustavljal.    Šofer se je nekoliko začuden ustavil in ga vprašal: \"Kdo neki si pa ti in kaj hočeš??\"    Mali zeleni možiček je odvrnil: \"Jaz sem prišel z Venere, sem peder in sem lačen.\"    Voznik tovornjaka mu je dal sendvič in rekel: \"Tale sendvič je vse s čimer ti lahko ustrežem.\"    Peljal se je dalje, dokler ni ob cesti zagledal majhnega rdečega možička , ki ga je ustavljal.    Ustavil se je in vprašal: \"Od kod si spet ti vzel in kaj bi rad?\"    Mali rdeči možiček je odgovoril: \"Jaz sem prišel s Saturna, sem peder in sem žejen.\"    Šofer mu je dal pijačo in rekel: \"Žal mi je, toda to je vse kar lahko storim zate.\"    Čez nekaj časa je zagledal ob cesti majhnega modrega možička, ki ga je ustavljal. Zadeva z možički mu je bila zdaj že dokaj dobro poznana.    Zato se je ustavil in dejal: \"No ti mali modri peder , kaj bi pa ti rad dobil od mene?\"    Mali modri mož je odgovoril: \"Za začetek vaše vozniško in prometno dovoljenje, prosim...\"", CategoryId = 43 },
                new Joke() { Id = 1628, Active = true, Title = "Sobotni večer in treba je na žur", Description = "\"Ati, s prijatelji gremo ven.\"    \"V tem mini krilu ne greš nikamor! Preobleci se!\"    \"Kaj pa naj oblečem?\"    \"Kakšne hlače ali kaj takega, Marko!\"", CategoryId = 11 },
                new Joke() { Id = 1629, Active = true, Title = "Res so čudni časi", Description = "Kakšni časi so prišli: Greš po ulici, v žepu imaš najnovejši iPhone.    Spodrsne ti, padeš in slišiš škrccc.    Moliš boga, da je šel kolk!", CategoryId = 43 },
                new Joke() { Id = 1630, Active = true, Title = "Verižna reakcija", Description = "Direktor podjetja pokliče tajnico in ji reče: \"Prosim, pripravite se, greva za en teden na službeno pot v tujino.\"  Tajnica po vrnitvi domov reče možu: \"Dragi, s šefom grem za en teden na službeno pot, moral boš poskrbeti zase ta čas.\"  Mož telefonira svoji ljubici: \"Moja žena bo odpotovala za en teden, ki ga lahko preživiva skupaj.\"  Ljubica pošlje e-pošto dijaku, ki ga uči matematike: \"Ta teden bom zelo na tesnem s časom, zato ti dam prosto.\"  Dijak ves srečen obvesti svojega deda: \"Dedek, en teden nimam ur iz matematike, ker moja inštruktorica nima časa. Daj, prosim, greva ribe lovit!\"  Ded (direktor podjetja) ponovno pokliče tajnico: \"Sprememba plana. Vnuk me prosi, da bi preživela prosti čas skupaj. Potovanje bova prestavila na kak drug čas.\"  Tajnica pokliče svojega moža: \"Dragi, šef je spremenil načrt in službena pot je odložena.\"  Mož telefonira ljubici: \"Ne bo šlo ta teden. Ženina službena pot je preložena.\"  Ljubica pošlje SMS dijaku: \"Vseeno bova imela ure tako kot doslej.\"  Dijak obvesti dedka: \"Dedek, žal, učiteljica je rekla, da bova imela inštrukcije tudi ta teden.\"  Ded stopi k tajnici: \"Ne sekirajte se, vseeno bova odpotovala.\"    Tajnica...!!!", CategoryId = 29 },
