                new Joke() { Id = 1654, Active = true, Title = "Zdravilni poljubi", Description = "Fant in dekle sedita na klopci v parku.    Ona mu reče: \"Boli me vrat!\"    On jo poljubi na vrat in bolečina ji izgine.    Ona: \"Zdaj me boli oko.\"    On jo poljubi na oko in bolečina ji izgine.    Ona: \"Zdaj me boli ustnica.\"    On jo poljubi na usta in bolečina ji izgine.    Vse to je poslušal en starček na sosednji klopi in vpraša: \"Ej poba, a hemeroide tudi zdraviš?\"", CategoryId = 43 },
