                new Joke() { Id = 1656, Active = true, Title = "Najlepše na svetu", Description = "Se Francoz, Italijan in Rus pogovarjajo kaj je najlepše na svetu.    Francoz: \"Predstavljajta si tole. Sem v restavraciji, na mizi polži, šampanjec in nasproti mene lepo dekle. Po večerji jo odpeljem domov, kjer poslušava glasbo in se potem strastno ljubiva celo noč.\"    Italijan mu pritrdi: ”Res je. Samo namesto polžev in šampanjca so na mizi špageti in kakšno dobro domače vino.\"    Rus pa samo zmaja z glavo in reče: \"Zdaj si pa vidva tole predstavljajta. Sibirija minus trideset stopinj in piha veter. Jaz v topli koči mirno spim v postelji.    Kar naekrat vstopi v sobo poveljnik in se zadere Vladimir, na stražo!\"    Francoz in Italijan se spogledata in vprašata: \"Kaj je pa tukaj tako lepega???\"    Pa pravi Rus: \"Da meni ni Vladimir ime!\"", CategoryId = 43 },
                new Joke() { Id = 1657, Active = true, Title = "Čudna situacija", Description = "Nekega dne je na naše dvorišče prišel vidno utrujen kuža. Po ovratnici in po tem, da je bil urejen in dobro hranjen sem sklepal, da ima dom in da dobro skrbijo zanj.  Mirno in ljubeznivo je prišel do mene, pobožal sem ga po glavi, potem pa je kar šel za mano v hišo, v kotu pa se je zvil v klobčič in trdno zaspal.    Pustil sem ga tam. Uro kasneje je prišel do vrat, spustil sem ga ven in je veselo odšel.    Naslednji dan je ponovno prišel, me pozdravil, šel v hišo na svoje mesto in ponovno odspal okoli uro in pol. To se je ponavljalo kar nekaj časa potem pa sem postal radoveden, za ovratnico sem mu zataknil listič: \"Prosim, da mi sporočite, kdo je lastnik tega čudovitega psa. Ali veste, da prihaja vsako popoldne k meni v hišo, kjer odspi kako urico?\"  Naslednji dan je pes ponovno prišel, za ovratnico pa je imel nov listek: \"Oprostite za nadlegovanje. Očitno ste dober človek. Naš kuže živi v družini s tremi otroki, od tega sta dva mlajša od treh let, zato poišče miren kotiček, da se naspi.  Če vam ne bi bilo odveč - bi smel jutri priti z njim????\"", CategoryId = 41 },
                new Joke() { Id = 1658, Active = true, Title = "Robot tajnica", Description = "Direktor se vrne iz Japonske s podarjeno umetno tajnico in jo razkazuje namestniku: \"Poglej Franc, je naravnost čudovita. Pritisneš na levo bradavico in začne tipkati, pritisneš na desno in piše stenogram. Če pritisneš na popek, se loti računalnika\" Pa še za poseksati je izvrstna.\"    Franc: \"A res?! A mi jo posodiš?\"    Direktor: \"Izvoli!\"    Franc pobaše tajnico na stranišče. Čez nekaj minut zatuli kot zverina.    Direktor se udari po glavi:\"Uh, jebemti, pozabil sem mu povedati, da ima v riti šilček!\"", CategoryId = 43 },
                new Joke() { Id = 1659, Active = true, Title = "Minister v mesariji", Description = "Pride g. minister v mesarijo in naroči krvavice.    Mesar postavi prašičje stegno na stroj in ven pridejo klobase.    G. minister se nato pošali na mesarjev račun in reče: \"Škoda, da vi nimate takšnega stroja, da daš na stroj klobaso, ven pa pride pujs.\"    Mesar ga strogo pogleda in mu odvrne zbadljivo:\"Ne, takšnega je imel pa vaš oče!\"", CategoryId = 23 },
                new Joke() { Id = 1660, Active = true, Title = "Srečanje po dolgem času", Description = "Srečata se dva pijančka in se pogovarjata:    Joško: \"Živjo Franci, kako si?\"  Franci: \"Dobr, pa ti?\"  Joško: \"Tudi dobr. A še kaj piješ?\"  Franci: \"Pijem, pijem, saj veš, žeja. Kaj pa ti?\"  Joško: \"Normaln, tud jaz sem žejen.\"  Franci: \"A nis bil ti na zdravljenju proti alkoholizmu?\"  Joško: \"Bil, 3 mesce!\"  Franci: \"Zakva pa pol še piješ?\"  Joško: \"Ja, zašuštral so me, zašuštral!!!!\"", CategoryId = 21 },
