                new Joke() { Id = 1669, Active = true, Title = "Ven iz hudiča ženske", Description = "S katerimi ženskami se ni dobro vezati?    Blagajničarka – vedno zahteva denar v naprej.  Sprevodnica – vedno vpije: \"Porini v sredini, da prideta noter še dva, ki sta zunaj.\"  Profesorica – vedno pravi: \"Bilo je dobro, ponoviva še enkrat.\"  Zdravnica – govori: \"Naslednji prosim.\"  Šefinja v rudniku – ukazuje: \"Pripravite se, da greste v jamo.\"  Lekarnarka – pravi: \"Dvakrat pred jedjo in dvakrat po jedi.\"  Telefonistka – pravi: \"Končajte gospod, drugače bom prekinila.\"  Kuharica – pravi: \"Mešaj hitreje, da se ne prime.\"", CategoryId = 40 },
