                new Joke() { Id = 1687, Active = true, Title = "Slabo in še slabše", Description = "Zdravnik po telefonu: \"Dragi pacient, za vas imam slabo novico in še eno hujšo!\"    Pacient začudeno: \"No, kaj je potem slaba novica?\"    Zdravnik: \"Ostal vam je samo še en dan življenja!\"    Pacient: \"Slabše res ne more biti. Kaj naj bi bila potem še hujša novica?\"    Doktor: \"Že od včeraj sem vas poskušal doklicati.\"", CategoryId = 39 },
