                new Joke() { Id = 1694, Active = true, Title = "Čudež", Description = "Mož gre sredi noči na stranišče. Ko se vrne, zbudi ženo in ji reče: \"Nekaj čarobnega se je zgodilo! Šel sem na stranišče in se je luč  sama od sebe prižgala, ko sem končal, pa je sama od sebe  ugasnila. Čarovnija!\"    Žena mu odgovori: \"Nobena čarovnija, kreten! Spet si se v hladilnik poscal!\"", CategoryId = 11 },
                new Joke() { Id = 1695, Active = true, Title = "Kavica", Description = "Marta rece Kosirju:  Ves kaj, ko zjutraj spijeva kavico,  me tako pozivi, da se pocutim vsaj  dvajset let mlajso.  Kosir odvrne:  Ce je pa tako, se kaksno spij, preden  greva spat.", CategoryId = 11 },
