                new Joke() { Id = 1698, Active = true, Title = "Luna", Description = "Nekega dne je uciteljica v razredu  govorila o poroki.  Janezek, kaksno zeno bi rad imel?  Rad bi imel tako, kot je luna.  Oh, kaksna izbira...Ali bi rad, da  je lepa kot luna?  Ne. Rad bi, da bi prisla zvecer in  izginila zjutraj.", CategoryId = 15 },
