                new Joke() { Id = 1703, Active = true, Title = "Polog na banko", Description = "V Švicarsko banko je vstopil možakar in povedal bančnemu uslužbencu, da želi odpreti račun in položiti denar.    \"Koliko boste pa položili na račun?\" ga je vprašal bančnik.    \"Tri milijone evrov!\" je zašepetal možakar.    \"Saj lahko govorite glasneje!\" mu je rekel bančnik. \"V Švici revščina ni sramota!\" ", CategoryId = 43 },
