                new Joke() { Id = 1708, Active = true, Title = "Uspešen ribolov", Description = "\"Se spominjaš, da si bil pred pol leta na ribolovu?\" je žena vprašala moža.    \"Seveda se spominjam! Odličen ulov je bil!\"    \"Klicala te je riba, ki si jo ulovil! Pričakuje male ribice!\" ", CategoryId = 11 },
                new Joke() { Id = 1709, Active = true, Title = "Situacija ni zavidljiva", Description = "Barbara in Suzana se vračata iz diskoteke. Že zdavnaj je odbila polnoč.    Barbara se ozre k prijateljici in reče: \"Kako zelo si zdajle želim, da bi bila miška!\"    \"Zakaj pa miška?\" se začudi Suzana.    \"Ker se moja mami miši zelo boji.\" ", CategoryId = 11 },
                new Joke() { Id = 1710, Active = true, Title = "Po spominu", Description = "Janez in Mojca gresta na   slikarsko rastavo negdanjega  Mojcinega sosolca.  Nenadoma naletita na akt, v  katerem Janez prepozna Mojco.  O ljubi bog, ali si mu gola  pozirala?  Mojca v solzah:  Nisem, dragi, to je narisal  po spominu.", CategoryId = 43 },
                new Joke() { Id = 1711, Active = true, Title = "Kandidat za vozniški izpit", Description = "\"Tone, slišal sem, da imaš danes vozniški izpit!\"    \"Ja, danes, danes, toda to je že za menoj.    \"Si ga uspešno naredil?\"    \"Ne vem, član izpitne komisije me ne mara.\"    \"Ah, to si samo domišljaš. Kaj ti je pa rekel?\"    \"Nič. Ko so ga bolničarji nalagali na nosila, me je samo grdo pogledal.\" ", CategoryId = 43 },
                new Joke() { Id = 1712, Active = true, Title = "Pivo", Description = "Marija sedi v baru in k njej pristopi   moski, ki jo ogovori:  Ali vam lahko placam pivo?  Ne, hvala. Pivo ni dobro za moje noge.  Ali vam otecejo?  Ne. Ne razmaknejo se dovolj...", CategoryId = 27 },
