                new Joke() { Id = 1714, Active = true, Title = "Svetlo pivo", Description = "Janez pride k zdravniku in  pravi:  Z zeno imava probleme s seksom.  Videti je, da imam premajhen   penis. Zdravnik ga vprasa:  Kaj najrajsi pijete?  Pivo.  Kaksno?  Zlatorog.  Za svetlo pivo so raziskave  pokazale, da stvari krcijo.  Pijte rajsi temno pivo.  Janez se cez mesec dni prismeji  k zdravniku:  Hvala, zdaj je vse v redu.  Ali pijete temno pivo?  Da. Zeno pa sem navadil na   zlatorog.", CategoryId = 11 },
