                new Joke() { Id = 1716, Active = true, Title = "Odločil se je", Description = "Egon je v družbi prijatelja sključeno sedel za mizo, nagnil vrček piva in dejal:\"Nič me ne bo več prepričalo o nasprotnem! Odločil sem se, da se bom končno ločil od najbolj sitne žene na svetu!\"    \"Ne govori traparij!\" mu je rekel njegov prijatelj. \"Od moje žene se pa ti ne moreš ločiti!\" ", CategoryId = 21 },
