                new Joke() { Id = 1719, Active = true, Title = "Povozil jo je", Description = "Joža se usede na moped in odhiti domov. Kar naenkrat pred seboj zagleda ženico in jo podre.    \"Tepec, norec, idiot, kreten! A ne znate peljat' okoli?\"    \"Saj bi,\" odvrne Joža, \"pa bi mi potem bencina zmanjkalo!\"", CategoryId = 43 },
                new Joke() { Id = 1720, Active = true, Title = "Pravi gorenjc", Description = "Na kmečkem turizmu turisti opazijo, da lastnik jaha svojega konja tako, da je s hrbtom obrnjen v smer ježe. Eden izmed gostov vpraša: \"Joža, zakaj pa jahaš tako? Obrniti bi se moral!\"    \"Saj se bom. Včeraj je konj med obrokom ovsa pojedel en cent pa čakam, da pride ven. Potem se bom pa obrnil.\"", CategoryId = 12 },
                new Joke() { Id = 1721, Active = true, Title = "Tole je pa rahlo sumljivo", Description = "V pekarno na Gorenjskem pride možakar in hoče kupiti kruh. Pek mu odvrne: \"Podražili smo kruh! Od sedaj bo za hlebček kruha potrebno odšteti 5 evrov!\"    \"Koliko? 5 evrov? Ste mar znoreli? Zakaj pa ravno toliko?\"    \"Država zahteva od vsakega hlebca 3 evre, občina še dodatnih 1 evro, preostali 1 evro pa stane kruh, ki ga spečem.\"    Joža jezno skomigne z rokami, seže v žep in na pult položi 5 evrov. Pek pospravi denar, iz blagajne vzame 1 evro in mu jih vrne.    \"Kaj pa zdaj to pomeni?\" popeni Joža.    \"Nič. Žal mi je kruha zmanjkalo.\"", CategoryId = 12 },
                new Joke() { Id = 1722, Active = true, Title = "Nakup dežnika", Description = "Tone pride v trgovino in reče: \"Navaden dežnik bi rad kupil.\"    \"Vam lahko predlagam kaj boljšega?\"    \"Ni potrebno, saj ga bom tako ali tako nosil samo takrat, ko bo vreme zanič.\"", CategoryId = 43 },
                new Joke() { Id = 1723, Active = true, Title = "Vsi možni popusti", Description = "Rudi pride v knjigarno, si izbere knjigo in vpraša: \"Kaj jaz kot upokojenec lahko uveljavljam kakšen popust?\"    \"Seveda. Kot upokojenec ste upravičeni do posebnega popusta.\"    \"Kaj pa zato, ker sem bil borec?\"    \"Tudi to upoštevamo in dajemo popust.\"    \"Kaj pa to, da sem delničar vaše založbe?\"    \"Seveda, tudi zaradi tega imate pravico do popusta.\"    \"In koliko me bo torej stala ta knjiga?\"    \"Samo trenutek, da izračunam. Aha, sem že! 30 evrov smo mi dolžni vam.\"", CategoryId = 43 },
                new Joke() { Id = 1724, Active = true, Title = "Šparat je treba", Description = "\"Si slišal, da na Gorenjskem mačkam porežejo repe, ko so še mlade.\"    \"Ne. Zakaj pa?\"    \"Da potem pozimi lahko hitreje za njimi zapahnejo vrata.\"", CategoryId = 12 },
                new Joke() { Id = 1725, Active = true, Title = "Malo po malo, pa se prišpara", Description = "Zakaj gorenjci med branjem knjige za kratek čas ugašajo luči?    Med obračanjem lista pa res ne rabijo svetlobe.", CategoryId = 12 },
