                new Joke() { Id = 1727, Active = true, Title = "Ves razcapan", Description = "Desetletni Jure je prišel domov ves raztrgan in mama se je razjezila: \"Kaj misliš, da ti bom vsak teden kupovala nova oblačila?\"    \"Bodi vesela, da je tako!\" je odgovoril sin. \"Sosedje bodo morali kupiti novega sina, ker sem mu pošteno preštel rebra!\" ", CategoryId = 11 },
                new Joke() { Id = 1728, Active = true, Title = "Vljuden kompliment", Description = "Vljuden gost, med zabavo, reče dekletu: \"Vaša šala o goskah je bila res enkratna!\"    \"Resno mislite?\"    \"Seveda! Kadarkoli bom videl gosko, se bom spomnil na vas!\" ", CategoryId = 43 },
                new Joke() { Id = 1729, Active = true, Title = "Matematična uganka", Description = "Učitelja matematike, ki je vprašal učence tole: \"Avtobus se pelje 60 km na uro v nasprotno smer pa teče potok 3 km na uro jaz pa hodim po avtobusu 2 km nauro v smeri potoka , no koliko sem star?\" Janezek odgovori, kot iz topa: \"24 let gospod učitelj\".    \"Točno!\", pravi učitelj, \"Kako si pa to pogruntal?\".    \"Ni bilo težav\", pravi Janezek Pri sosedu imajo mulca za katerega vsi pravijo da je na pol idiot in star je 12 let.", CategoryId = 32 },
                new Joke() { Id = 1730, Active = true, Title = "Darilo za rojstni dan", Description = "Se pogovarjata dve dami: \"Včeraj sem imela rojstni dan.\"    \"Čestitam. Kaj ti je mož kupil?\"    \"Vidiš audija na spodnjem parkirišču?\"    \"Jaaaa ....\"    \"No, takšne barve predpasnik.\"", CategoryId = 40 },
                new Joke() { Id = 1731, Active = true, Title = "Hitro si je premislila", Description = "\"No, Jože, si se že poročil z Barbaro?\"    \"Ne, ne bom se poročil z njo!\"    \"Zakaj pa ne? Saj si jo že predstavil svojemu bogatemu stricu!\"    \"Saj ravno zato! Zdaj je Barbara moja teta!\" ", CategoryId = 40 },
                new Joke() { Id = 1732, Active = true, Title = "Vse so iste", Description = "\"Zdaj moram pa zelo paziti, da ne dobim otroka!\" je Sonja rekla prijateljici.    \"Kako? Ali se tvoj mož ni steriliziral?\"    \"Seveda se je! In ravno zato moram paziti!\" ", CategoryId = 40 },
                new Joke() { Id = 1733, Active = true, Title = "Mladina je pokvarjena", Description = "Mama se prijateljici pritožuje nad svojo odraščajočo hčerko: \"Današnja mladina je grozna! Samo mojo hči poglej! Petnajst let je stara pa ima že resnega fanta, na moj devetindvajseti rojstni dan je pa čisto pozabila!\" ", CategoryId = 11 },
                new Joke() { Id = 1734, Active = true, Title = "Locitev", Description = "Kako locis Hrvata od  Slovenca?  Med njima postavis  zicnato ograjo.", CategoryId = 3 },
                new Joke() { Id = 1735, Active = true, Title = "Jaz sem bog", Description = "Rocky, Jackie Chan in Chuck   Norris.  Rocky ponuja kokain in rece:  Mene je bog poslal na zemljo,   da imam najvec denarja in   vse zenske.  Jackie globoko vdihne, zaokrozi  z ocmi in rece:  Mene je bog poslal,da namesto  njega vodim svet....  Chuck Norris pa z globokim   glasom:  Nisem jaz nikogar nikamor   poslal.", CategoryId = 43 },
                new Joke() { Id = 1736, Active = true, Title = "Zapustila ga je", Description = "\"Si slišal, da je Bogdana zapustila žena?\"    \"Res? In kako je prenesel?\"    \"Zdaj je že precej bolje! Prvi teden pa se mu je pa skoraj zmešalo od veselja in veseljačenja.\" ", CategoryId = 37 },
                new Joke() { Id = 1737, Active = true, Title = "Ne more iz svoje kože", Description = "Gorenjec vstopi na matični urad in pove: \"Rad bi prijavil, da je moja žena rodila otroka. Koliko stane prijava?\"    \"Nič.\"    \"No, potem vam pa povem, da so trojčki. Pa še enega, ki je bil rojen pred leti, bi tudi rad prijavil!\" ", CategoryId = 12 },
                new Joke() { Id = 1738, Active = true, Title = "Pri okulistu", Description = "Starejši pacient potrka na vrata okulistove ordinacije. Odpre mu medicinska sestra in zavpije nanj: \"Kaj ne vidite napisa, da je trkanje prepovedano!?\"    \"Ne, ne vidim. Zato sem pa tukaj.\" ", CategoryId = 39 },
                new Joke() { Id = 1739, Active = true, Title = "Nova mišelovka", Description = "\"Ali ste testirali mojo mišelovko?\" vpraša izumitelj na patentnem uradu.    \"Smo.\"    \"Torej jo boste patentirali?\"    \"O tem bomo še razpravljali. Je pa zelo učinkovita! Danes zjutraj smo namreč pred mišelovko našli tri miši, ki so umrle od smeha, ko so jo videle.\" ", CategoryId = 43 },
                new Joke() { Id = 1740, Active = true, Title = "Mlad par", Description = "Mladi par se odloči imeti otroka. Poizkušata mesec, dva, pol leta....nič. Ni uspelo. Se odločita, da gresta do zdravnika po strokovno pomoč. Vse razložita, opišeta trud, na dolgo in široko. Doktor ponižno posluša, potem pa le spregovori: ''Fanta, a je to kakšna zajebancija?????'", CategoryId = 39 },
                new Joke() { Id = 1741, Active = true, Title = "Nekam znan se mu zdi", Description = "\"Gospod natakar, ali mi lahko poveste, kdo je gospod pri sosednji mizi? Ne vem, kam naj ga dam, ampak tako grozno se mi zdi znan!\"    \"Nič čudnega, saj ste ga prav gotovo videli na televiziji. Gospod je urednik našega največjega časopisa.\"    \"Kaj pa krasotica, ki je z njim?\"    \"To je pa sobotna priloga.\" ", CategoryId = 43 },
                new Joke() { Id = 1742, Active = true, Title = "Kar naenkrat so se pojavili problemi", Description = "\"Dve leti sva bila srečno poročena, zdaj pa je neznosno!\" reče žena svojemu odvetniku.    \"In zakaj se je, po vašem mnenju, zakonsko življenje tako grozno spremenilo?\"    \"Mož je pustil delo v tujini in se vrnil domov.\" ", CategoryId = 11 },
                new Joke() { Id = 1743, Active = true, Title = "Srečanje alkoholikov", Description = "Doktor za bolezni odvisnosti vpraša paciente: \"Žejnemu oslu ponudijo vedro vode in vedro vina. Kaj bo spil?\"    \"Vodo!\" so v en glas povedali udeleženci srečanja.    \"In zakaj?\"    \"Ker je osel.\" ", CategoryId = 21 },
                new Joke() { Id = 1744, Active = true, Title = "Uganke", Description = "Učiteljica vpraša učence: \"Katera žival daje jajca?\"    \"Gos!\" se oglasi Metka.    \"V principu res, toda jaz sem mislila na kokoš,\" je rekla učiteljica.    \"No, in katera žival daje mleko?\"    \"Koza!\" se oglasi Mateja.    \"V principu res, toda jaz sem mislila na kravo!\"    Nenadoma se oglasi Janezek: \"Učiteljica, tudi jaz znam eno uganko. Ko ga daš noter je trd, ko ga vzameš ven pa je mehek. Kaj je to?\"    Učiteljica zardi in obstane kot vkopana. \"Ampak, Janezek....!\"    \"V principu res,\" odgovori Janezek,\" toda jaz sem mislil na žvečilni gumi!\" ", CategoryId = 15 },
                new Joke() { Id = 1745, Active = true, Title = "Gol moški narisan na tabli", Description = "Profesorica je vstopila v razred in na tabli zagledala narisanega golega moškega.    \"Po končani uri naj se mi javi tisti, ki je narisal tole!\" je dejala.    Javil se ni nihče.    Naslednji dan, ko je vstopila v razred, je na tabli zagledala napis: \"Še vi narišite, kaj mi nudite, pa se bom mogoče javil!\" ", CategoryId = 32 },
                new Joke() { Id = 1746, Active = true, Title = "Dolgočasna predavanja", Description = "\"Kakšna je današnja mladina!\" se pritožuje profesor v zbornici. \"Sploh nimajo interesa poslušati predavanja! Najbolj me jezi, ko kdo pogleda na uro!\"    \"Mene pa najbolj razjezi, če kdo prisloni uro k ušesu, da preveri, ali se mu ni ustavila!\" mu odgovori kolega. ", CategoryId = 32 },
                new Joke() { Id = 1747, Active = true, Title = "Kje je bil rojen", Description = "Policista se pogovarjata: \"Kje si bil rojen?\"    \"Doma. Kje pa ti?\"    \"V bolnici.!    \"Ubožec! A si bil tako hudo bolan?\"", CategoryId = 22 },
                new Joke() { Id = 1748, Active = true, Title = "Trener ga je okaral", Description = "Trener rokometnega moštva je rekel vratarju: \"Ti bi lahko delal kot vratar v javni hiši!\"    \"Zakaj pa?\"    \"Ker tudi on vsakega pusti noter!\"", CategoryId = 43 },
                new Joke() { Id = 1749, Active = true, Title = "Res nesramno", Description = "\"Kakšna nesramnost!\" se razburja sedemdesetletnik. \"Razlagam ti, da je moja žena rodila sina, ti pa sprašuješ, kdo je oče!\"    \"No, nikar se ne razburjaj, no! Sem mislil, da veš.\"", CategoryId = 43 },
                new Joke() { Id = 1750, Active = true, Title = "Žensko odraščanje", Description = "Kar se žensk tiče, one imajo tri stopnje odraščanja:  1. Jezijo očeta  2. Živcirajo moža  3. Sitnarijo zetu  ", CategoryId = 40 },
                new Joke() { Id = 1751, Active = true, Title = "Tik pred zdajci", Description = "Janez kolesari preko mosta, ko na drugi strani ograje vidi stati punco, ki hoče skočiti.     Zaustavi se in pravi: \"Preden skočiš, bi te rad poljubil.\"    Punca pravi : \"Lahko,\" objameta se in globoko poljubita.    Janez: \"To je bil najlepši poljub v mojem življenju. Zakaj se hočeš vreči dol?\"    \"Starši ne marajo, da se preoblačim v punco.\"", CategoryId = 43 },
                new Joke() { Id = 1752, Active = true, Title = "Greh in sramota", Description = "Janezek vpraša očeta: \"Kakšna je razlika med grehom in sramoto?\"    Oče: \"Greh je, če jaz spim z drugo žensko, sramota pa je, če izpustim tako priložnost.\"", CategoryId = 15 },
                new Joke() { Id = 1753, Active = true, Title = "Demokracija", Description = "Mali cigo vpraša očeta: \"Čale, ka je to demokracija?\"    \"To je, da slovenci hodijo vsak dan delat, mi pa samo sedimo doma in jim krademo, pa še socialno podporo in otroške doklade dobivamo od njih\"    \"Kako pa, da jih to ne nervira?\"    \"Sej jih nervira, sam to je pa že diskriminacija.\"", CategoryId = 7 },
                new Joke() { Id = 1754, Active = true, Title = "Žalosten dan", Description = "\"Doktor, zakaj ste pa danes tako žalosten?\" vpraša sestra.    \"Ah, Sonja, umrl je gospod Koren, ki sem ga zdravil.\"    \"Ne jemljite si tega tako k srcu. Morda bi umrl tudi brez vašega zdravljenja.\" ", CategoryId = 39 },
                new Joke() { Id = 1755, Active = true, Title = "Ker je bosanec", Description = "Mali Mujo pride k mami in ji reče: \"Mami, danes smo se učili abecedo. Vsi so poznali samo črke do C, jaz pa vso abecedo!\"    \"To je pa zato sinko, ker si Bosanec,\" mu reče mama.    Naslednji dan mali Mujo spet pride k mami: \"Mami, danes smo se učili šteti. Vsi so šteli do 10, jaz pa do 100!\"    \"To je pa zato sinko, ker si Bosanec,\" mu reče mama.    Naslednji dan: \"Mami, danes smo bili na zdravniškem pregledu. Videl sem,da imajo vsi moji sošolci majhne pimplne, jaz imam pa velikega. A je to zato, ker sem Bosanec?\"    \"Ne, sinko. To je pa zato, ker imaš petindvajset let!\"", CategoryId = 3 },
                new Joke() { Id = 1756, Active = true, Title = "Počaka pri rdeči", Description = "Mujo se s Štefanom pelje po Ljubljani. Ko prideta na križišče do semaforja, Štefan opazi rdečo luč. Mujo pa kar pelje.    Štefan ga vpraša, zakaj je peljal skozi?    \"Moj brat Haso bi tudi...\"    Na naslednjem križišču se zgodba spet ponovi.    Potem pa prideta do naslednjega križišča in semaforja z zeleno lučjo. Mujo ustavi.    Štefan pa ga vpraša: \"Zakaj si pa sedaj ustavil?\"    \"Kaj pa, če pride mimo moj brat Haso, a?\"", CategoryId = 18 },
                new Joke() { Id = 1757, Active = true, Title = "Opozorilo", Description = "Pred solo je bil na cesti napis  z opozorilom:  Pazite, da ne povozite otrok!  Z otrosko pisavo je bilo pod  napisom pripisano:  Pocakajte raje na ucitelje!", CategoryId = 32 },
                new Joke() { Id = 1758, Active = true, Title = "Gnezdo", Description = "V ordenacijo prizvizga pacient  in rece psihiatru:  Doktor, mislim, da sem ptic!  Kar odletite nazaj v cakalnico,   jaz pa bom poklical v bolnisnico,   da vam pripravijo gnezdo.", CategoryId = 39 },
                new Joke() { Id = 1759, Active = true, Title = "Prazne groznje", Description = "Oce zagrozi sinu:  Ce se ne bos resno lotil  studija, bos sel delad.  Sin pa se zasmeji:  Haha, oci. Kam pa?", CategoryId = 11 },
                new Joke() { Id = 1760, Active = true, Title = "Stopnjevanje", Description = "Kako Dolenjci stopnjujejo  crko š?  Šilce, štamperle, štuc,   štefan, škaf...", CategoryId = 10 },
                new Joke() { Id = 1761, Active = true, Title = "Vesoljski", Description = "\"Ti si moje Sonce, moja Venera.\" je šepetal fant, ko se je stiskal k dekletu.    \"Raje bi bila tvoj Saturn!\"    \"Zakaj pa Saturn?\"    \"Saturn ima prstan!\" ", CategoryId = 43 },
                new Joke() { Id = 1762, Active = true, Title = "Oče in znanost", Description = "\"Že zelo dolgo nisem videl tvojega očeta!\"    \"Žrtev znanosti je postal.\"    \"Kaj? Operacija?\"    \"Ne, prstni odtisi.\" ", CategoryId = 11 },
                new Joke() { Id = 1763, Active = true, Title = "Črnc z belim tičem", Description = "Po plaži v Fiesi se sprehajajo trije goli črnci. Vsi so od nog do glave črne barve, le eden ima tisto moško zadevo belo.    Vsi jih z začudenjem gledajo, potem se pa le en domačin opogumi, stopi zraven in vpraša: \"Oprostite, kako pa to, da vaš kolega ni v celoti črn? Še nikoli nisem videl črnca z belim tičem\"    \"Ah ne, saj mi sploh nismo črnci. Rudarji iz Velenja smo, ki smo tukaj na počitnicah, kolegu je pa včeraj prišla žena na obisk.\"", CategoryId = 8 },
                new Joke() { Id = 1764, Active = true, Title = "Pijanček in viskiji", Description = "V gostilno vstopi pijanček Nace in naroči pet viskijev. Vse spije enega za drugim, nato naroči štiri viskije. Tudi te spije enega za drugim, nato naroči tri viskije, pa dva in nazadnje enega.      \"Ali ni čudno?\" je rekel natakarju, \"manj kot spijem, bolj sem pijan!\" ", CategoryId = 21 },
                new Joke() { Id = 1765, Active = true, Title = "Žena obišče moža v zaporu", Description = "Žena je obiskala moža v zaporu in mu potarnala: \"Otroci kar hitro odraščajo. Vedno večji so in že so začeli praševati!\"    \"Po meni?\"    \"Ne! Sprašujejo kam si skril denar!\"", CategoryId = 11 },
                new Joke() { Id = 1766, Active = true, Title = "Blondinka v lekarni", Description = "\"Tu imate zdravilo za vašega moža\", je farmacevtka rekla blondinki.  \"Pred uporabo ga je potrebno pretresti.\"    \"Le kako bom to izvedla, ko pa ima 120 kilogramov!\" je obupano dejala blondinka. ", CategoryId = 4 },
                new Joke() { Id = 1767, Active = true, Title = "Rodila bo", Description = "Bodoča mamica v porodnišnici vpraša ginekologa: \"Je moj mož lahko prisoten ob porodu?\"    Doktor nima nič proti: \"Seveda, mi celo spodbujamo, da so očetje poleg.\"    \"Potem pa nič! Veste, onadva ne prenašata drug drugega preveč dobro.\" ", CategoryId = 11 },
                new Joke() { Id = 1768, Active = true, Title = "Pulz", Description = "Zdravnik pregleda pacienta in reče: \"Vaš srčni utrip je zelo počasen.\" \"Saj se mi nikamor ne mudi,\" odvrne pacient.", CategoryId = 39 },
                new Joke() { Id = 1769, Active = true, Title = "Zanima se za posebno knjigo", Description = "V knjigarno vstopi moški in reče prodajalki: \"Prosim, rad bi knjigo z naslovom Moški, gospodar v hiši.\"    Prodajalka ga pogleda in reče: \"Poglejte zgoraj, znanstveno fantastiko prodajamo v prvem nadstropju.\" ", CategoryId = 43 },
                new Joke() { Id = 1770, Active = true, Title = "Preganje", Description = "Učiteljica je rekla Mihcu: \"Spregaj besedo hodim!\"    Mihec, opotekajoče: \"Hodim ... hodiš ... hodi …\"    \"Hitreje!\" mu je rekla učiteljica.    \"Tečem, tečeš, teče.\" ", CategoryId = 32 },
                new Joke() { Id = 1771, Active = true, Title = "Nerodno vprašanje", Description = "Blondinka je na klopci v parku sedela z novim znancem.    Ta jo je vprašal: \"Bi me hotela osrečiti?\"    \"Seveda!\" mu je zašepetala.    \"Potem mi pa predstavi svojo črnolaso prijateljico!\" ", CategoryId = 4 },
                new Joke() { Id = 1772, Active = true, Title = "Masiral bi plesalke", Description = "Moški se ponudi lastniku nočnega kluba: \"Za tisoč evrov mesečno bi masiral vaše plesalke!\"    \"Prav!\" je rekel lastnik bara. \"Imate denar s seboj?\" ", CategoryId = 43 },
                new Joke() { Id = 1773, Active = true, Title = "Na sodišču", Description = "Sodnik je vprašal obtoženca: \"Ste kriv ali nedolžen?\"    \"To boste morali pa sami ugotoviti, saj ste vendar plačani za to!\" ", CategoryId = 43 },
                new Joke() { Id = 1774, Active = true, Title = "Pravljica za lahko noč", Description = "Mala Barbara je zlezla k mamici v posteljo in ji rekla: \"Mami, povej mi kakšno pravljico za lahko noč.\"    Mama: \"Počakaj, da se vrne očka, pa jo bo povedal obema!\" ", CategoryId = 11 },
                new Joke() { Id = 1775, Active = true, Title = "V gostilni", Description = "Pride blondinka v bar in jo moški ogovori: \"Gospodična, kaj boste spili?\"    Blondinka: \"A si ti fukjen? Jaz imam fanta!\"    Moški: \"Pa, a si ti fukjena? Jaz sem natakar!\"", CategoryId = 4 },
                new Joke() { Id = 1776, Active = true, Title = "Blondinka na pumpi", Description = "Blondinka na bencinski črpalki prosi delavca, da ji natoči gorivo.    Delavec: \"Bencin ali diesel?\"    Blondinka: \"Bencin.\"    Delavec: \"95 ali 98?\"    Blondinka: \"A kaj bolj novega nimate?\"", CategoryId = 4 },
                new Joke() { Id = 1777, Active = true, Title = "Malo ga je zaneslo", Description = "\"Imel sem pivo, zrezek, krompir in solato,\" našteva gost natakarju, ki piše račun.    \"Solate vam ne bom računal. Tisto so bile rože.\"", CategoryId = 13 },
                new Joke() { Id = 1778, Active = true, Title = "Na drugo stran", Description = "Blondinka se je sprehajala ob reki in na drugi strani reke zagledala drugo blondinko.    \"Kako se pride na drugo stran?\" ji je zakričala.    \"Saj si že na drugi strani!\" ji je odgovorila blondinka. ", CategoryId = 4 },
                new Joke() { Id = 1779, Active = true, Title = "Župnik na letalu", Description = "Župnik potuje z letalom v Rim.    Med poletom pride do njega stevardesa in ga vpraša: \"Boste malo konjaka?\"    \"Kako visoko pa smo, gospodična?\"    \"Deset tisoč metrov.\"    \"Potem pa raje ne, da me šef ne vidi.\" ", CategoryId = 42 },
                new Joke() { Id = 1780, Active = true, Title = "Zvestoba", Description = "Kaj je to zvestoba?    Da imaš po treh ločitvah če kar isto ljubico.", CategoryId = 43 },
                new Joke() { Id = 1781, Active = true, Title = "Pritlikavca v gostilni", Description = "Dva pritlikavca sta vstopila v gostilno in za točilnim pultom naročila: \"Dva kratka!\"    \"Ja, to vidim! Kaj bosta pa pila?\" ju je vprašal natakar. ", CategoryId = 13 },
                new Joke() { Id = 1782, Active = true, Title = "Nenehni glavoboli", Description = "\"Gospod doktor, kaj naj storim? Kar naprej me boli glava.\"    \"Gospa, spremembo potrebujete!\"    \"Sem že poskušala, a je mož preveč ljubosumen.\" ", CategoryId = 39 },
                new Joke() { Id = 1783, Active = true, Title = "Iti ali ne iti", Description = "Pred zabavo je rekla žena: \"Sploh nimam nikakršnega veselja oditi k Peternelovim na zabavo!\"    \"Misliš, da grem jaz rad?\" se je oglasil mož.    \"Toda, pomisli kako bosta vesela, če ne prideva!\"    \"Prav imaš! Greva!\" ", CategoryId = 43 },
                new Joke() { Id = 1784, Active = true, Title = "Šla sta na pogreb", Description = "Dva pacienta psihiatrične bolnice sta odšla kot odposlanca vseh bolnikov na pogreb direktorja bolnice.    Ko sta se vrnila, so ju vprašali, kako je bilo.    \"Čudno!\" je odgovoril eden. \"Tako lepa muzika je bila, pa sva samo midva plesala!\" ", CategoryId = 43 },
                new Joke() { Id = 1785, Active = true, Title = "Predlog za malico", Description = "\"Natakar, kaj priporočate za malico?\"    \"Kaviar, gospod!\"    \"Kaj pa je to?\"    \"To so ribja jajca!\"    \"Potem mi pa prinesite tri. Ampak mehko kuhana!\" ", CategoryId = 13 },
                new Joke() { Id = 1786, Active = true, Title = "Mladenič jo ogovori", Description = "Mladenič vpraša dekle: \"Ti je že kdo rekel, da si podobna Sharon Stone?\"    \"Ne, nihče!\" z žarom v očeh odgovori dekle.    \"Ja, se mi je kar zdelo!\" komentira fant. ", CategoryId = 17 },
                new Joke() { Id = 1787, Active = true, Title = "Ravnanje z ženskami", Description = "\"Z ženskami ravnam kot s knjigami.\"    \"A tako pazljivo?\"    \"Ne, ko jo preberem, jo odložim in poiščem drugo!\" ", CategoryId = 43 },
                new Joke() { Id = 1788, Active = true, Title = "Gripa ali moški", Description = "Zakaj imajo ženske raje gripo, kot pa moške?    Ker jih gripa, četudi so grde, vseeno položi.", CategoryId = 40 },
                new Joke() { Id = 1789, Active = true, Title = "Ukradli so mu denarnico", Description = "Možak potoži na policijski postaji: \"Denarnico so mi ukradli!\"     \"Kakšna pa je bila?\" vpraša policist.    Možaku se razjasni obraz: \"Lepa, velike oči, dolge noge, blond ...\" ", CategoryId = 43 },
                new Joke() { Id = 1790, Active = true, Title = "Janša se pelje po podeželjski cesti", Description = "Janša in njegov šofer se peljeta po mirni podeželjski cesti.    Ko se peljeta mimo samotne kmetije priteče na cesto svinja in šofer jo zbije tako hudo, da je bila na mestu mrtva.    Janša: \"Joj, kako se je pa to zgodilo? Svinja je verjetno pobegnila iz tele bližnje kmetije. Pojdi tja, jim povej kaj se je zgodilo, in kmetu svinjo plačaj.\"    Šofer se odpravi do kmetije in Janša ga čaka. Minule so že dve uri in Janša postaja že živčen.    Po treh urah in pol se šofer vrne, ves nasmejan.    \"Kaj se je zgodilo?\", ga ves nervozen vpraša Janša.    Šofer: \"Gospod, ko bi vi vedeli, kako tale gospodinja dobro kuha! To še ni vse! Kmet ima res odlično črno vino! Jedel in pil sem, kot še v življenju ne. Imata pa tudi zelo postavno hčerko. Prava mrha je mala! Ko sem se najedel, me je peljala v spalnico. Tako sva se žgala, da ne vem, če sem kdaj doživel tako divji seks.\"    Janša, ves začuden: \"Pa kako je to mogoče, kaj si jim rekel?\"    Šofer: \"Rekel sem jim: jaz sem od Janše šofer in povozil sem prasca.\"", CategoryId = 23 },
                new Joke() { Id = 1791, Active = true, Title = "Ne more spati", Description = "\"Doktor, ali se da ozdraviti mojo nespečnost?\" je vprašal pacient.    \"Ni problem! Samo tisto zlobo, ki vas ne pusti spati, morava odstraniti!\"    \"Ne, to pa ne! Moja žena je preveč navezana na najinega novorojenčka!\"", CategoryId = 39 },
                new Joke() { Id = 1792, Active = true, Title = "Seks pri nosečnici", Description = "Zakonski par je obiskal zdravnika.    Žena je bila noseča in želela sta se pozanimati, v katerem položaju lahko seksata.    \"V prvi tretjini nosečnosti lahko seksata čisto normalno!\" je rekel doktor.    V drugi tretjini nosečnosti seksajta v pasjem položaju, v zadnji tretjini pa naj mož zavzame volčji položaj.\"    \"Volčji položaj?\" sta se začudila.    \"Ja, mož naj se uleže pred luknjo in tuli!\" ", CategoryId = 39 },
                new Joke() { Id = 1793, Active = true, Title = "Kmet je šel v kino", Description = "Pride kmet v kino. Se postavi v vrsto da bi kupil karto.    Prodajalka vstopnic ga vpraša:  \"Kaj pa imate tole na ramenu?\"    Kmet je odgovoril:  \"To je moja veverica, Maja. Vedno jo vzamem s  seboj, kamorkoli že grem.\"    \"Žal mi je\", pravi prodajalka. \"V kino ne spuščamo živali\".    Kmet je šel za vogal in Majo skril v hlače. Nato se je vrnil k prodajalki, kupil vstopnico, vstopil v dvorano in se usedel k dvema starejšima vdovama, Milki in Marički.    Film se je začel in Maja se je začela pritoževati nad neudobnim položajem.    Kmet si je odpel hlače, tako da je Maja lahko dala glavo ven in  gledala film.    \"Marička,\" je zašepetala Milka.    \"Kaj?\" pravi Marička, ki jo je film že popolnoma prevzel.    \"Mislim, da je moj sosed perverznež!\"    \"Zakaj?\" vpraša Marička.    \"Odpel si je hlače in ga dal ven.\"    \"No, ne sekiraj se zaradi tega,\" je rekla Marička, ki je še vedno pozorno gledala na platno.    \"Pri najini starosti sva videli že vse. Prav gotovo ni nič drugačen od ostalih. Centimeter več ali manj...\"    \"Tudi jaz sem tako mislila, ampak tale žre moje kokice!\"", CategoryId = 43 },
                new Joke() { Id = 1794, Active = true, Title = "Eskimi", Description = "Bucek obisce male Eskimcke.  Ti mu hite razlagati, na  kaj mora se posebno paziti:  Nikar ne jej rumenega snega.", CategoryId = 43 },
                new Joke() { Id = 1795, Active = true, Title = "Rdeca luc", Description = "Policist ustavlja vozilo, ki je  prevozilo rdeco luc.  A sok! Ko pride do avta, ugotovi.  da je za volanom njegov komandir.  Ta strogo: Zakaj si me ustavil?   Prevozili ste rdeco.  Pa kaj potem?   Menda vidis, da se mi mudi?  Ze, ze, a sem se bal, da bo kaksen  norec istocasno zapeljal v zeleno.", CategoryId = 22 },
                new Joke() { Id = 1796, Active = true, Title = "Papiga", Description = "Na policiji zvoni telefon:  Pomagajte, macka mi je usla v hiso!  Ampak, gospa, za to se ni treba   toliko razburjati.  Kaksna gospa, jaz sem papiga.", CategoryId = 41 },
                new Joke() { Id = 1797, Active = true, Title = "Ocetovstvo in vetrovi", Description = "Mlada dama je na sodiscu tozila  vec moskih hkrati za ocetovstvo.  Sodnik jo vprasa:  Kako ne veste, s kom ste zanosili?  Gospod sodnik, ce pojes kroznik  fizola, prav tako ne ves, zaradi  katerega zrna si spustil vetrove.", CategoryId = 40 },
                new Joke() { Id = 1798, Active = true, Title = "Drugo mnenje", Description = "Bjim se, pravi kirurg, da bo  potrebna operacija srcne zaklopke.  Pacientka se nervozno presede   na stolu.  Zelela bi se drugo mnenje.  Seveda, gospa.  Tudi predebeli ste gospa.", CategoryId = 39 },
                new Joke() { Id = 1799, Active = true, Title = "Tajnica", Description = "Podjetnik Janez doma pravi zeni:  Zaposliti moram tajnico.  V redu, ampak glej, da bo vsaj   abrahamovka, biti mora debela  in grda, skratka taksna, da ob njej  ne bos niti pomislil na seks.  Prav. Kdaj bos lahko zacela?", CategoryId = 29 },
                new Joke() { Id = 1800, Active = true, Title = "Mastno", Description = "Janez se zvecer vrne iz druge  izmene, se sede na stol v  kuhinji in vprasa:  Kaj bo za vecerjo?  Zena se postavi v zapeljivo  pozo in rece:  Mogoce jaz?  Saj ves, da ne smem nic mastnega.", CategoryId = 37 },
                new Joke() { Id = 1801, Active = true, Title = "Pojoca travica", Description = "Kako ves, da nekdo laze?  Das mu pojoco travico.  Kako pa ves, kdaj politik laze?  Ko se mu ustnice premikajo.", CategoryId = 23 },
                new Joke() { Id = 1802, Active = true, Title = "Osredotočenost moških", Description = "Joški so živ dokaz, da se moški lahko osredotoči na dve stvari naenkrat.", CategoryId = 17 },
                new Joke() { Id = 1803, Active = true, Title = "Dilema glede datuma", Description = "\"Katerega smo danes?\" vpraša policist svojega kolega.    \"Ne vem.\"    \"Ali ne piše v časopisu?\"    \"Ta je včerajšnji.\" ", CategoryId = 22 },
                new Joke() { Id = 1804, Active = true, Title = "Omara", Description = "Dva pubertetnika se zabavata pred stanovanjskim blokom, ko je mimo njiju prišla ženska,  ki je bila na pogled bolj podobna moškemu.   Eden od pubertetnikov se je oglasil:  \"Poglej jo! Kakšna omara!\"  Ženska je pristopila k njemu in mu dala močno zaušnico, on pa je vprašal:  \"Kaj pa zdaj to pomeni?\"  \"Vrata od omare so se odprla!\" mu je odgovorila ženska.", CategoryId = 15 },
                new Joke() { Id = 1805, Active = true, Title = "Ženska v avtošoli", Description = "Kandidatka za vozniški izpit je vprašala inštruktorja: \"Koliko še potrebujem, da bom šla lahko na izpit iz praktične vožnje?\"    \"Pet.\"    \"Pet ur?\"    \"Ne. Pet avtomobilov!\"", CategoryId = 40 },
                new Joke() { Id = 1806, Active = true, Title = "Sposodil bi si cigareto", Description = "Dijak četrtega letnika srednje šole reče učiteljici: \"Učiteljica, prosim, posodite mi cigareto.\"    \"Ali bi rad, da ostanem brez službe?\"    \"Morda, toda še raje bi cigareto.\" ", CategoryId = 32 },
                new Joke() { Id = 1807, Active = true, Title = "Na sodišču", Description = "Sodnik obtožencu: \"Ali ste poročeni?\"    \"Nisem in tudi nikoli ne bom!\"    \"Kdo bi si mislil?! Tako pameten možakar, pa krade!\" je skomignil sodnik. ", CategoryId = 43 },
                new Joke() { Id = 1808, Active = true, Title = "Muca", Description = "Učiteljica:\"Ja Janezek, zakaj si pa prinesel muco v šolo?\" Janezek:\"Sem zjutraj slišal očeta kako je mamici reku, da takoj ko gre mali v šolo, da ji bo pojedu muco!\"", CategoryId = 15 },
                new Joke() { Id = 1809, Active = true, Title = "V čakalnici", Description = "Sestra v ambulanti kliče bolnike: \"Medved, Čuk, Volk, Jazbec…\"    Eden od pacientov se oglasi: \"Sestra, kdaj bomo pa ljudje prišli na vrsto?\" ", CategoryId = 39 },
                new Joke() { Id = 1810, Active = true, Title = "Žena bi rada šla v kino", Description = "Žena je rekla možu Gorenjcu: \"Dragi, ali bi šla v kino?\"    \"Saj sva že bila!\"    \"Toda zdaj vrtijo že barvne filme z zvokom!\" ", CategoryId = 12 },
                new Joke() { Id = 1811, Active = true, Title = "Omenjena v časopisu", Description = "\"Ali veš, da je o moji ženi včeraj pisalo v časopisu.\"    \"Kaj res?\"    \"Da. Pisalo je, da je na svetu pet procentov žensk preveč.\"", CategoryId = 43 },
                new Joke() { Id = 1812, Active = true, Title = "Na obravnavi pred lovsko komisijo", Description = "Lovska disciplinska komisija obravnava kmeta Andreja.    \"Zakaj ste ustrelili zajca, če pa niste član lovske družine?\"    \"Zato ker je jedel moje zelje, čeprav ni član moje družine.\" ", CategoryId = 35 },
                new Joke() { Id = 1813, Active = true, Title = "Uspešen ulov", Description = "Jure je obiskal lovskega tovariša in ga vprašal: \"Je res, da si na lovu zadel? Kje imaš pa plen? V pečici?\"    \"Ne, v bolnišnici.\" ", CategoryId = 35 },
                new Joke() { Id = 1814, Active = true, Title = "O ti predrznež", Description = "\"Tisti tvoj prijatelj, ki je bil sinoči pri nas je odnesel odeje in brisače!\"    \"Ali je bilo vse skupaj kaj vredno?\"    \"Seveda! Saj sva jih šele pred tremi meseci odnesla iz hotela, kjer sva dopustovala!\" ", CategoryId = 43 },
                new Joke() { Id = 1815, Active = true, Title = "Pobralo ga je", Description = "\"Si slišala, da je Petri umrl mož?\"    \"Ja, sem. Koliko časa se je pa mučil?\"    \"Ne dolgo. Poročena sta bila šele dve leti.\" ", CategoryId = 11 },
                new Joke() { Id = 1816, Active = true, Title = "Z dovolj muje se vsak škorenj obuje", Description = "Vzgojiteljica opazuje malčka v mali šoli, kako si natika škornje, pa mu nikakor ne uspe.    Malček jo poprosi: \"Tovarišica, pomagajte mi!\"    In sta tlačila, vlekla, potiskala, škornji pa niso hoteli na noge.    Ko se je to končno posrečilo, sta oba prepotena in zapihana sedla na klop, fantek pa pogleda na škornje in reče: \"Tovarišica, ravno narobe sva jih obuta.\"    Vzgojiteljica pogleda in res. Ohranila je mirno kri, malčku škornje z muko sezula in jih začela znova tlačiti fantku na noge, tokrat vsakega na pravo nogo.    Fantek pogleda in reče: \"To sploh niso moji škornji.\"    Vzgojiteljica se ugrizne v jezik, da ne bi zakričala: \"Pa tega nisi že prej opazil?\"     S težavo malčku sezuje škornje, fantek pa ji razloži: \"To niso moji škornji, bratovi so, ampak mama jih je zdaj dala meni, ker so bratu postati premajhni!\"    Vzgojiteljica ne ve več, naj se smeji ali joka, ampak fantku znova pomaga zlesti v škornje.    Ko mu po tem hudem naporu pomaga obleči še plašček, ga vpraša: \"Kje imaš pa rokavice?\"    Fantek ji pove: \"Zjutraj sem jih natlačil v škornje\".", CategoryId = 32 },
                new Joke() { Id = 1817, Active = true, Title = "Mehičani in olimpijske igre", Description = "Zakaj ni Mehičanov na olimpijski igrah?    Zato, ker so vsi, ki znajo hitro teči, plavati ali visoko skakati že na drugi strani meje.", CategoryId = 43 },
                new Joke() { Id = 1818, Active = true, Title = "Poročil se je", Description = "\"Imaš zdaj kaj drugačno življenje kot prej, ko si bil še samski?\" je Polde vprašal prijatelja, ki se je pred kratkim poročil.    \"Samo v čevljih je razlika.\"    \"Kako? V čevljih?\"    \"Ja. Prej sem jih imel vedno v predsobi, zdaj pa jih, če prepozno pridem domov, dobim v glavo.\"", CategoryId = 11 },
                new Joke() { Id = 1819, Active = true, Title = "A ni to fenomen", Description = "Ivan opazuje ženo pri šivanju.    \"Tega pa res ne razumem!\"    \"Česa ne razumeš?\"    \"Tega, da s tako lahkoto vdeneš nit v šivankino uho, avta v garažo pa ne.\" ", CategoryId = 40 },
                new Joke() { Id = 1820, Active = true, Title = "Hotel je nekaj od mene", Description = "Zadnjič sem se sprehajal po parku in v miru jedel burek.    Grem mimo enega gostega grma in iz njega se nenadoma zasliši pritajen glas: \"Daj ga sem, daj ga sem!\"    Ker nisem videl, kdo se oglaša izza grma, sem rekel: \"Kaj hočeš? Burek?\"    Glas izza grma: \"Ne burek, papir!\"", CategoryId = 43 },
                new Joke() { Id = 1821, Active = true, Title = "Ni ravno tako, kot se sliši", Description = "Žena možu šepeta na uho: \"Dragi, kmalu bomo trije.\"    \"Kaj res?\" veselo vzklikne mož.    \"Ja, moja mama se bo preselila k nama.\" ", CategoryId = 11 },
                new Joke() { Id = 1822, Active = true, Title = "Pobegnila je", Description = "\"Si že slišal, da je Dušanu žena pobegnila z najboljšim prijateljem?\"    \"Verjetno je zdaj zelo osamljen!\"    \"Res je. Pravi, da prijatelja zelo pogreša.\" ", CategoryId = 11 },
                new Joke() { Id = 1823, Active = true, Title = "Med poukom", Description = "\"Kaj delaš tam zadaj, Janezek?\" vpraša učitelj Janezka.    \"Verjetno nič pametnega, kajne?\"    \"Res je. Vas poslušam!\" ", CategoryId = 15 },
                new Joke() { Id = 1824, Active = true, Title = "Menjava svečk", Description = "Mehanik pove blondinki, da bo na avtu potrebno zamenjati svečke.    \"Tega pa res ne razumem. Še nikoli jih nisem prižgala, vedno vozim s prižganimi lučmi.\" ", CategoryId = 4 },
                new Joke() { Id = 1825, Active = true, Title = "Življensko zavarovanje", Description = "\"Dragi, kaj ti ne nameravaš skleniti življenjskega zavarovanja?\"    \"Tega pa ne! Moj znanec že trideset let plačuje pa še vedno ni umrl!\"    \"Morda boš pa ti imel več sreče!\" ", CategoryId = 11 },
                new Joke() { Id = 1826, Active = true, Title = "Dan žena", Description = "Dan žena bi moral biti 6. marca.    Ampak je trajalo predolgo, da so se uredile. Zato zdaj praznujemo 8. marca.", CategoryId = 40 },
                new Joke() { Id = 1827, Active = true, Title = "Vročina in mraz", Description = "Učitelj fizike sprašuje učence o učinkih vročine in mraza.    \"Vročina razteza, mraz pa krči,\" reče Mojca.    \"Točno! Mi lahko kdo to ponazori s primerom?\"    \"Poleti so dnevi dolgi, pozimi pa krajši.\" ", CategoryId = 32 },
                new Joke() { Id = 1828, Active = true, Title = "Pri uri slovenščine", Description = "Učiteljica je pri uri slovenščine na tablo napisala stavek: \"Reven moški je umrl zaradi lakote.\"    \"Peter, kje je subjekt?\" je vprašala.    Peter, previdno: \"Verjetno na pokopališču!?\" ", CategoryId = 32 },
                new Joke() { Id = 1829, Active = true, Title = "Droge", Description = "Droge povzročajo odvisnost.    Le na Kosovu povzročajo neodvisnost.", CategoryId = 3 },
                new Joke() { Id = 1830, Active = true, Title = "Pri ginekologu", Description = "Ginekolog vprašal pacientko: \"Imata z možem urejeno spolno življenje?\"    \"Jaz ga imam, za moža pa ne vem!\" ", CategoryId = 11 },
                new Joke() { Id = 1831, Active = true, Title = "V nebesih išče moža", Description = "Žena pride v nebesa in išče svojega moža.    Sveti Peter jo vpraša, koga išče in ko mu razloži, doda: \"Rekel mi je, da se lahko za vsakokrat, ko me je prevaral, obrne v grobu!\"    \"Aja, tega mislite! Pri nas ga imamo za ventilator!\" ", CategoryId = 11 },
                new Joke() { Id = 1832, Active = true, Title = "Na dvorišču se prepirajo", Description = "Na dvorišču psihiatrične klinike se prepirajo trije pacienti: \"Jaz sem Prešeren!\" reče prvi.    \"Lažeš!\" zavpije drugi. \"Prešeren sem jaz!\"    \"Utihni! Meni je Bog povedal, kdo sem!\" se brani prvi.    \"Jaz ti nisem ničesar povedal!\" mu reče tretji.", CategoryId = 43 },
                new Joke() { Id = 1833, Active = true, Title = "Vstopnice za gledališko predstavo", Description = "\"Draga, jutri bova pa uživala! Kupil sem tri vstopnice za gledališko predstavo!\"    \"Tri? Zakaj pa tri?\"    \"No, ja ... eno za tvojega očeta, eno za tvojo mamo in eno za tvojega bratca!\" ", CategoryId = 11 },
                new Joke() { Id = 1834, Active = true, Title = "Dobil je slabo oceno", Description = "Kako je bilo v šoli?    \"Slabo. Pri geografiji sem dobil nezadostno.\"    \"Zakaj pa?\"    \"Nisem našel ekvatorja.\"    \"Saj ni čudno, ko pa imaš v torbi takšen nered!\" ", CategoryId = 32 },
                new Joke() { Id = 1835, Active = true, Title = "Ženske, kot ženske", Description = "Kako ženske kličejo debeluhe brez denarja?    Svinja.    A debeluha, ki ima veliko pod palcem?    Moj mali medo!  ", CategoryId = 40 },
                new Joke() { Id = 1836, Active = true, Title = "Delitev žensk", Description = "Žene se delijo na vdove in na tiste, ki delajo na tem.", CategoryId = 40 },
                new Joke() { Id = 1837, Active = true, Title = "Nova obleka", Description = "Mami mami, a ti je oči kupil to lepo obleko?    \"Ne sinek, če bi nanj čakala, tudi tebe ne bi imela.\"", CategoryId = 11 },
                new Joke() { Id = 1838, Active = true, Title = "Mož in pes", Description = "Poznaš razliko med možem in psom?    Je ni! Oba te gledata, kot da te razumeta.", CategoryId = 17 },
                new Joke() { Id = 1839, Active = true, Title = "Žena mu je umrla", Description = "Pokoplje mož ženo in uredi vse potrebno na pokopališču.     Ko pride domov se ulije, utrga se oblak, grmi, strele švigajo povsod,...     Pogleda mož  v nebo in reče: \"Evo, je že gor!\"", CategoryId = 11 },
                new Joke() { Id = 1840, Active = true, Title = "Kakšen je v postelji", Description = "Reče deklica fantu: \"Sem slišala veliko tebi, kakšen si v postelji.\"    \"Daj no, nsaj ni nič posebnoega.\"    \"Ja, prav to sem slišala.\"", CategoryId = 27 },
                new Joke() { Id = 1841, Active = true, Title = "Ob štirih zjutraj na cesti", Description = "Policaj zaustavi pijanca ob 4 zjutraj: \"Kam pa vi greste?\"    \"K spovedi\", odgovori pijanec.    \"A ti zajebavaš, kdo pa izpoveduje ob 4 ponoči?\"    \"Moja žena.\"", CategoryId = 21 },
                new Joke() { Id = 1842, Active = true, Title = "Pomoč pri domači nalogi", Description = "Vpraša učiteljica Petrčka: \"A ti tvoj oči še pomaga pri domačih nalogah?\"    \"Ne več. Tista enka zadnjič ga je dokončno zlomila!\"", CategoryId = 32 },
                new Joke() { Id = 1843, Active = true, Title = "Presrečna je", Description = "Hčerka veselo razlaga mami: \"Mami, mami! A veš, da me je moj fant zaprosil? Ne vem, kaj naj naredim? Saj me še sploh ne pozna tako dobro!\".    Mama: \"Omoži se, preden te dodobra spozna!\".", CategoryId = 11 },
                new Joke() { Id = 1844, Active = true, Title = "Iskali so direktorja", Description = "\"Gospod direktor, v vaši odsotnosti vas je iskal gospod, ki je dejal, da vam bo polomil vse kosti.\"    \"In kaj ste mu odgovorili?\"    \"Da mi je žal, ker vas ni!\" ", CategoryId = 29 },
                new Joke() { Id = 1845, Active = true, Title = "Jezus obišče Ljubljano", Description = "Jezus Kristus se je odločil, da gre za en dan pogledat v Ljubljano, kaj se dogaja z njemu preljubimi Slovenci.    Napoti se proti predsedniški palači, kjer sreča Pahorja, ki mu ponudi cigareto s travo. Pri tem poudari, da je ta trava zelo dobra.    Jezus potegne in pravi Pahorju: \"Da se ti predstavim, jaz sem Jezus Kristus!\".    Pahor pa pravi: \"Sem ti rekel, da je ta trava zelo dobra!\".", CategoryId = 23 },
                new Joke() { Id = 1846, Active = true, Title = "Ženske in motor", Description = "Ženska je kot motor.    Igra se s tvojimi živci, zahteva denar, a navsezadnje ti nudi užitek.", CategoryId = 40 },
                new Joke() { Id = 1847, Active = true, Title = "Torta", Description = "Mi lahko kdo pove, katera hrana povzroča največ gorja in trpljenja še leta po zaužitju? Po nekaj trenutkih tišine se nekdo oglasi: »Poročna torta.«", CategoryId = 37 },
                new Joke() { Id = 1848, Active = true, Title = "Branje misli", Description = "Če bi ženske znale brati misli bi moški dobili klofuto vsako sekundo.", CategoryId = 17 },
                new Joke() { Id = 1849, Active = true, Title = "Da ne bo tako monotono", Description = "\"Pojdiva danes zvečer ven in se zabavajva!\" je ženi predlagal mož.    \"Prav!\" je dejala žena.    \"Ampak če boš doma pred menoj, pusti vrata odklenjena!\" ", CategoryId = 11 },
                new Joke() { Id = 1850, Active = true, Title = "Bolhe ima", Description = "Kužek vohlja čevlje fine dame.    Dama ga opazi in zavrešči: \"Da mi takoj odpeljete to ščene! Bolhe kar skačejo po moji nogi!\"    Lastnik: \"Pridi Valdi, gospa ima bolhe!\" ", CategoryId = 43 },
                new Joke() { Id = 1851, Active = true, Title = "Čudna prigoda na potovanju", Description = "Trije duhovniki so šli na potovanje.    V gorskem jezercu so zaplavali v Adamovem kostimu, ko jih je presenetila skupina žensk, ki so se sprehajale ob jezeru.    Planili so iz vode, pograbili obleko in dva duhovnika sta si z obleko pokrila mednožje, eden pa obraz.    Ko so pritekli na varno razdaljo v bližnje grmovje je prvi vprašal tretjega: \"Zakaj si si pa ti z obleko pokril obraz?\"    \"No, ne vem, kako je v vajinih farah, toda v moji fari me ljudje prepoznajo po obrazu!\"", CategoryId = 42 },
                new Joke() { Id = 1852, Active = true, Title = "Ustavil ga je", Description = "\"Vi ste pili!\" reče policist vozniku.    \"Nisem!\"    \"Ste, ste. Oči imate čisto rdeče!\"    \"No, če me že žalite, tudi vi imate štrleča ušesa!\" ", CategoryId = 22 },
                new Joke() { Id = 1853, Active = true, Title = "Ni iz Ljubljane", Description = "Blondinki sta se srečali v letalu in prva vpraša: \"Ali si ti morda iz Ljubljane?\"    \"Ne, nisem!\"    \"Jaz tudi ne!\" je druga veselo zavpila. \"Oh, kako majhen je ta svet!\" ", CategoryId = 4 },
                new Joke() { Id = 1854, Active = true, Title = "Trije možakarji o svojih ženah", Description = "Trije možakarji, med njimi tudi policist, so se pogovarjali o svojih ženah.    \"Moja je kupila čoln, pa še plavati ne zna!\" je dejal prvi.    \"Moja si je kupila modrček, pa nima jošk!\" je rekel drugi.    \"Moja je pa včeraj kupila škatlo kondomov, pa niti penisa nima!\" se je oglasil policist. ", CategoryId = 22 },
                new Joke() { Id = 1855, Active = true, Title = "Direktorjev šlic", Description = "Prijatelj pride k direktorju na obisk in opazi, da ima ta odprt razporek na hlačah.    Ko ga opozori na to, si direktor zapne hlače in se v zadregi opraviči: \"Saj veš, te tajnice vse razmečejo. Za sabo pa nikoli ne pospravijo.\" ", CategoryId = 43 },
                new Joke() { Id = 1856, Active = true, Title = "Na smrtni postelji še zadnja želja", Description = "Micka je umirala in na smrtni postelji je prosila Jožeta: \"Prosim, ne dovoli, da bi tvoja naslednja žena nosila moja oblačila!\"    \"Bodi kar brez skrbi, saj ji tako ali tako niso prav!\" ", CategoryId = 11 },
                new Joke() { Id = 1857, Active = true, Title = "Nazorna razlaga", Description = "Učiteljica je želela učencem pojasniti, kaj je žepar.    \"Če dam moškemu roko v žep, zato da bi mu ven vzela denar, kaj sem potem jaz?\" je vprašala.    \"Njegova žena!?\" se je oglasil Mitja.", CategoryId = 32 },
                new Joke() { Id = 1858, Active = true, Title = "Zanima ga rodovnik", Description = "Miha je prijatelju pokazal novega psa.    \"Ima družinsko deblo?\" ga je vprašal prijatelj.    \"Ne, on lula pri vsakem drevesu.\" ", CategoryId = 43 },
                new Joke() { Id = 1859, Active = true, Title = "Čaka pred vrtcem", Description = "Policist je pred vrtcem čakal na svojega prijatelja.    K njemu je pristopila vzgojiteljica in ga vprašala: \"Čakate na otroka?\"    \"Ne, trebuh imam od piva!\"", CategoryId = 22 },
                new Joke() { Id = 1860, Active = true, Title = "Zasliševanje na sodišču", Description = " Na sodišču sprašujejo ženo: \"Zakaj je umrl vaš prvi mož?\"    \"Zaradi zastrupitve z gobami, gospod sodnik.\"    \"Zakaj pa je umrl vaš drugi mož?\"    \"Tudi zaradi zastrupitve z gobami, gospod sodnik.\"    \"Pa tretji mož?\"    \"Bila je nesreča, padel je po stopnicah, ni maral gob.\"", CategoryId = 11 },
                new Joke() { Id = 1861, Active = true, Title = "Žeparja med pogovorom", Description = "Žeparja sta prišla iz gostilne in eden je vprašal: \"Si videl čudovito natakarjevo uro?\"    \"Ne, pokaži mi jo!\" ", CategoryId = 43 },
                new Joke() { Id = 1862, Active = true, Title = "Kupil bi harmoniko", Description = "V veleblagovnici kupec želi kupiti harmoniko.    \"Kar tisto bom vzel,\" je rekel prodajalki.    \"Ste vi policist?\"    \"Kako pa veste?\"    \"Tisto je radiator, in ne harmonika.\"", CategoryId = 22 },
                new Joke() { Id = 1863, Active = true, Title = "Zemlja se vrti", Description = "Znanec vpraša Gorenjca: \"Zakaj pa vašemu fantu tolikokrat poveste, da se zemlja vrti?\"    \"Zato, da me ne bi prosil za denar za vrtiljak.\" ", CategoryId = 12 },
                new Joke() { Id = 1864, Active = true, Title = "Vrnila se je iz salona", Description = "Mira se je vrnila domov precej pozno in se pohvalila bratu Igorju: \"Danes sem bila pa v lepotilnem salonu!\"    \"In kdaj boš na vrsti?\" jo je vprašal bratec.", CategoryId = 11 },
                new Joke() { Id = 1865, Active = true, Title = "Išče parkirni prostor", Description = "Nemški turist se zaustavi pred slovenskim policistom in reče: \"Oprostite, iščem parkirni prostor.\"    \"In zato ste prišli iz Nemčije?\" se čudi policist.", CategoryId = 22 },
                new Joke() { Id = 1866, Active = true, Title = "Ločujeta se", Description = "Mož in žena sta na sodišču, ker se želita ločiti.    Sodnik: \"Imata tri otroke, kako si jih bosta razdelila?\"    Po dolgem premisleku nista mogla priti do rešitve. Nato rečeta: \"Čez devet mesecev se vrneva s še enim!\".    Čez devet mesecev sta dobila dvojčke.", CategoryId = 11 },
                new Joke() { Id = 1867, Active = true, Title = "Kuhana jajca za zajtrk", Description = "Pri zajtrku ljubimec vpraša blondinko: \"Zakaj so pa jajca tako trda? Kako dolgo si jih pa kuhala?\"    \"Trideset minut!\"    \"Kako? Trideset minut? Jajca se kuha največ pet minut!\"    \"To vem, ampak jajc je bilo šest!\" ", CategoryId = 4 },
                new Joke() { Id = 1868, Active = true, Title = "Zamišljen gost", Description = "Za šankom sedi gospod in zamišljeno zre v kozarec.    Čez čas reče: \"Seksal sem s svojo pacientko.\"    Oštir, ki ga ni poznal, ga skuša pomiriti: \"To pa res ni tako hudo! Prepričan sem, da se veliko zdravnikov pregreši s svojimi pacientkami.\".    Zamišljeni gost dvigne pogled in reče: \"Ampak jaz sem živinozdravnik.\".", CategoryId = 43 },
                new Joke() { Id = 1869, Active = true, Title = "Nenehno bi seksal", Description = "Pacientka potarna zdravnici: \"Gospa zdravnica, moj mož želi ves dan intenzivno seksati. Kaj mu naj dam?\"    Zdravnica: \"Mojo telefonsko številko.\"", CategoryId = 39 },
                new Joke() { Id = 1870, Active = true, Title = "V parku na klopci", Description = "Mojca in Mirko sedita v parku na klopci in Mojca ves čas miži.    \"Zakaj pa mižiš?\" jo je začudeno vprašal Mirko.    \"Oče je rekel, da te ne smem več videti!\"", CategoryId = 43 },
                new Joke() { Id = 1871, Active = true, Title = "Pri parlamentu", Description = "Pri vhodu v parlament sta se srečala poslanca. Eden je odhajal, drugi je bil šele namenjen v parlament.    \"Kako je kaj notri. Se na zasedanju kaj posebnega dogaja?\"    \"Ja. Minister ima že dve uri zelo pomemben govor.\"    \"O čem pa govori?\"    \"Tega pa še ni povedal.\"", CategoryId = 23 },
                new Joke() { Id = 1872, Active = true, Title = "Akcija v spalnici", Description = "Sin je vstopil v spalnico staršev, ko je ravno mama skakala po očetu.    \"Ja kaj pa delata?\" je vprašal sin.    Starša, osramočeno zardita, mama pa reče: \"Poglej, kako velik trebuh ima oče! Skačem po njemu, da ne bo imel tako velikega!\"    \"Brez zveze, mami!\" je rekel sin. \"Ko tebe ni doma, mu pa ga gospodinjska pomočnica napihuje!\"", CategoryId = 11 },
                new Joke() { Id = 1873, Active = true, Title = "Dve miški iščeta hrano", Description = "Dve miški se priglodata do videoteke in prva začne glodati filmski trak.    Druga miška pravi: \"Kakšen se ti zdi film?\"    Prva odgovori: \"Ti a veš, da je knjiga boljša\"", CategoryId = 41 },
                new Joke() { Id = 1874, Active = true, Title = "Blondinki v gozdu", Description = "Blondinki se v gozd odpravita iskat božično drevo.    Nenadoma se ena ustavi in reče: \"Jaz imam tega dovolj. Ne grem se več!\"    \"Kako to misliš?\", vpraša druga.    Pa ji odgovori: \"Dovolj imam iskanja božičnega drevesa. Prvo drevo, ki ga zagledava, vzameva, četudi brez okraskov!\"", CategoryId = 4 },
                new Joke() { Id = 1875, Active = true, Title = "Kar je res, je res", Description = "Mož predlaga ženi, da gresta na nudistično plažo.    Žena pa ni za to in pravi: \"Nočem, da vsi vidijo, da sem se poročila zaradi denarja!\"", CategoryId = 11 },
                new Joke() { Id = 1876, Active = true, Title = "Pozno je prišel domov", Description = "\"Jure, kje si pa bil tako dolgo?\" je mama vprašala desetletnega sina, ko se je ta vrnil domov.    \"S Sonjo sva šla v park in se usedla na klopco, nato pa gledala gospoda in gospo, ki sta sedela na drugi klopci.\"    \"In potem?\"    \"Potem je pa gospod začel poljubljati gospo in jaz sem začel poljubljati Sonjo.\"    \"Kaj je bilo pa potem?\"    \"Potem je gospod gospe slekel bluzo in ji otipavati prsi, zato sem tudi jaz Sonji slekel bluzo in ji začel otipavati prsi.\"    \"In potem?\" je zgroženo vprašala mama.    \"Potem je pa gospod slekel gospe še krilo in hlačke in sta odšla v grmovje.\"    \"In vidva?\"    \"Midva s Sonjo sva šla pa domov, ker naju ni tiščalo kakat!\"", CategoryId = 43 },
                new Joke() { Id = 1877, Active = true, Title = "Policaji in kampiranje", Description = "Štirje policaji so se za konec tedna odpravljali na taborjenje.    Da se ne bi dolgočasili, so se dogovorili, da vsak s seboj prinese kakšno družabno igro.    Ko so v kampu postavili šotor, eden vpraša: \"No, kakšne družabne igre ste prinesli s seboj?\"    \"Jaz sem prinesel pikado.\"    \"Jaz sem s seboj vzel šah\", je rekel drugi.    \"Jaz pa monopoli\", se je oglasil tretji.    \"Jaz pa vložke\", je ponosno povedal četrti.    \"Allways vložke?\", so se začudili ostali trije policisti. Za kaj pa boš potreboval vložke?    \"Enkratni so! Na televiziji sem videl reklamo, da z vložki lahko delaš kar hočeš: plavaš, jahaš, tečeš, voziš kolo, igraš tenis...\"", CategoryId = 22 },
                new Joke() { Id = 1878, Active = true, Title = "Škoti in kilti", Description = "Zakaj Škoti nosijo kilte?    Ker so se ovce že navadile na zvok zadrge.", CategoryId = 43 },
                new Joke() { Id = 1879, Active = true, Title = "Nov general v Tujski legiji", Description = "V bazo Tujske legije v puščavi je na dolžnost prišel nov general.    Že prvi dan je šel na obhod baze in med obhodom opazil sumljivo zvezano mulo za steber.    Vprašal je najbližjega vojaka, čemu služi ta žival tukaj.    \"Gospod general, mula je za zabavo vojakov. Veste kako je, dolgo smo tukaj, brez žena in ...\"    \"Dobro, potem ji pa malo uredite prostor in naredite streho!\" ukaže general.    Čez mesec dni tudi general ni mogel več prenašati samote, zato se je odločil, da se bo tudi on malo zabaval z mulo.    Ukaže stražarju, da mulo drži, da se nebi nevarno premikala, medtem ko bi on opravljal zadevo.    Ko je opravil in se oblačil je olajšan in zadovoljen vprašal stražarja: \"Povej mi junak, ali običajni vojaki delajo to tudi tako, kot mi generali?\"    \"Pa obstaja ena razlika, gospod general. Običajni vojaki praviloma mulo zajahajo in odjahajo do najbližjega naselja, kjer se nahaja javna hiša!\"", CategoryId = 36 },
                new Joke() { Id = 1880, Active = true, Title = "Po poročni noči ga že zaslišuje", Description = "Po prvi poročni noči tašča vpraša zeta: \"No, moj dragi zet, ali si zadovoljen s svojo mlado nedolžno ženo?\"    \"Niti ne!\"    \"Da te ni sram! Cela vas je bila z njo zadovoljna, ti pa ne?\"", CategoryId = 34 },
                new Joke() { Id = 1881, Active = true, Title = "Priporočila za kosilo", Description = "\"Natakar, kaj mi priporočate?\"    \"Flambirano juho, flambiran zrezek, flambirano solato.\"    \"Zakaj pa vse flambirano?\"    \"Kuhinja nam gori!\" ", CategoryId = 13 },
                new Joke() { Id = 1882, Active = true, Title = "Dva pijančka v akciji", Description = "Dva pijančka gresta domov iz gostilne in se izgubita.    Srečata policaja in ga prvi vpraša: \"Ej ti, a nama poveš, kje smo.\"    Policaj odgovori: \"Kako si dovolita, a vesta kdo sem jaz?\"    Pa pravi drugi pijanček:\" Nič ne bo, midva ne veva kje sva, ma ta tip ne ve niti, kdo je!\" ", CategoryId = 21 },
                new Joke() { Id = 1883, Active = true, Title = "Blondinka v cvetličarni", Description = "Blondinka v cvetličarni: \"Želim lepo rdečo vrtnico.\"    \"Dolgo?\"    \"Kaj? Tudi izposodim si jo lahko?\"", CategoryId = 4 },
                new Joke() { Id = 1884, Active = true, Title = "Babica in vnukinja se pogavarjata", Description = "Babica pravi svoji 13-letni vnukinji: \"Ko sem bila stara toliko kot ti, sem že delala!\"    Vnukinja ji odgovori: \"Ko bom stara toliko kot ti, bom tudi še delala.\" ", CategoryId = 11 },
                new Joke() { Id = 1885, Active = true, Title = "Na sodišču", Description = "Sodnik je vprašal obtoženko: \"Vaš priimek in ime?\"    \"Berta Koren\".    \"Stari?\"    \"Čaka me pred sodno dvorano.\" ", CategoryId = 43 },
                new Joke() { Id = 1886, Active = true, Title = "Vseskozi nekaj dobiš", Description = "Včeraj sem dobil avto.    Danes motor.    Pa tele Kinder jajčke so res zakon! ", CategoryId = 43 },
                new Joke() { Id = 1887, Active = true, Title = "Od kje jim izkušnje?", Description = "Ženske trdijo, da so vsi moški isti.    Le od kod jim toliko izkušenj?", CategoryId = 40 },
                new Joke() { Id = 1888, Active = true, Title = "Dobra vila in želje", Description = "Dobra vila mi je izpolnila dve želji.    Tretjič zapored nisem več mogel. ", CategoryId = 43 },
                new Joke() { Id = 1889, Active = true, Title = "Kdo je najbolj pameten?", Description = "Očka, kdo je bil v tvojih otroških letih najbolj pameten?    \"Moji starši.\"    \"Kdo pa je danes najpametnejši?\"    \"Danes ste najbolj pametni otroci.\"    \"Ubogi očka. Ti pa res nikoli nisi bil pameten.\"", CategoryId = 11 },
                new Joke() { Id = 1890, Active = true, Title = "Gorenjec in kajenje", Description = "Gorenjec se pritožuje: \"Kajenje zame ni noben užitek!\"    \"Zakaj?\"    \"Če kadim svoj tobak, mi je žal denarja.\"    \"Kaj pa če kadiš tujega?\"    \"Takrat pa pipa ne vleče dobro, ker jo preveč natlačim.\"", CategoryId = 12 },
                new Joke() { Id = 1891, Active = true, Title = "Posledice prometne nesreče", Description = "\"Zakaj pa hodiš s pomočjo palice?\"    \"Prometna nesreča.\"    \"Ali res ne moreš brez?\"    \"Zdravnik pravi, da lahko, odvetnik pa, da ne morem.\" ", CategoryId = 43 },
                new Joke() { Id = 1892, Active = true, Title = "Ustavil ga je", Description = "Policist ustavi voznika zaradi prehitre vožnje in ga vpraša: \"Ali veste, kaj ste storili narobe?\"    \"Vem! Prepozno sem vas zagledal.\" ", CategoryId = 22 },
                new Joke() { Id = 1893, Active = true, Title = "Žeparji na oddihu", Description = "V krčmi, kjer se zbirajo žeparji in postopači, nekdo od njih lista po modni reviji.    \"Od kdaj pa se ti zanimaš za modo?\" ga vpraša eden.    \"Gledam samo to, kje bodo prihodnjo sezono prišiti žepi na oblačilih.\" ", CategoryId = 43 },
                new Joke() { Id = 1894, Active = true, Title = "Janezek zamudi k pouku", Description = "Janezek je nekoliko zamudil pouk, zato se je poskušal potihoma pritihotapiti v razred.    Učiteljica ga opazi in ga ozmerja: \"Kaj je Janezek? A se tvoj oče, ko pride domov, tudi takole hinavsko priplazi domov? Pojdi ven in pridi v razred, kot se spodobi!\"    Janezek gre ven in zapre vrata.    Čez nekaj časa vrata skoraj padejo s tečajev, Janezek pa s čikom v kotičku ust in steklenico piva v roki prilomasti v razred, zaloputne vrata, vrže čik na tla, ga pohodi, na dušek spije preostanek piva in reče: \"Kva j'tastara, kva pa z'jaš? A si misl'la, da me še ne bo?\" ", CategoryId = 15 },
                new Joke() { Id = 1895, Active = true, Title = "Elektronska pošta na napačen naslov", Description = "Par iz Minneapolisa se je odločil, da gre na dopust na Florido.    Planirala sta biti v istem hotelu, kot že velikokrat prej.    Zaradi poslovnih razlogov žena ni mogla odpotovati istočasno z možem, zato je odšel sam. Žena pa naj bi prišla naslednji dan.    Mož se je prijavil v hotel in ker je imel računalnik v sobi, je ženi poslal email. Vendar se je zmotil pri vpisovanju naslova in izpustil eno črko.    Medtem pa se je nekje v Houstonu vdova ravnokar vrnila iz pogreba svojega moža.    Odločila se je, da preveri elektronsko pošto, v pričakovanju izrazov sožalja zaradi smrti moža.    Ko je prebrala prvo sporočilo, je omedlela.    Ko je v sobo prišel njen sin, je videl nezavestno mamo na tleh in sporočilo na ekranu. To: Moji preljubi ženi Subject: Prišel sem Vem, da si presenečena, da se ti javljam, vendar imajo sedaj tu računalnike in lahko pošiljam sporočila svojim bližnjim. Ravnokar sem prispel in se vpisal ter ti sporočam, da je vse pripravljeno za tvoj prihod jutri. Se že veselim, da te spet vidim. P.S. Je pa res vroče tu doli! ", CategoryId = 11 },
                new Joke() { Id = 1896, Active = true, Title = "Pri zobozdravniku", Description = "\"Ni vam treba tako na široko odpirati ust,\" reče zobozdravnik pacientu.    \"Ali ne boste vrtali?\"    \"Bom, a jaz bom ostal zunaj!\"", CategoryId = 39 },
                new Joke() { Id = 1897, Active = true, Title = "Ni in ni odnehal", Description = "Gorenjcu so, na britofu, trugo skup zabili.    Zato, ker ga je pes že trikrat domov privlekel, ker je mislil, da je pijan. ", CategoryId = 12 },
                new Joke() { Id = 1898, Active = true, Title = "Ljubezen", Description = "Janko reče dekletu: \"Tako te ljubim, da te vsako noč sanjam.\"    \"Lažeš! Če bi me tako zelo ljubil, ne bi mogel spati.\" ", CategoryId = 43 },
                new Joke() { Id = 1899, Active = true, Title = "Zmerjata se kar sredi pouka", Description = "V razredu se je med poukom vnel prepir med sošolcema: \"Ti si neumen kot osel!\" je zavpil Mare na Milana.    \"Ti si pravi idiot!\" mu je vrnil Milan.    Pa se je vmešal profesor: \"Vidva sta verjetno pozabila, da sem tudi jaz v razredu!\" ", CategoryId = 32 },
                new Joke() { Id = 1900, Active = true, Title = "Mož in žena na modni reviji", Description = "Na modni reviji. Žena se obrne k možu in mu reče: \"Ko vidim tako lepo oblečene manekenke, si takoj zaželim novo obleko.\"    \"Jaz pa novo ženo.\" ", CategoryId = 11 },
                new Joke() { Id = 1901, Active = true, Title = "Na nudistični plaži", Description = "Srečata se na nudistični plaži.    Med njima se zaiskri in on reče: \"Veseli me, da sva se spoznala.\"    \"Mene tudi. Prideš zvečer k meni v bungalov?\"    \"Rad!\"    \"No zdaj pojdi pa v vodo, da ne bodo vsi videli, kako si vesel.\"", CategoryId = 43 },
                new Joke() { Id = 1902, Active = true, Title = "Malo je zamešal", Description = "Včeraj je lovec Aleš spet prišel pijan z lova.    \"Kako pa veš, da je bil pijan?\"    \"Psa je nesel v nahrbtniku, fazana pa je imel privezanega na vrvici.\"", CategoryId = 35 },
                new Joke() { Id = 1903, Active = true, Title = "Nuna in avtoštop", Description = "Voznik je na cesti pobral nuno, ki je štopala, in jo peljal v želeni smeri.    Ker mu je bila nuna všeč, ji je med vožnjo položil dlan na kolena, nuna pa je rekla: \"Psalm 90, verz 5.\"    Voznik je zmedeno odmaknil roko z njenega kolena in nadaljeval pot.    Ko je prišel domov, je pogledal v Biblijo in v psalmu 90, verzu 5 prebral: \"Ti si na pravi poti!\"", CategoryId = 43 },
                new Joke() { Id = 1904, Active = true, Title = "Pogosto", Description = "Miha benti na ženo: \"Z mano si nežna samo takrat, ko potrebuješ denar.\"    \"Dragi, ali ni to dovolj pogosto?\"", CategoryId = 11 },
                new Joke() { Id = 1905, Active = true, Title = "Čarovnik in papagaj", Description = "Čarovnik je bil zaposlen na luksuzni čezoceanski ladji.    Njegov poklic je bil zabavati potnike na dolgih križarjenjih s svojimi magičnimi triki. Ker so se potniki zamenjali vsak teden, ni bilo nobene potrebe po tem, da bi se naučil nekaj več kot 20 trikov.    Problem pa je nastal, ko si je nekoč kapitan ladje kupil papagaja in ta je zelo rad opazoval čarovnika pri delu.    Čez čas je bistri papagaj spregledal čarovnikove trike in mu je začel med predstavami uničevati čarovniške trike z medklici, kot so: \"Karto je dal v rokav!\", \"To ni isti klobuk!\" ali \"Pod mizo ga je skril!\".    Čarovnika je to močno frustriralo, kajti njegove točke občinstva niso več navduševale, nič pa ni mogel zoper papagaja, ker je bil kapitanova last.    Potem pa je neke noči ladjo zajelo hudo neurje in potopila se je. Naslednje jutro sta se na istemu kosu lesa znašla čarovnik in papagaj.    Povsem sama sta bila sredi oceana in gledala sta se brez besed.    Tudi drugi dan sta se opazovala v tišini.    Isto tretji dan.    In nato je četrtega dne papagaj rekel: \"Stari, vdam se... Kam si skril ladjo?\"", CategoryId = 43 },
                new Joke() { Id = 1906, Active = true, Title = "Cigareti v mladeničevem žepu", Description = "Mihec, kaj pa pomenijo cigareti v tvojem žepu?    \"Ah, nič, našel sem jih na cesti in jih spravil.\"    \"Zakaj pa?\"    \"Da jih bom pokadil, ko bom velik.\" ", CategoryId = 43 },
                new Joke() { Id = 1907, Active = true, Title = "Izdeluje stol za ženo", Description = "Janez gre k prijatelju na obisk.    Ta je bil ravno v delavnici in Janez ga vpraša: \"Kaj pa delaš?\"    Prijatelj mu dogovori: \"Stol za ženo\".    Janez: \"Pa gre?\"    Prijatelj: \"Gre, gre, samo elektrika še manjka.\" ", CategoryId = 43 },
                new Joke() { Id = 1908, Active = true, Title = "Iskanje", Description = "Rad bi dobil punco, ki ima rada dolge romantične sprehode.    Ker nimam avtomobila. ", CategoryId = 43 },
                new Joke() { Id = 1909, Active = true, Title = "Sočutje", Description = "Učitelj se v šoli razjezi na učence in reče: \"Vsak, ki je neumen, naj vstane!\"    Pa najprej nobeden ne vstane, pol se pa počasi Janezek dvigne s stola.    Učitelj ga vpraša: \"A ti misliš, da si neumen?\"    Janezek pa reče: \"Ne, ampak nerodno mi je, ker samo vi stojite!\"", CategoryId = 32 },
                new Joke() { Id = 1910, Active = true, Title = "Računstvo", Description = "Profesor je vprašal Jureta: \"Imaš 54 evrov in mamo prosiš, da ti da še 78 evrov. Koliko evrov imaš potem?\"    \"54!\"    \"Še vedno ne znaš računati?\" se je začudil profesor.    \"Računati znam, toda vi ne poznate moje mame.\" ", CategoryId = 32 },
                new Joke() { Id = 1911, Active = true, Title = "Kakšno naklučje", Description = "\"Soseda, ali ste včeraj slišali prepir pri Korenčkovih?\"    \"Seveda sem ga, saj je ropotalo celo noč! Kaj pa sta imela?\"    \"On je dal oglas v erotični časopis da išče žensko, ki bi se igrala z njim razne spolne igrice, na oglas pa se je javila njegova žena!\" ", CategoryId = 47 },
                new Joke() { Id = 1912, Active = true, Title = "Hudiča no, Jože", Description = "Zdravnik: \"Za vas imam slabo novico.\"    Jože: \"Kaj je, gospod zdravnik?\"    Zdravnik: \"Morali boste prenehati mastrubirati.\"    Jože: \"O Bog, zakaj?\"    Zdravnik: \"Zato, ker se pogovarjam z vami!\" ", CategoryId = 39 },
                new Joke() { Id = 1913, Active = true, Title = "Ogovoril je neznanko", Description = "Mladi fant, zvečer v parku, ogovori mlado gospodično: \"Ali veš, da je drugi najbolj pogost način, da punco pripraviš do tega, da bi seksala s tabo smeh?\"    Punca: \"Ne, nisem vedela. Kaj je pa prvi?\"    Fant: \"Nož!\"    Punca: \"Hi hi hi hi.\"    Fant: \"Pametno si se odločila!\" ", CategoryId = 9 },
                new Joke() { Id = 1914, Active = true, Title = "Kontrola na meji", Description = "Starec se je pripeljal na mejni prehod in carinik ga je vprašal: \"Kava, alkohol, cigareti …?\"    \"Ne hvala, v prtljažniku imam vsega dovolj!\" je odgovoril starec.", CategoryId = 43 },
                new Joke() { Id = 1915, Active = true, Title = "Policisti so šli na kurbe", Description = "Štirje policisti so se ob koncu tedna odpravili na lahka dekleta.    Dva sta se v avtomobilu usedla spredaj, dva pa zadaj.    Oddrveli so v najbolj živahno ulico. Ko so zagledali prvo prostitutko, jo voznik vpraša: \"Koliko?\" \"Kot ponavadi.Sto evrov od spredaj, od zadaj pa 50 % dražje.\"    Pa se oglasita policista zadaj: \"Zakaj je pa za naju dražje?\"", CategoryId = 22 },
                new Joke() { Id = 1916, Active = true, Title = "Sumi, da ga vara", Description = "Prijatelj potarna prijatelju: \"Ima me, da bi se ločil.\"    \"Kaj pa se ti je zgodilo?\"    \"Občutek imam, da me žena vara.\"    \"Kako si pa to ugotovil?\"    \"Včeraj ni prespala doma in ko sem jo zjutraj vprašal, kje je bila, mi je odgovorila, da pri prijateljici Micki.\"    \"Pa, saj to ni nič takega\"    \"O, pa je!\"    \"Zakaj pa?\"    \"Pri Micki sem bil jaz.\"", CategoryId = 11 },
                new Joke() { Id = 1917, Active = true, Title = "Slabo spričevalo", Description = "Mama razočarano pogleda Marijo. \"Marija, tvoje spričevalo je prava katastrofa! Kaj naj rečem na to?\"    \"To, kar si mi vedno rekla, če se mi je kaj slabega zgodilo!\"    \"In kaj sem rekla?\"    \"Glavno je, da si zdrava, otrok moj. Ostalo ni važno!\"", CategoryId = 11 },
                new Joke() { Id = 1918, Active = true, Title = "Na fronti", Description = "Vojak z daljnogledom ogleduje okolico in zavpije: \"Komandant! Približujejo se nam vojaki s tanki!\"    \"So sovražniki ali prijatelji?\"    \"Verjetno so prijatelji, ker vozijo tako skupaj!\" ", CategoryId = 36 },
                new Joke() { Id = 1919, Active = true, Title = "Doživljanje orgazma", Description = "\"Žena, zakaj mi nikoli ne poveš, ko doživiš orgazem?\"    \"Ker te takrat nikoli ni doma!\"", CategoryId = 27 },
                new Joke() { Id = 1920, Active = true, Title = "Hvala za pomoč", Description = "Oče je vprašal sina, ki se je vrnil iz šole: \"In, kaj je rekla učiteljica za domačo nalogo, ki sem ti jo naredil včeraj?\"    \"Rekla mi je, da sem vsak dan bolj zabit.\" ", CategoryId = 11 },
                new Joke() { Id = 1921, Active = true, Title = "Nova frizura", Description = "Pride stranka v frizerski salon in se usede na stol.    Frizer ga vpraša, kako ga naj ostriže?    On pravi: \"Spredaj poševno iz leve proti desni, nad levim ušesom na nulo, nad desnim stopničasto, na vrhu glave za pest veliko plešo, zadaj pa resice!\"    Frizer ga začudeno pogleda in pravi: \"Ja to pa ne vem, če bo šlo!\"    Stranka pa pravi: \"A prejšnjič ti pa je uspelo?\"", CategoryId = 43 },
                new Joke() { Id = 1922, Active = true, Title = "Kako so prišli na svet", Description = "Učiteljica je dala učencem za domačo nalogo da napišejo, kako so prišli na svet.    Janezek je doma, ravno med lupljenjem krompirja, vprašal mamo, iz česa je nastal.    Mami se ni dalo pogovarjati o tej temi, zato je pokazala na krompir in rekla: \"Iz tega!\"    Naslednji dan v šoli. Janezek ima krompir v žepu, tako kratko nalogo kot je dobil pa ni napisal.    Vsi njegovi sošolci so že prebrali svojo domačo nalogo, ko pa je prišel na vrsto Janezek je vprašal učiteljico: \"Ali naj ga najprej izvlečem in nato pripovedujem, ali naj najprej povem in ga nato izvlečem?\"    \"Nič ni potrebno!\" ga je prekinila učiteljica, \"očitno se zelo dobro spoznaš na to temo!\"", CategoryId = 15 },
                new Joke() { Id = 1923, Active = true, Title = "Novi fant mu ni všeč", Description = "\"Očka, zakaj ti moj novi fant ni všeč?\"    \"Zato, ker s teboj hodi samo zaradi mojega denarja!\"    \"To ni res! Rekel mi je, da bi z menoj hodil, tudi če bi bila revna.\"    \"Potem je pa še večji bedak, kot sem mislil.\"", CategoryId = 11 },
                new Joke() { Id = 1924, Active = true, Title = "Prava ljubezen", Description = "\"Poklical sem, da vam povem, da vas imam rad.\"    \"Gospod, poklicali ste v gostilno.\"    \"Vem.\"", CategoryId = 21 },
                new Joke() { Id = 1925, Active = true, Title = "WiFi geslo", Description = "Tri mične gospodične v restavraciji.    Natakar pristopi k mizi in prva ga takoj ogovori: \"Kakšno je geslo za WiFi?\".    Natakar: \"jebovaskelnar\".    Druga spre vpraša: \"A z malim?\".    Natakar: \"Ne, z velikim!\".    Tretja: \"A posebej?\".    Natakar: \"Ne, vse naenkrat!\".", CategoryId = 13 },
                new Joke() { Id = 1926, Active = true, Title = "Spol vetra", Description = "Učiteljica vpraša Janezka: \"Janezek, katerega spola je veter?\"    Janezek odgovori: \"Moškega.\"    Tovarišica ga pohvali, nato pa vpraša:\"In kako to vemo?\"    \"Ker ženskam dviguje krila.\"", CategoryId = 43 },
                new Joke() { Id = 1927, Active = true, Title = "Delovna doba", Description = "\"Kako dolgo delate v našem podjetju?\" vpraša šef Janeza.    \"Osem let, šef.\"    \"In kaj vam je tu najbolj všeč?\"    \"Vaša tajnica.\"", CategoryId = 29 },
                new Joke() { Id = 1928, Active = true, Title = "Potrdilo", Description = "\"Gospod doktor, potreboval bi potrdilo, da ne morem delati!\"    \"In kaj vam manjka?\"    \"To potrdilo.\"", CategoryId = 39 },
                new Joke() { Id = 1929, Active = true, Title = "Čudežni otrok", Description = "\"Vi ste bili pa gotovo čudežni otrok!\"    \"Ali res tako mislite, šef?\"    \"Da, verjetno ste pri šestih letih vedeli toliko kot zdaj.\"", CategoryId = 29 },
                new Joke() { Id = 1930, Active = true, Title = "Ne najbolj prijetna družba", Description = "Starejši gospod in dama srednjih let v kupeju vlaka.    Starec nenadoma spusti prdec in dama se prekriža: \"Nezaslišano! Kaj takega se mi še ni zgodilo!\"    \"Kaj?\" se začudi starec. \"Jaz sem pa mislil da je meni ušlo.\"", CategoryId = 43 },
                new Joke() { Id = 1931, Active = true, Title = "Dilema", Description = "\"Ti, kaj predstavlja ta slika? Sončni vzhod ali zahod?\"    \"Prepričan sem, da sončni zahod!\"    \"Po čem pa to sklepaš?\"    \"Poznam slikarja, ki je narisal to sliko. On nikoli ne vstane tako zgodaj, da bi lahko videl sončni vzhod!\"", CategoryId = 43 },
                new Joke() { Id = 1932, Active = true, Title = "Brhka plavolaska", Description = "\"Ali vidiš tisto brhko plavolasko? Nocoj je tolkla po mojih vratih!\"    \"Srečnež! Pa si jo spustil noter?\"    \"Ah, ne! Nisem je pustil ven.\"", CategoryId = 43 },
                new Joke() { Id = 1933, Active = true, Title = "Kava", Description = "\"Natakar, kakšno kavo ste mi prinesli?!\"    \"Poživljajočo!\"    \"Saj je v skodelici sama voda!\"    \"No, vidite, en požirek kave, pa ste že razburjeni!\"", CategoryId = 13 },
                new Joke() { Id = 1934, Active = true, Title = "Problem s slepičem", Description = "Sredi noči zazvoni telefon pri kirurgu: \"Tukaj Mlinarjev Tone. Gospod doktor, pridite hitro k nam! Mislim, da ima moja žena vnetje slepiča.\"    \"Pomirite se,\" reče zdravnik, \"vaši ženi sem izrezal slepič pred tremi leti! Še nikoli pa nisem slišal, da bi imel človek dva slepiča!\"    \"Ali tudi tega še niste slišali, da se je nekdo dvakrat oženil?\"", CategoryId = 39 },
                new Joke() { Id = 1935, Active = true, Title = "Gorenjec in novo stanovanje", Description = "Gorenjec je kupil novo stanovanje in se pohvalil prijatelju: \"Kupil sem novo stanovanje. Povem ti, to je zadnji krik arhitekture! Pri vratih lahko pozvoniš z nogo, z brado, z laktom, s čelom ...\"    \"A tako, normalno, z roko, se ne da?\"    \"Lahko. Ampak saj vendar ne boš prišel na obisk praznih rok?\"", CategoryId = 12 },
                new Joke() { Id = 1936, Active = true, Title = "Ponosen na spričevalo", Description = "Peter je mami ponosno pokazal letno šolsko spričevalo in dejal: \"Poglej, popravil sem vse ocene!\"    \"Joj!\" je zastokala mama. \"Upam, da v šoli tega ne bodo opazili!\"", CategoryId = 11 },
                new Joke() { Id = 1937, Active = true, Title = "Iskren in obziren", Description = "\"Če hočeš uspeti, moraš biti iskren in obziren,\" reče oče sinu.    \"In kaj pomeni iskren?\" vpraša sin.    \"Da vedno storiš, kar si obljubil.\"    \"Kaj pa obziren?\"    \"Da nikoli ničesar ne obljubiš.\"", CategoryId = 43 },
                new Joke() { Id = 1938, Active = true, Title = "Zimsko spanje", Description = "Medvedka se s svojim mladičem odpravi na zimsko spanje.    Medvedek se kmalu zbudi in vpraša mamo medvedko: \"Mami ali sem res medvedek?\"    Medvedka mu odgovori: \"Seveda si. Pojdi spat.\"    Čez eno uro medvedek ponovi vprašanje, medvedka pa mu isto odgovori.    Potem pa medvedek še enkrat vpraša: \"Mami ali sem res medvedek?\"    Medvedka se razjezi: \"Pa zakaj te to tako zelo zanima!?\"    Medvedek odgovori: \"Če me pa zebe kot psa!\"", CategoryId = 41 },
                new Joke() { Id = 1939, Active = true, Title = "Optimist in pesimist", Description = "Lojzka ima dva sinova.    Eden je optimist in drugi pesimist.    Ko sinova na božično jutro odpirata vsak svoje darilo, ga najprej odpre sin pesimist.  Dobi velikega plišastega medveda, pa pravi: \"Ah, to se bo takoj strgalo in umazalo.\"    Potem odpre darilni paket optimist. V njem je konjski drek.    Ko ga brat vpraša, kaj je dobil, ta navdušeno odgovori: \"Ponija, ampak ga še ni tu!\"", CategoryId = 11 },
                new Joke() { Id = 1940, Active = true, Title = "Hujšanje", Description = "Polde razlaga Stanetu: \"Moja žena je zaradi hujšanja začela jahati.\"    \"Pa se že kaj pozna?\"    \"Ja, konj je že shujšal za 10 kilogramov.\"", CategoryId = 27 },
                new Joke() { Id = 1941, Active = true, Title = "Norci in drevo", Description = "Na dvorišču norišnice raste drevo.    Norci imajo navado, da plezajo po njem.    Nekega dne ima paznik težave, kako jih spraviti dol.    \"Gremo dol, kosilo čaka!\" vpije nanje.    Oni pa nazaj: \"Kako naj gremo dol, ko smo pa listi?\"    Paznik malo pomisli in reče: \"Kaj pa še počnete gor, ne vidite, da je jesen?\"    Norci pogledajo po vejah in vidijo, da listje res odpada. In splezajo z drevesa vsi, razen enega.    Paznik ga vpraša, zakaj ne spleza dol, norec pa odgovori: \"Butec, a ne vidiš, da sem zimzelen?!\"", CategoryId = 43 },
                new Joke() { Id = 1942, Active = true, Title = "Žemlje", Description = "Kupec v trgovini: \"Te žemlje so včerajšnje, jaz pa želim današnje.\"    Prodajalka: \"Potem pridite jutri!\"", CategoryId = 43 },
                new Joke() { Id = 1943, Active = true, Title = "Župnik in pijanec", Description = "Na avtobusni postaji se k župniku usede moški, ki zaudarja po alkoholu, ima razmazano šminko okoli ust, iz raztrganega žepa pa mu štrli steklenica vina.    Moški razgrne časopis in začne brati.    Kar naenkrat vpraša župnika: \"Kaj povzroča artritis?\"    Župnik pomisli, kako bi dal pijančku lekcijo, in reče: \"Artritis dobijo tisti, ki preveč razuzdano živijo, se družijo z ženskami dvomljivega slovesa, se vdajajo alkoholu in nimajo sočutja do sočloveka.\"    Čez nekaj minut župnik pomisli, da je bil mogoče pregrob do pijančka: \"Oprostite, da sem bil prej tako nevljuden. Kako dolgo pa že bolehate za artritisom?\"    Pijanček odgovori: \"Eh, nimam ga jaz. V časopisu sem prebral, da so ga našli pri papežu!\"", CategoryId = 42 },
                new Joke() { Id = 1944, Active = true, Title = "Umrla je tašča", Description = "Marjan: \"Vinko, ti sekaš drva, pravkar pa ti je umrla tašča. Ali moraš prav zdaj sekati?\"    Vinko: \"Glej Marjan, najprej delo, potem zabava!\"", CategoryId = 34 },
                new Joke() { Id = 1945, Active = true, Title = "Duševne motnje", Description = "\"Imate v vaši družini kakšen primer duševne bolezni?\" vpraša zdravnik.    \"Da, imamo,\" reče pacientka. \"Mož si domišlja, da je gospodar v hiši!\"", CategoryId = 39 },
                new Joke() { Id = 1946, Active = true, Title = "Hotel se je prepričati", Description = "\"Očka, kajne, da so tebe po krivici vrgli iz šole?\"    \"Seveda! Zakaj sprašuješ?\"    \"Ker se je zgodovina ponovila.\"", CategoryId = 32 },
                new Joke() { Id = 1947, Active = true, Title = "Vdrli so mu v avto", Description = "Na policijski postaji sredi noči zazvoni telefon: \"Policija, pomagajte! V moj avto so vdrli in pokradli – volan, zavore, menjalnik, pedala, radio, armaturno ploščo, vse!\"    \"Kje ste?\" vpraša dežurni policaj, zapiše naslov in obljubi, da bo takoj poslal patruljo.    Čez nekaj minut spet zazvoni telefon na postaji: \"Policija! Ni treba hoditi, zmotil sem se in se usedel na zadnji sedež!\"", CategoryId = 43 },
                new Joke() { Id = 1948, Active = true, Title = "Selitev", Description = "Janez se seli in nosi na hrbtu veliko omaro.    Sosed ga vidi in vpraša, zakaj si ni priskrbel pomoči.    Janez odgovori: \"Saj mi Miha pomaga. V omari drži predale!\"", CategoryId = 47 },
                new Joke() { Id = 1949, Active = true, Title = "Po prepiru", Description = "Žena pravi možu: \"Danes sem veliko razmišljala o najinem včerajšnjem prepiru in ugotovila, da je bilo vse skupaj trapasto. Še posebej vse tisto, kar si rekel ti!\"", CategoryId = 11 },
                new Joke() { Id = 1950, Active = true, Title = "Postavljanje diagnoze", Description = "\"Ne morem natanko ugotoviti, kaj vam je,\" pravi zdravnik pacientu.    \"Mislim, da je kriv alkohol!\"    \"Nič ne de,\" pravi bolnik, \"bom prišel, ko boste trezni.\"", CategoryId = 39 },
                new Joke() { Id = 1951, Active = true, Title = "Janezek in alkohol", Description = "Janezek gre v gostilno in naroči viski.    Natakar pravi, da mu ne more dati viskija, ker ni dovolj star.    Janezek plane v jok in natakar ga vpraša, zakaj joka.    Janezek odgovori: \"Ati in mami sta mi rekla, če bom pil alkohol, da bom dobil mačka!\"", CategoryId = 15 },
                new Joke() { Id = 1952, Active = true, Title = "Švicarji", Description = "\"Mamica, ali v Švici res živijo ljudožerci?\"    \"Mihec, kako ti pride kaj takšnega na misel?\"    \"Zakaj pa je potem stric Polde rekel, da Švicarji živijo od turistov?\"", CategoryId = 43 },
                new Joke() { Id = 1953, Active = true, Title = "Seks s policistko", Description = "\"Včeraj sem seksal s policistko,\" se Polde pohvali Lojzetu.    \"Ali si ti že kdaj?\"    \"Ne, bojim se,\" pravi Lojze.    \"Česa se bojiš?\"    \"Da bi me kaznovala zaradi hitrosti!\"", CategoryId = 27 },
                new Joke() { Id = 1954, Active = true, Title = "Vožnja skozi tunel", Description = "Očka, mamica in petletni Lukec se peljejo z vlakom skozi dolg tunel.    Očka pogleda mamico in se nasmehne: \"Ali se spomniš vožnje skozi ta tunel pred šestimi leti?\"    Tudi mamica se nasmehne in pomenljivo prikima.    Sinko z zanimanjem vpraša: \"Kje sem bil pa jaz takrat?\"    Očka pojasni: \"Ko smo šli v predor, si bil pri meni, ko pa smo prišli iz predora, si bil že pri mamici.\"", CategoryId = 11 },
                new Joke() { Id = 1955, Active = true, Title = "Delovni staž", Description = "Pred zaposlitvijo novega uslužbenca telefonira direktor njegovemu prejšnjemu delodajalcu: \"Koliko časa je delal pri vas?\"    \"Okoli tri dni.\"    \"Kako? Rekel je, da je bil dolgo časa v vašem podjetju.\"    \"To je pa res. Pri nas je bil deset let!\"", CategoryId = 29 },
                new Joke() { Id = 1956, Active = true, Title = "Dolžina penisa", Description = "Mož se v spalnici ogleduje pred ogledalom: \"Če bi imel samo dva centimetra daljšega, bi pa lahko rekel, da sem kralj,\" reče ženi.    Žena mu odgovori: \"Ja, če bi imel pa dva centimetra krajšega, bi bil pa kraljica!\"", CategoryId = 27 },
                new Joke() { Id = 1957, Active = true, Title = "Malica v gostilni", Description = "V gostilni želi gost plačati račun.    \"Kaj ste jedli?\" ga vpraša natakar.    \"To pa ve le kuhar. Jaz sem sicer naročil postrv!\"", CategoryId = 13 },
                new Joke() { Id = 1958, Active = true, Title = "Penzionista v restavraciji", Description = "Bine sedi v restavraciji s hitro prehrano in gleda starejši par za sosednjo mizo, ki je naročil le eno porcijo.    Mož hamburger prereže na polovico in ga pol da ženi.    Nato razdeli krompirček po sistemu enega meni, enega tebi.    Na koncu pol pijače prelije v dodaten kozarec.    Ko razdeli porcijo, začne mož jesti, žena pa sedi na stolu in ga opazuje.    Mladenič jima reče: \"Naj vama kupim še eno porcijo, da si vama ne bo treba deliti ene same.\"    Mož odvrne: \"Ne, ne, hvala. Poročena sva 40 let in vse v življenju si deliva na pol.\"    Mladenič se obrne k ženi in vpraša: \"Vi ne boste jedli?\"    \"Ne še. Zdaj je mož na vrsti za zobno protezo!\"", CategoryId = 43 },
                new Joke() { Id = 1959, Active = true, Title = "Predčasni odhod", Description = "Tri ženske so skupaj delale v isti pisarni in so imele žensko za šefico.    Vsak dan je šefica odšla iz službe že precej pred iztekom delovnega časa.    Punce so sklenile, da bodo tudi one začele odhajati prej. Konec koncev, šefica ni nikoli poklicala nazaj v službo in le kako naj bi vedela, da jih ni tam?    Črnolaska je odšla prva. Napotila se je naravnost domov in se lotila vrtnarjenja. Presadila je nekaj zelenjave in obrezala vrtnice, potem pa je prišla njena hčerka iz šole in ji je pomagala napraviti domačo nalogo.    Rdečelaska je bila srečna, da je lahko odšla prej, kajti fant jo je povabil na večerjo in je imela tako dovolj časa, da se je lepo uredila in pripravila zanj.    Blondinka je bila zelo vesela, da bo lahko prišla domov prej in presenetila brezposelnega moža. Ampak ko je prišla domov, ga ni bilo nikjer.    Potem je iz spalnice zaslišala čudne glasove. Potiho se je prikradla do vrat spalnice in potihoma odškrknila vrata. Imela je kaj videti. Njen mož je bil v postelji z njeno šefico. Ona je jahala na njem in iz grla so ji prihajali nerazločni zvoki.    Prav potihoma je zaprla vrata in se kradoma izmuznila iz hiše.    Naslednji dan, ob opoldanski kavi, sta črnolaska in rdečelaska objavili, da bosta spet odšli prej iz službe.    Vprašali sta blondinko, če bo prej odšla tudi ona. \"Ni govora,\" je rekla blondinka: \"včeraj bi me šefica skoraj dobila!\"", CategoryId = 29 },
                new Joke() { Id = 1960, Active = true, Title = "Pečke od jabolk", Description = "Policist je pristopil k prodajalcu pečk in ga vprašal: \"Kaj prodajaš?\"    \"Pečke od jabolk.\"     \"Po koliko pa so?\"    \"10 evrov za eno pečko.\"    \"Zakaj so pa tako drage?\"    \"Ker ti po njih začnejo delovati možgani.\"    \"No, bom pa kupil eno!\" se je odločil policist.    Policist je pojedel pečko, odšel, nato pa se je kmalu vrnil. \"Prevaral si me!\" je rekel prodajalcu. \"Za deset evrov bi si lahko kupil deset kilogramov jabolk in tako dobil več sto pečk!\"    \"No, vidiš, da deluje! Možgani so ti začeli delovati!\" je rekel prodajalec.", CategoryId = 22 },
                new Joke() { Id = 1961, Active = true, Title = "Poročna noč in posledice", Description = "Mlad par prebije prvo poročno noč v hotelu.    Zjutraj se ženin poreže pri britju in kri obriše v rjuho.    Sobarica vidi kri na rjuhi, misli, da je bila nevesta nedolžna in pove to šefu hotela.    Šef pravi mladoporočencema: \"To je velika redkost in za naš hotel velika čast. Za nagrado bosta lahko noč po zlati poroki, čez 50 let, brezplačno preživela pri nas.\"    Čez 50 let dedek in babica res prideta in prespita v isti sobi.    Zjutraj babica, precej prehlajena, izpiha nos v rjuho.    \"Ja kaj pa delaš?\" pravi dedek, babica pa odgovori: \"Pred 50 leti si ti meni dvignil ugled, zdaj ga bom pa jaz tebi.\"", CategoryId = 37 },
                new Joke() { Id = 1962, Active = true, Title = "Mestna in poljska miška", Description = "Mestna miška na cesti sreča poljsko miško.    Začneta se pogovarjati in mestna miška se pohvali: \"Strašno dobrega tipa sem spoznala. Zaljubljena sem do ušes.\"    \"Imaš kakšno njegovo sliko?\" vpraša poljska miška.    Mestna miška iz torbice potegne fotografijo in jo pokaže.    \"Saj to je netopir!\" vzklikne poljska miška.    \"Oh, on mi je pa rekel, da je pilot!\"", CategoryId = 41 },
                new Joke() { Id = 1963, Active = true, Title = "Vsako znanje lahko pomaga", Description = "\"Kaj znate?\"    \"Znam govoriti iz trebuha.\"    \"Se da od tega živeti?\"    \"Seveda. V trgovini z živalmi prodajam govoreče papige.\"", CategoryId = 29 },
                new Joke() { Id = 1964, Active = true, Title = "Navzkrižna vprašanja", Description = "V šoli pri pouku matematike učiteljica vpraša Janezka: \"Janezek, na veji sedijo tri vrane, lovec eno ustreli, koliko jih še sedi na veji?\".    \"Nobena, učiteljica. Ustreljena pade, ostali dve pa odletita.\".    \"Janezek, narobe. Dve še sedita na veji. Ampak mi je pa všeč tvoj način razmišljanja.\".    Janezek je nekaj časa tiho, nato pa dvigne roko: \"Učiteljica, sedaj bi pa jaz vas nekaj vprašal!\".    Učiteljica malo premišljuje, kaj neki bo Janezek spet ušpičil, pa ji radovednost ne da miru in se odloči: \"No, Janezek, pa vprašaj!\".    \"Takole, po cesti hodijo tri ženske in v roki držijo sladoled. Prva ga grizlja, druga ga sesa, tretja ga pa liže. Kaj mislite, katera od teh treh je poročena?\"    Učiteljica zardi in je malo v zadregi, nato pa le odgovori: \"Janezek, mislim da tista ki ga sesa!\".    \"Učiteljica, narobe. Tista, ki ima na roki poročni prstan. Ampak mi je pa všeč vaš način razmišljanja!\".", CategoryId = 15 },
                new Joke() { Id = 1965, Active = true, Title = "Ženske in oblaki", Description = "Zakaj so ženske kot oblaki?    Ko enkrat gredo stran dan postane zelo lep.", CategoryId = 40 },
                new Joke() { Id = 1966, Active = true, Title = "Spal je skoraj z vsemi", Description = "Slišal sem, da je hišnik spal že z vsemi ženskami iz našega bloka, razen z eno je rekel mož svoji ženi blondinki.    \"Ja, to je gotovo tista važna iz petega nadstropja\" ugotavlja blondinka.", CategoryId = 4 },
                new Joke() { Id = 1967, Active = true, Title = "Hoče se ločiti", Description = "Odvetnik posluša klientko, ki se želi ločiti od moža in ga ves čas kritizira.    \"Ampak nekaj je pa le moralo biti pozitivnega, da ste se z njim poročili?\" vpraša odvetnik.    \"Ja, je bilo, toda vse to sem do zadnjega evra potrošila!\"", CategoryId = 11 },
                new Joke() { Id = 1968, Active = true, Title = "Želi si obiskati cirkus", Description = "Tinček prosi očeta: \"Očka, pelji me v cirkus!\"    \"Dragi sinko, nimam časa.\"    \"Ah, očka, pa tako zanimiv program imajo. Na tigru pleše naga lepotica.\"    \"Prav, pa pojdiva. Saj res že dolgo nisem videl živega tigra!\"", CategoryId = 11 },
                new Joke() { Id = 1969, Active = true, Title = "Norec na telefonu", Description = "\"Naslednjič pokličite meteorologe!\" zavpije Lojze v slušalko in besno odloži telefon.    \"Kaj pa je bilo?\" ga vpraša žena.    \"Neki norec je že tretjič klical in vprašal, ali je zrak čist!\"", CategoryId = 11 },
                new Joke() { Id = 1970, Active = true, Title = "Priprave na razgovor", Description = "Čedna mladenka se poteguje za službo tajnice.    Obleče se posebej izzivalno, v oprijeto krilo, globoko izrezano bluzo, se skrbno našminka in obuje čevlje z zelo visoko peto.    Ko čaka na razgovor z direktorjem, pride mimo starejša uslužbenka, jo pogleda in reče: \"Kar se tiče našega direktorja, bi bilo bolje, če bi na razgovor poslali svojega brata!\"", CategoryId = 29 },
                new Joke() { Id = 1971, Active = true, Title = "Oče na roditeljskem  sestanku izvedavo", Description = "Oče na roditeljskem sestanku vpraša učiteljico: \"Se vam ne zdi, da je moj sin resnično izviren v nekaterih stvareh?\"    \"Da, res je. Še posebno pri pravopisu!\"", CategoryId = 32 },
                new Joke() { Id = 1972, Active = true, Title = "Šok terapija", Description = "\"Kolega, slišal sem, da na pacientih izvajate novo šok terapijo.\"    \"Res je, vnaprej jim pošljem račun!\"", CategoryId = 39 },
                new Joke() { Id = 1973, Active = true, Title = "Priporočila", Description = "\"Pokažite mi svoja priporočila.\", reče šef kadrovske službe kandidatki za tajnico.    Kandidatka ga zaskrbljeno vpraša: \"Kaj pa, če kdo pride?\"", CategoryId = 29 },
                new Joke() { Id = 1974, Active = true, Title = "Klic na društvo za zaščito živali", Description = "\"Halo, je tam društvo za zaščito živali?\"    \"Ja, želite?\"    \"Takoj pošljite nekoga k meni. Na našem drevesu sedi poštar in zmerja mojega psa!\"", CategoryId = 43 },
                new Joke() { Id = 1975, Active = true, Title = "Govor pred množico", Description = "\"Si že kdaj govoril pred množico?\"    \"Že.\"    \"O čem pa?\"    \"O pravnih vprašanjih.\"    \"Kaj pa si rekel?\"    \"Nisem kriv!\"", CategoryId = 43 },
                new Joke() { Id = 1976, Active = true, Title = "Razbil mu je avto", Description = "\"Kaj je rekel oče, ko si mu povedal, da si razbil avto?\"    \"Ali naj kletvice izpustim?\"    \"Seveda.\"    \"Nič!\"", CategoryId = 11 },
                new Joke() { Id = 1977, Active = true, Title = "Kako pridemo na svet", Description = "V šoli se pogovarjajo, kako so nastali.    Skoraj vsi v razredu zakričijo, da jih je prinesla štorklja, le Janezek je tiho.    Pa ga vpraša učiteljica: \"Kako si pa ti nastal?\"    Janezek odgovori: \"Iz jajca.\"    \"Ne moreš priti iz jajca,\" pravi učiteljica.    \"Kako ne? Če sem pa včeraj slišal sosedo, ki je rekla svoji prijateljici, da sem sin tiste koklje Marte!\"", CategoryId = 15 },
                new Joke() { Id = 1978, Active = true, Title = "Kompliment", Description = "Fant punci: \"Zelo lepo postavo imaš!\"    Punca: \"Hvala. Veš, to je od plavanja.\"    Fant: \"Če je pa tako bi bilo pa vredu, če bi tudi obraz kdaj pa kdaj namočila.\"", CategoryId = 43 },
                new Joke() { Id = 1979, Active = true, Title = "Nesreča v sreči", Description = "Skozi predor se pelje avto in na koncu predora stoji policist, ki ta avto ustavi.    Voznik odpre okno in policist mu z nasmehom na ustih reče: \"Čestitam, vi ste milijonti voznik, ki ste se pripeljali skozi ta predor, zato vam naša država poklanja milijon evrov.\"    Voznik je začel vriskati od veselja, zato ga je policist vprašal: \"Če ni skrivnost, kako pa boste zapravili ta denar?\"    Voznik: \"Kako? Vozniški izpit bom naredil!\"    Policist malo začudeno pogleda in hoče nekaj reči, ko ga prekine voznikova žena: \"Ne mu verjeti, ali ne vidite, da je pijan?\"    Za voznikovo ženo je sedel voznikov oče, ki je bil malo naglušen in je pripomnil: \"Saj sem vedel, da z ukradenim avtomobilom ne bomo daleč prišli.\"    Policist je bil tako jezen zaradi vseh izjav, da je trikrat udaril po pokrovu prtljažnika na avtomobilu in izpod pokrova se zasliši glas: \"Francelj, a smo že čez?\"", CategoryId = 22 },
                new Joke() { Id = 1980, Active = true, Title = "Vzgoja otrok", Description = "Mihec bere knjigo.    Ko mama vidi naslov knjige, ga vpraša: \"Mihec, zakaj bereš knjigo o vzgoji otrok?\"    \"Nadziram, ali me pravilno vzgajata!\"", CategoryId = 11 },
                new Joke() { Id = 1981, Active = true, Title = "Janez na fakulteti", Description = "Janez ima občutek, da je premalo izobražen, zato se vpiše na pravno fakulteto.    Prej ali slej pride na vrsto izpit, in sicer ustni.    Janez sedi v kabinetu, profesor si ga ostro ogleduje, potem pa zastavi vprašanje: \"Ali ima mož pravico odpreti pismo, ki je naslovljeno na ženino ime?\"    Janez nekaj časa premišljuje in odgovori: \"Pravico ima, poguma pa ne.\"", CategoryId = 32 },
                new Joke() { Id = 1982, Active = true, Title = "Malček opazuje policaja pri delu", Description = "Mali Jure je na cesti opazoval policista pri delu.    Policist ga je zagledal, pristopil k njemu in ga vprašal: \"Boš ti tudi policist, ko boš velik?\"    \"Jaz ne, bo pa moj brat, on je bolj slab v šoli.\"", CategoryId = 22 },
                new Joke() { Id = 1983, Active = true, Title = "Big brother", Description = "Peter je v nočnem lokalu srečal svojega osebnega zdravnika.    Ta mu je jezno dejal: \"Razložite mi naslednje: pred kratkim sem vam napisal recept za uspavalne tablete, vas pa sem v zadnjih dneh že trikrat videl v nočnem lokalu!\"    \"To pa ja ni nič posebnega!\" mu je odgovoril Peter. \"Tablete so za mojo ženo!\"", CategoryId = 39 },
                new Joke() { Id = 1984, Active = true, Title = "Big brother", Description = "Mož: \"Žena, dajva, igrajva se Big Brotherja.\"    Žena: \"No, pa dajva.\"    Mož: \"Govori Big Brother. Imaš dve minuti časa, da zapustiš hišo.\"", CategoryId = 11 },
                new Joke() { Id = 1985, Active = true, Title = "Služinčad", Description = "Mož: \"Mislim, da bi se morala naučiti likati, potem bi lahko shajala tudi brez služkinje!\"    Žena: \"No, če bi se ti naučil ženo malo bolj porihtati, bi nam zneslo tudi brez vrtnarja!\"", CategoryId = 11 },
                new Joke() { Id = 1986, Active = true, Title = "Pomoč pri opravilih", Description = "Se hvali Micka prijateljici, kako ji mož pomaga pri kuhanju, pomivanju posode in likanju, odkar je bral, da so spočite žene boljše ponoči v postelji.    \"In? Ali pomaga?\" vpraša prijateljica.    \"Ne vem. Je preveč utrujen.\"", CategoryId = 11 },
                new Joke() { Id = 1987, Active = true, Title = "Študent agronomije in vrtnar", Description = "Študent agronomije je obiskal vrtnarja z namenom, da zbere dovolj informacij za sestavo diplomske naloge.    Ko si je ogledoval vrtnarijo, mu je očital: \"Vi pa vrtnarite še precej po starem! Ta način je zelo zastarel. Dvomim, da vam bo tole drevo obrodilo kaj sliv!\"    \"Seveda jih ne bo!\" se je zasmejal vrtnar, \"tole je namreč češnja!\"", CategoryId = 43 },
                new Joke() { Id = 1988, Active = true, Title = "Damjan Murko v prometu", Description = "Damjan Murko se vozi po Ljubljani, ko mu naenkrat na okno avtomobila potrka brezdomec: \"Dej mi 10 EUR\".    Murko brez besed odpelje naprej, ko čez nekaj časa zopet potrka isti brezdomec: \"Dej mi 10 EUR\".    Murko ves jezen pohodi gas. Čez kakšnih 20 minut vožnje pa po oknu zopet trka isti brezdomec.    Murko se ujezi: \"Pa dobro! Kako ti to uspeva, da si brez avta, a vedno pred menoj?!!\".    Brezdomec: \"Daj mi 10 EUR, pa ti pomagam iz krožišča\".", CategoryId = 43 },
                new Joke() { Id = 1989, Active = true, Title = "Treba si je privoščiti", Description = "\"Draga, kaj ko bi si privoščila en lep vikend?\"    \"Prav imaš. Dajva si ga!\"    \"No, prav. Potem pa se vidiva v ponedeljek!\"", CategoryId = 11 },
                new Joke() { Id = 1990, Active = true, Title = "Napaka", Description = "V drogerijo je prišel gospod in vprašal: \"Kdo je moji ženi včeraj dal lepilo namesto zobne paste?\"    \"Najbrž jaz,\" je oklevajoče dejal mlad prodajalec.    \"Hvala ti, tu imaš sto evrov,\" je dejal gospod. ", CategoryId = 43 },
                new Joke() { Id = 1991, Active = true, Title = "Izvirna risba", Description = "Učiteljica naroči učencem, naj do konca pouka narišejo risbo in jo oddajo.    Janezek odda prazen list.    Učiteljica ga vpraša: \"Janezek, kaj si pa ti narisal?\"    Janezek: \"Kravo in travo.\"    Učiteljica: \"Kje pa je trava?\"    Janezek: \"Krava jo je pojedla.\"    Učiteljica: \"Kje pa je krava?\"    Janezek: \"Šla je, ker ni bilo več trave!\"", CategoryId = 15 },
                new Joke() { Id = 1992, Active = true, Title = "Izgubil se je", Description = "Mali Miha v gneči izgubi svojo mamo.    Končno sreča policista in ga vpraša: \"Ali ste mogoče videli kakšno mamo brez mene?\" ", CategoryId = 43 },
                new Joke() { Id = 1993, Active = true, Title = "Ena stvar je vodila do druge", Description = "Posloven človek pride v bar.    Za točilno mizo prisede k njemu dekle in predlaga: \"Kaj mislite o tem, da bi skupaj spila kozarec šampanjca?\"    \"Nisem Onassis,\" reče poslovni človek, \"za steklenico šampanjca pa že dam.\"    Medtem, ko pijeta šampanjec in poslušata nežno glasbo, dekle predlaga: \"Kaj mislite o tem, da bi malo zaplesala?\"    \"Nisem Fred Astaire, a malo plesa mi že ne bo škodilo.\"    Med plesom se dekle nekoliko privije k njemu in zašepeta: \"Kaj mislite o tem, da bi šla za hipec gor, v vašo hotelsko sobo?\"    \"Nisem Casanova, reče poslovni človek, \"toda to utegne biti prav prijetno.\"    Ko je zadeva v sobi opravljena, ga dekle vpraša: \"Kaj menite o sto dolarjih plačila?\"    \"Nisem žigolo, pa bom vseeno vzel.\"", CategoryId = 40 },
                new Joke() { Id = 1994, Active = true, Title = "Kipa in angel", Description = "Pred kipom ženske in moškega, ki že več let stojita v mestnem parku, se pojavi angel in reče: \"Ker sta že več let vzorna kipa in razveseljujeta množice ljudi, sem vama prišel izpolnit vajino največjo željo, zato vama za pol ure poklanjam dar življenja.\"    Kipa nenadoma oživita, se nasmehneta drug drugemu in stečeta v grmovje.    Angel se nasmehne in posluša hahljanje v grmičevju, pokanje vej in šumenje listja.    Po 15 minutah kipa prideta iz grmovja zadovoljna in nasmejana, angel pa jima reče: \"Še vedno vama je ostalo 15 minut. Ali bi rada nadaljevala?\"    Moški pogleda žensko in jo vpraša: \"Ali bi rada ponovila?\"    Ženska smeje odgovori: \"Seveda, ampak tokrat boš ti držal goloba, jaz pa bom tista, ki se mu bo posrala na glavo.\"", CategoryId = 43 },
                new Joke() { Id = 1995, Active = true, Title = "Nauk zgodbe", Description = "Učiteljica: \"Povejte vsaj eno kratko zgodbico z naukom na koncu!\"    Mojca: \"Moj dedek je nesel jajca v košari, pa se je spotaknil, košara mu je padla na tla in vsa jajca so se razbila.\"    Učiteljica: \"Dobro, in kakšen je nauk?\"    Mojca: \"Nikoli ne nosi vseh jajc v eni košari!\"    Jožek: \"Moj ata je imel v inkubatorju 10.000 jajc in je že vnaprej prodal 10.000 mladih piščancev, potem pa se jih je izvalilo samo 8.000.\"    Učiteljica: \"In nauk?\"    Jožek: \"Nikoli ne prodajaj piščancev, dokler se ne izvalijo.\"    Janezek: \"Moj stric Franc je bil v tujski legiji. Nekoč so leteli in letalo se je pokvarilo. Moral je skočiti s padalom in s seboj je uspel vzeti samo brzostrelko, mačeto in liter šnopsa. Med padanjem je popil ves šnops. Ko je pristal, ga je napadel bataljon črncev. Najprej jih je 50 postrelil z brzostrelko. Ko mu je zmanjkalo nabojev, jih je še 20 posekal z mačeto. Ko se je zlomila, je pa še preostalih 10 pokončal z golimi rokami.\"    Učiteljica požre slino, se odkašlja in zajame sapo: \"In kaj je tu nauk zgodbe Janezek?\"    Janezek: \"Nikoli se ne zajebavaj s stricem Francem, kadar se napije!\"", CategoryId = 15 },
                new Joke() { Id = 1996, Active = true, Title = "Holmes in dr. Watson kampirata", Description = "Sherlock Holmes in dr. Watson gresta taborit.    Postavita šotor ter kmalu utrujena zaspita.    Čez nekaj ur Holmes zbudi svojega zvestega prijatelja: \"Watson, poglej v nebo in mi povej, kaj vidiš?\"    Watson odgovori: \"Vidim na milijone zvezd.\"    Holmes: \"In kaj ti to pove?\"    Watson se za nekaj časa globoko zamisli: \"Astronomsko mi pove, da obstaja na milijone galaksij in planetov, astrološko, da je Saturn v znamenju Leva, časovno, da je ura približno četrt na eno zjutraj, teološko, da je očitno Gospod vsemogočen in da smo mi majhni in nepomembni, meteorološko pa, da bova jutri imela lep dan. Kaj pa tebi pove?\"    Holmes za trenutek pomolči in nato reče: \"Bistvo, moj dragi Watson, bistvo! Nekdo nama je ukradel šotor!\"", CategoryId = 43 },
                new Joke() { Id = 1997, Active = true, Title = "Enolična hrana", Description = "Mlad zakonski par sedi pri večerji.    Mož se pritoži: \"Spet hrana iz konzerve?\"    \"Ja, dragi moj, toda tokrat je bil na konzervi narisan lep kužek in spodaj je pisalo: Za mojega ljubega.\"", CategoryId = 37 },
                new Joke() { Id = 1998, Active = true, Title = "Slavisti na simpoziju", Description = "Slavisti so imeli simpozij v Portorožu in so se prepirali o jezikovnih pravilih.    Nikakor se niso mogli dogovoriti, kako se opiše deževno vreme. \"Dež pada,\" je trdil prvi.    \"Ne, ne, cenjeni kolega, reče se dežuje\", je vztrajal drugi.    \"Dež gre,\" je predlagal tretji.    \"Dež gre.\" \"Dežuje!\" \"Dež pada!\" \"Dež gre\" ... \"Dežuje\" ... \"Pada.\"    Tako so se kregali pozno v noč.    Ker se niso mogli dogovoriti, so sklenili, da za tisti večer končajo.    Stopili so iz hotela in v en glas vzkliknili: \"Mater, ščije!\"", CategoryId = 43 },
                new Joke() { Id = 1999, Active = true, Title = "Lenoba", Description = "Zjutraj je častnik sklical zbor vojakov in jim rekel: \"Danes je dan za lenobe. Najbolj len vojak bo prejel teden dni dopusta. Torej, tisti, ki je najbolj len med vam, naj stopi korak naprej!\"    Vsi vojaki so stopili korak naprej, le Janez je obstal na mestu.    \"Kaj je pa s teboj?\" ga je vprašal častnik.    \"Jaz sem pa prelen, da bi stopil naprej.\"", CategoryId = 36 },
                new Joke() { Id = 2000, Active = true, Title = "Pri spovedi", Description = "Mladoletni fant pride v spovednico: \"Odpustite mi, oče, grešil sem. Bil sem z žensko dvomljive morale.\"    Župnik vpraša: \"Ali si to ti, sosedov Jožek?\"    \"Da, oče.\"    \"Kako pa je ženski ime?\"    \"Tega vam ne morem povedati, oče. Ne bi hotel omadeževati njenega imena.\"    \"Slej kot prej ga bom izvedel. Saj ti ni treba imena povedati, le 'da' reci. Je bila Drginčeva Katra?\"    \"Res ne bom povedal.\"    \"Je bila Malejeva Marjanca?\"    \"Pa ne morem, če sem obljubil!\"    \"Srakarjeva Metka?\"    \"Molčal bom kot grob.\"    Župnik vztraja: \"Kaj pa mogoče Zupančeva Tinca?\"    \"Oče, ne sprašujte, ne bom je izdal.\"    \"Potem je bila pa Lavrinova Mici?\"    \"Prosim vas oče, zaobljubil sem se, da bom molčal.\"    Župnik nejevoljno vzdihne: \"Si pa res vztrajen, Jožek. Skoraj te moram občudovati. Vendar si grešil in za to se moraš pokoriti. Tri mesece ne smeš k maši. Zdaj pa pojdi v miru.\"    Jožek se vrne v svojo klop, kjer ga pričaka Franček, njegov najboljši prijatelj: \"No, kako je bilo?\"    \"Super!\"    \"Kaj si pa dobil?\"    \"Tri mesece počitnic in pet dobrih namigov.\"", CategoryId = 42 },
                new Joke() { Id = 2001, Active = true, Title = "Treba se je pripraviti", Description = "Mlad fant vstopi v lekarno in reče lekarnarju: \"Dober dan, a lahko dobim en kondom? K punci grem na večerjo in mislim, da nekaj pričakuje od mene.\"    Lekarnar mu da kondom, fant plača, na izhodu pa se ustavi in vrne. \"Dajte mi še en kondom. Sestra moje punce je zelo mikavna. Vedno prekriža noge na provokativen način. Mislim, da tudi ona nekaj pričakuje od mene!\"    Lekarnar mu da še drugi kondom, ko se fant zopet oglasi: \"Dajte mi še en kondom, ker je mama moje punce zelo lepa ženska, vedno, ko me vidi, obrača oči. Ker me je ona povabila na večerjo, mislim, da tudi ona nekaj pričakuje od mene!\"    Na večerji za mizo fant sedi s svojo punco, njeno sestro in mamo, ko se pojavi dekletov oče. Fant spusti glavo in prične moliti.    Deset minut pozneje fant še vedno moli. Vsi ga gledajo presenečeno.    Punca se skloni k njemu in mu zašepeta na uho: \"Nisem vedela, da si tako pobožen!\"    Fant ji odgovori: \"Jaz tudi nisem vedel, da je tvoj oče lekarnar!!!\" ", CategoryId = 43 },
                new Joke() { Id = 2002, Active = true, Title = "Nakup darila za novo punco", Description = "Mladenič je želel za svojo novo ljubezen kupiti darilo za rojstni dan.    Skupaj z dekletovo sestro sta odšla v veleblagovnico izbirati vsak svoje darilo.    Mladenič se je odločil, da bo dekletu kupil rokavice, saj je menil, da je za intimno darilo še prezgodaj.    Njena sestra pa ji je kupila svilene spodnje hlačke.    Mladenič je prodajalki izročil pismo za svoje dekle, ki naj ga shrani v škatlico z rokavicami.    Trgovka pa se je zmotila in se je pismo za njegovo dekle znašlo pri spodnjih hlačkah.    Dekletovo sestro je prosil, naj ji izroči njegovo darilo.    Ko je dekle prejelo darilo, je onemelo, ko je prebralo pismo:  \"Draga moja! Odločil sem se, da ti za darilo kupim nekaj, za kar vem, da na najinih zmenkih nikoli ne nosiš. Najprej sem ti hotel kupiti take z gumbki, pa je tvoja sestra rekla, da so krajše precej boljše za tebe. Tudi ona nosi takšne in pravi, da se lažje potegnejo dol. Morda ti barva ne bo všeč, toda prodajalka, ki mi jih je prodala, mi je pokazala svoje in povedala, da jih nosi že mesec dni, pa se popolnoma nič ne vidi, da bi bile umazane. Prosil sem jo, če tvoje lahko probam, in ko sem si jih dal gor, je rekla, da so izvrstne. Zaželel sem si, da bi ti jih jaz nataknil, ko te prvič vidim. Ker pa ne vem, kdaj to bo, ti jih raje pošiljam in tudi vem, da se jih bo dotlej dotaknilo že mnogo rok. Ko jih boš slekla, jih pa daj sušiti, saj mi je prodajalka rekla, da po uporabi postanejo nekoliko vlažne. No, upam, da jih boš nosila na najinem naslednjem zmenku.    Tvoj Peter.\"", CategoryId = 43 },
                new Joke() { Id = 2003, Active = true, Title = "Po pomoč k župniku", Description = "Par ima dva otroka, stara 8 in 10 let, ki sta zelo neubogljiva, nenehno se zapletata v težave in za vsako stvar, ki se zgodi v vasi, okrivijo njiju.    Nekega dne mami pride na uho, da je lokalni duhovnik precej uspešen pri discipliniranju neubogljivih otrok, zato ga vpraša, če se lahko pogovori z otrokoma.    Duhovnik se strinja, zato gre naslednji dan k njemu najprej mlajši.    Duhovnik, obilen možakar z globokim prodornim glasom, dečku ukaže, naj sede, ga pogleda naravnost v oči in z resnim glasom vpraša: \"Kje je Bog?\"    Deček nič ne odgovori, samo sedi tam s široko odprtimi očmi.    Duhovnik ponovi vprašanje: \"Kje je Bog?\"    Deček spet nič ne odgovori, zato duhovnik še dodatno povzdigne glas in uperi prst naravnost proti njegovemu obrazu: \"KJE JE BOG?!?\"    Deček bliskovito pobegne iz sobe, steče domov, se skrije v omaro in močno zaloputne vrata za seboj.    Ko ga tam najde starejši brat, ga vpraša, kaj se je zgodilo.    Mlajši, hlastajoč za zrakom, zgroženo reče: \"Zdaj sva pa v velikih težavah! Bog je izginil in vsi mislijo, da sva kriva midva!\"", CategoryId = 42 },
                new Joke() { Id = 2004, Active = true, Title = "Spis za domačo nalogo", Description = "Otroci so v šoli dobili domačo nalogo: “Opiši v stotih besedah, kako ste preživeli vikend”.    Mali Franček je napisal: \"Ta vikend smo se nameravali odpeljati z družino k teti. Naložili smo se v avto in ta nikakor ni hotel vžgati. Žalostni smo šli iz avta, razen očeta, ki je ostal pri avtomobilu in izrekel ostalih 60 besed, ki pa niso primerne za mojo domačo nalogo.\"", CategoryId = 32 },
                new Joke() { Id = 2005, Active = true, Title = "Sama v postelji", Description = "Žena sredi noči ugotovi, da moža ni v skupni postelji.    Obleče se in ga gre iskat.    Najde ga za mizo v kuhinji, s skodelico kave pred njim.    Globoko je zamišljen in strmi v zid. Vsake toliko si obriše solzo in srkne požirek kave.    \"Kaj pa je s tabo, dragi? Kaj počneš tukaj sredi noči?\"    Soprog dvigne pogled z mize: \"Kaj se spomniš, kako sva se dobivala pred 20 leti, ko ti je bilo samo 16 let?\"    Žena, ganjena do solz, da je mož tako čutec in da se vsega spomni. \"Seveda se,\" odgovori.    On napravi najprej kratko pavzo, besede mu ne grejo lahko z jezika. \"Se spomniš, kako naju je tvoj oče zalotil, ko sva se ljubila v avtu na zadnjih sedežih ?\"    \"Da, da, spomnim, se, kaj se ne bi,\" pravi ona in sede v najbližji stol, da bi mu bila bližje.    Možak nadaljuje: \"Se spomniš, kako mi je v obraz porinil cev od šibrovke in rekel, ali se boš poročil z mojo hčerko ali pa te pošljem za dvajset let v zapor?\"    \"Tudi tega se spominjam,\" pravi ona mehko, skoraj zaljubljeno.    On pa si obriše še eno solzo z lica in reče: \"No, vidiš, na današnji dan bi me izpustili.\"", CategoryId = 11 },
                new Joke() { Id = 2006, Active = true, Title = "Zbiranje snovi za domačo nalogo", Description = "Učiteljica da otrokom domačo nalogo, da napišejo tri stavke.    Janezek pride domov k očetu in mu reče, naj pove en stavek.    Oče ves jezen odgovori: \"Pusti me pri miru, a ne vidiš, da berem časopis.\"    Janezek to zapiše in se odpravi v park, kjer sreča dva zaljubljenca in ju prosi, da mu povesta en stavek.    Fant pogleda svojo punco in ji reče: \"No, pa pojdiva ljubica.\"    Janezek zabeleži tudi to in se odpravi naprej.    V peskovniku zagleda majhnega dečka, ki se igra.    Reče mu, naj pove en stavek in fantek odgovori: \"Jaz sem King Kong v kratkih hlačah.\"    Naslednji dan mu v šoli tovarišica reče, naj jih prebere.    Janezek reče: \"Pusti me pri miru, a ne vidiš, da berem časopis.\"    Učiteljica ga debelo pogleda in reče: \"Janezek, a greva k ravnatelju?\"    Janezek nadaljuje: \"No, pa pojdiva ljubica.\"    Prideta k ravnatelju, tovarišica mu razloži, zakaj sta prišla in ravnatelj reče Janezku: \"Ja, kdo pa misliš, da si ti?\"    Janezek odgovori: \"Jaz sem King Kong v kratkih hlačah.\"", CategoryId = 32 },
                new Joke() { Id = 2007, Active = true, Title = "Domov je prišel šele zjutraj", Description = "Mož pride domov ob sedmih zjutraj in se skoraj zaleti v ženo, ki ga čaka na hodniku.    Žena: \"Nekam pozen si, Superman?!\"    Mož: \"Lahko ti pojasnim, draga. Bil sem s strankami ...\"    Žena: \"... in potem si z njimi razpravljal do sedmih zjutraj, kajne, Superman?\"    Mož: \"Počakaj, da končam. Uspelo mi je pridobiti novo stranko, zato sem ga odpeljal na večerjo ...\"    Žena: \"... ki je trajala do sedmih zjutraj? Superman, nikar me ne imej za norca!\"    Mož: \"Priznam, da smo šli še v nočni klub na pijačo in smo bili tam do treh ... \"    Žena: \"... ja, ja, Superman, do treh. In kje si bil do sedmih?\"    Mož: \"Nooo, odšli smo še v striptiz klub, ampak jaz sem samo gledal, bil je živi dolgčas!\"    Žena: \"Vse je v redu, Superman, ti si samo gledal in čakal. Kaj naj ti se verjamem, Superman?\"    Mož: \"Pusti, da končno povem do konca. In zakaj mi stalno govoriš Superman?\"    Žena: \"Zato, ker samo Supermannosi gate prek hlač ...\"", CategoryId = 11 },
                new Joke() { Id = 2008, Active = true, Title = "Mlada gospodična in menih na carini", Description = "Na meji mlada gospodična ogovori starejšega meniha: \"Gospod, nekaj vas bi prosila!\"    Menih: \"Da, hči, povej!\"    Gospodična: \"Kupila sem si nov ženski depilatorski strojček, pa me je strah carine ... Ali bi ga lahko vi pod kuto spravili čez.\"    Menih: \"O, hči, rad bi, a ne smem lagati! Pa se bom vseeno česa domislil.\"    Carinik: \"Oče, imate kaj za prijavit?\"    Menih: \"Od brade do pasu nič.\"    Carinik: \"Pa od pasu navzdol?\"    Menih: \"Tam je strojček za ženske, ki pa še nikoli ni bil uporabljen!\"", CategoryId = 5 },
                new Joke() { Id = 2009, Active = true, Title = "Izmenjava", Description = "Po napadu malih zelenih Marsovcev se srečata parčka.    Zemljan se želi postaviti pred malim Marsovcem, ki mu je komaj do kolen, in predlaga: \"Kako bi bilo, če bi zamenjala ženi?\"    Marsovec se strinja.    Zemljanka pride v sobo in reče: \"Pa kaj boš ti mali, poglej se kakšnega imaš.\"    Marsovec pravi: \"To pa res ni problem. Ti samo povej, kakšnega si želiš.\"    Potem se začne tolči po čelu in one raste.    Zemljanka reče: \"Dobro. A kaj, ko je tako tanek.\"    Marsovec se začne vleči za ušesa in one se debeli...    Ko prideta Zemljana spet skupaj, mož vpraša ženo, kako je bilo?    Ona odgovori: \"Presenetljivo dobro!\"    Mož pa razočaran odvrne: \"Pri meni pa slabo. Ne vem, zakaj me je Marsovka kar naprej tepla po čelu in vlekla za ušesa?!\"", CategoryId = 27 },
                new Joke() { Id = 2010, Active = true, Title = "Svetuje mu, naj se oženi", Description = "Zagrizenega samca sprašuje prijatelj: \"Si prepričan Polde, da ne bi poiskal prijaznega dekleta in se z njim poročil?\"    Polde: \"Le zakaj bi se? Saj zame skrbita dve sestri.\"    \"Že, že, sestri,\" pravi prijatelj, \"ampak sestri nista isto kot žena.\"    Polde: \"Kdo je pa rekel, da sta moji sestri!\"", CategoryId = 43 },
                new Joke() { Id = 2011, Active = true, Title = "Neprimeren trenutek", Description = "Kdaj je najslabši možni trenutek, da te zadane srčni infarkt?    Med igranjem pantomime!", CategoryId = 43 },
                new Joke() { Id = 2012, Active = true, Title = "Za vsakega se kaj najde", Description = "Polž zasopihan prileze iz gozda in sreča lisico.    Ta ga začudeno vpraša: \"Kaj je, polžek, zakaj tako hitiš?\"    Ta odgovori: \"Ne sprašuj, prišla je davčna inšpekcija.\"    \"Pa kaj?\"    \"No, saj veš, jaz imam hišo, moja žena ima hišo in tudi vsi moji otroci imajo hišo ... Lahko si predstavljaš, kaj to pomeni.\"    Lisica se zamisli in steče za njim.    Srečata štorkljo, ki presenečena vpraša lisico: \"Lisička, kam pa kam?\"    \"Ali nisi slišala? Po gozdu se sprehaja davčna inšpekcija!\"    \"In kaj zdaj?\"    \"No, jaz imam drago krzno, moj mož ima drago krzno in tudi otroci imajo drago krzno ... Lahko si predstavljaš, kaj to pomeni!\"    Štorklja se zamisli, se nasmehne in reče: \"Ah, mi, razen tega ubogega gnezda, nimamo nič. In še to je umazano, grdo in poceni. Praktično brez vrednosti.\"    Polž jo pogleda in reče: \"Hja, štorklja! Pol leta doma, pol leta v tujini ... Od kod pa to???\"", CategoryId = 41 },
                new Joke() { Id = 2013, Active = true, Title = "Po opravljenih posteljnih užitkih", Description = "Blažen, s cigareto v roki, v tišini zatemnjene sobe Janez reče Marjani: \"Sodeč po temle, kar sem doživel in videl nocoj, nisem tvoj prvi.\"    Marjana mu odgovori: \"Eh, kje pa! In sodeč po tem, kar sem doživela in videla jaz nocoj, tudi ne boš zadnji.\"", CategoryId = 27 },
                new Joke() { Id = 2014, Active = true, Title = "Komunikacija", Description = "Prijateljici na kavi se pogovarjata: \"Ali ti vedno poveš svojemu možu, ko doživiš orgazem?\"    \"Kje pa! On ne mara, da ga pokličem, kadar je v službi!\"", CategoryId = 27 },
                new Joke() { Id = 2015, Active = true, Title = "Zahteva ločitev", Description = "Gospa pride k odvetniku, ker se želi ločiti od moža.    Odvetnik jo vpraša: \"Ali vaš mož pije?\"    \"Ne, ne pije.\"    \"Ali se drogira?\"    \"Kje pa, sploh ne ve, kaj je to droga.\"    \"Ima slabo plačo?\"    \"Ne, zasluži 4000 evrov na mesec.\"    \"Ali vas pretepa?\"    \"Ne, seveda ne!\"    \"Slabo skrbi za otroke?\"    \"Pravzaprav zelo lepo skrbi za njih.\"    \"Ali vas vara?\"    \"Nikoli me ni prevaral. On ni te sorte.\"    \"Vam ne pomaga pri hišnih opravilih?\"    \"O, pomaga. Veliko postori.\"    \"Ja, ljuba gospa, zakaj se pa potem želite ločiti od njega?\"    \"Oh, on res počne vse prav, ampak, da vidite, kakšne face ob tem poka!\"", CategoryId = 11 },
                new Joke() { Id = 2016, Active = true, Title = "Janezek in pingvin", Description = "Janezek za rojstni dan dobi papagaja.    Nekega dne ga ponesreči pozabi v hladilniku.    Po dveh urah iskanja se končno spomni, kje je.    Odpre hladilnik, se zagleda v ptiča in ljubeče reče: \"Koga moje očke vidijo?\"    Papagaj jezno začivka: \"Pingvina, idiot!\"", CategoryId = 15 },
                new Joke() { Id = 2017, Active = true, Title = "Povišica", Description = "Zjutraj se v kopalnici mladi par pripravlja za službo.    Moški se brije brado rekoč: \"Danes se bom, v službi, dogovoril za povišico.\".    Žena si pod tušem brije tamalo in odgovori: \"Jaz tudi.\".", CategoryId = 27 },
                new Joke() { Id = 2018, Active = true, Title = "Predčasni izhod", Description = "Pride delavec k šefu: \"Šef, ali me lahko danes spustite dve uri prej iz službe? Z ženo bi moral po nakupih.\"    Šef: \"Sploh ne pride v poštev!\"    Delavec: \"Najlepša hvala. Vedel sem, da me ne boste pustili na cedilu.\"", CategoryId = 29 },
                new Joke() { Id = 2019, Active = true, Title = "Trop netopirjev", Description = "Netopirji visijo v votlini z glavami navzdol, le netopir Mirko čepi na skalnem robu.    Pa vpraša eden od netopirjev svojega soseda: \"Kaj pa je z Mirkom?\"    \"Ah, nič. Z jogo se je začel ukvarjati!\"", CategoryId = 41 },
                new Joke() { Id = 2020, Active = true, Title = "Horoskop", Description = "Micka prebira horoskop in reče svojemu Janezu: \"Če bi ti prišel pet dni prej na svet, bi bil danes prijazen, pozoren do mene in velik ljubimec!\"", CategoryId = 11 },
                new Joke() { Id = 2021, Active = true, Title = "Nenadoma pride do akcije", Description = "Mož in žena zdolgočaseno sedita v dnevni sobi in gledata televizijo.    Žena nenadoma vstane, se postavi pred moža in mu prisoli krepko zaušnico.    Mož v šoku začudeno vpraša: \"Zakaj pa to?\"    Žena: \"Zato, ker si slab ljubimec!\"    Mine petnajst minut, ko mož nenadoma vstane, stopi do žene in jo močno klofne.    Žena ga vpraša: \"Zakaj pa to?\"    Mož: \"Zato, ker poznaš razliko med dobrimi in slabimi ljubimci!\"", CategoryId = 11 },
                new Joke() { Id = 2022, Active = true, Title = "Tipkanje", Description = "Pokliče direktor tajnico in vpraša: \"Ali bova danes kaj tipkala?\"    Tajnica: \"Gospod direktor, danes ne morem, imam rdeč trak v mašini.\"    Minilo je nekaj dni, ko je tajnica potrkala na direktorjeva vrata: \"Gospod direktor, ali bova danes kaj tipkala?\"    Direktor: \"Ne bo potrebno, sem že na roko napisal!\"", CategoryId = 29 },
                new Joke() { Id = 2023, Active = true, Title = "Rop", Description = "Želva oropa polža.    Ta gre na policijo in jo prijavi.    Policist vpraša: \"Kaj pa se je zgodilo?\"    Polž odgovori: \"Ne vem točno, vse se je dogajalo tako hitro!\"", CategoryId = 41 },
                new Joke() { Id = 2024, Active = true, Title = "Popravljanje ocene", Description = "Mama pravi Janezku: \"Sinko, kdaj boš popravil tisto enko iz matematike?\"    Janezek: \"Saj bi jo mama, pa učitelj redovalnice sploh ne da iz rok!\"", CategoryId = 32 },
                new Joke() { Id = 2025, Active = true, Title = "Nenadna prepreka", Description = "Dva polža se srečata in prvi reče drugemu: \"Zakaj pa imaš tako buško na glavi?\"    \"Veš, šel sem na sprehod po gozdu in kar naenkrat pred menoj zraste velik jurček in jaz tresssk!!!\"", CategoryId = 41 },
                new Joke() { Id = 2026, Active = true, Title = "Čuden razlog", Description = "Možakar nabira drva v gozdu.    Nenadoma se pred njim pojavi gozdar in vpraša: \"Kaj pa delate?\"    \"Hrano za zajčke nabiram.\"    \"Kako, ali vaši zajčki jedo drva?\"    \"Poskusil bom. Če jih slučajno ne bodo hoteli jesti, jih bom pa skuril!\"", CategoryId = 43 },
                new Joke() { Id = 2027, Active = true, Title = "Fant in punca o kajenju", Description = "Punca: \"Ali kadiš?\".    Fant: \"Da.\".    Punca: \"Koliko škatlic na dan pokadiš?\".    Fant: \"Ammmm 2/3.\".    Punca: \"Koliko pa stane zavojček cigaret?\".    Fant: \"3.50€.\".    Punca: \"In koliko časa kadiš?\".    Fant: \"15 let.\".    Punca: \"Torej 1 zavoj stane 3.50€ in ti jih na dan pokadiš tri, kar bi pomenilo da na mesec porabiš 400€ in v letu bi porabil 4.600€, imam prav?\".    Fant: \"Ja verjetno.\".    Punca: \"Torej, če bi ves ta denar šparal bi si danes lahko kupil Ferarija!\".    Fant: \"Res je, kaj pa ti, kadiš?\".    Punca: \"Seveda, da ne!\".    Fant: \"No, kje maš potem ti Ferarija? Pizda ti materna!\".", CategoryId = 43 },
                new Joke() { Id = 2028, Active = true, Title = "Ljubosumje", Description = "Žena je hotela napraviti moža ljubosumnega, zato ga je vprašala: \"Dragi, kaj bi rekel, če bi ti priznala, da sem spala s človekom, ki ga imaš ti najraje?\".    Mož: \"Da si lezbijka!\".", CategoryId = 11 },
                new Joke() { Id = 2029, Active = true, Title = "Žigosanje živali na kmetiji", Description = "Uslužbenec na ministrstvu za kmetijstvo je na pritožbo nekega kmeta vztrajal, da je treba živali žigosati.    \"Dobro, bom poskusil,\" se je vdal kmet.    Nekaj dni pozneje se je uslužbenec pozanimal, kako stvari napredujejo.    \"Ne gre slabo,\" je pojasnil kmet. \"Zdaj sem ožigosal vse piščance, čaka me pa še precej zahtevno delo s čebelami.", CategoryId = 43 },
                new Joke() { Id = 2030, Active = true, Title = "Okužba s škrlatinko", Description = "Zaskrbljen oče po telefonu: \"Gospod doktor, moj sin ima škrlatinko!\"    Doktor: \"Vem, včeraj sem ga pregledal. Poskrbite, da ne pride v stik z drugimi!\"    Oče: \"Ne razumete! On ... Moj sin ... Je poljubil našo pomočnico.\"    Doktor: \"Potem moramo dekle izolirati!\"    Oče: \"Da ... In jaz sem tudi poljubil to dekle!\"    Doktor: \"No, zdaj pa postaja zapleteno. Verjetno ste se tudi vi okužili, če še niste imeli škrlatinke.\"    Oče: \"In moja žena ... Njo sem tudi poljubil!\"    Doktor: \"Prekleto, potem bom pa verjetno tudi jaz zbolel!\"", CategoryId = 39 },
                new Joke() { Id = 2031, Active = true, Title = "Po dolgih letis se srečata", Description = "Znanca se srečata po več letih.    \"Kaj počneš?\"    \"Mučim ženske, ženem jih, da se znojijo, ne dajem jim jesti, nazadnje jim pa še vzamem denar.\"    \"Ali ni to nemoralno in protizakonito?\"    \"Ne. Imam lepotni salon.\"", CategoryId = 43 },
                new Joke() { Id = 2032, Active = true, Title = "Vskočil mu je v besedo", Description = "Direktor hotela sliši, kako šef recepcije reče nekemu gostu: \"Ne, tega pa pri nas nimamo!\"    \"Kako, nimamo? Seveda imamo!\", se vmeša direktor.    Gost se zahvali in odide.    \"Kaj pa je vprašal?\", vpraša direktor šefa recepcije.    \"Vprašal je, ali imamo pri nas veliko dežja.\"", CategoryId = 29 },
                new Joke() { Id = 2033, Active = true, Title = "Vzorec urina", Description = "Medicinska sestra je dala pacientu lonček za vzorec urina, ga poslala v kopalnico in mu naročila, naj ga napolni.    Po nekaj minutah se pacient vrne in ji izroči prazen lonček.    Medicinska sestra ga čudno pogleda, pacient pa reče: \"Hvala za lonček, ampak ga nisem potreboval, je bilo v prostoru stranišče!\"", CategoryId = 39 },
                new Joke() { Id = 2034, Active = true, Title = "Olajševalne okoliščine", Description = "Na sodišču, sodnik vpraša obtoženca: \"Ali mi lahko navedete kakšne olajševalne okoliščine?\"    Obtoženec: \"Seveda! Prosim vas, da upoštevate mladost in neizkušenost odvetnika, ki ste mi ga dodelili!\"", CategoryId = 48 },
                new Joke() { Id = 2035, Active = true, Title = "Pijan zet", Description = "Mama je na obisku pri hčerki in se jezi: \"Hčera, poslušaj! Če bo še enkrat, ko pridem k tebi na obisk, tvoj mož pijan kot čep, se bom pri priči obrnila in me ne bo nikoli več k vam.\"    Hčerka: \"Mama, ne govori tako glasno! Če te bo moj mož slišal, ne bo nikoli več trezen!\"", CategoryId = 34 },
                new Joke() { Id = 2036, Active = true, Title = "Spremeniti svet", Description = "Če želite spremeniti svet to storite dokler ste še samski.    Ko boste poročeni, ne boste mogli zamenjati niti TV programa.", CategoryId = 11 },
                new Joke() { Id = 2037, Active = true, Title = "Odhod na dopust", Description = "Odpravila sva se na dopust.    Vključil sem telefonski odzivnik, pokril kletko s kanarčkom in spustil mačko na dvorišče.    Žena je poklicala taksi, ki je precej hitro pripeljal.    Ko sva zapuščala hišo, se je mačka nekako med nogami izmuznila nazaj v hišo.    Nisva je želela pustiti v hiši, ker se neprestano trudi požreti kanarčka.    Žena je vstopila v taksi, jaz pa sem se vrnil v hišo, da bi mačko spet pregnal na dvorišče.    Medtem je že zbežala v zgornje nadstropje.    Žena, ki je čakala v taksiju, ni želela, da bi taksist izvedel, da bo hiša nekaj dni prazna, zato je pojasnila, da sem se vrnil v hišo zato, da bi voščil lahko noč njeni mami.    Čez dobrih 10 minut sem se končno usedel v taksi. \"Žal mi je, ker ste tako dolgo čakali,\" sem rekel in naprej pojasnjeval: \"Neumnica se je skrila pod posteljo. Z dežnikom sem jo moral drezati v rit, da je prilezla ven. Potem se je odločila, da pobegne, pa sem jo zagrabil za vrat. Začela je praskati, tako da sem jo zavil v odejo, da me prasica ne opraska. Ampak uspelo mi je! Na koncu sem jo odvlekel po stopnicah in jo vrgel na dvorišče. Upam, da se nam ne bo spet posrala pred vrati!\"    Lahko si predstavljate tišino, ki je nastala v taksiju!", CategoryId = 11 },
                new Joke() { Id = 2038, Active = true, Title = "Napisati morajo spis", Description = "Otroci morajo v šoli napisati prosti spis z naslovom 'Jaz sem direktor.'    Vsi pišejo, le Janezek gleda okoli sebe.    Učiteljica ga vpraša: \"Janezek, kaj pa je narobe, zakaj ne pišeš?\"    Janezek: \"Čakam na tajnico!\"", CategoryId = 32 },
                new Joke() { Id = 2039, Active = true, Title = "Župnik na cesti", Description = "Se pelje župnik z avtom in naleti na mrtvega osla, ki leži na cesti.    Pokliče policijo in reče: \"Tukaj župnik Anton, imate enega mrtvega osla na cesti, pa sem hotel, da ga umaknete, da se ne bi kdo zaletel v njega.\"    Dežurni policaj se hoče malo pošalit in reče: \"Hej župnik, a ste mu že zmolili oče naš?\"    Župnik: \"Še ne, sem najprej poklical naj bližnje sorodnike\"", CategoryId = 42 },
                new Joke() { Id = 2040, Active = true, Title = "Ženska se pritožuje", Description = "Ženska se pritožuje arhitektu, ki je projektiral hišo, da se tla in zidovi neznosno tresejo, ko pelje mimo hiše avtobus.    \"Tresenje je tako močno, da me skoraj vrže iz postelje. Če mislite, da pretiravam, preizkusite,\" pravi ženska.    Arhitekt res leže v posteljo.    Takrat vstopi mož in začuden zavpije: \"Kaj pa vi v moji postelji?!\"    Arhitekt: \"Saj vem, da mi ne boste verjeli, ampak na avtobus čakam!''", CategoryId = 11 },
                new Joke() { Id = 2041, Active = true, Title = "Medo odpre trgovino", Description = "Podjetni medved v gozdu odpre trgovino.    Pride zajec in vpraša, če prodaja jagode.    Medved pravi, da nimajo jagod.    Vendar se zajček ne da in pride v trgovino vsak dan z istim vprašanjem.    Po tednu dni medved ponori in reče: \"Zajec, če me še enkrat vprašaš, ali imam jagode, te bom z žeblji pribil na steno!\"    Pride zajček naslednji dan spet v trgovino in vpraša medveda: \"Hej, medo, imaš žeblje?\"    Medved: \"Nimam!\"    Zajec: \"Aha, ali imaš mogoče potem vsaj jagode?!?\"", CategoryId = 41 },
                new Joke() { Id = 2042, Active = true, Title = "Hipohonder pride k zdravniku", Description = "Pride hipohonder k zdravniku in ta mu reče: \"Pozdravljen Mirko, vas pa že dolgo ni bilo. Kaj pa se je zgodilo?\"    Mirko: \"Ah, nič posebnega, gospod doktor, nekaj sem bil bolan!\"", CategoryId = 39 },
                new Joke() { Id = 2043, Active = true, Title = "Taksist in potnik v temni noči", Description = "V temni noči taksi pobere osamljenega pešca.    Med vožnjo molčita, potnik pa bi želel nekaj vprašati in narahlo potrka taksista po rami.    Ta zakriči, izgubi oblast nad vozilom, skoraj zadene v avtobus, vendar še v zadnjem hipu obrne volan, poskoči čez visok robnik na pločnik in nazadnje le uspe ustaviti avto nekaj centimetrov pred izložbenim oknom.    Trenutek tišine.    Potnik se nato prestrašeno opraviči: \"Nisem si mislil, da vas bo moja kretnja tako prestrašila?\"    Ko voznik pride k sebi, odgovori: \"Pravzaprav niste vi krivi. Danes je moj prvi dan v službi taksista. Prej sem 15 let vozil mrliški avto!\"", CategoryId = 43 },
                new Joke() { Id = 2044, Active = true, Title = "Ves stolčen", Description = "Pride možakar v službo z izbitim zobom in modricami.    Prijatelji ga vprašajo: \"Kdo te je pa tako zdelal?\"    \"Janez.\"    \"Nemogoče! On pa vendar ni tak pretepač, pa še najboljša prijatelja sta.\"    \"Samo eno besedo sem mu rekel, pa je počilo.\"    \"Kaj si mu rekel?\"    \"Hvalil se je, kako sijajna je njegova žena v postelji, jaz pa sem samo pripomnil: ‘Vem!’\"", CategoryId = 43 },
                new Joke() { Id = 2045, Active = true, Title = "Prošnja", Description = "Kaj rece kurac kondomu?    \"Pokrij me, jaz grem noter!\"", CategoryId = 27 },
                new Joke() { Id = 2046, Active = true, Title = "Problemi s papagajem", Description = "Stari dami sta imeli papagaja, ki je zelo preklinjal.    Nekoč sta izvedeli, da ima tudi vaški župnik papigo, zato sta ga prosili, če lahko za nekaj dni prineseta svojega papagaja na prevzgojo. Župnikova papiga je namreč ves čas sedela v kotu kletke in tiho molila.    Župnik je pristal in tako sta dami prinesli grešnega papagaja in ga spustili v kletko k papigi.    Papagaj se je stresel, zamahnil s krili in zakričal: \"A je tu kakšna ptička za seks?\"    Papiga se je zbudila in veselo zažvižgala: \"O, moj Bog! Pa si le uslišal moje molitve!\"", CategoryId = 41 },
                new Joke() { Id = 2047, Active = true, Title = "Skrb za otroke", Description = "Žena se huduje nad možem: \"Občutek imam, da te sploh ne zanima, kako gre najinim otrokom v šoli.\"    Mož: \"Oh, draga, pretiravaš, tvoji občutki te varajo. Ravno prejšnji teden sem jih vprašal, v kateri razred hodijo!\"", CategoryId = 11 },
                new Joke() { Id = 2048, Active = true, Title = "Neprijetna situacija", Description = "Ugleden zdravnik je z ženo v gledališču.    Med premorom pijeta šampanjec, ko se mimo njiju sprehodi dekle v tesni oblekici. Pogleda zdravnika in reče: \"Pozdravljeni, gospod zdravnik!\"    Zdravnik v zadregi pogleda soprogo in se začne opravičevati: \"Saj razumeš, draga, da v tem poklicu spoznaš veliko ljudi.\"    Žena: \"Čigavem poklicu? Tvojem ali njenem?\"", CategoryId = 11 },
                new Joke() { Id = 2049, Active = true, Title = "Janezek v čakalnici", Description = "Janezek pride v ginekološko ambulanto. Dolgočasi se, ko čaka, da pride mamica na vrsto.    Mimo pride nosečnica in Janezek z roko pokaže na njen trebuh ter jo vpraša: \"Teta, kaj pa je to?\"    \"To je moj dojenček.\"    \"Pa ga imate radi?\"    \"Seveda, zelo ga imam rada.\"    \"Zakaj ste ga pa potem pojedli?\"", CategoryId = 15 },
                new Joke() { Id = 2050, Active = true, Title = "Resno vprašanje", Description = "Mož besno vpraša svojo ženo: \"Žena, zakaj si me varala s skoraj vsemi mojimi prijatelji?\"    Žena: \"Zato, ker mi sovražnikov nisi predstavil!\"", CategoryId = 11 },
                new Joke() { Id = 2051, Active = true, Title = "Miški na sprehodu", Description = "Dve miški se sprehajata in kar naenkrat se znajdeta pred debelim mačkom.    Ena od mišk besno zalaja, zato maček stisne rep med noge in pobegne.    Miška se obrne k svoji prijateljici in reče: \"Ali si videla, kako prav mi je prišlo znanje tujih jezikov?\"", CategoryId = 41 },
                new Joke() { Id = 2052, Active = true, Title = "Vzporednice", Description = "Vzporednice imajo toliko skupnega.    A kaj, ko se nikoli ne bosta srečali.", CategoryId = 32 },
                new Joke() { Id = 2053, Active = true, Title = "Težave z avtomobilom", Description = "Avtomehanik reče lastnici avtomobila: \"Gospa, bojim se, da je problem pri vašem avtomobilu večji, kot sem mislil. Prepričan sem bil, da vaš avto potrebuje nov akumulator.\"    \"In kaj sedaj?\"    \"Ravno obratno.\"    \"Kako?\"    \"Akumulator bo potreboval nov avto!\"", CategoryId = 43 },
                new Joke() { Id = 2054, Active = true, Title = "Preganjavica", Description = "Pacient pride k psihiatru in mu reče: \"Prosim vas, rešite me.\"    \"Kaj pa vam je?\"    \"Daje me grozen občutek.    \"Kakšen pa je ta občutek?\"    \"Grozen. Vedno in povsod se mi zdi, da me preganjajo.\"    \"Od kdaj pa se vam zdi tako?\"    \"Odkar sem pred tednom dni pobegnil iz zapora!\"", CategoryId = 39 },
                new Joke() { Id = 2055, Active = true, Title = "Zadnja želja umirajočega", Description = "Notar sestavlja oporoko ob postelji umirajočega in ga vpraša: \"Vse je popolnoma jasno, toda ne razumem, zakaj želite, da se vaš pepel raztrese po morju?\"    \"Zato, ker se je moja tašča zaklela, da bo plesala na mojem grobu!\"", CategoryId = 34 },
                new Joke() { Id = 2056, Active = true, Title = "Prekipelo ji je", Description = "Janez je imel šest otrok in je bil na to tako ponosen, da je ženo, kljub njenemu nasprotovanju, začel klicati mati šestih.    Ko sta se nekega večera odpravljala na zabavo, je zavpil proti kopalnici: \"Mati šestih, ali boš kmalu gotova?\"     \"Samo še minutko, oče štirih!\"", CategoryId = 11 },
                new Joke() { Id = 2057, Active = true, Title = "Nasipal se ga je", Description = "Gost v gostilni po celovečernem popivanju pokliče natakarja in reče: \"Pijan sem kot čep. Prinesite mi kaj, da se streznim, preden se odpeljem domov.\"    Natakar: \"Da, gospod! Takoj vam prinesem račun!\"", CategoryId = 13 },
                new Joke() { Id = 2058, Active = true, Title = "Neljuba nesreča", Description = "Zdravnik pregleduje poškodovanko in jo vpraša: \"Gospa, kako pa ste se opekli po ušesih?\"    Gospa: \"Veste, likala sem, nakar je zazvonil telefon in sem namesto slušalke dvignila likalnik.\"    Zdravnik: \"Ampak, opekline imate na obeh ušesih?\"    Gospa: \"Seveda. Ko sem se opekla, sem hotela poklicati rešilca!\"", CategoryId = 40 },
                new Joke() { Id = 2059, Active = true, Title = "Poizvedava žena", Description = "Žena vpraša moža: \"Veš, kaj me zanima? Zakaj moški toliko lažete?\"    Mož: \"Čisto enostavno. Zato, ker ženske toliko sprašujete!\"", CategoryId = 17 },
                new Joke() { Id = 2060, Active = true, Title = "Pijanček in neznanka", Description = "Pijan moški vstopi v gostilno.    Zagleda se v žensko, ki sedi za pultom, odmaje se do nje in se nagne, da bi jo poljubil.    Gospa poskoči in ga klofne.    Tip se začne opravičevati: \"Joj, res mi je žal, ampak mislil sem, da ste moja žena.\"    \"O, ti pijani, smrdljivi, neznosni bedak!\"    \"Zanimivo, ampak tudi govorite tako kot ona!\"", CategoryId = 21 },
                new Joke() { Id = 2061, Active = true, Title = "Pameten nasvet", Description = "Zdravnik pove pacientu: \"Takoj morate nehati zapeljevati žene drugih moških, sicer ne boste več dolgo živeli.\"    \"Ampak kako, moje zdravje je odlično, ženske pa so nore na mene.\"    \"Ravno v tem je problem! Ena od njih je tudi moja!\"", CategoryId = 39 },
                new Joke() { Id = 2062, Active = true, Title = "Dobra ocena", Description = "Sin lastnika kina je šel prvič v šolo.    Ko se vrne, ga oče vpraša: \"Kako je bilo v šoli, sinko?\"    \"Popoln uspeh, očka. Razprodano do zadnjega sedeža!\"", CategoryId = 32 },
                new Joke() { Id = 2063, Active = true, Title = "Novopečeni voznik", Description = "Na podeželju prijatelj vpraša novopečenega voznika: \"No, kako ti gre kaj vožnja?\"    \"Po šahovsko.\"    \"Kako, po šahovsko?\"    \"Zbijem kmeta, zbijem konja...\"", CategoryId = 43 },
                new Joke() { Id = 2064, Active = true, Title = "Kako smo prišli na svet", Description = "Učiteljica sprašuje otroke, kako so prišli na svet.    Metka pravi, da jo je prinesla štorklja, Anže je rekel, da ga je prinesla teta iz Amerike, Vanja je rekla, da so jo kupili v trgovini.    Janezek pa vpraša: \"Učiteljica, kaj tisti, ki že seksamo, lahko gremo ven iz razreda, na en čik?\"", CategoryId = 15 },
                new Joke() { Id = 2065, Active = true, Title = "Politiki in samomor", Description = "Ko Japonci slišijo, da je kak njihov politik naredil samomor, rečejo: \"Hara - kiri?\"    Če bi ga naredil pa slovenski politik, bi pa ljudje rekli: \"Hura - keri?\"", CategoryId = 23 },
                new Joke() { Id = 2066, Active = true, Title = "Ali so ribe zdrave", Description = "\"So ribe zdrave?\" vpraša pacient zdravnika.    Zdravnik: \"Mislim, da so, saj še nobene nisem zdravil.\"", CategoryId = 39 },
                new Joke() { Id = 2067, Active = true, Title = "Grda razvada in rešitev", Description = "\"Končno je moj mož prenehal gristi nohte!\"    \"Kako mu je pa to uspelo?\" \"Skrila sem mu zobe!\"", CategoryId = 11 },
                new Joke() { Id = 2068, Active = true, Title = "Modre šči", Description = "\"Po kom pa imaš modre oči?\"    \"Po očetu, ki je bil boksar.\"", CategoryId = 11 },
                new Joke() { Id = 2069, Active = true, Title = "Dobra in slaba novica", Description = "Odvetnik svoji stranki: \"Imam dobro in slabo novico.\"    \"Kakšna je slaba,\" vpraša stranka.    \"Vaša kri ustreza DNA vzorcu, ki so ga našli na prizorišču umora,\" je zaskrbljen odvetnik.    \"Hudiča! Kakšna pa je dobra novica,\" vpraša stranka.    \"Vaš holesterol je končno v mejah normale.\"", CategoryId = 48 },
                new Joke() { Id = 2070, Active = true, Title = "Ko odraste", Description = "\"Kaj bi rad postal, ko odrasteš,\" vpraša Janezka soseda.    \"Zdravnik,\" odgovori Janezek.    \"A res? Zakaj pa,\" je radovedna.    \"Ker je to edini poklic, v katerem lahko ženskam rečeš naj se slečejo, račun za storitev pa naprtiš njihovim možem.\"", CategoryId = 15 },
                new Joke() { Id = 2071, Active = true, Title = "Razlika", Description = "Kakšna je razlika med ljubico in ženo?    30 kilogramov.    Kakšna pa med ljubimcem in možem?    30 minut.", CategoryId = 27 },
                new Joke() { Id = 2072, Active = true, Title = "Premajhna plača za dva", Description = "Vpraša Micka svojega moža: \"Si povedal svojemu šefu v službi, da midva ne moreva živeti od tvoje bedne plače?\"    Mož: \"Sem.\"    Micka: \"In? Kaj je rekel?\"    Mož: \"Predlagal mi je, da se ločim!\"", CategoryId = 37 },
                new Joke() { Id = 2073, Active = true, Title = "Zelo zanesljiva", Description = "Direktor kandidatki za tajnico: \"Upam, da niste klepetulja in poslovnih skrivnosti ne trosite okoli.\"    \"Bodite brez skrbi. Lahko vam povem, da imam na banki več kot 10.000 €in to samo zato, ker sem znala molčati.' ", CategoryId = 29 },
                new Joke() { Id = 2074, Active = true, Title = "Pripravljena na vse", Description = "Prijateljici se pripravljata na zabavo v planinski koči.    Planinska koča je polna fantov.    Ko se približata koči, ena izmed njiju reče: \"Joj, saj ti nimaš pod plaščem sploh ničesar oblečenega!\"    Pa jo vpraša prva prijateljica: \"Seveda ne. A si ti kdaj vstaviš vato v ušesa, ko greš na koncert?\"", CategoryId = 27 },
                new Joke() { Id = 2075, Active = true, Title = "Delo v nedeljo", Description = "Direktor pride v pisarno k tajnici jo vpraša: \"Gospodična, a vi kaj delate v nedeljo?\"    \"Nič ne delam.\"    \"Potem pa poglejte na koledar in naj vas spomnim, da danes ni nedelja!\"", CategoryId = 29 },
                new Joke() { Id = 2076, Active = true, Title = "Škrtuh kupuje darilo za svojo ženo", Description = "Moški jemlje v roke različne predmete in sprašuje za ceno.    Vse mu je predrago.    Končno vpraša prodajalko: \"Kaj bi si želeli za rojstni dan, če bi bila moja žena?\"    Prodajalka: \"Drugega moža!\"", CategoryId = 17 },
                new Joke() { Id = 2077, Active = true, Title = "Piknik", Description = "Trije Slovenci se zmenijo, da bodo imeli piknik.    Primorec obljubi, da bo prinesel pršut.    Dolenjec obljubi, da bo prinesel cviček.    Gorenjec pa obljubi, da bo pripeljal nekaj svojih prijateljev.", CategoryId = 28 },
                new Joke() { Id = 2078, Active = true, Title = "Ni ovir, če imaš značko", Description = "Kriminalist pride k kmetu, da bi preiskal njegovo posest.    Kmet mu pravi, da lahko vse pregleda, razen tistega nasada tam.    Kriminalist mu pokaže značko in pravi: \"Vidiš to značko? S to značko lahko počnem karkoli in ti ne moreš nič naredit za to!\"    Čez nekaj minut se kriminalist začne dreti, ko beži pred razjarjenim bikom.    Kmet odvrže orodje, steče k ograji in se zadere: \"Potegni značko ven! Pokaži mu značko!\"", CategoryId = 22 },
                new Joke() { Id = 2079, Active = true, Title = "Povabilo in prošnja", Description = "Joža je k sebi povabil goste in jim ob povabilu naročil: \"Ko boste prihajali, pridite vsi skupaj!\"    \"Zakaj pa?\"    \"Da psu ne bo treba dvakrat lajati!\"", CategoryId = 43 },
                new Joke() { Id = 2080, Active = true, Title = "Navihani lovci", Description = "Po lovu so vsi lovci dali 2 evra za slasten golaž, ki jim ga je pripravil kolega, le lovec Jaka ni nikoli dal prispevka, raje si je prinesel malico od doma.    Nekoč po lovu so mu kolegi izmaknili iz suknjiča malico. Pol krajnske klobase so mu zamenjali z zamrznjenim pasjim iztrebkom in vrnili zavitek v žep suknjiča.    Ko že vsi jedo golaž Jaka še vedno nemirno hodi okrog in kadi. Pa ga le eden od lovcev privoščljivo vpraša: \"Kaj je s tabo Jaka, a ne boš danes nič malical?\"    \"Saj bi, pa sem pol klobase dal pogreti v golaž, sedaj je pa kuhar ne najde!\" ", CategoryId = 35 },
                new Joke() { Id = 2081, Active = true, Title = "Ženske in ogledalo", Description = "\"Ženska je res čudno bitje. Kar naprej gleda v ogledalo, samo takrat ne, ko z avtom vozi nazaj!\"", CategoryId = 40 },
                new Joke() { Id = 2082, Active = true, Title = "Blondinke in novoletna jelka", Description = "So šle 3 blondinke v gozd po novoletno jelko.    Iščejo od jutra pa vse do mraka.    Končno 1 predlaga: \"Kaj pa če vzamemo kar eno brez okraskov?\"", CategoryId = 4 },
                new Joke() { Id = 2083, Active = true, Title = "Ženske v raju", Description = "V raj je prispela nova skupina žensk.    Sveti Peter jih postroji in reče: \"Vse, ki ste vsaj enkrat prevarale moža, stopite korak naprej!\"    Vse izstopijo iz vrste, razen ene.    Ko Bog to vidi, reče sv. Petru: \"Pojdi in preveri, če ni mogoče gluha!\"", CategoryId = 40 },
                new Joke() { Id = 2084, Active = true, Title = "Chuck Norris in led", Description = "Chuck Norris lahko pije led po slamici.", CategoryId = 6 },
                new Joke() { Id = 2085, Active = true, Title = "14-letna nosečnica ", Description = "Kaj imata skupnega 14-letna nosečnica in njen plod?  Oba razmišljata: “O šit, moja mama me bo ubila”", CategoryId = 9 },
                new Joke() { Id = 2086, Active = true, Title = "Sin od župnika", Description = "Kako se reče dečku, ki ga je spočel župnik?    Fant od fare.", CategoryId = 5 },
                new Joke() { Id = 2087, Active = true, Title = "Priklop interneta v vrtcu", Description = "V vrtec pridejo priklopit internet, rekoč: \"Zdravo jaz sem od Amisa.\".    Vzgojiteljica: \"Aha, bom pogledala, samo mislim da še spi.\".", CategoryId = 43 },
