                new Joke() { Id = 2092, Active = true, Title = "Treba bi se bilo prepričati", Description = "Na sojenju morilcu branilec zaslišuje patologa.    \"Ali ste, preden ste podpisali mrliški list, preverili, ali umrli morda ne diha in ali morda nima srčnega utripa?\" \"Ne.\"    \"Torej ne morete z gotovostjo trditi, da je bil mrtev, ko ste podpisali mrliški list, kajne?\"    \"No, njegovi možgani so bili v kozarcu na moji mizi, ampak, ja, očitno bi bil najbrž še res sposoben delati kot odvetnik!\"", CategoryId = 48 },
