                new Joke() { Id = 2095, Active = true, Title = "Prvič pri prostitutki", Description = "Mladenič se je odločil, da je dovolj čakanja in, da mora končno izgubiti nedolžnost.    Odšel je na obisk k prelepi prostitutki.    Ker je bilo dokaj očitno, da bo zanj prvič, ga ljubeče vpraša: \"Si nervozen?\".    \"Da, zelo!\".    Prostitutka: \"Prvič?\"    Mladenič: \"Ne, že večkrat sem bil nervozen.\".", CategoryId = 43 },
