                new Joke() { Id = 2099, Active = true, Title = "Vinko iz kartonaže", Description = "Po koncu protokola so Busha, ko je obiskal Slovenijo, vprašali, če ima še kakšno posebno željo pa je rekel, da bi zelo rad videl Vinka iz Logatca. Tudi Putin je imel enako željo ob obisku Slovenije in je želel pozdraviti Vinka iz Logatca. Počasi se je direktorju KLI Logatca, kjer je bil Vinko zaposlen v obratu kartonaže, vse skupaj zdelo že malo preveč, in ga je poklical v pisarno. Šef: “Ja Vinko, kako to, da te Bush in Putin poznata?” Vinko:” Ah, to ni nič takega! Dosti potujem, pa srečujem ljudi…” Šef: “Pa dobro, ampak stavim, da papeža ne poznaš osebno.” Vinko: “Ah, kaj da ne! Seveda ga poznam.” Šef: “Tega pa ne verjamem. To boš dokazal.” In je šel KLI Logatec na sindikalni izlet v Vatikan. Komaj je Vinko stopil iz avtobusa, že je od daleč slišal papeža vpiti: “Oooo, Vinko, kje si! Dolgo te nisem videl!” Vinko je pohitel do papeža in prav prisrčno sta se objela in trepljala po ramenih. Naenkrat nastane pri avtobusu panika in Vinko takoj pohiti nazaj. Na tleh leži njegov šef, ki je omedlel. Ko se po nekaj trenutkih spet zave, ga Vinko zaskrbljen vpraša, kaj se je zgodilo. Šef: “Veš kaj, Vinko, vse sem prenesel. In to, da poznaš Busha, in da poznaš Putina. Tudi za papeža ti zdaj verjamem, ampak ko je pa Japonček zraven mene rekel “Kdo je tisti z belo kapco poleg Vinkota?”, je bilo pa preveč.", CategoryId = 43 },
                new Joke() { Id = 2100, Active = true, Title = "Postopek jedenja človeka", Description = "Uči mama malega morskega psa, kako naj lovi. Tako priplavata do  neke osamljene plaže in mama reče:  “Najprej priplavaš v bližino človeka in narediš dva kroga  okrog njega. Potem se malo oddaljiš, spet na hitro priplavaš  in ga udariš z repom. Potem ponovno priplavaš do njega in  samo malo zagrizeš vanj. Nato narediš še manjši krog okoli  njega in ga poješ.”  Pa vpraša mali morski pes: “Zakaj bi zgubljal toliko časa, zakaj ga  takoj ne pojem?”  “Lahko”, pravi mama: “Ampak potem ga boš pojedel z drekom  vred!”", CategoryId = 41 },
