                new Joke() { Id = 2103, Active = true, Title = "Blondinka in advokat", Description = "v letalu se na sedežu znajdeta bjonda in advokat.    Ona se ravno pripravlja na dremež ,ko se k njej skloni odvetnik in ji predlaga igrico.    Blondinka ni za stvar. Ne drugič,ne tretjič,ne četrtič.    Naposled je tudi advokatu dovolj.Zdaj predlaga,da ji bo zastavil vprašanje.Če nanj ne bo pravilno odgovorila,mu dolguje 5 evrov,če pa on ne bo pravilno odgovoril na njeno vprašanje,bo ona dobila 500 evrov.    Blondinka klone.Advokat: \"Koliko kilometrov je od Zemlje do Lune?\"    Bjonda mirno seže v torbico in mu da 5 evrov.    Zdaj je na vrsti ona: \"Kaj je to? Zjutraj gre s tremi nogami na drevo, zvečer pa s štirimi dol pride?\"    Odvetnik se praska po glavi, odpre prenosni računalnik, se poveže z internetom,a nič. Kliče tudi svoje kolege, a neuspešno. Naposled prizna poraz, zbudi svetlolasko in ji da 500 evrov.    A radovednost mu ne da miru: \"In kakšen je odgovor na tvoje vprašanje?\"    Blondinka spet seže v torbico in mu da 5 evrov.", CategoryId = 4 },
