                new Joke() { Id = 2105, Active = true, Title = "Ob padcu iz drevesa", Description = "Jože je med obiranjem češenj padel z drevesa.    Ko pride k zdravniku, ga ta vpraša: \"Ste takrat, ko ste padli z drevesa, padli v nezavest?\"    \"Ne. V koprive!\"", CategoryId = 39 },
