                new Joke() { Id = 2114, Active = true, Title = "Ženino darilo", Description = "Ivan ni bil prav pameten in njegovi prijatelji so se pogosto norčevali iz njega. Nekoč je prišel urejen kot že dolgo ne. Povsem nova obleka, kravata, čudovita srajca.  - Madona Ivan, kako pa si se danes uredil, so se čudili sodelavci.  - Ženino darilo.  - Ali je bilo presenečenje?  - Pa še kakšno. Včeraj, ko sem prišel domov malo prej kot  navadno, me je obleka že čakala na postelji.", CategoryId = 37 },
